INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(10, 'Siêu Nhện Tái Xuất 2 - Người Nhện Siêu Đẳng 2: Sự Trỗi Dậy Của Người Điện', 'The Amazing Spider-Man 2', 2014, '<p>Siêu Nhện Tái Xuất 2 - Người Nhện Siêu Đẳng 2: Sự Trỗi Dậy Của Người Điện -The Amazing Spider-man 2 là một bộ phim siêu anh hùng của đạo diễn Marc Webb. Chúng ta luôn biết rằng trận chiến quan trọng nhất của Người Nhện đã định sẵn trong người anh: Cuộc chiến giữa những nghĩa vụ của Peter Parker và trách nhiệm của một Spiderman. Thật tuyệt vời khi là một Spiderman. Peter Parker không đánh đu giữa những tòa nhà chọc trời, không phải là một anh hùng, chỉ dành thời gian cho cô bạn gái Gwen. Nhưng với một Spiderman thì lại khác. Giá trị của Spderman là bảo vệ những công dân New York từ những thế lực đen tối và tàn bạo. Với sự xuất hiện của Người Điện, Peter phải đối đầu với một kẻ thủ mạnh hơn mình. Sự trở lại của một người bạn cũ, Harry Osborn khiến Peter nhận ra rằng tất cả những kẻ thù chung của mình có một điểm chung: Oscorp!</p>', 0, 'https://img.ophim11.cc/uploads/movies/sieu-nhen-tai-xuat-2-nguoi-nhen-sieu-dang-2-su-troi-day-cua-nguoi-dien-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sieu-nhen-tai-xuat-2-nguoi-nhen-sieu-dang-2-su-troi-day-cua-nguoi-dien-poster.jpg', '2024-02-08 12:22:24', 8, '', 0, 0),
(11, 'Địa Đàng Sụp Đổ', 'Concrete Utopia', 2023, '<p>Thế giới đã trở thành đống đổ nát sau một trận động đất lớn. Trong khi không ai biết chắc chắn tàn tích trải dài bao xa, hay nguyên nhân gây ra trận động đất là gì, thì ở trung tâm Seoul chỉ còn lại một tòa nhà chung cư. Nó được gọi là Căn hộ Hwang Gung.</p>', 0, 'https://img.ophim11.cc/uploads/movies/dia-dang-sup-do-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dia-dang-sup-do-poster.jpg', '2024-02-08 12:26:15', 8, 'https://www.youtube.com/watch?v=t5eg01hDNxA', 130, 3),
(12, 'Northmen - A Viking Saga', 'Northmen - A Viking Saga', 2014, 'Chiến Binh Phương Bắc là bộ phim sử thi hành động kể về một hoàng tử trẻ người Viking trong hành trình trả thù cho cái chết của cha anh.', 0, 'https://img.ophim11.cc/uploads/movies/northmen-a-viking-saga-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/northmen-a-viking-saga-poster.jpg', '2024-02-08 12:29:33', 8, '', 97, 0),
(13, 'Trò Chơi Trí Mệnh', 'The Spirealm', 2024, '<p><br>Nhà thiết kế trò chơi thực tế ảo Lăng Cửu Thời quyết định nghỉ việc vì công việc không suôn sẻ, một trò chơi thử nghiệm đã giúp anh tìm được niềm vui quên đi nỗi buồn, anh bất ngờ nhận được một đĩa game được gửi từ nước ngoài. Sau một tai nạn xe hơi, anh tới một hành lang với 12 cánh cửa sắt. Khi bước vào bên trong, một người bí ẩn giúp anh thoát khỏi nanh vuốt của bầy sói trong rừng núi tuyết, chào đón anh đến với thế giới của các cánh cửa. Thế giới bên trong cánh cửa đầy rẫy hiểm nguy, một sơ sẩy nhỏ cũng có thể mất mạng. Kế tiếp, Lăng Cửu Thời phát hiện một điều kỳ lạ, rằng khi gặp nguy hiểm bên trong cánh cửa và quay trở lại thế giới bên ngoài, anh cũng sẽ gặp phải rủi ro.</p>', 1, 'https://img.ophim11.cc/uploads/movies/tro-choi-tri-menh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tro-choi-tri-menh-poster.jpg', '2024-02-08 12:42:47', 8, '', 20, 0),
(15, 'Avengers: Hồi Kết', 'Avengers: Endgame', 2019, '<p>Sau những sự kiện tàn khốc của Avengers: Infinity War (2018), vũ trụ đang bị hủy hoại. Với sự trợ giúp của các đồng minh còn lại, Avengers đã lắp ráp một lần nữa để đảo ngược hành động của Thanos và khôi phục lại sự cân bằng cho vũ trụ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/avengers-hoi-ket-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/avengers-hoi-ket-poster.jpg', '2024-02-08 13:05:34', 8, '', 181, 0),
(16, 'Avengers: Cuộc Chiến Bí Mật', 'Avengers: Secret Wars', 2026, '<p>Một bộ phim sắp ra mắt trong Giai đoạn thứ sáu của Vũ trụ Điện ảnh Marvel và là phần cuối của The Multiverse Saga. Âm mưu không rõ. Khởi chiếu ngày 1-5-2026</p>', 0, 'https://img.ophim11.cc/uploads/movies/avengers-cuoc-chien-bi-mat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/avengers-cuoc-chien-bi-mat-poster.jpg', '2024-02-08 13:07:46', 8, 'https://www.youtube.com/watch?v=ldGpwnBEMMU', 0, 0),
(17, 'Avengers: Cuộc Chiến Vô Cực', 'Avengers: Infinity War', 2018, '<p>The Avengers và các đồng minh của họ phải sẵn sàng hy sinh tất cả trong một nỗ lực để đánh bại Thanos mạnh mẽ trước khi Blitz của sự tàn phá và hủy hoại của anh ta chấm dứt vũ trụ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/avengers-cuoc-chien-vo-cuc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/avengers-cuoc-chien-vo-cuc-poster.jpg', '2024-02-08 13:08:19', 8, '', 149, 0),
(18, 'Avengers: Đế Chế Ultron', 'Avengers: Age of Ultron', 2015, '<p>Khi Tony Stark và Bruce Banner cố gắng nhảy-Bắt đầu một chương trình gìn giữ hòa bình không hoạt động được gọi là Ultron, mọi thứ đã sai lầm khủng khiếp và anh hùng hùng mạnh nhất của Trái đất để ngăn chặn Ultron nhân vật phản diện ban hành kế hoạch khủng khiếp của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/avengers-de-che-ultron-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/avengers-de-che-ultron-poster.jpg', '2024-02-08 13:08:39', 8, '', 141, 0),
(19, 'Biệt Đội Siêu Anh Hùng', 'The Avengers', 2012, '<p>Những anh hùng hùng mạnh của Trái đất phải đến với nhau và học cách chiến đấu với tư cách là một đội nếu họ sẽ ngăn chặn Loki tinh nghịch và quân đội người ngoài hành tinh của mình khỏi sự nô lệ nhân loại.</p>', 0, 'https://img.ophim11.cc/uploads/movies/biet-doi-sieu-anh-hung-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/biet-doi-sieu-anh-hung-poster.jpg', '2024-02-08 13:09:11', 8, '', 143, 0),
(20, 'Thư ký Kim sao thế?', 'What\'s Wrong with Secretary Kim', 2018, '<p>Một giám đốc điều hành kiêu căng tự phụ dường như có mọi thứ, nhưng anh lại nhận được tin dữ khi nữ trợ lý giỏi giang của anh quyết định nghỉ việc.</p>', 1, 'https://img.ophim11.cc/uploads/movies/thu-ky-kim-sao-the-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thu-ky-kim-sao-the-poster.jpg', '2024-02-08 13:10:37', 8, '', 12, 31),
(21, 'Sứ Giả Của Chúa (Bàn Tay Diệt Quỷ)', 'The Divine Fury', 2019, '<p>Phim kể về câu chuyện thần chết đến dương thế, đồng thời đây cũng là một bộ phim hành động kinh dị có yếu tố siêu nhiên. Sau khi mất cha, võ sĩ Yong Ho (Park Seo-joon đóng) đã gặp cha An (Ahn Sung-ki đóng) và chiến đấu chống lại thần chết độc ác đã làm xáo trộn thế giới.</p>', 0, 'https://img.ophim11.cc/uploads/movies/su-gia-cua-chua-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/su-gia-cua-chua-poster.jpg', '2024-02-08 13:12:29', 8, '', 2327, 0),
(22, 'Già Thiên', 'Shrouding the Heavens', 2023, '<p>Ở tận cùng vũ trụ, nơi vô cùng lạnh lẽo và tối tăm, chín xác rồng khổng lồ kéo một cỗ quan tài bằng đồng cổ kính, tồn tại suốt từ thời xa xưa. Đây là hình ảnh cực sốc mà tàu thám hiểm không gian đã thấy được trong vũ trụ hiu quạnh. Chín con rồng kéo quan tài, rốt cuộc là trở về thời cổ đại hay đã đến bên kia bầu trời đầy sao? Một thế giới tiên hiệp rộng lớn, kỳ dị và đầy bí ẩn. Nhiệt huyết sục sôi như núi lửa phun trào, đam mê cuồn cuộn như biển cả, ham muốn vô tận như vực thẳm... Đường lên trời, rộn tiếng ca vang.</p>', 1, 'https://img.ophim.live/uploads/movies/gia-thien-thumb.jpg', 'https://img.ophim.live/uploads/movies/gia-thien-poster.jpg', '2024-02-08 13:15:23', 8, '', 20, 0),
(23, 'Thảm Họa Mưa Axit', 'Acid', 2023, '<p>Giữa một đợt nắng nóng bất thường, thì mây mưa giống như làn gió xua tan oi bức. Nhưng những đám mây kỳ lạ trên bầu trời nước Pháp lại đem tới cho con người sự huỷ diệt và chết chóc. Hàng loạt trận mưa axit đổ xuống, đốt cháy mạng sống của vạn vật dưới mặt đất. Trước sự huỷ diệt tàn bạo của thiên nhiên, một cô gái 15 tuổi phải cùng với cha mẹ mình tìm cách chạy trốn khỏi những cơn mưa axit.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/tham-hoa-mua-axit-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tham-hoa-mua-axit-poster.jpg', '2024-02-08 13:15:39', 8, 'https://www.youtube.com/watch?v=XeRo7qpNFxo', 99, 1),
(24, 'Thợ Săn Hoang Mạc', 'Badland Hunters', 2024, 'After a deadly earthquake turns Seoul into a lawless badland, a fearless huntsman springs into action to rescue a teenager abducted by a mad doctor.', 0, 'https://img.ophim11.cc/uploads/movies/tho-san-hoang-mac-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tho-san-hoang-mac-poster.jpg', '2024-02-08 13:16:33', 8, '', 107, 0),
(25, 'Aquaman 2: Vương Quốc Thất Lạc', 'Aquaman and the Lost Kingdom', 2023, 'Đạo diễn James Wan và Jason Momoa trong vai Aquaman—cùng với Patrick Wilson, Amber Heard, Yahya Abdul-Mateen II và Nicole Kidman sẽ trở lại trong phần tiếp theo của bộ phim DC có doanh thu cao nhất mọi thời đại “Aquaman Và Vương Quốc Thất Lạc (tựa gốc: Aquaman and the Lost Kingdom)”.', 0, 'https://img.ophim11.cc/uploads/movies/aquaman-va-vuong-quoc-that-lac-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/aquaman-va-vuong-quoc-that-lac-poster.jpg', '2024-02-08 13:17:29', 8, 'https://www.youtube.com/watch?v=UGc5Tzz19UY', 124, 0),
(26, 'Wonka', 'Wonka', 2023, '<p>Dựa trên nhân vật từ quyến sách gối đầu giường của các em nhỏ trên toàn thế giới \"Charlie và Nhà Máy Sôcôla\" và phiên bản phim điện ảnh cùng tên vào năm 2005, WONKA kể câu chuyện kỳ diệu về hành trình của nhà phát minh, ảo thuật gia và nhà sản xuất sôcôla vĩ đại nhất thế giới trở thành WILLY WONKA đáng yêu mà chúng ta biết ngày nay. Từ đạo diễn loạt phim Paddington và nhà sản xuất loạt phim chuyển thể đình đám Harry Potter, WONKA hứa hẹn sẽ là một bộ phim đầy vui nhộn và màu sắc cho khán giả dịp Lễ Giáng Sinh năm nay.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/wonka-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/wonka-poster.jpg', '2024-02-08 13:19:19', 8, 'https://www.youtube.com/watch?v=otNh9bTjXWg', 117, 0),
(27, 'Di Sản Kỳ Bí', 'The Bequeathed', 2024, '<p>Sau khi người chú xa lạ qua đời, người phụ nữ nọ thừa kế một nghĩa trang rồi trở thành tâm điểm của chuỗi án mạng và những bí mật đen tối.</p>', 1, 'https://img.ophim11.cc/uploads/movies/di-san-ky-bi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/di-san-ky-bi-poster.jpg', '2024-02-08 13:19:56', 8, 'https://www.youtube.com/watch?v=1rpDy2Hloic', 282, 2),
(28, 'Biệt Đội Marvel', 'The Marvels', 2023, '<p>Carol Danvers, hay còn gọi là Captain Marvel, đã lấy lại danh tính của mình từ Kree độc tài và trả thù Trí tuệ tối cao. Nhưng những hậu quả ngoài ý muốn khiến Carol phải gánh vác gánh nặng của một vũ trụ bất ổn. Khi nhiệm vụ của cô ấy đưa cô ấy đến một hố sâu dị thường có liên quan đến một nhà cách mạng Kree, sức mạnh của cô ấy bị vướng vào sức mạnh của Kamala Khan, một người hâm mộ cuồng nhiệt của Thành phố Jersey, hay còn gọi là Ms. Marvel, và cháu gái bị ghẻ lạnh của Carol, hiện là S.A.B.E.R. phi hành gia thuyền trưởng Monica Rambeau. Cùng với nhau, bộ ba kỳ lạ này phải hợp tác và học cách phối hợp với nhau để cứu vũ trụ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/biet-doi-marvel-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/biet-doi-marvel-poster.jpg', '2024-02-08 13:21:08', 8, 'https://www.youtube.com/watch?v=iuk77TjvfmE', 105, 1),
(29, 'Hãy Nói Với Anh Rằng Em Yêu Anh', 'Tell Me You Love Me', 2023, '<p>Nó sẽ miêu tả câu chuyện về một người đàn ông khiếm thính thoải mái thể hiện cảm xúc qua hình ảnh thay vì lời nói và một người phụ nữ thể hiện những gì trong lòng mình qua giọng nói. Jung Woo Sung sẽ vào vai Cha Jin Woo, một người khiếm thính thể hiện cảm xúc của mình qua những bức ảnh. Shin Hyun Bin sẽ mang lại sự sống cho nhân vật có tên Jung Mo Eun. Cô ấy có lòng tự trọng cao và vô tư. Cô ấy là người dễ tính dù có nhiều định kiến ​​trên thế giới.</p>', 1, 'https://img.ophim11.cc/uploads/movies/hay-noi-voi-anh-rang-em-yeu-anh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hay-noi-voi-anh-rang-em-yeu-anh-poster.jpg', '2024-02-08 13:22:20', 8, 'https://www.youtube.com/watch?v=RBSXQX9oDE8', 60, 0),
(30, 'Những gã trai hư', 'Bad Boys', 1995, '<p>Bad Boys</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-ga-trai-hu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-ga-trai-hu-poster.jpg', '2024-02-08 13:22:42', 8, '', 159, 1),
(31, 'Cộng đồng trong tuyết', 'Society of the Snow', 2023, '<p>Năm 1972, một chuyến bay của Uruguay bị rơi ở trung tâm xa xôi của dãy Andes, buộc những người sống sót trở thành niềm hi vọng lớn nhất của nhau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cong-dong-trong-tuyet-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cong-dong-trong-tuyet-poster.jpg', '2024-02-08 13:24:35', 8, 'https://www.youtube.com/watch?v=pDak4qLyF4Q', 144, 0),
(32, 'Đột kích: Chuộc tội', 'The Raid: Redemption', 2011, '<p>The Raid: Redemption</p>', 0, 'https://img.ophim11.cc/uploads/movies/dot-kich-chuoc-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dot-kich-chuoc-toi-poster.jpg', '2024-02-08 13:24:51', 8, '', 140, 1),
(33, 'Echo', 'Echo', 2024, 'Pursued by Wilson Fisk\'s criminal empire, Maya\'s journey brings her home and must confront her own family and legacy.', 1, 'https://img.ophim11.cc/uploads/movies/echo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/echo-poster.jpg', '2024-02-08 13:25:18', 8, 'https://www.youtube.com/watch?v=AFUKnherhuw', 42, 1),
(34, 'Monarch: Thế Giới Quái Thú', 'Monarch: Legacy of Monsters', 2023, 'Sống sót sau cuộc tấn công của Godzilla vào San Francisco, Cate lại bị chấn động bởi một bí mật gây sốc. Giữa những mối đe dọa khủng khiếp, cô dấn thân vào cuộc phiêu lưu khắp thế giới để tìm hiểu sự thật về gia đình mình — và tổ chức bí ẩn có tên Monarch.', 1, 'https://img.ophim11.cc/uploads/movies/monarch-the-gioi-quai-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/monarch-the-gioi-quai-thu-poster.jpg', '2024-02-08 13:26:48', 8, 'https://www.youtube.com/watch?v=JLHsM4bpfxY', 50, 0),
(35, 'Cuộc Chiến Không Gian (Phần 4)', 'For All Mankind Season 4', 2023, 'Explore an aspirational world where NASA and the space program remained a priority and a focal point of our hopes and dreams as told through the lives of NASA astronauts, engineers, and their families.', 1, 'https://img.ophim11.cc/uploads/movies/cuoc-chien-khong-gian-phan-4-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuoc-chien-khong-gian-phan-4-poster.jpg', '2024-02-08 13:27:30', 8, 'https://www.youtube.com/watch?v=HZS9M52Bd_w', 50, 0),
(36, 'Ngoài Vòng Pháp Luật 2', 'The Roundup', 2022, '<p>Đã 4 năm trôi qua kể từ khi thám tử Ma Suk-Do (Ma Dong-Seok thủ vai) xóa sổ Jang Chen và nhóm của anh ta.Ma Suk-Do và các thành viên trong nhóm của mình nhận nhiệm vụ đưa một nghi phạm trốn khỏi Việt Nam trở về Hàn Quốc. Ma Suk-Do đuổi theo Kang Hae-Sang ( Son Suk-Ku ) ở Việt Nam và trở về Hàn Quốc.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ngoai-vong-phap-luat-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ngoai-vong-phap-luat-2-poster.jpg', '2024-02-08 13:29:54', 8, 'https://www.youtube.com/watch?v=aeZXhy6mIyE', 106, 0),
(37, 'Trùm, Cớm và Ác Quỷ', 'The Gangster, the Cop, the Devil', 2019, '<p>Sau đó hầu như không còn sống sót một cuộc tấn công bạo lực của một kẻ giết người nối tiếp khó nắm bắt, ông chủ tội phạm Jang Dong-su (Don Lee) thấy mình hình thành một sự hợp tác không thể xảy ra với thám tử địa phương Jung Tae-Seok (Kim Moo Yul) để bắt kẻ giết người tàn bạo chỉ đơn giản là \"K \".</p>', 0, 'https://img.ophim11.cc/uploads/movies/trum-com-va-ac-quy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/trum-com-va-ac-quy-poster.jpg', '2024-02-08 13:31:44', 8, '', 0, 0),
(38, 'Đại Thảm Hoạ Núi Baekdu', 'Ashfall', 2019, '<p>Bộ phim mới Đại thảm hoạ núi Baekdu được xác nhận với sự tham gia của Lee Byung Hun, Ha Jung-woo, Ma Dong-seok, hiện tại các tình tiết trong phim đang được điều chỉnh, bộ phim sẽ do Lee Ha Jun [Lạc giữa đảo hoang] và Kim Byung-seo làm đạo diễn. Bộ phim kể về núi lửa Baekdu sắp phun trào và mọi người đang tìm cách ngăn lại thảm hoạ đó. Lee Byung Hun vào vai nhân viên ngăn chặn núi lửa phun trào người Triều Tiên, Ha Jung-woo hoá thân vào vai một nhân viên quan trọng của Hàn Quốc, cùng hợp tác và chiến đấu với nhân vật của Lee Byung Hun. Ma Dong Seok vào vai một nhà khoa học. Có thông tin cho rằng bộ phim được đầu tư khoảng 20 tỷ won và sẽ khởi quay vào đầu năm sau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/dai-tham-hoa-nui-baekdu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dai-tham-hoa-nui-baekdu-poster.jpg', '2024-02-08 13:32:57', 8, '', 239, 2),
(39, 'Chuyến Tàu Sinh Tử', 'Train To Busan (Busanhaeng)', 2016, '<p>Phim Train To Busan - Chuyến Tàu Sinh Tử lấy bối cảnh đất nước Hàn bị tấn công bởi một loại virus bí ẩn, biến con người thành những xác sống hung hăng, khát máu. Có mặt trên chuyến tàu từ Seoul tới Busan là một người cha cùng con gái, hai vợ chồng chuẩn bị đón đứa con đầu lòng và một số cô cậu học sinh cấp 3. Khi đại dịch xác sống bất ngờ bùng phát, họ không còn cách nào khác ngoài đương đầu với nó để bảo vệ những người thân yêu của mình. Hành trình 453km từ Seoul tới vùng an toàn Busan bỗng trở thành cuộc chiến khốc liệt để sinh tồn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chuyen-tau-sinh-tu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chuyen-tau-sinh-tu-poster.jpg', '2024-02-08 13:35:20', 8, 'https://www.youtube.com/watch?v=09sMnP1tTdQ', 118, 0),
(40, 'Thần Ẩn', 'The Last Immortal', 2023, '<p>Câu chuyện đầy cảm hứng kể về A Âm, thú Thủy Ngưng chăm chỉ cầu tiến và Cổ Tấn, con trai của chân thần bị phong ấn thần lực, hai người tình cờ quen biết, từ đây bước vào con đường tìm kiếm tiên nguyên Phượng Ẩn, sau đó đồng hành cùng các bạn là Hồng Dịch, hồ ly Yêu tộc và Yến Sảng, công chúa Ưng tộc. Họ lên đường thu thập tiên nguyên Phượng Ẩn, trải qua vô vàn hiểm trở, nhiều lần đánh bại sự cản trở từ phản diện Thanh Lâm và thuộc hạ của hắn, giúp sức cho Phượng Ẩn niết bàn trở về, họ gặt hái được tình yêu, tình bạn và tình thân, bảo vệ hòa bình thế gian, gánh vác đại nghĩa chúng sinh.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/than-an-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/than-an-poster.jpg', '2024-02-08 13:36:23', 8, '', 45, 0),
(41, 'Ẩn Thân', 'Secretly Greatly', 2013, '<p>Một nhóm các điệp viên, Quân đoàn 5446 được đào tạo bởi các lực lượng đặc biệt của Bắc Triều Tiên kể từ tuổi trẻ của họ, với mục tiêu thống nhất Hàn Quốc. Họ được gửi đến Hàn Quốc, nơi mỗi người ngụy trang như một kẻ ngốc, một ca sĩ đầy tham vọng và một học sinh trung học. Thời gian nhàm chán mà không nhận được bất kỳ đơn đặt hàng nào từ miền Bắc, họ dần dần quen với cuộc sống như những người hàng xóm bình thường trong một thị trấn nhỏ. Do các sự kiện của trận chiến thứ hai của Yeonpyeong, Hàn Quốc yêu cầu tên, địa điểm và thứ hạng 30 gián điệp của Bắc Triều Tiên hoạt động ở Hàn Quốc, triển vọng hỗ trợ tài chính cho miền Bắc trong tình trạng mà Bình Nhưỡng biến thành điệp viên của họ. Để ngăn người ưu tú rơi vào tay kẻ thù, chính phủ Bắc Triều Tiên đặt hàng hàng chục gián điệp tích cực để có cuộc sống của chính họ. Trong khi đó, người hướng dẫn quân đội Hàn Quốc của họ Kim Tae-won tạt biên biên để loại bỏ những người từ chối tuân thủ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/an-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/an-than-poster.jpg', '2024-02-08 13:37:17', 8, '', 0, 0),
(42, 'Cô Đi Mà Lấy Chồng Tôi', 'Marry My Husband', 2024, '<p>Khi Ji-won, một bệnh nhân ung thư 37 tuổi, bước vào gặp chồng và cũng là bạn thân của cô, cô nhận ra cả cuộc đời mình chỉ là một lời nói dối. Tệ hơn nữa, cô lại chết một cách bi thảm dưới tay chồng mình. Liệu mọi chuyện có khác đi nếu cô ấy đưa ra những lựa chọn khác? May mắn thay cho Ji-won, cô có cơ hội viết lại số phận của mình khi được tái sinh thành bản thân lúc trẻ. Lần này, cô thề sẽ sống một cuộc sống hạnh phúc. Nhưng trước hết là sự trả thù. Kế hoạch của cô ấy? Để gả người bạn thân cũ của mình cho người chồng dối trá, lừa dối của mình.</p>', 1, 'https://img.ophim13.cc/uploads/movies/co-di-ma-lay-chong-toi-thumb.jpg', 'https://img.ophim13.cc/uploads/movies/co-di-ma-lay-chong-toi-poster.jpg', '2024-02-08 13:38:23', 8, 'https://www.youtube.com/watch?v=pyq3fEf-cHg', 80, 59),
(43, 'Haikyu - Chàng khổng lồ tí hon (Phần 1)', 'Haikyu!! (Season 1)', 2015, '<p>Tràn đầy cảm hứng sau khi xem một trận đấu tranh giải vô địch trên TV, cậu học sinh cấp ba Hinata gia nhập một CLB bóng chuyền và bắt đầu tập luyện, dù chiều cao có hạn.</p>', 1, 'https://img.ophim11.cc/uploads/movies/haikyu-chang-khong-lo-ti-hon-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/haikyu-chang-khong-lo-ti-hon-phan-1-poster.jpg', '2024-02-08 13:59:05', 8, '', 24, 0),
(44, 'Haikyu - Chàng khổng lồ tí hon (Phần 2)', 'Haikyu!! (Season 2)', 2016, '<p>Đội bóng chuyền Trung học Karasuno cuối cùng đã lọt vào vòng chung kết quận Miyagi. Nhưng họ sẽ phải chạm trán với đội vô địch hiện tại: Shiratorizawa.</p>', 1, 'https://img.ophim11.cc/uploads/movies/haikyu-chang-khong-lo-ti-hon-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/haikyu-chang-khong-lo-ti-hon-phan-2-poster.jpg', '2024-02-08 14:07:17', 8, '', 24, 0),
(45, 'Haikyu - Chàng khổng lồ tí hon (Phần 3)', 'Haikyu!! (Season 3)', 2020, '<p>Những thách thức mới đang chờ đón khi cả đội chuẩn bị cho Giải toàn quốc. Nhưng khi Kageyama được mời đến một trại huấn luyện, Hinata tự mình giải quyết vấn đề.</p>', 1, 'https://img.ophim11.cc/uploads/movies/haikyu-chang-khong-lo-ti-hon-phan-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/haikyu-chang-khong-lo-ti-hon-phan-3-poster.jpg', '2024-02-08 14:07:24', 8, '', 24, 0),
(46, 'Thiếu niên bóng chuyền', 'Haikyu!!', 2014, '<p>Shoyo Hinata, một cậu bé đam mê bóng chuyền, đã bị đánh bại bởi cầu thủ thiên tài Tobio Kageyama trong trận đấu chính thức đầu tiên cũng là cuối cùng tại trường trung học cơ sở. Tuy nhiên, cả hai đã gặp lại nhau tại câu lạc bộ bóng chuyền của trường trung học Karasuno. Câu chuyện bóng chuyền của các thanh niên đầy nhiệt huyết bắt đầu! \"</p>', 1, 'https://img.ophim11.cc/uploads/movies/thieu-nien-bong-chuyen-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thieu-nien-bong-chuyen-poster.jpg', '2024-02-08 14:07:57', 8, '', 25, 0),
(47, 'Vua Bóng Chuyền (Phần 4)', 'Haikyu!! S4', 2020, '<p>Hinata Shōyō, một học sinh sơ trung đã ấp ủ ước mơ trở thành vận động viên bóng chuyền sau khi tình cờ xem trên TV Câu lạc bộ Bóng chuyền Cao trung Karasuno giành lấy chiến thắng ở vòng loại tiến vào Giải Bóng chuyền Thiếu niên Quốc gia. Có điểm chung là vóc người nhỏ con, cậu đặc biệt ngưỡng mộ tay đập biên thấp người nhưng vô cùng tài năng, đồng thời là \"ace\" của đội Karasuno, người được các bình luận viên mệnh danh là \"Chàng khổng lồ tí hon\". Dù hoàn toàn thiếu kinh nghiệm, Hinata có một tinh thần thể thao rất ấn tượng cùng một sức bật nhảy đáng gờm; cậu tham gia vào câu lạc bộ bóng chuyền của trường – nhưng trớ trêu thay lại là thành viên duy nhất. Hinata đành dành ra hai năm tiếp theo thuyết phục những học sinh khác gia nhập câu lạc bộ để có đủ thành viên tham gia các giải đấu.</p>', 1, 'https://img.ophim11.cc/uploads/movies/vua-bong-chuyen-phan-4-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vua-bong-chuyen-phan-4-poster.jpg', '2024-02-08 14:08:16', 8, '', 24, 0),
(48, 'Chiến Tranh Giữa Các Vì Sao 1: Hiểm Họa Bóng Ma', 'Star Wars: Episode I - The Phantom Menace', 1999, '<p>Liên đoàn thương mại xấu xa, dẫn đầu bởi Nute Gunray đang lên kế hoạch tiếp quản thế giới yên bình của Naboo. Jedi Knights Qui-Gon Jinn và Obi-Wan Kenobi được gửi đến để đối đầu với các nhà lãnh đạo. Nhưng không phải mọi thứ đều đúng như kế hoạch. Hai người Jedi trốn thoát, và cùng với người bạn Gungan mới của họ, Jar Jar Binks Head to Naboo để cảnh báo Nữ hoàng Amidala, nhưng Droids đã bắt đầu bắt Naboo và Nữ hoàng không an toàn ở đó. Cuối cùng, họ hạ cánh trên Tatooine, nơi họ trở thành bạn bè với một cậu bé được gọi là Anakin Skywalker. Qui-Gon tò mò về cậu bé, và nhìn thấy một tương lai tươi sáng cho anh ta. Bây giờ nhóm phải tìm cách đến Coruscant và cuối cùng giải quyết tranh chấp thương mại này, nhưng có người khác trốn trong bóng tối. Là người Sith thực sự tuyệt chủng? Là nữ hoàng thực sự cô ấy nói cô ấy là ai? Và những gì đặc biệt về cậu bé này?</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-1-hiem-hoa-bong-ma-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-1-hiem-hoa-bong-ma-poster.jpg', '2024-02-08 17:28:23', 8, '', 0, 0),
(49, 'Buổi Diễn Của Truman', 'The Truman Show', 1998, '<p>Kể từ khi sinh ra, một lời nói dối lớn xác định tuổi thọ được tổ chức tốt nhưng độ mùny của nhân viên bán hàng bảo hiểm nhân vật và nhà thám hiểm đầy tham vọng, Truman Burbank. Hoàn toàn không biết về hàng ngàn camera ẩn khéo léo đang theo dõi mọi động thái của mình, trong gần ba thập kỷ, toàn bộ sự tồn tại của Truman xung quanh ý chí và trí tưởng tượng hoang dã của nhà sản xuất truyền hình thao túng tàn nhẫn, Christof - TV-God cực kỳ mạnh mẽ của Extreme Chương trình thực tế 24/7: Triển lãm Truman. Kết quả là, khu phố đẹp như tranh vẽ của Truman với các bãi cỏ được cắt tỉa và cư dân hoàn hảo chưa được thực hiện không là gì ngoài một bộ hiện đại phức tạp, và sự thật duy nhất anh ta biết là mạng truyền hình trên toàn thế giới và lợi ích tài chính sâu sắc của nó ra lệnh. Chuột Lab có biết chúng là mãi mãi bị cầm tù?</p>', 0, 'https://img.ophim11.cc/uploads/movies/buoi-dien-cua-truman-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/buoi-dien-cua-truman-poster.jpg', '2024-02-08 17:28:31', 8, '', 0, 0),
(50, 'Bone Tomahawk', 'Bone Tomahawk', 2015, '<p>Sau một cách ngoài vòng pháp luật vô tình dẫn dắt một nhóm troglodytes cannibalistic vào thị trấn Western Western hòa bình, những con quái vật bắt cóc một số người định cư, bao gồm cả vợ của một người chăn nuôi địa phương. Mặc dù có chân bị thương, người chăn nuôi đã tham gia một bữa tiệc cứu hộ nhỏ với Cảnh sát trưởng, Phó già của anh ta và một kẻ bắn súng mạnh mẽ. Những gì sau đây là một hành trình vào địa ngục trên trái đất khi tư thế đến nhận ra nó đang chống lại một kẻ thù có sự man rợ biết không có giới hạn. Bộ phim diễn ra vào đầu thế kỷ quanh biên giới của những gì bây giờ Texas và New Mexico.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bone-tomahawk-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bone-tomahawk-poster.jpg', '2024-02-08 17:28:37', 8, '', 0, 0),
(51, 'Chiến Tranh Giữa Các Vì Sao 2: Cuộc Tấn Công Của Người Vô Tính', 'Star Wars: Episode II - Attack of the Clones', 2002, '<p>Mười năm sau cuộc xâm lược Naboo, Cộng hòa Thiên hà đang đối mặt với một phong trào ly khai và cựu Nữ hoàng và bây giờ Thượng nghị sĩ Padmé Amidala đi đến Coruscant để bỏ phiếu trong một dự án để tạo ra một đội quân để giúp Jedi bảo vệ Cộng hòa. Khi đến nơi, cô trốn thoát khỏi một nỗ lực để giết cô, và Obi-Wan Kenobi và Padawan Anakin Skywalker của anh được chỉ định để bảo vệ cô. Họ đuổi theo Shape-Shifter Zam Wessell nhưng cô bị giết bởi một phi tiêu bị nhiễm độc trước khi tiết lộ ai đã thuê cô. Hội đồng Jedi phân công Obi-Wan Kenobi để khám phá những người đã cố gắng giết Amidala và Anakin để bảo vệ cô ở Naboo. Obi-Wan phát hiện ra rằng phi tiêu là từ hành tinh Kamino, và anh ta đi đến hành tinh xa xôi. Ông tìm thấy một đội quân của các bản sao đã được sản xuất trong nhiều năm cho Cộng hòa và Hunter Bounty Jango Fett là ma trận cho các bản sao. Trong khi đó Anakin và Amidala yêu nhau, và anh ta có tầm nhìn ác mộng của mẹ. Họ đi du lịch đến hành tinh gia cầm của mình, Tatooine, để gặp mẹ anh, và anh phát hiện ra rằng cô đã bị bắt cóc bởi những kẻ đột kích Tusken. Anakin tìm thấy mẹ anh chết, và anh ta giết tất cả bộ lạc Tusken, bao gồm cả phụ nữ và trẻ em. Obi-Wan theo Jango Fett đến Geoonosis hành tinh nơi anh phát hiện ra những người đứng sau phong trào ly khai. Ông truyền những khám phá của mình đến Anakin vì anh ta không thể đến được Hội đồng Jedi. Ai là người lãnh đạo của phong trào ly khai? Anakin sẽ nhận được tin nhắn của obi-wan? Và tình yêu bí mật giữa Anakin và Amidala có thành công không?</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-2-cuoc-tan-cong-cua-nguoi-vo-tinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-2-cuoc-tan-cong-cua-nguoi-vo-tinh-poster.jpg', '2024-02-08 17:28:44', 8, '', 0, 0),
(52, 'Chiến Tranh Giữa Các Vì Sao 3: Người Sith Báo Thù', 'Star Wars: Episode III - Revenge of the Sith', 2005, '<p>Gần ba năm đã trôi qua kể từ khi bắt đầu chiến tranh nhân bản. Cộng hòa, với sự giúp đỡ của Jedi, hãy đếm Đếm Dooku và những người ly khai. Với mối đe dọa mới mọc lên, Hội đồng Jedi gửi Obi-Wan Kenobi và Anakin Skywalker để hỗ trợ Thủ tướng bắt giữ. Anakin cảm thấy anh sẵn sàng được thăng chức Jedi Master. Obi-Wan đang săn lùng người chia tay nói chung, đau buồn. Khi Anakin có tầm nhìn về nỗi đau và đau khổ trong tương lai, theo cách của Padmé, anh ta thấy Master Yoda để được tư vấn. Khi Darth Sidious thực hiện trật tự 66, nó sẽ phá hủy hầu hết tất cả Jedi đã xây dựng. Trải nghiệm sự ra đời của Darth Vader. Cảm thấy sự phản bội dẫn đến sự thù hận giữa hai anh em. Và chứng kiến sức mạnh của hy vọng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-3-nguoi-sith-bao-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-3-nguoi-sith-bao-thu-poster.jpg', '2024-02-08 17:28:50', 8, '', 0, 0),
(53, 'Chiến Tranh Giữa Các Vì Sao Tập 4: Niềm Hi Vọng Mới', 'Star Wars', 1977, '<p>Các lực lượng Imperial, theo đơn đặt hàng từ Cruel Darth Vader, giữ Mẹ Lê Tử công chúa trong nỗ lực dập tắt cuộc nổi loạn chống lại Đế chế Thiên hà. Luke Skywalker và Han Solo, Thuyền trưởng Falcon Thiên niên kỷ, làm việc cùng với Droid Duo R2-D2 và C-3po đồng hành để giải cứu công chúa xinh đẹp, giúp liên minh nổi dậy và khôi phục sự tự do và công lý cho thiên hà.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-tap-4-niem-hi-vong-moi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-tap-4-niem-hi-vong-moi-poster.jpg', '2024-02-08 17:28:56', 8, '', 0, 0),
(54, 'Chiến Tranh Giữa Các Vì Sao Tập 5: Đế Chế Phản Công', 'Star Wars: Episode V - The Empire Strikes Back', 1980, '<p>Luke Skywalker, Han Solo, Princess Leia và Chewbacca Face Tấn công bởi các lực lượng Hoàng gia và những người đi bộ tại The Walket On the Ice Planet. Trong khi Han và Leia trốn thoát trong thiên niên kỷ Falcon, Luke đi đến Dagobah để tìm kiếm Yoda. Chỉ với sự giúp đỡ của Jedi Master sẽ sống sót sau khi mặt tối của lực lượng vẫy gọi anh ta vào trận đấu cuối cùng với Darth Vader.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-tap-5-de-che-phan-cong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-tap-5-de-che-phan-cong-poster.jpg', '2024-02-08 17:29:01', 8, '', 0, 0),
(55, 'Chiến Tranh Giữa Các Vì Sao Tập 6: Sự Quay Trở Lại Của Jedi', 'Star Wars: Episode VI - Return of the Jedi', 1983, '<p>Luke Skywalker chiến đấu với Jabba The Hutt và Darth Vader để cứu những đồng đội của mình trong Liên minh Rebel và Triumph trên Đế chế Thiên hà. Han Solo và Princess Leia xác nhận lại tình yêu của họ, và đội của họ với Chewbacca, Lando Calrissian, Ewoks và Droids C-3po và R2-D2 để hỗ trợ sự gián đoạn của mặt tối, và sự thất bại của Hoàng đế độc ác.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-tap-6-su-quay-tro-lai-cua-jedi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-tranh-giua-cac-vi-sao-tap-6-su-quay-tro-lai-cua-jedi-poster.jpg', '2024-02-08 17:29:08', 8, '', 0, 0),
(56, 'It: Chapter Two', 'It: Chapter Two', 2019, '<p>Defeated by members of the Losers\' Club, the evil clown Pennywise returns 27 years later to terrorize the town of Derry, Maine, once again. Now adults, the childhood friends have long since gone their separate ways. But when people start disappearing, Mike Hanlon calls the others home for one final stand. Damaged by scars from the past, the united Losers must conquer their deepest fears to destroy the shape-shifting Pennywise -- now more powerful than ever.</p>', 0, 'https://img.ophim11.cc/uploads/movies/it-chapter-two-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/it-chapter-two-poster.jpg', '2024-02-08 17:29:12', 8, '', 0, 0),
(57, 'Alpha: Người Thủ Lĩnh', 'Alpha', 2018, '<p>Một cuộc phiêu lưu sử thi được thiết lập trong kỷ băng hà cuối cùng, Alpha là một câu chuyện hấp dẫn, trực quan tỏa sáng một ánh sáng trên nguồn gốc của người bạn thân nhất của con người. Khi đang săn lùng đầu tiên với nhóm ưu tú nhất của bộ lạc, một chàng trai trẻ bị thương và phải học cách sống sót một mình trong vùng hoang dã. Sau khi chàng trai trẻ dồn dập một con sói đơn độc bị bỏ rơi bởi gói của nó, cặp đôi này học cách dựa vào nhau và trở thành những đồng minh không có khả năng, chịu đựng vô số nguy hiểm và tỷ lệ cược áp đảo để tìm đường về nhà trước khi mùa đông đến.</p>', 0, 'https://img.ophim11.cc/uploads/movies/alpha-nguoi-thu-linh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/alpha-nguoi-thu-linh-poster.jpg', '2024-02-08 17:29:30', 8, '', 0, 0),
(58, 'Perfume', 'Perfume', 2018, '<p>Khi một ca sĩ bị giết hại với tuyến mùi thơm trên cơ thể bị cắt đi, các thám tử bắt đầu lần theo một nhóm bạn đã ở cùng ngôi trường nội trú với nạn nhân.</p>', 1, 'https://img.ophim11.cc/uploads/movies/perfume-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/perfume-poster.jpg', '2024-02-08 17:29:34', 8, '', 60, 0),
(59, 'Trợ Lý Của Tôi Không Đơn Giản', 'Never Too Late', 2023, 'Khương Điềm bỏ nhà đi để trở thành kiến trúc sư nội thất ở Bắc Kinh. Khi mọi thứ đang tiến triển theo hướng mà cô mong muốn, Khương Điềm bị chuyển về chi nhánh quê hương do cô xúc phạm lãnh đạo công ty. Không ngờ rằng, tại môi trường làm việc mới, cô trở thành đồng nghiệp của ông Ngô Kính Phương, một người 60 tuổi. Đối mặt với môi trường làm việc không phù hợp và kế hoạch trở về Bắc Kinh của cô bị gián đoạn do chia tay với bạn trai, Khương Điềm thất nghiệp, thất tình, không còn lựa chọn nào khác ngoài việc ở lại quê hương. Trong những ngày buồn rầu, Ngô Kính Phương từng bước xây dựng lại sự tự tin cho Khương Điềm để cô ở lại quê hương. Ngô Kính Phương cũng chăm chỉ học thiết kế từ Khương Điềm để có được chỗ đứng trong xã hội và trở thành trợ lý của Khương Điềm. Khương Điềm dẫn dắt Ngô Kính Phương tiếp tục tham gia vào xã hội cạnh tranh khốc liệt, và Ngô Kính Phương giúp Khương Điềm tìm cách hòa nhập với quê hương. Cả hai đã xây dựng được tình bạn sâu sắc thông qua những thất bại, trong khi giúp đỡ những người khác xây dựng ngôi nhà lý tưởng của mình, họ cũng xác định được con đường mình nên đi trong tương lai.', 1, 'https://img.ophim11.cc/uploads/movies/tro-ly-cua-toi-khong-don-gian-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tro-ly-cua-toi-khong-don-gian-poster.jpg', '2024-02-08 17:29:46', 8, '', 45, 9),
(60, 'Xác Sống: Daryl Dixon', 'The Walking Dead: Daryl Dixon', 2023, '<p>Daryl dạt vào bờ biển Pháp và cố gắng tìm hiểu xem làm thế nào anh đến được đó và tại sao. Bộ phim theo dõi hành trình của anh qua một nước Pháp tan vỡ nhưng kiên cường khi anh hy vọng tìm được đường trở về nhà. Tuy nhiên, khi anh ấy thực hiện cuộc hành trình, những mối liên hệ mà anh ấy hình thành trên đường đi đã làm phức tạp thêm kế hoạch cuối cùng của anh ấy.</p>', 1, 'https://img.ophim11.cc/uploads/movies/xac-song-daryl-dixon-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/xac-song-daryl-dixon-poster.jpg', '2024-02-08 17:30:26', 8, 'https://www.youtube.com/watch?v=iTOaFootkSk', 60, 0),
(61, 'Tình Yêu 199 - Muốn Mãi Mãi Yêu', 'Love Endures', 2024, '<p>Đều sinh ra trong những gia đình làm cho doanh nghiệp nhà nước, Hoàng Doanh Tử, Tưởng Dực, Phương Minh Vũ, Trang Viễn, Lam Diệc Phi, Đinh Dã, Vera đều là con trai, con gái độc nhất trong gia đình. Họ trở thành bạn bè từ năm sáu tuổi sau một tai nạn trong nhà máy. Lập nhóm bạn “Bắc Đẩu Thất Tinh” và hẹn nhau sẽ thi cùng đỗ đại học và đến Bắc Kinh. Năm tháng trôi dần, tuổi 17 chợt đến rồi đi, tuổi 18 vội vàng với kỳ thi đại học quan trọng của đời người. Hoàng Doanh Tử đỗ đại học đến Bắc Kinh, Tưởng Dực đi Mỹ, những người bạn mỗi người một phương, nhóm “Bắc Đẩu Thất Tinh” tạm rời khỏi giang hồ từ đây. Nhiều năm sau, ở tuổi 30, họ một mình bước đi trên con đường cuộc đời của mỗi người. Bỗng nhiên có một ngày, bọn họ nhận được tin tức bạn thân Quan Siêu sắp kết hôn, ký ức bị đánh thức, chuyện cũ rõ ràng hiện ra trước mắt. Đối với Hoàng Doanh Tử vẫn luôn hy vọng có thể tập hợp bảy người bạn lại một lần nữa mà nói là một cơ hội tốt. Với Hoàng Doanh Tử cô cũng muốn cho bản thân của năm 17 tuổi một câu trả lời với câu hỏi:”Năm 17 tuổi đó cô đã thích ai?”.</p>', 1, 'https://img.ophim11.cc/uploads/movies/tinh-yeu-199-muon-mai-mai-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tinh-yeu-199-muon-mai-mai-yeu-poster.jpg', '2024-02-08 17:32:03', 8, '', 45, 7),
(62, 'A Mạch Tòng Quân', 'Fighting for Love', 2024, 'A Mai, the daughter of a Nanxia official, is out for blood after her family was killed by her childhood sweetheart Chen Qi. Having grown into a young woman, she disguises herself as a man and wanders the lands to seek revenge. During a chance encounter, A Mai rescues Shang Yizhi, the son of the Crown Princess, and helps him out of many predicaments. Their fates have been intertwined ever since.  When war broke out, A Mai joined the military. She moved up from a foot soldier to a commander due to her marvelous achievements. At the same time, Shang Yizhi has been struggling to survive as he is being hunted down. A Mai assists him in turning the tide. Meanwhile, she also has repeated encounters with the enemy general Chang Yu Qing in the battlefield. Through unexpected events, their paths cross again and they experience life and death together. In the face of the cruelties of the times, A Mai must make a decision for the sake of her country.', 1, 'https://img.ophim11.cc/uploads/movies/a-mach-tong-quan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/a-mach-tong-quan-poster.jpg', '2024-02-08 17:32:13', 8, '', 45, 0),
(63, 'Cherry Magic: 30 Tuổi Vẫn Còn \"Zin\" Sẽ Biến Thành Phù Thủy', 'Cherry Magic! Thirty Years of Virginity Can Make You a Wizard?!', 2024, 'Nhân viên văn phòng Kiyoshi Adachi đã sống đến 30 năm mà chưa bao giờ trải qua mối quan hệ tình dục. Do thành tựu đáng kinh ngạc này, anh trở thành một pháp sư có khả năng đọc suy nghĩ thông qua tiếp xúc vật lý. Tuy nhiên, anh nghĩ rằng kỹ năng mới của mình là quá nhàm chán và khiến anh không thích những nơi đông đúc.\n\nTrên đường đi làm, Adachi gặp đồng nghiệp xinh đẹp và được mọi người yêu mến, Yuuichi Kurosawa. Bị hấp dẫn bởi tính cách của Kurosawa, anh lén chạm vào Kurosawa và liếc nhìn vào tâm hồn anh ta, chỉ để phát hiện ra rằng người đàn ông này mang trong mình ước mơ lãng mạn với một đồng nghiệp ở văn phòng. Adachi cố gắng liên kết các thông tin, nhưng sớm thôi, ảo tưởng của Kurosawa được phơi bày - suy nghĩ không trong sạch của đồng nghiệp dành cho anh ta! Mặc dù cố gắng hết sức để tập trung, anh giờ đây gần như không thể tập trung khi có Kurosawa ở gần.', 1, 'https://img.ophim11.cc/uploads/movies/cherry-magic-30-tuoi-van-con-zin-se-bien-thanh-phu-thuy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cherry-magic-30-tuoi-van-con-zin-se-bien-thanh-phu-thuy-poster.jpg', '2024-02-08 17:32:37', 8, '', 24, 0),
(64, 'Ragna Crimson', 'ラグナクリムゾン', 2023, 'Ragna là một thợ săn rồng &quot;kém cỏi&quot;. Anh có một cô em gái vô cùng mạnh mẽ. Một ngày nọ một kẻ địch cực mạnh xuất hiện, đe dọa sinh mạng của em gái Ragna. Lúc này, một nhân vật lạ mặt xuất hiện - ông ta chính là Ragna trong tương lai và đang nắm giữ một sức mạnh vô cùng lớn. \n\nRagna tương lai căm ghét sức mạnh của mình, nhưng Ragna hiện tại thì cần nó! Tương lai trao lại sức mạnh cho quá khứ và rồi một thợ săn rồng hùng mạnh ra đời!', 1, 'https://img.ophim11.cc/uploads/movies/ragna-crimson-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ragna-crimson-poster.jpg', '2024-02-08 17:33:01', 8, '', 47, 0),
(65, 'Anh hùng ngoài hành tinh', 'Alien Hero', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/anh-hung-ngoai-hanh-tinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/anh-hung-ngoai-hanh-tinh-poster.jpg', '2024-02-08 17:33:25', 8, '', 11124, 0),
(66, 'Thảm họa hạt nhân', 'Pandora', 2016, '<p>Động đất xảy ra tại một ngôi làng ở Hàn Quốc, nơi có một nhà máy điện hạt nhân cũ kĩ. Một người đàn ông mạo hiểm tính mạng để cứu đất nước khỏi thảm họa chực chờ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tham-hoa-hat-nhan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tham-hoa-hat-nhan-poster.jpg', '2024-02-08 17:33:32', 8, '', 216, 1),
(67, 'High on the Hog: Ẩm thực Mỹ gốc Phi đã thay đổi Hoa Kỳ như thế nào (S1)', 'High on the Hog: How African American Cuisine Transformed America', 2021, 'Ẩm thực người da đen chính là ẩm thực Mỹ. Cùng đầu bếp kiêm nhà văn Stephen Satterfield theo dấu món ngon xuyên suốt từ châu Phi đến Texas trong loạt phim tài liệu này.', 1, 'https://img.ophim11.cc/uploads/movies/high-on-the-hog-am-thuc-my-goc-phi-da-thay-doi-hoa-ky-nhu-the-nao-s2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/high-on-the-hog-am-thuc-my-goc-phi-da-thay-doi-hoa-ky-nhu-the-nao-s2-poster.jpg', '2024-02-08 17:33:59', 8, 'https://www.youtube.com/watch?v=7wsEdxt1Ico', 45, 0),
(68, 'Tà Khí Xứ Enfield ', 'The Enfield Poltergeist', 2023, 'Trải nghiệm câu chuyện có thật rùng rợn về một vụ quỷ ám nổi tiếng nhất thế giới qua các bản ghi âm gốc được ghi lại bên trong ngôi nhà khi các sự kiện diễn ra.', 1, 'https://img.ophim11.cc/uploads/movies/ta-khi-xu-enfield-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ta-khi-xu-enfield-poster.jpg', '2024-02-08 17:34:21', 8, 'https://www.youtube.com/watch?v=ncN8o_LfRlY', 55, 0),
(69, 'Frieren - Pháp Sư Tiễn Táng', 'Frieren: Beyond Journey\'s End', 2023, 'Sau một thập kỷ phiêu lưu, Frieren cùng tổ đội của dũng sĩ Himmel đã đánh bại Ma vương và mang lại hòa bình cho thế giới. Thế rồi cô ấy, một Elf với thọ mệnh hơn cả ngàn năm tuổi, lập lời hứa sẽ tái ngộ cùng nhóm Himmel rồi lên đường đi phiêu lưu một mình. 50 năm sau, Frieren đến thăm Himmel, nhưng lúc này anh ta đã già và chỉ còn lại một chút thời gian ngắn ngủi. Chứng kiến cái chết của Himmel, Frieren hối hận vì đã không \"tìm hiểu nhiều hơn về con người\", và thế là một chuyến phiêu lưu mới của cô với mục đích trên đã bắt đầu. Trên chuyến phiêu lưu này, cô đã gặp gỡ rất nhiều người và trải qua rất nhiều sự kiện.', 1, 'https://img.ophim11.cc/uploads/movies/frieren-phap-su-tien-tang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/frieren-phap-su-tien-tang-poster.jpg', '2024-02-08 17:34:37', 8, 'https://www.youtube.com/watch?v=Iwr1aLEDpe4', 24, 0),
(70, 'Châu Mỹ Hoang Dã', 'Untamed Americas', 2012, 'Bộ phim do National Geographic thực hiện mô tả cuộc sống hoang dã của các loài động vật tại bốn vùng sinh thái đặc trưng tại châu Mỹ gồm : núi, bờ biển, sa mạc và rừng. Phim được dàn dựng với những cảnh quay hiếm có và công phu không hề kém cạnh những bộ danh tiếng mà các bạn đã xem như Planet Earth, Frozen Planet….', 1, 'https://img.ophim11.cc/uploads/movies/chau-my-hoang-da-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chau-my-hoang-da-poster.jpg', '2024-02-08 17:35:10', 8, 'https://www.youtube.com/watch?v=AB9HVLLAO4U', 60, 0),
(71, 'Những Dòng Sông Hùng Vĩ Trên Trái Đất', 'Earth\'s Great Rivers', 2019, 'Những con sông rộng lớn của Trái đất, từ nguồn đến biển, thực hiện những chuyến đi phi thường xuyên qua các lục địa. Chúng nuôi dưỡng các nền văn minh cổ đại và kết nối sự sống trên khắp thế giới của chúng ta từ những ngọn núi và sa mạc của sông Nile, tới các thành phố và đầm lầy bí ẩn của Mississippi và thế giới bí mật của vùng nhiệt đới Amazon. Những con sông lớn là nguồn sống, huyết mạch của hành tinh trái đất.', 1, 'https://img.ophim11.cc/uploads/movies/nhung-dong-song-hung-vi-tren-trai-dat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-dong-song-hung-vi-tren-trai-dat-poster.jpg', '2024-02-08 17:35:23', 8, '', 50, 0),
(72, 'Đấu Phá Thương Khung (Phần 2)', 'Fights Break Sphere Season 2 /  Battle Through The Heaven Season 2', 2023, '<p>Đấu Phá Thương Khung được chuyển thể từ tiểu thuyết cùng tên của nhà văn Thiên Tàm Thổ Đậu. Bộ phim xoay quanh nhân vật chính Tiêu Viêm (Ngô Lỗi). Năm Tiêu Viêm lên 9 tuổi, mẫu thân cậu bị sát hại. Món đồ duy nhất bà để lại cho cậu là một chiếc nhẫn. Kể từ đấy, nó trở thành vật bất ly thân của Tiêu Viêm.</p>', 1, 'https://img.ophim11.cc/uploads/movies/dau-pha-thuong-khung-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dau-pha-thuong-khung-phan-2-poster.jpg', '2024-02-08 17:35:48', 8, '', 35, 0),
(73, 'What If...? (Phần 2)', 'What If...? Season 2', 2023, 'What If...? là series phim truyền hình Mỹ, phát sóng trên nền tảng xem phim trực tuyến Disney+. Giám chế phim là A.C. Bradley, cùng với đạo diễn là Bryan Andrews. Tác phẩm được xây dựng trong bối cảnh của Vũ trụ Điện ảnh Marvel (MCU), nói về những biến cố có thể xảy ra nếu các sự kiện trong các phim điện ảnh của vũ trụ này không đi theo chiều hướng ban đầu.', 1, 'https://img.ophim11.cc/uploads/movies/what-if-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/what-if-phan-2-poster.jpg', '2024-02-08 17:35:57', 8, 'https://www.youtube.com/watch?v=4iLVoEg9aLk', 24, 0),
(74, 'Vietnam: 50 Years Remembered', 'Vietnam: 50 Years Remembered', 2015, 'The history of U.S. involvement is told in this 7 part documentary series featuring personal stories from veterans and detailing the battles, strategy, and politics of a war that consumed multiple U.S. Presidents. A chronicle of the tragedy that tested the strength of our country and forever changed the social and political landscape of the world.', 1, 'https://img.ophim11.cc/uploads/movies/vietnam-50-years-remembered-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vietnam-50-years-remembered-poster.jpg', '2024-02-08 17:36:13', 8, '', 50, 0),
(75, 'Hiệp Sỹ Mặt Nạ: Hiểm Họa Trí Tuệ Nhân Tạo', 'Kamen Rider Zero One', 2019, '<p>Hiden Intelligence, công ty hàng đầu trong lĩnh vực trí tuệ nhân tạo (AI), đã phát triển và bắt đầu thử nghiệm thực tế Human Gear, những AI trong hình dạng con người, để thay thế con người trong các lĩnh vực đời sống. MetsubouJinrai.NET, một tổ chức khủng bố đã hack vào Human Gear và biến chúng thành vũ khí để tiêu diệt loài người. Chính phủ Nhật Bản đã nhanh chóng phát hiện ra và thành lập AIMS, Tổ chức quân sự trí tuệ nhân tạo, để tiêu diệt những Human Gear nổi loạn.</p>', 1, 'https://img.ophim11.cc/uploads/movies/hiep-sy-mat-na-hiem-hoa-tri-tue-nhan-tao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hiep-sy-mat-na-hiem-hoa-tri-tue-nhan-tao-poster.jpg', '2024-02-08 17:36:34', 8, '', 23, 0),
(76, 'Đấu Phá Thương Khung 2: Ngừng Chiến', 'Fights Break Sphere 2', 2023, '<p>&nbsp;Để giành chiến thắng trong cuộc thách đấu ba năm với Nạp Lan Yên Nhiên, Tiêu Viêm và Dược Lão đã đến sa mạc của tộc rắn, tìm kiếm ngọn lửa kỳ bí - Lửa Trái Đất Thanh Liên, để nâng cao sức mạnh của mình. Trong sa mạc của tộc rắn, họ bất ngờ bị cuốn vào cuộc chiến tranh giữa nhân loại và tộc rắn. Nữ hoàng của tộc rắn, Medusa, đang đóng cửa tu luyện để thăng cấp tôn nhi, tình cờ tạo cơ hội cho Tiêu Viêm. Do đó, Tiêu Viêm liên minh với Thanh Lân và Mực Lực, cùng nhau xâm nhập lâu đài của tộc rắn. Trong lúc này, Medusa do hấp thụ Lửa Trái Đất Thanh Liên mà mê muội, Tiêu Viêm dễ dàng giành được \"Lửa Trái Đất Thanh Liên\" mà anh từng ao ước. Trong khi đó, bên ngoài thành phố, cuộc chiến tranh lớn giữa nhân loại và tộc rắn đang diễn ra... Sức mạnh của Tiêu Viêm tăng vọt, hủy diệt âm mưu kế hoạch của tộc rắn. Sau một chuỗi sắp xếp, Tiêu Viêm bắt đầu hành trình đến \"Học Viện Ca-na-an\"...</p>', 0, 'https://img.ophim11.cc/uploads/movies/dau-pha-thuong-khung-2-ngung-chien-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dau-pha-thuong-khung-2-ngung-chien-poster.jpg', '2024-02-08 17:36:59', 8, '', 87, 1),
(77, 'Hộ sinh Hạc (Phần 2)', 'Dr. Storks (Season 2)', 2017, '<p>Bác sĩ sản khoa Konotori Sakura giúp đỡ đàn anh cũ tại một bệnh viện đa khoa trên hòn đảo xa xôi có nguồn lực y tế hạn chế.</p>', 1, 'https://img.ophim11.cc/uploads/movies/ho-sinh-hac-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ho-sinh-hac-phan-2-poster.jpg', '2024-02-08 17:37:27', 8, '', 59, 7),
(78, 'Đại Chiến Mai Mối', 'The Matchmakers', 2023, '<p>Được dẫn dắt bởi Rowoon và Cho Yi Hyun, The Matchmaker là một bộ phim truyền hình lãng mạn lịch sử sắp ra mắt lấy bối cảnh triều đại Joseon. Phim xoay quanh cuộc đời của Shim Jung Woo (Rowoon), một học giả thiên tài có cuộc đời bị đảo lộn sau cái chết của người yêu, công chúa.</p>', 1, 'https://img.ophim11.cc/uploads/movies/dai-chien-mai-moi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dai-chien-mai-moi-poster.jpg', '2024-02-08 17:38:22', 8, '', 60, 0),
(79, 'Ta Muốn Trở Thành Chúa Tể Bóng Tối (Phần 2)', '陰の実力者になりたくて！ 2nd season', 2023, 'Như bao người ngưỡng mộ những anh hùng khi còn nhỏ, nhân vật chính của chúng ta lại ngưỡng mộ những con người trong bóng tối. Sau khi giấu đi khả năng thật sự và sống 1 cuộc đời tầm thường của 1 thường dân vào ban ngày trong khi trải qua những khóa huấn luyện điên rồ vào ban đêm, anh ta cuối cùng cũng được chuyển sinh sang thê giới khác. Người đàn ông ấy, người mà chỉ phô diễn sức mạnh trong bóng tối, những người hầu cận và cùng với đó là tổ chức lớn mạnh của anh… Đây là câu chuyện về một chàng trai, người luôn khao khát sức mạnh trong màn đêm, trị vì thế giới ngầm ở thế giới khác.', 1, 'https://img.ophim11.cc/uploads/movies/ta-muon-tro-thanh-chua-te-bong-toi-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ta-muon-tro-thanh-chua-te-bong-toi-phan-2-poster.jpg', '2024-02-08 17:39:01', 8, '', 23, 17),
(80, 'Màn Đêm Kinh Hoàng', 'Night Has Come', 2023, 'Trapped in the deadly cursed \"Mafia Game,\" the students of Yoo Il High must play the game to survive, while unraveling the mysteries behind the curse.', 1, 'https://img.ophim11.cc/uploads/movies/man-dem-kinh-hoang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/man-dem-kinh-hoang-poster.jpg', '2024-02-08 17:39:13', 8, '', 35, 15);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(81, 'Đảo Hải Tặc', 'One Piece (Luffy)', 1999, '<p>Monkey D. Luffy, 1 cậu bé rất thích <strong>Đảo hải tặc</strong> có ước mơ tìm được kho báu <strong>One Piece</strong> và trở thành <strong>Vua hải tặc</strong> - Pirate King. Lúc nhỏ, Luffy tình cờ ăn phải trái quỉ (Devil Fruit) Gomu Gomu, nó cho cơ thể cậu khả năng co dãn đàn hồi như cao su nhưng đổi lại cậu sẽ không bao giờ biết bơi. Sau đó Luffy lại được Shank cứu thoát tuy nhiên ông ta bị mất 1 cánh tay. Sau đấy Shank chia tay Luffy và để lại cho cậu cái mũ rơm (Straw Hat) và nói rằng: Sau này bao giờ thành cướp biển hãy gặp ta và trả lại nó. Chính lời nói này đã thúc đầy Luffy trở thành 1 cướp biển thật sự.</p><p>Hãy cùng theo dõi xem liệu <strong>Luffy</strong> có thể trở thành đạt được kho báu <strong>One Piece</strong> và trở thành <strong>Vua Hải Tặc </strong>không nhé.</p>', 1, 'https://img.ophim.live/uploads/movies/one-piece-thumb.jpg', 'https://img.ophim.live/uploads/movies/one-piece-poster.jpg', '2024-02-09 12:21:43', 8, '', 25, 7),
(82, 'Ta Muốn Trở Thành Chúa Tể Bóng Tối', 'The Eminence in Shadow', 2022, '<p>[Chúa tể bóng tối] Đó không phải nhân vật chính cũng chẳng phải trùm cuối. Đây là một kẻ bình thường che giấu thực lực, giả làm nhân vật quần chúng nhưng luôn ở trong bóng tối âm thầm can thiệp và thể hiện thực lực. Vốn dĩ hắn là một thiếu niên vì nuôi mộng làm [Chúa tể bóng tối] nên mỗi ngày đều sống an phận như một nhân vật quần chúng nhưng chăm chỉ tu luyện để có được sức mạnh. Đến một ngày, hắn đã mất mạng vì tai nạn và được chuyển sinh tới một thế giới khác. Thiếu niên một lần nữa được sinh ra dưới thân phận Cid Kagenou đã quyết định sẽ sống hạnh phúc ở thế giới khác với cái thiết lập [Chúa tể bóng tối]. Vốn dĩ [Ảo tưởng] mà hắn vẽ ra là sẽ âm thầm chiến đấu để tiêu diệt [Giáo Đoàn Hắc Ám] nhưng chẳng ngờ ở thế giới khác này, [Giáo Đoàn Hắc Ám] lại thật sự tồn tại!? Thuận theo đó, các thiếu nữ thủ hạ của hắn cũng vì hiểu lầm mà tôn thờ hắn dưới danh nghĩa Shadow, bản thân Cid đã chẳng hề hay biết mà trở thành [Chúa tể bóng tối] đích thực, và thế là tổ chức bóng tối [Shadow Garden] do Cid lãnh đạo sẽ đi hủy diệt hắc ám của thế gian...</p>', 1, 'https://img.ophim11.cc/uploads/movies/ta-muon-tro-thanh-chua-te-bong-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ta-muon-tro-thanh-chua-te-bong-toi-poster.jpg', '2024-02-09 12:23:15', 8, '', 23, 8),
(83, 'Chào Mừng Đến Samdal-ri ', 'Welcome to Samdal-ri', 2023, '<p>Sau khi rớt xuống từ trên đỉnh cao, nữ nhiếp ảnh gia nọ quay về quê hương và tình cờ gặp lại người bạn thơ ấu. Thế rồi mối tình còn dang dở cứ thế mà nhen nhóm.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/chao-mung-den-samdal-ri-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chao-mung-den-samdal-ri-poster.jpg', '2024-02-10 08:25:42', 8, 'https://www.youtube.com/watch?v=aY8QmExZrlY', 50, 0),
(84, 'Vua Hải Tặc: Thành Phố Vàng', 'One Piece Film: Gold', 2016, '<p>\"Gran Tesoro\" là thành phố giải trí lớn nhất trên thế giới. Băng hải tặc Mũ Rơm tiếp tục cuộc phiêu lưu của mình, gặp Guild Teroso \"Hoàng đế vàng\" , người có sức mạnh di chuyển chính phủ thế giới. Rốt cuộc anh ta muốn cái quái gì? Và nhóm Luffy sẽ làm gì! !!</p>', 1, 'https://img.ophim11.cc/uploads/movies/vua-hai-tac-thanh-pho-vang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vua-hai-tac-thanh-pho-vang-poster.jpg', '2024-02-10 08:26:21', 8, '', 120, 0),
(85, 'Sứ Mệnh Thần Chết: Tàn Phai Vào Bóng Đêm, Gọi Tên Em', 'Bleach: Fade to Black Bleach Movie 3: Fade to Black - Kimi no Na wo Yobu', 2008, '<p>Hai con người đến từ một nơi xa xăm có khả năng xóa đi kí ức. Một loại Hollow hiếm xuất hiện. Một sản phẩm của Kurotsuchi bị lạm dụng. Ký ức của tất cả Thần Chết bị đảo lộn. Soul Society rơi vào tình trạng hỗn độn. Ẩn sau đó là một bi kịch của quá khứ. Duy chỉ hai con người không bị ảnh hưởng. Họ phải làm thế nào để giải quyết mọi thứ?</p>', 1, 'https://img.ophim11.cc/uploads/movies/su-menh-than-chet-tan-phai-vao-bong-dem-goi-ten-em-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/su-menh-than-chet-tan-phai-vao-bong-dem-goi-ten-em-poster.jpg', '2024-02-10 08:26:55', 8, '', 0, 0),
(86, 'Naruto Shippuden: Cái Chết Tiên Đoán', 'Naruto Shippûden: The Movie', 2007, '<p>Một tinh thần mạnh mẽ đã từng đe dọa phá hủy thế giới đã trở lại! Nhiệm vụ của Naruto là bảo vệ một nữ tu sĩ có tên Shion, người duy nhất có sức mạnh để bịt kín con quái vật.</p>', 0, 'https://img.ophim11.cc/uploads/movies/naruto-shippuden-cai-chet-tien-doan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/naruto-shippuden-cai-chet-tien-doan-poster.jpg', '2024-02-10 08:29:11', 8, '', 0, 0),
(87, 'Naruto Shippuden: Nhiệm Vụ Bí Mật', 'Naruto Shippuden: The Movie - Bonds', 2008, '<p>Một nhóm Ninja bí ẩn được gọi là Sora-Nin từ Sky Country thực hiện một cuộc tấn công bất ngờ trên Konoha. Điều này là do Konoha gần như phá hủy đất nước bầu trời trong Chiến tranh thế giới Shinobi cuối cùng, nhưng họ đã sống sót và bây giờ họ sau Konoha và nước cứu hỏa để trả thù.</p>', 0, 'https://img.ophim11.cc/uploads/movies/naruto-shippuden-nhiem-vu-bi-mat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/naruto-shippuden-nhiem-vu-bi-mat-poster.jpg', '2024-02-10 08:29:17', 8, '', 0, 0),
(88, 'Tom and Jerry: The Fast and the Furry', 'Tom and Jerry: The Fast and the Furry', 2005, '<p>Tom và Jerry và tay đua khác cố gắng giành được chìa khóa cho giải thưởng. Trước tiên, họ đến Mexico và tìm ra xếp hạng là quá cao để họ mở rộng nó đến Jungle Amazon. Tom loại bỏ Mẹ bóng đá bằng cách khiến cô ấy lái xe minivan của mình thành một hố cát lún. Bugs bầy đàn và ăn bóng đá.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tom-and-jerry-the-fast-and-the-furry-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tom-and-jerry-the-fast-and-the-furry-poster.jpg', '2024-02-10 08:29:29', 8, '', 0, 0),
(89, 'Vút Bay', 'Up', 2009, '<p>Là một cậu bé, Carl Fredricksen muốn khám phá Nam Mỹ và tìm những ngã thiên đường hoang dã. Khoảng 64 năm sau, anh ta được bắt đầu hành trình cùng với Boy Scout Russell bằng cách nâng ngôi nhà của mình với hàng ngàn quả bóng bay. Trên hành trình của họ, họ làm cho nhiều người bạn mới bao gồm một con chó biết nói, và tìm ra rằng ai đó có kế hoạch xấu xa. Carl sớm nhận ra rằng những kẻ bất lương này là thần tượng thời thơ ấu của anh.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vut-bay-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vut-bay-poster.jpg', '2024-02-10 08:29:35', 8, '', 0, 0),
(90, 'Người Nhện: Vũ Trụ Mới', 'Spider-Man: Into the Spider-Verse', 2018, '<p>Miles Teen Morales trở thành người nhện của vũ trụ của mình, và phải tham gia với năm cá nhân chạy bằng nhện từ các khía cạnh khác để ngăn chặn mối đe dọa cho tất cả các thực tế.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-nhen-vu-tru-moi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-nhen-vu-tru-moi-poster.jpg', '2024-02-10 08:29:55', 8, '', 0, 0),
(91, 'Vua Sư Tử', 'The Lion King', 2019, '<p>Ở Châu Phi, Lion Cub Simba là niềm tự hào và niềm vui của cha mẹ King Mufasa và Nữ hoàng Sarabi. Mufasa chuẩn bị Simba là Vua tiếp theo của Jungle. Tuy nhiên, Simba ngây thơ tin vào vết sẹo của chú ghen tị của mình muốn giết Mufasa và Simba để trở thành Vua tiếp theo. Anh ta dụ dỗ Simba và người bạn Nala của mình để đi đến một nơi bị cấm và họ bị Hyenas tấn công nhưng họ được MUFASA cứu trợ. Sau đó, Scar Plots một kế hoạch khác để giết Mufasa và Simba nhưng Cub đã trốn thoát sống và rời khỏi vương quốc tin rằng anh ta chịu trách nhiệm cho cái chết của cha mình. Bây giờ sẹo trở thành nhà vua được hỗ trợ bởi hyenas độc ác trong khi Simba phát triển trong một vùng đất xa xôi. Thỉnh thoảng, Nala gặp Simba và nói rằng Vương quốc đã trở thành một vùng đất hoang đáng sợ. Simba sẽ làm gì?</p>', 0, 'https://img.ophim11.cc/uploads/movies/vua-su-tu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vua-su-tu-poster.jpg', '2024-02-10 08:30:26', 8, '', 0, 0),
(92, 'Oculus', 'Oculus', 2013, 'Mieke is being harassed by an inexplicable phenomenon. She is having nightmares and her children are acting strange. For no apparent reason her mother appears, after a long period without any contact. She tries to warn Mieke for impending doom. Has it something to do with the doll that one of her sons got for his birthday? Mieke makes a discovery, a very dark one. Something that will turn her life upside down.', 0, 'https://img.ophim11.cc/uploads/movies/oculus-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/oculus-poster.jpg', '2024-02-10 08:31:06', 8, '', 14, 0),
(93, 'Trận chiến ánh sáng', 'The Current War', 2017, '<p>Các đối thủ Thomas Edison và George Westinghouse tham gia một cuộc đua điên cuồng để xác định xem hệ thống điện của ai sẽ cung cấp năng lượng cho thế giới hiện đại.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tran-chien-anh-sang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tran-chien-anh-sang-poster.jpg', '2024-02-10 17:26:05', 8, '', 147, 0),
(94, 'Trạng Quỳnh', 'Trang Quynh', 2019, '<p>Chàng trai thông minh, lắm trò ma mãnh nỗ lực giải oan cho người thầy yêu quý của mình khỏi lời luận tội đáng ngại liên quan đến một gã quan liêu gian xảo.</p>', 0, 'https://img.ophim11.cc/uploads/movies/trang-quynh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/trang-quynh-poster.jpg', '2024-02-10 17:26:08', 8, '', 133, 3),
(95, 'Điệp viên thiên thần', 'The Angel', 2018, '<p>Khi đất nước mình đang chuẩn bị chiến tranh, quan chức cấp cao của Ai Cập Ashraf Marwan đã liên lạc với Israel và lao vào công cuộc tình báo đầy nguy hiểm.</p>', 0, 'https://img.ophim11.cc/uploads/movies/diep-vien-thien-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/diep-vien-thien-than-poster.jpg', '2024-02-10 17:26:11', 8, '', 154, 0),
(96, 'Biệt đội đánh thuê', 'The Expendables', 2010, '<p>Một người lính dẫn đầu nhóm tay súng đánh thuê nghèo khó thực hiện vụ lật đổ một kẻ độc tài Nam Mỹ, công việc mà không đơn vị quân sự chính thức nào sẵn lòng đụng vào.</p>', 0, 'https://img.ophim11.cc/uploads/movies/biet-doi-danh-thue-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/biet-doi-danh-thue-poster.jpg', '2024-02-10 17:26:13', 8, '', 143, 0),
(97, 'HOMECOMING: Phim của Beyoncé', 'HOMECOMING: A film by Beyoncé', 2019, '<p>Bộ phim là cái nhìn gần gũi và sâu sắc về buổi diễn nổi tiếng ở Coachella năm 2018 của Beyoncé, hé lộ con đường đầy cảm xúc từ ý tưởng sáng tạo đến trào lưu văn hóa.</p>', 0, 'https://img.ophim11.cc/uploads/movies/homecoming-phim-cua-beyonce-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/homecoming-phim-cua-beyonce-poster.jpg', '2024-02-10 17:26:16', 8, '', 217, 0),
(98, 'Trái tim rồng 3: Lời nguyền của phù thủy', 'Dragonheart 3: The Sorcerer\'s Curse', 2015, '<p>Khi một hiệp sĩ nhiệt huyết vô tình chạm trán một con rồng, cả hai tạo ra một liên minh lạ thường trong trận chiến cam go với một pháp sư hiểm ác.</p>', 0, 'https://img.ophim11.cc/uploads/movies/trai-tim-rong-3-loi-nguyen-cua-phu-thuy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/trai-tim-rong-3-loi-nguyen-cua-phu-thuy-poster.jpg', '2024-02-10 17:26:18', 8, '', 137, 0),
(99, 'Tay đua siêu phàm', 'Burn Out', 2017, '<p>Một tay đua siêu xe cảm giác mạnh đã làm thêm công việc giao nhận ma túy để xóa nợ cho mẹ của đứa con mình khi cô ấy gặp rắc rối với lũ tội phạm thế giới ngầm Paris.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tay-dua-sieu-pham-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tay-dua-sieu-pham-poster.jpg', '2024-02-10 17:26:20', 8, '', 143, 0),
(100, 'Kẻ trộm siêu thị', 'Shoplifters', 2018, '<p>Nghèo nhưng gắn bó, nhà Shibata ăn trộm để tồn tại. Hành động cứu một cô bé từ gia đình của em khiến họ rơi vào xung đột với phần còn lại của xã hội.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ke-trom-sieu-thi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ke-trom-sieu-thi-poster.jpg', '2024-02-10 17:26:23', 8, '', 2, 0),
(101, 'Mục tiêu khó diệt', 'Hard Target', 1993, '<p>Băng nhóm tàn ác tại New Orleans săn người cho thú vui độc ác. Nhưng khi cha của một cô gái mất tích, cô đã nhờ người đàn ông Cajun mạnh mẽ Chance Boudreaux tìm ông.</p>', 0, 'https://img.ophim11.cc/uploads/movies/muc-tieu-kho-diet-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/muc-tieu-kho-diet-poster.jpg', '2024-02-10 17:26:25', 8, '', 139, 0),
(102, 'Ông hoàng thời trang', 'Fashion King', 2014, '<p>Nhờ sự hướng dẫn của một cố vấn về phong cách, một học sinh cấp ba bắt đầu hành trình giành lấy danh hiệu \"Ông hoàng thời trang\" và lấy lòng cô gái trong mộng của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ong-hoang-thoi-trang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ong-hoang-thoi-trang-poster.jpg', '2024-02-10 17:26:28', 8, '', 154, 0),
(103, 'Món quà bí ẩn', 'Good Sam', 2019, '<p>Khi theo đuổi câu chuyện về nhân vật bí ẩn tặng cả túi tiền cho những người lạ khắp thành phố New York, cô phóng viên tò mò đã tìm được tình yêu của đời mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/mon-qua-bi-an-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mon-qua-bi-an-poster.jpg', '2024-02-10 17:26:30', 8, '', 130, 0),
(104, 'Tam đại tặc vương', 'Trivisa', 2016, '<p>Trivisa</p>', 0, 'https://img.ophim11.cc/uploads/movies/tam-dai-tac-vuong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tam-dai-tac-vuong-poster.jpg', '2024-02-10 17:26:32', 8, '', 137, 0),
(105, 'Tốc độ nguy hiểm', 'Maximum Risk', 1996, '<p>Maximum Risk</p>', 0, 'https://img.ophim11.cc/uploads/movies/toc-do-nguy-hiem-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/toc-do-nguy-hiem-poster.jpg', '2024-02-10 17:26:35', 8, '', 140, 0),
(106, 'Cú click huyền bí', 'Click', 2006, '<p>Click</p>', 0, 'https://img.ophim11.cc/uploads/movies/cu-click-huyen-bi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cu-click-huyen-bi-poster.jpg', '2024-02-10 17:26:37', 8, '', 147, 0),
(107, 'Những gã trai hư 2', 'Bad Boys II', 2003, '<p>Trong phần tiếp theo đầy ắp hành động này, bộ đôi cảnh sát chống ma túy Miami điều tra mối liên hệ của trùm ma túy Cuba với nguồn cung dồi dào thuốc lắc ở Florida.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-ga-trai-hu-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-ga-trai-hu-2-poster.jpg', '2024-02-10 17:26:40', 8, '', 226, 2),
(108, 'Godzilla Minus One', 'Godzilla Minus One', 2023, 'In postwar Japan, a new terror rises. Will the devastated people be able to survive... let alone fight back?', 0, 'https://img.ophim.live/uploads/movies/godzilla-minus-one-thumb.jpg', 'https://img.ophim.live/uploads/movies/godzilla-minus-one-poster.jpg', '2024-02-10 17:26:41', 8, 'https://www.youtube.com/watch?v=r7DqccP1Q_4', 125, 0),
(109, 'Hẹn Hò Với Ông Già Tuyết ', 'Dating Santa', 2023, '<p>Lucia là một chuyên gia giỏi và là mẹ đơn thân của Leo, cô con gái 6 tuổi xinh đẹp và tinh nghịch của cô, người bị ám ảnh bởi lễ Giáng sinh và tin rằng sự ra đời của mình là do một phép màu Giáng sinh. Giữa hai công việc toàn thời gian của mình (làm mẹ và kiến trúc), cô không có thời gian cũng như không có ý định yêu lần nữa, nhưng khi cô miễn cưỡng đồng ý hẹn hò mù quáng với Sergio, một đầu bếp đẹp trai và dễ mến, tia lửa đã lóe lên. không thể phủ nhận.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hen-ho-voi-ong-gia-tuyet-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hen-ho-voi-ong-gia-tuyet-poster.jpg', '2024-02-10 17:26:47', 8, '', 98, 0),
(110, 'Bewitched', 'Bewitched', 1981, '<p><strong>Bùa Quỷ – Bewitched (1981)</strong> một người đàn ông qua Nam Dương du lịch tình cờ quen được 1 cô gái và tán tỉnh cổ. Sau khi chiếm trọn con tim của cô gái và trao thân cho người đàn ông này thì hóa ra là kẻ sở khanh, cô bèn lập tức yểm bùa lên người đàn ông khiến anh ta hóa điên và giết chết con gái mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bewitched-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bewitched-poster.jpg', '2024-02-10 17:26:50', 8, '', 146, 0),
(111, 'Kỳ Nghỉ Đáng Nhớ', 'Bilitis', 1977, 'A coming of age story centering on the exploits of a young girl during summer vacation.', 0, 'https://img.ophim11.cc/uploads/movies/ky-nghi-dang-nho-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ky-nghi-dang-nho-poster.jpg', '2024-02-10 17:26:52', 8, 'https://www.youtube.com/watch?v=gpxRAfnd15U', 95, 0),
(112, 'Black Magic 2', 'Black Magic 2', 1976, '', 0, 'https://img.ophim11.cc/uploads/movies/black-magic-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/black-magic-2-poster.jpg', '2024-02-10 17:26:59', 8, '', 130, 2),
(113, 'Đại Sự Kiện', 'Breaking News', 2004, 'Một nhóm phóng viên truyền hình phát trực tiếp cuộc đọ súng giữa lực lượng cảnh sát và 5 tên cướp ngân hàng. Hình ảnh viên cảnh sát xin bọn cướp tha chết đã làm dấy lên một làn sóng phẫn uất trong dư luận và câu hỏi về vai trò của lực lượng gìn giữ trật tự được đặt ra. Dấu vết của bọn tội phạm được phát hiện, hàng nghìn cảnh sát được huy động bao vây tòa nhà nơi bọn chúng trú ngụ. Nữ thanh tra Rebecca (Trần Tuệ Lâm) quyết định biến cuộc tấn công thành một show truyền hình, qua đó lấy lại uy tín cho ngành cảnh sát. Lính đặc nhiệm được trang bị những camera nhỏ xíu để thu trực tiếp hình ảnh của cuộc chiến, sự kiện sẽ được dựng lại rồi phát ngay trên sóng truyền hình cho mọi người dân Hong Kong được theo dõi. Nhưng bọn tội phạm đã phát hiện ra mánh khóe này, thật ngạc nhiên, chúng lại quyết định hợp tác với đài truyền hình với mục đích chống lại phía cảnh sát. Thế là người dân Hong Kong được trực tiếp chứng kiến một cuộc chiến thực sự...', 0, 'https://img.ophim11.cc/uploads/movies/dai-su-kien-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dai-su-kien-poster.jpg', '2024-02-10 17:27:02', 8, 'https://www.youtube.com/watch?v=rEVC3-6Gv4Q', 90, 0),
(114, 'Gái Bar Nổi Loạn', 'Coyote Ugly', 2000, 'Graced with a velvet voice, 21-year-old Violet Sanford heads to New York to pursue her dream of becoming a songwriter only to find her aspirations sidelined by the accolades and notoriety she receives at her \"day\" job as a barmaid at Coyote Ugly. The \"Coyotes\" as they are affectionately called tantalize customers and the media alike with their outrageous antics, making Coyote Ugly the watering hole for guys on the prowl.', 0, 'https://img.ophim11.cc/uploads/movies/gai-bar-noi-loan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/gai-bar-noi-loan-poster.jpg', '2024-02-10 17:27:07', 8, 'https://www.youtube.com/watch?v=2lqWOOHOwlE', 100, 0),
(115, 'Carol và ngày tận thế', 'Carol & the End of the World', 2023, 'Khi tận thế sắp đến với hành tinh, người phụ nữ nọ chật vật đương đầu với những hỗn loạn trước ngày tàn để tìm kiếm ý nghĩa trong những tháng cuối cùng của mình trên Trái Đất.', 1, 'https://img.ophim11.cc/uploads/movies/carol-va-ngay-tan-the-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/carol-va-ngay-tan-the-poster.jpg', '2024-02-10 17:27:14', 8, 'https://www.youtube.com/watch?v=RlFvhRhY2Nc', 27, 0),
(116, 'Phi đội gà bay 2: Âm mưu gà nugget', 'Chicken Run: Dawn of the Nugget', 2023, 'Một đàn gà dũng cảm tập hợp lại để cứu loài gia cầm khỏi mối đe dọa mới đáng ngại: trang trại gần đó đang âm mưu điều gì đó đáng ngờ.', 0, 'https://img.ophim11.cc/uploads/movies/phi-doi-ga-bay-2-am-muu-ga-nugget-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phi-doi-ga-bay-2-am-muu-ga-nugget-poster.jpg', '2024-02-10 17:27:19', 8, 'https://www.youtube.com/watch?v=icfv_T5pkdI', 101, 0),
(117, 'Yêu Lại Vợ Ngầu', 'Love Reset', 2023, '<p>Một bộ phim hài lãng mạn về \'Roh Jeong-yeol\' và \'Hong Na-ra\' bị mất ký ức do một tai nạn bất ngờ chỉ 30 ngày trước khi kết thúc cuộc sống hôn nhân của họ, bắt đầu như một mối tình lãng mạn nhưng lại trở thành một bộ phim kinh dị.</p>', 0, 'https://img.ophim11.cc/uploads/movies/yeu-lai-vo-ngau-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/yeu-lai-vo-ngau-poster.jpg', '2024-02-10 17:28:10', 8, 'https://www.youtube.com/watch?v=wzlzVRud5HQ', 119, 0),
(118, 'Tôi Ghét Giáng Sinh (Phần 2)', 'I Hate Christmas', 2023, '<p>Sau khi nói dối gia đình về việc có bạn trai, một y tá độc thân phải tìm cho ra nửa kia bằng mọi giá trước Giáng sinh – tức là còn 24 ngày nữa.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/toi-ghet-giang-sinh-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/toi-ghet-giang-sinh-phan-2-poster.jpg', '2024-02-10 17:28:16', 8, 'https://www.youtube.com/watch?v=TZ5NFlE_wd0', 31, 0),
(119, 'Ma Thổi Đèn: Nam Hải Quy Hư', 'South Sea Tomb', 2023, '<p>Hồ Bát Nhất và Vương Mập đã gỡ bùa Mô Kim, lẽ ra định cùng Shirley Dương ra nước ngoài, lúc này lại được giáo sư Trần nhờ vả, họ cùng chú Minh từng làm sói biển đến vực xoáy San Hô ở Nam Hải tìm kiếm báu vật quốc gia mất tích đã lâu: “Tần Vương Chiếu Cốt kính”. Họ mua “con tàu ma” Đinh Ba ở đảo Miếu San Hô có trang thiết bị mạnh nhưng không ai dám dùng đến, đồng thời làm quen với ba thầy trò Nguyễn Hắc, Cổ Xai, Đa Linh là dân sống lênh đênh trên biển, mọi người cùng ra khơi. Một hôm đúng ngày trăng tròn, lửa đen dưới đáy biển lại bốc cháy, mắt biển Quy Khư mở ra, họ đang tìm kiếm vị trí “Tần Vương Chiếu Cốt kính” ở vùng biển vực xoáy San Hô bị hút vào động biển Quy Khư kỳ lạ. Mọi người nhiều lần đấu tranh, tuy thoát chết nhưng lại không biết làm sao để quay lại mặt biển. Trong lúc tuyệt vọng, Hồ Bát Nhất và Shirley Dương quyết định dùng cây cung bắn mặt trời khổng lồ làm từ Kiện Mộc do tộc người nước Hận Thiên để lại, liều mình một phen, đưa mọi người thoát khỏi Quy Khư, quay trở lại đảo Miếu San Hô.</p>', 1, 'https://img.ophim11.cc/uploads/movies/ma-thoi-den-nam-hai-quy-hu-2023-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ma-thoi-den-nam-hai-quy-hu-2023-poster.jpg', '2024-02-10 17:28:17', 8, '', 30, 0),
(120, 'Tôi và các cậu bé nhà Walter', 'My Life with the Walter Boys', 2023, 'Khi bi kịch đảo lộn cuộc sống của cô, thiếu nữ nọ chuyển đến sống cùng gia đình lớn của người giám hộ ở thị trấn nhỏ và có những bài học mới về tình yêu, hi vọng và tình bạn.', 1, 'https://img.ophim11.cc/uploads/movies/toi-va-cac-cau-be-nha-walter-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/toi-va-cac-cau-be-nha-walter-poster.jpg', '2024-02-10 17:28:24', 8, 'https://www.youtube.com/watch?v=pHIXtOrHF80', 48, 1),
(121, 'Ngày May Mắn Đẫm Máu', 'A Bloody Lucky Day', 2023, '<p>Một tài xế taxi vui vẻ đi ngang qua đường với một kẻ sát nhân trẻ tuổi là hành khách đường dài.</p>', 1, 'https://img.ophim11.cc/uploads/movies/a-bloody-lucky-day-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/a-bloody-lucky-day-poster.jpg', '2024-02-10 17:28:30', 8, '', 60, 0),
(122, 'Cuộc Hôn Nhân Thứ Ba', 'The Third Marriage', 2023, '<p>Cuộc Hôn Nhân Thứ Ba 2023 VietSub - The Third Marriage 2023 là một bức tranh tinh thần đầy màu sắc, mô tả cuộc hành trình của Kim Min Hee, một phụ nữ trẻ đối diện với những thử thách và bi kịch đầy khắc nghiệt của cuộc đời.</p><p>Min Hee (do diễn viên nổi tiếng đảm nhận) là một người phụ nữ thông minh và quyết đoán. Nhưng số phận đã đưa cô vào tình huống khó khăn khi cô em gái Ji Soo gặp tai nạn nghiêm trọng và cần một cuộc phẫu thuật cấp cứu đắt đỏ để sống sót. Để cứu lấy em gái, Min Hee đã đồng ý kết hôn với Joon Ho (do một diễn viên tài năng đóng), một người đàn ông giàu có và quyền lực, mặc cho tình cảm thực sự của cô.</p><p>Nhưng bi kịch chưa dừng lại ở đó. Ji Soo mất mạng trong một tai nạn bí ẩn, để lại Min Hee đau khổ và hối hận. Sự thất bại này đánh thức một khao khát trả thù đẫy mê hoặc trong tâm hồn cô. Min Hee quyết định bước vào cuộc hôn nhân thứ ba không phải với mục tiêu xây dựng một mái ấm gia đình, mà để tìm ra sự thật đằng sau cái chết của em gái mình.</p><p>Tuy nhiên, cuộc sống trong ngôi nhà mới với người chồng mới không hề êm đềm. Min Hee phải đối mặt với những âm mưu, thù địch và những bí mật đen tối mà cô không thể ngờ tới. Cuộc hôn nhân trở thành một cuộc chiến đấu không khoan nhượng, và Min Hee phải sử dụng tất cả sự thông minh và sức mạnh của mình để đối mặt với những thách thức khó khăn.</p><p>Cuộc Hôn Nhân Thứ Ba 2023 VietSub - The Third Marriage 2023 là một tác phẩm điện ảnh đậm chất con người. Bên cạnh diễn xuất xuất sắc của các diễn viên, bộ phim chạm đến những khía cạnh nhức nhối của cuộc sống và trái tim con người. Nó là một câu chuyện về tình yêu, sự hy sinh, và trả thù trong một thế giới đầy bi kịch. Cùng với sự căng thẳng, hấp dẫn và đầy xúc động, bộ phim chắc chắn sẽ gợi lại nhiều cảm xúc trong lòng khán giả. Hãy cùng khám phá cuộc hành trình đầy oan trái và bí ẩn này khi \"Cuộc Hôn Nhân Thứ Ba\" ra mắt.</p>', 1, 'https://img.ophim11.cc/uploads/movies/cuoc-hon-nhan-thu-ba-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuoc-hon-nhan-thu-ba-poster.jpg', '2024-02-10 17:28:33', 8, '', 45, 13),
(123, 'Silver và Quyển Mộng Thư', 'Silver and the Book of Dreams', 2023, '<p>Khi Liv chuyển đến London, cô gặp một nhóm chàng trai bí ẩn kéo cô vào thế giới du hành trong mơ. Cô và nhóm người lang thang trong mơ tiến hành một nghi lễ để biến giấc mơ lớn nhất của họ thành hiện thực, nhưng nó đòi hỏi sự hy sinh nghiêm túc nhất.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/silver-va-quyen-mong-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/silver-va-quyen-mong-thu-poster.jpg', '2024-02-10 17:28:39', 8, 'https://www.youtube.com/watch?v=l82zIibKF-E', 92, 1),
(124, 'Con Gái Của Vua Đầm Lầy', 'The Marsh King\'s Daughter', 2023, '<p>Helena, một người phụ nữ sống một cuộc sống tưởng chừng như bình thường, đang che giấu một bí mật đen tối—cha cô là \'Vua đầm lầy\' khét tiếng, người đã giam giữ cô và mẹ cô ở vùng hoang dã trong nhiều năm. Sau một đời cố gắng trốn thoát khỏi quá khứ, Helena buộc phải đối mặt với ác quỷ của mình khi cha cô bất ngờ trốn thoát khỏi nhà tù.</p>', 0, 'https://img.ophim11.cc/uploads/movies/con-gai-cua-vua-dam-lay-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/con-gai-cua-vua-dam-lay-poster.jpg', '2024-02-10 17:28:45', 8, 'https://www.youtube.com/watch?v=FDnUVhLMqI0', 108, 0),
(125, 'The King\'s Daughter', 'The King\'s Daughter', 2022, '<p>Cuộc tìm kiếm sự bất tử của Vua Louis XIV khiến ông bắt và đánh cắp sinh lực của một nàng tiên cá, một động thái còn phức tạp hơn khi con gái ngoài giá thú của ông phát hiện ra sinh vật này.</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-kings-daughter-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-kings-daughter-poster.jpg', '2024-02-10 17:28:51', 8, 'https://www.youtube.com/watch?v=sLiKspC9MeM', 94, 0),
(126, 'Cinderella Chef', 'Cinderella Chef', 2022, 'Ye Jiayao finds herself back in time in the body of Ye Jinxuan. After many twists, she thought that she would finally be able to lead a simple life and achieve her dream of opening the best restaurant in Huai Song. However, there are villains constantly trying to bring her down.', 1, 'https://img.ophim11.cc/uploads/movies/cinderella-chef-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cinderella-chef-poster.jpg', '2024-02-10 17:28:55', 8, '', 21, 0),
(127, 'Bánh Mỹ 4: Hội Trại Ban Nhạc', 'American Pie Presents: Band Camp', 2005, 'Các cô cậu nam thanh nữ tú trong thời đại cuộc sống số có một quan điểm về giới tính và tình dục thoáng đến mức khó tin, tất nhiên điều đó dẫn tới những tác hại khôn lường. Anh chàng Stifler Matthew là một thanh niên điển hình trong trào lưu này, người có cách hành xử cực kỳ…thô thiển và tự do. Đó là việc anh chàng này có niềm đam mê… quay lén những các thiếu nữ trong trang phục bikini và thoát y khi tắm! Với một tính cách động trời như thế, cộng với bản tính siêu quậy, anh chàng nhanh chóng bị đe dọa sa thải khỏi trường trung học.', 0, 'https://img.ophim11.cc/uploads/movies/banh-my-4-hoi-trai-ban-nhac-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/banh-my-4-hoi-trai-ban-nhac-poster.jpg', '2024-02-10 17:28:57', 8, 'https://www.youtube.com/watch?v=ORLDIRIENXY', 94, 0),
(128, 'Bánh Mỹ 7: Cuốn Sách Tình Yêu', 'American Pie Presents: The Book of Love', 2009, 'Chuyện phim American Pie Presents: The Book Of Love (2009) lấy bối cảnh tại trường trung học East Great Falls. Ba cô cậu học sinh “vẫn còn tem” nhân vật chính của bộ phim là Rob, Nathan và Lube. Một tối nọ, Rob tình cờ phóng hỏa thư viện và tìm thấy “The Bible”, thứ giang hồ vẫn đồn đại là “bí kíp tình yêu”. Tiếc thay, cuốn sách đã bị hỏng nặng, chỉ còn lại một số lời khuyên không nguyên vẹn.Tuy vậy, cả ba vẫn quyết định “sử dụng” nó như một “kim chỉ nam” trên con đường... đánh mất sự trong trắng và gây ra một số tình huống dở khóc dở cười. Sau vài lần ứng dụng thử, cả bọn quyết định sẽ khôi phục lại quyển sách... American Pie Presents: The The Book Of Love (2009) là phần thứ tư, đồng thời là phần cuối cùng trong loạt phiên bản American Pie Presents. Có sự góp mặt của dàn diễn viên xinh đẹp và cốt truyện thú vị,đây vẫn là một tập phim đáng xem với những khán giả đã trung thành với series phim được ưa thích này.', 0, 'https://img.ophim11.cc/uploads/movies/banh-my-7-cuon-sach-tinh-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/banh-my-7-cuon-sach-tinh-yeu-poster.jpg', '2024-02-10 17:29:03', 8, 'https://www.youtube.com/watch?v=SWYLgOrrsno', 93, 0),
(129, 'Once Were Warriors', 'Once Were Warriors', 1994, 'A drama about a Maori family living in Auckland, New Zealand. Lee Tamahori tells the story of Beth Heke’s strong will to keep her family together during times of unemployment and abuse from her violent and alcoholic husband.', 0, 'https://img.ophim11.cc/uploads/movies/once-were-warriors-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/once-were-warriors-poster.jpg', '2024-02-10 17:29:08', 8, 'https://www.youtube.com/watch?v=N0-Q3ChKcfE', 99, 0),
(130, 'Trung Nghĩa Quần Anh ', 'Seven Warriors', 1989, 'In the early 1920\'s of China, seven former soldiers band together to defend a helpless village against a group of vicious bandits in this Hong Kong remake of Seven Samurai.', 0, 'https://img.ophim11.cc/uploads/movies/trung-nghia-quan-anh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/trung-nghia-quan-anh-poster.jpg', '2024-02-10 17:29:14', 8, '', 96, 0),
(131, 'Anh Giai Nằm Vùng', 'Undercover Brother', 2002, 'An Afro-American organization, the B.R.O.T.H.E.R.H.O.O.D., is in permanent fight against a white organization \"The Man\" defending the values of the black people in North America. When the Afro-American candidate Gen. Warren Boutwell behaves strangely in his presidential campaign, Undercover Brother is hired to work undercover for \"The Man\" and find what happened with the potential candidate.', 0, 'https://img.ophim11.cc/uploads/movies/anh-giai-nam-vung-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/anh-giai-nam-vung-poster.jpg', '2024-02-10 17:29:19', 8, 'https://www.youtube.com/watch?v=lFn1SZj59x8', 86, 0),
(132, 'Đặc Vụ Tự Do', 'Freelance', 2023, 'An ex-special forces operative takes a job to provide security for a journalist as she interviews a dictator, but a military coup breaks out in the middle of the interview, they are forced to escape into the jungle where they must survive.', 0, 'https://img.ophim11.cc/uploads/movies/freelance-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/freelance-poster.jpg', '2024-02-10 17:29:26', 8, 'https://www.youtube.com/watch?v=6ura9bYCDJg', 108, 4),
(133, 'Người Dơi Nhí', 'Merry Little Batman', 2023, '<p>Cậu bé Damian Wayne đối mặt với kẻ thù trong thành phố của mình sau khi thấy mình đơn độc tại Trang viên Wayne.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-doi-nhi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-doi-nhi-poster.jpg', '2024-02-10 17:29:32', 8, 'https://www.youtube.com/watch?v=_GSMmXz0bHA', 97, 0),
(134, 'Truyện Lạ Trường An', 'The Man\'s Secret', 2023, '<p>Bộ phim kể về câu chuyện diễn ra vào thời Vĩnh Huy nhà Đường, trên bầu trời xuất hiện bất thường khiến dân chúng lầm than. Trong lúc cầu nguyện, Quỷ nghìn đầu bất ngờ xuất hiện, vô số bách tính bị hại. Triều đình buộc phải để tử tù Độc Cô (Nhậm Đạt Hoa đóng) phá án. Quá trình điều tra ẩn chứa nhiều bí ẩn, và Quỷ nghìn đầu dường như chỉ là phần nổi của vấn đề. Mặt khác, Độc Cô bề ngoài gánh vác công lý nhưng dường như cũng có chuyện quá khứ đen tối mà không thể để ai biết. Câu chuyện mở đầu với thể loại võ hiệp huyền ảo mới kiểu Trung Quốc, câu chuyện kinh dị nhiều suy luận, sáng tạo, nhân vật lạ lùng, tình yêu và thù hận đầy kỳ lạ, đem lại bữa tiệc thị giác đầy phong cách.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/truyen-la-truong-an-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/truyen-la-truong-an-poster.jpg', '2024-02-10 17:29:39', 8, '', 0, 3),
(135, 'Đạo hiệp tặc nghĩa', 'A Great Thief', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/dao-hiep-tac-nghia-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dao-hiep-tac-nghia-poster.jpg', '2024-02-10 17:29:44', 8, '', 1438, 0),
(136, 'Đêm tuyết hồn bay', 'Snow Fight', 2016, '', 0, 'https://img.ophim11.cc/uploads/movies/dem-tuyet-hon-bay-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dem-tuyet-hon-bay-poster.jpg', '2024-02-10 17:29:45', 8, '', 1128, 0),
(137, 'Điện thoại không phải là bố', 'Put Down Your Phone', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/dien-thoai-khong-phai-la-bo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dien-thoai-khong-phai-la-bo-poster.jpg', '2024-02-10 17:29:48', 8, '', 1453, 0),
(138, 'Độ linh nhân 2', 'Soul Hunter 2', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/do-linh-nhan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/do-linh-nhan-2-poster.jpg', '2024-02-10 17:29:50', 8, '', 122, 1),
(139, 'Đội lốt người yêu của hoa khôi', 'The Fake Boyfriend of the School Beauty', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/doi-lot-nguoi-yeu-cua-hoa-khoi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-lot-nguoi-yeu-cua-hoa-khoi-poster.jpg', '2024-02-10 17:29:53', 8, '', 1928, 0),
(140, 'Đối tác siêu cường', 'Superpower Partners', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/doi-tac-sieu-cuong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-tac-sieu-cuong-poster.jpg', '2024-02-10 17:29:54', 8, '', 1375, 2),
(141, 'Final Destination 5', 'Final Destination 5', 2011, '<p>Trong khi ở trong một cuộc rút lui kinh doanh, Sam có linh cảm rằng anh ta, đồng nghiệp, ông chủ và một số người khác sẽ chết trong một cơn sập cây khủng khiếp. Khi linh cảm của anh kết thúc, anh cố gắng khiến mọi người xuống xe. Chỉ có một số đồng nghiệp của mình, cùng với ông chủ của mình, rời đi. Ngay sau đó, cây cầu sụp đổ. Mọi người đều nghĩ rằng họ an toàn cho đến khi những người sống sót bắt đầu chết. Bây giờ đến Sam để cố gắng tìm cách ngăn chặn bất kỳ ai khác chết trước khi quá muộn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/final-destination-5-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/final-destination-5-poster.jpg', '2024-02-10 17:34:39', 8, '', 0, 0),
(142, 'Giải Cứu Binh Nhì Ryan', 'Saving Private Ryan', 1998, '<p>Khai mạc với cuộc xâm lược đồng minh Normandy vào ngày 6 tháng 6 năm 1944, các thành viên của Tiểu đoàn Ranger thứ 2 theo CPT. Miller chiến đấu lên bờ để đảm bảo một bãi biển. Giữa cuộc chiến, hai anh em bị giết trong hành động. Trước đó ở New Guinea, một người anh trai thứ ba là Kia. Mẹ của họ, bà Ryan, là nhận cả ba bức điện tín trong cùng một ngày. Đội ngũ nhân viên của quân đội Hoa Kỳ, George C. Marshall, được tạo cơ hội để giảm bớt một số đau buồn của mình khi anh ta học được một người anh em thứ tư, riêng tư James Ryan và quyết định gửi 8 người đàn ông (CPT. Miller và chọn thành viên từ Rangers thứ 2) để tìm anh ta và đưa anh ta trở về nhà với mẹ ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/giai-cuu-binh-nhi-ryan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giai-cuu-binh-nhi-ryan-poster.jpg', '2024-02-10 17:34:40', 8, '', 0, 0),
(143, 'GoldenEye', 'GoldenEye', 1995, '<p>Khi một hệ thống vũ khí vệ tinh chết người rơi vào tay sai, chỉ có đặc vụ James Bond 007 (Pierce Brosnan) có thể cứu thế giới khỏi một thảm họa nhất định. Được trang bị giấy phép để giết, các cuộc đua trái phiếu đến Nga để tìm kiếm các mã truy cập bị đánh cắp cho \"Goldeneye\", một vũ khí không gian tuyệt vời có thể bắn một xung điện từ tàn khốc về phía Trái đất. Nhưng 007 đang chống lại kẻ thù dự đoán mọi động thái của mình: một kẻ chủ mưu được thúc đẩy bởi những năm mãnh liệt. BOND CSONG SIQUARE OFF TRÊN XENIA ONATOPP (Famke Janssen), một kẻ ám sát sử dụng niềm vui như vũ khí cuối cùng của cô ấy</p>', 0, 'https://img.ophim11.cc/uploads/movies/goldeneye-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/goldeneye-poster.jpg', '2024-02-10 17:34:42', 8, '', 0, 0),
(144, 'Hell Fest', 'Hell Fest', 2018, '<p>Hell Fest is introduced as a horror theme park which travels across the country during the Halloween season. A young girl from Cincinnati is shown to be separated from her group during one of the mazes. There she is confronted by a masked figure known as \"The Other\" (Stephen Conroy). She recognizes The Other as a man who had been following her and her group of friends the entire night. The Other attacks the girl, stabbing her in the gut before hanging her. The young girl\'s corpse appears to blend in with the other prop bodies as The Other leaves the scene. Natalie (Amy Forsyth) is shown to be arriving at her former apartment where her best friend, Brooke (Reign Edwards), still resides. She greets her old friend but is disappointed to learn that a former classmate, Taylor (Bex Taylor-Klaus), whom Natalie does not get along with is living with her. Though Natalie\'s visit was planned, Brooke is shown to have been uncertain that Natalie would actually arrive as she had been distant of late due to school and work. As such Brooke and Taylor arranged a visit to Hell Fest with Quinn (Christian James), Brooke\'s boyfriend, Taylor\'s boyfriend Asher (Matt Mercurio), and their respective friend Gavin (Roby Attal) who is attracted to Natalie..</p>', 0, 'https://img.ophim11.cc/uploads/movies/hell-fest-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hell-fest-poster.jpg', '2024-02-10 17:34:43', 8, '', 0, 0),
(145, 'Héc-Quyn', 'Hercules', 2014, '<p>Chịu đựng những người lao động huyền thoại của mình, Hercules, Demigod Hy Lạp, có cuộc sống của mình như một người thuê kiếm được thử nghiệm khi Vua Thrace và con gái của anh ta tìm kiếm sự cứu trợ của anh ta trong việc đánh bại một lãnh chúa chuyên chế.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hec-quyn-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hec-quyn-poster.jpg', '2024-02-10 17:34:44', 8, '', 0, 0),
(146, 'Immortals', 'Immortals', 2011, '<p>Eons sau các vị thần đã giành chiến thắng trong cuộc đấu tranh thần thoại chống lại những người khổng lồ, một điều ác mới đe dọa vùng đất. Mad với quyền lực, King Hyperion (Mickey Rourke) đã tuyên chiến với nhân loại. Tận hưởng một đội quân lính khát máu bị biến dạng bởi chính bàn tay của chính mình, Hyperion đã tạo ra Hy Lạp để tìm kiếm Bow Epirus huyền thoại, vũ khí của quyền lực không thể tưởng tượng được rèn trên thiên đàng bởi Ares (Daniel Sharman). Chỉ có người sở hữu chiếc cung này có thể giải phóng những người khổng lồ, người đã bị cầm tù sâu trong bức tường của Núi Tartaros kể từ buổi sáng của thời gian và khát khao để trả thù. Trong tay vua, cung sẽ mưa sẽ hủy hoại nhân loại và tiêu diệt các vị thần. Nhưng luật cổ đại ra lệnh cho các vị thần không được can thiệp vào cuộc xung đột của con người. Họ vẫn bất lực để ngăn chặn Hyperion, cho đến khi một nông dân tên là Theseus (Henry Cavill) xuất hiện như hy vọng duy nhất của họ. Bí quyết chọn bởi Zeus (Luke Evans), Theseus phải cứu người của mình khỏi Hyperion và Hordes của anh ta. GIẢI QUYẾT MỘT BAN OFASIDERS GIẢI THƯỞNG, bao gồm cả tư nhân tầm nhìn Phaedra (Freida Pinto) và Stavros nô lệ xảo quyệt (Stephen Dorff), một anh hùng sẽ dẫn đầu cuộc nổi dậy, hoặc ngắm nhìn quê hương rơi vào đống đổ nát và các vị thần của ông biến mất vào truyền thuyết.</p>', 0, 'https://img.ophim11.cc/uploads/movies/immortals-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/immortals-poster.jpg', '2024-02-10 17:34:45', 8, '', 0, 0),
(147, 'It: Chapter One', 'It: Chapter One', 2017, '<p>In the Town of Derry, the local kids are disappearing one by one. In a place known as \'The Barrens\', a group of seven kids are united by their horrifying and strange encounters with an evil clown and their determination to kill It.</p>', 0, 'https://img.ophim11.cc/uploads/movies/it-chapter-one-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/it-chapter-one-poster.jpg', '2024-02-10 17:34:47', 8, '', 0, 0),
(148, '120 Nhịp Tim 1 Phút', 'BPM (Beats per Minute)', 2017, 'Bộ phim theo chân Nathan, thành viên mới của tổ ACT-UP, tổ chức chuyên giành quyền lợi cho những người bị nhiễm HIV-AIDS tại Pháp trước sự chậm chạp của chính phủ cũng như các công ty dược phẩm trong việc cung cấp thuốc. Khi tham gia các hoạt động đấu tranh, Nathan gặp gỡ Sean và nhanh chóng rơi vào tình yêu với anh chàng này...', 0, 'https://img.ophim11.cc/uploads/movies/120-nhip-tim-1-phut-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/120-nhip-tim-1-phut-poster.jpg', '2024-02-10 17:34:48', 8, 'https://www.youtube.com/watch?v=2fhO2A4SL24', 135, 0),
(149, 'Bố Già Hoàn Lương 2', 'Analyze That', 2002, 'Trong phần tiếp theo này, sau khi ra khỏi nhà tù SingSing, Paul Vitti lại bị đưa đến gặp bác sĩ Ben Sobe. Ông trùm mafia này cần có sự giúp đỡ của Sobel để có thể trở lại cuộc sống bình thường. Vì thế, bác sĩ Sobel giờ đây rơi vào thế tiến thoái lưỡng nan, cuộc sống của ông và gia đình thêm một lần nữa bị xáo trộn vì sự hiện diện thường trực của tên trùm mafia trong căn nhà của mình. Nhiệm vụ của ông là phải giúp tên trùm trở lại cuộc sống lương thiện càng nhanh càng tốt.', 0, 'https://img.ophim11.cc/uploads/movies/bo-gia-hoan-luong-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bo-gia-hoan-luong-2-poster.jpg', '2024-02-10 17:34:55', 8, 'https://www.youtube.com/watch?v=vF-lF7slKV4', 96, 0),
(150, 'Bố Già Hoàn Lương', 'Analyze This', 1999, 'Một bố già mafia đầy quyền lực bỗng thấy mình như “nhỏ lại”, thích khóc nhè và run sợ khi những ký ức về quá khứ dồn dập tràn về. Để cho lũ đàn em biết thì còn mặt mũi nào, ông tìm đến một chuyên gia tâm lý để nhờ giúp đỡ. Nhiệm vụ của bác sĩ trị liệu chỉ việc ngồi đó nghe tay trùm giải tỏa nỗi lòng, nhưng...', 0, 'https://img.ophim11.cc/uploads/movies/bo-gia-hoan-luong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bo-gia-hoan-luong-poster.jpg', '2024-02-10 17:35:02', 8, 'https://www.youtube.com/watch?v=ejjjWYYST1Q', 103, 0),
(151, 'Elegy', 'Elegy', 2008, 'Cultural critic David Kepesh finds his life -- which he indicates is a state of \"emancipated manhood\" -- thrown into tragic disarray by Consuela Castillo, a well-mannered student who awakens a sense of sexual possessiveness in her teacher.', 0, 'https://img.ophim11.cc/uploads/movies/elegy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/elegy-poster.jpg', '2024-02-10 17:35:06', 8, 'https://www.youtube.com/watch?v=z2qTmdKfSjY', 112, 0),
(152, 'Mặt Trăng', 'Moon', 2009, 'Bối cảnh của phim đặt ở tương lai, khi cuộc khủng hoảng năng lượng ở Trái đất đã được giải quyết ổn thỏa bằng một loại đá trên Mặt trăng. Công ty Lunar thuê Sam Bell lên mặt trăng làm việc trong hợp đồng 3 năm, coi sóc việc khai thác loại đá này. Anh ở trong một trung tâm điều khiển hiện đại, với sự giúp đỡ của con Robot thông minh Gerty. Chỉ còn 2 tuần nữa là hợp đồng kết thúc và anh đang mong muốn trở về nhà. Anh muốn gặp lại vợ và cô con gái 2 tuổi xinh đẹp chưa một lần bồng bế.Nhưng Sam bắt đầu thấy những ảo giác và sức khỏe giảm sút rõ rệt. Anh gặp tai nạn khi đang khảo sát địa hình ngoài bề mặt. Sau đó, Sam thức giấc và thấy mình đã quay lại trung tâm. Gesty thông báo rằng anh đã mất một phần trí nhớ. Sam cảm thấy nghi ngờ khi Gerty không cho anh ra ngoài lần nữa. Anh tìm cách thoát ra, tìm đến hiện trường vụ tai nạn và thấy có một Sam Bell khác đang nằm trong xe. Sam ngạc nhiên tột cùng, quyết định đưa Sam kia về chữa trị và tìm hiểu những điều bí ẩn.', 0, 'https://img.ophim11.cc/uploads/movies/mat-trang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mat-trang-poster.jpg', '2024-02-10 17:35:12', 8, 'https://www.youtube.com/watch?v=xV5udqNpP94', 97, 0),
(153, 'Basic', 'Basic', 2003, 'A DEA agent investigates the disappearance of a legendary Army ranger drill sergeant and several of his cadets during a training exercise gone severely awry.', 0, 'https://img.ophim11.cc/uploads/movies/basic-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/basic-poster.jpg', '2024-02-10 17:35:18', 8, 'https://www.youtube.com/watch?v=kE7Ue5hjJc0', 98, 1),
(154, 'Qua Lỗ Khóa', 'In The Room', 2015, '<p>In The Room là một bộ phim chính kịch khiêu dâm của Singapore năm 2015 do Eric Khoo đạo diễn và Khoo và Jonathan Lim viết kịch bản. Phim có sự tham gia của Josie Ho, George Young, Daniel Jenkins, Koh Boon Pin, W Leon U, Show Nishino, Lawrence Wong, Nadia AR và Ian Tan</p>', 0, 'https://img.ophim11.cc/uploads/movies/qua-lo-khoa-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/qua-lo-khoa-poster.jpg', '2024-02-10 17:35:24', 8, '', 144, 1),
(155, 'Lone Wolf McQuade', 'Lone Wolf McQuade', 1983, 'The archetypical renegade Texas Ranger wages war against a drug kingpin with automatic weapons, his wits and martial arts after a gun battle leaves his partner dead. All of this inevitably culminates in a martial arts showdown between the drug lord and the ranger, and involving the woman they both love.', 0, 'https://img.ophim11.cc/uploads/movies/lone-wolf-mcquade-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/lone-wolf-mcquade-poster.jpg', '2024-02-10 17:35:26', 8, 'https://www.youtube.com/watch?v=rCTCwTJqibo', 107, 0),
(156, 'Tình Ngang Trái', 'Love Actually... Sucks!', 2012, '<p><strong>Tình Ngang Trái – Love Actually… Sucks! (2012)</strong> được lấy cảm hứng từ những câu chuyện có thật trong cuộc sống và mở đầu bằng một bữa tiệc cưới đầy kịch tính với màn trả thù không thể bất ngờ hơn. Sau đó, phim đưa người xem theo dõi lần lượt sáu câu chuyện về tình yêu, tình dục và sự suy đồi đã trở nên sai trái: một anh trai và em gái trong mối quan hệ loạn luân.</p><p>Một nam họa sĩ đã kết hôn phải lòng người mẫu nam trẻ tuổi của mình, một giáo viên trường múa người bị vây hãm với Queen, một trong những học sinh của anh ta và là một phụ nữ giàu có, mối tình tay ba giữa Moon – một phụ nữ trung niên trong mối tình tay ba phức tạp với hai người đàn ông trẻ tuổi, một trong hai người là rắc rối và cô ấy muốn thoát khỏi anh ta và một một cặp đôi đồng tính nữ, một trong số họ mắc chứng hoang tưởng đóng vai.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tinh-ngang-trai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tinh-ngang-trai-poster.jpg', '2024-02-10 17:35:32', 8, '', 123, 6),
(157, 'Nhân Tình Đẳng Cấp', 'Maîtresse', 1975, 'After breaking into a house he believes is empty, thief Olivier is caught by the owner, Ariane, who turns out to be a dominatrix. Improbably falling for her, Olivier returns periodically, and an impulsive romance blossoms despite Ariane\'s profession. Soon Olivier becomes more familiar with her work, even joining in on occasion. However, when he discovers that Ariane has a son, he attempts to \"fix\" her, hoping to give her a better life.', 0, 'https://img.ophim11.cc/uploads/movies/nhan-tinh-dang-cap-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhan-tinh-dang-cap-poster.jpg', '2024-02-10 17:35:35', 8, 'https://www.youtube.com/watch?v=7QVBYbmHrPs', 112, 0),
(158, 'Once Upon a Time… in Hollywood', 'Once Upon a Time… in Hollywood', 2019, 'Los Angeles, năm 1969, cựu ngôi sao Rick Dalton và người đóng thế lâu năm cho anh là Cliff Booth nay đã thành những kẻ hết thời. Cả hai buộc phải đấu tranh để tồn tại giữa Hollywood khắc nghiệt. Cuối cùng, họ phải nhờ đến sự giúp đỡ của cô hàng xóm- nữ minh tinh xinh đẹp Sharon Tate. Do Quentin Tarantino làm đạo diễn, Leonardo DiCaprio cùng Brad Pitt thủ vai chính, không có gì ngạc nhiên khi Once Upon A Time được nhiều người xem là bộ phim đáng mong đợi nhất 2019.', 0, 'https://img.ophim11.cc/uploads/movies/once-upon-a-time-in-hollywood-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/once-upon-a-time-in-hollywood-poster.jpg', '2024-02-10 17:35:41', 8, 'https://www.youtube.com/watch?v=Scf8nIJCvs4', 162, 1),
(159, 'Trả Đũa', ' Payback', 1999, '<p>Payback là một bộ phim kinh dị hành động tân cổ điển của Mỹ năm 1999 do Brian Helgeland viết kịch bản và đạo diễn trong lần đầu làm đạo diễn, với sự tham gia của Mel Gibson, Gregg Henry, Maria Bello và David Paymer. Nó dựa trên cuốn tiểu thuyết The Hunter của Donald E.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tra-dua-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tra-dua-poster.jpg', '2024-02-10 17:35:48', 8, '', 141, 0),
(160, 'Dị Biến', 'The Anomaly', 2014, 'A former soldier is taken captive and awakens in the back of a van where he learns that he only has less than 10 minutes to figure out how he got there.', 0, 'https://img.ophim11.cc/uploads/movies/di-bien-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/di-bien-poster.jpg', '2024-02-10 17:35:51', 8, 'https://www.youtube.com/watch?v=dtQ9trILuK8', 97, 0),
(161, 'Tay Súng Sát Thủ ', 'El Topo', 1970, 'El Topo decides to confront warrior Masters on a trans-formative desert journey he begins with his 6 year old son, who must bury his childhood totems to become a man.', 0, 'https://img.ophim11.cc/uploads/movies/tay-sung-sat-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tay-sung-sat-thu-poster.jpg', '2024-02-10 17:35:57', 8, 'https://www.youtube.com/watch?v=3joYVNyyi5w', 125, 0),
(162, 'The Story of Adele H.', 'The Story of Adele H.', 1975, 'Adèle Hugo, daughter of renowned French writer Victor Hugo, falls in love with British soldier Albert Pinson while living in exile off the coast of England. Though he spurns her affections, she follows him to Nova Scotia and takes on the alias of Adèle Lewly. Albert continues to reject her, but she remains obsessive in her quest to win him over.', 0, 'https://img.ophim11.cc/uploads/movies/the-story-of-adele-h-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-story-of-adele-h-poster.jpg', '2024-02-10 17:36:04', 8, 'https://www.youtube.com/watch?v=fvH77u47d7k', 96, 0);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(163, 'Giải Bóng Chày Nữ', 'A League of Their Own', 1993, 'A League of Their Own is an American sitcom that aired from April 10, 1993 to April 24, 1993 with two additional episodes aired on August 13, 1993. based on the movie from 1992 starring Sam McMurray in his first leading role on a TV Show.\n\nMegan Cavanagh and Tracy Reiner reprised their roles from the movie.', 0, 'https://img.ophim11.cc/uploads/movies/giai-bong-chay-nu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giai-bong-chay-nu-poster.jpg', '2024-02-10 17:36:10', 8, '', 30, 0),
(164, 'Dịch Vụ Massage Tại Nhà', 'Delivery Massage', 2022, '<p>So-min luôn cô đơn vì chồng thường xuyên phải đi công tác. Em gái của So-min, Ha-yeon, đến nhà và đề nghị cô ấy đi mát-xa. So-min thức dậy với một cảm giác kích thích mới &nbsp;bằng cách được mát-xa kích dục thay vì mát-xa mà cô nghĩ rằng nó sẽ là ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/dich-vu-massage-tai-nha-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dich-vu-massage-tai-nha-poster.jpg', '2024-02-10 17:57:21', 8, '', 61, 2),
(165, 'Cảnh Sát Ở Berverly Hills 3', 'Beverly Hills Cop III', 1994, '<p>Sức nóng ở Beverly Hills lại tiếp tục tăng lên khi anh chàng cảnh sát lắm mồm Axel Foley trở lại. Lần này, cùng với người đồng nghiệp vừa được thăng chức Billy Rosewood, họ điều tra về một nhóm làm hàng giả.</p>', 0, 'https://img.ophim11.cc/uploads/movies/canh-sat-o-berverly-hills-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/canh-sat-o-berverly-hills-3-poster.jpg', '2024-02-10 17:57:56', 8, '', 0, 1),
(166, 'Quái Vật Chân To Và Nhà Henderson', 'Harry and the Hendersons', 1987, '<p>Trên đường trở về nhà sau chuyến săn bắn trong rừng, chiếc xe của gia đình Henderson đã đâm phải một con vật qua đường. Ban đầu mọi người sợ hãi ngỡ rằng đó là người vì nó đi 2 chân sau, nhưng khi kiểm tra thì họ phát hiện đó là một con bigfoot (dã nhân, vượn người). Họ nghĩ nó đã chết và mang xác về hy vọng kiếm ít tiền. Nhưng thực sự nó chưa chết và sống cùng cả nhà. Không như họ nghĩ, Harry (tên bigfoot) là một con vật rất hiền lành và thân thiện. Gia đình Henderson giờ đây phải lo quyền nuôi giữ và tránh khỏi các cặp mắt dòm ngó con vật này.</p>', 0, 'https://img.ophim11.cc/uploads/movies/quai-vat-chan-to-va-nha-henderson-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quai-vat-chan-to-va-nha-henderson-poster.jpg', '2024-02-10 17:57:59', 8, '', 0, 0),
(167, 'Tên Cướp Bugsy', 'Bugsy', 1991, '<p>Xoay quanh chuyện tình của một tay gangster hào hoa và một cô nữ minh tinh đang lên, Bugsy (1991) là bộ phim với những tình tiết hấp dẫn, gay cấn về một phần lịch sử của Las Vagas – sòng bạc nổi tiếng nhất thế giới hiện nay. Benjamin “Bugsy” Siegel (Warren Beatty) là một tay gangster quyến rũ có công việc làm ăn ở New York cùng với Meyer Lansky (Ben Kingsley) và Charlie “Lucky” Luciano (Bill Abraham). Được các cộng sự gửi tới Los Angeles làm ăn nhưng khi vừa đặt chân tới đây, Benjamin đã ngay lập tức bị quyến rũ trước vẻ đẹp và tài trí của một diễn viên điện ảnh đang lên – Virginia Hill (Annette Bening). Trên đường tới Nevada, Benjamin nảy ra ý tưởng về một sòng bài ở Sa mạc và kêu gọi các “đồng sự” giúp đỡ cả vật chất và tinh thần. Ông tuyển Mickey Cohen (Harvey Keitel) phụ giúp; kêu gọi tài trợ từ Meyer Lansky và các cộng sự gangster khác ở New York, thu được gần 1 triệu USD để xây dựng sòng bạc. Benjamin ngay lập tức bắt tay vào xây dựng Flamingo Las Vegas Hotel Casino. Tuy nhiên, với “năng khiếu” làm kế toán của một diễn viên điện ảnh như Virginia và “tài năng” quản lý tài chính của một tay gangster, dự án casino bị đội vốn gấp 6 lần và lâm vào nợ nần. Sự ăn chơi của bộ đôi và tính ngông cuồng của “Bugsy” Siegel là điều không thể chấp nhận được đối với thế giới ngầm, nhất là với “ông trùm của các ông trùm” Lucky Luciano…</p>', 0, 'https://img.ophim11.cc/uploads/movies/ten-cuop-bugsy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ten-cuop-bugsy-poster.jpg', '2024-02-10 17:58:03', 8, '', 0, 0),
(168, 'Mồi Mực Và Cá Voi', 'The Squid and the Whale', 2005, '<p>Theo chân kế hoạch của hai cậu bé giải quyết vụ ly hôn của cha mẹ họ ở Brooklyn vào những năm 1980.</p>', 0, 'https://img.ophim11.cc/uploads/movies/moi-muc-va-ca-voi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/moi-muc-va-ca-voi-poster.jpg', '2024-02-10 17:58:08', 8, '', 0, 0),
(169, 'Người Giữ Giấc Mơ', 'Dreamcatcher', 2003, '<p>Dreamcatcher là tên gọi của một loại bùa bình an. Truyền thuyết kể rằng: Ojibwa - một bộ tộc người Mỹ - tin rằng màn đêm luôn chứa đựng những giấc mơ đẹp và những giấc mơ xấu. Trong văn hóa của Ojibwa, Dreamcatcher là một loại bùa được treo đầu giường để bảo vệ những đứa trẻ đang ngủ khỏi những cơn ác mộng. Câu chuyện bắt đầu khi bốn người bạn thân từ thời thơ ấu có chuyến họp mặt săn bắn hàng năm tại một cabin trong rừng, và rồi những điều kỳ lạ xảy ra ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-giu-giac-mo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-giu-giac-mo-poster.jpg', '2024-02-10 17:58:12', 8, '', 0, 0),
(170, 'Chim Ưng Trỗi Dậy', 'Falcon Rising', 2014, '<p>Cựu lính thủy đánh bộ John \"Falcon\" Chapman là người luôn bị dằn vặt bởi quá khứ và chấn thương tâm lý sau chiến tranh, nóng tính và có xu hướng đập phá. Cho nên anh chỉ là \"giải pháp cuối cùng\" cho những vụ khó giải quyết của cảnh sát. Khi biết tin em gái mình bị hành hung suýt chết ở Brazil, anh liền tức tốc lên đường...</p>', 0, 'https://img.ophim11.cc/uploads/movies/chim-ung-troi-day-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chim-ung-troi-day-poster.jpg', '2024-02-10 17:58:17', 8, '', 0, 0),
(171, 'Ẩn Danh', 'Incognito', 1997, '<p>Harry Donovan là một tay đạo chích nghệ thuật, người vẽ bức tranh Rembrandt giả với giá năm trăm ngàn đô la. Anh gặp và yêu say đắm cô nàng Marieke ở Paris, thế nhưng hóa ra Marieke lại là một chuyên gia nghệ thuật, người mà khách hàng của Harry đang sử dụng để kiểm tra bức tranh giả mà anh vẽ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/an-danh-1997-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/an-danh-1997-poster.jpg', '2024-02-10 17:58:21', 8, '', 0, 0),
(172, 'Chiến Mã', 'War Horse', 2011, '<p>Lấy bối cảnh miền Tây nước Anh trong giai đoạn Thế chiến thứ nhất, War Horse là câu chuyện về chàng trai Albert cùng với chú ngựa Joey của mình. Cả hai là những người bạn thân thiết với nhau, nhưng rồi một ngày, Joey lại bị bán cho quân đội để phục vụ binh lính trên chiến trường. Không thể bỏ mặc bạn mình nên Albert cũng quyết định tham gia nhập ngũ với quyết tâm tìm lại Joey...</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-ma-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-ma-poster.jpg', '2024-02-10 17:58:25', 8, '', 0, 1),
(173, 'Sinh Vật Huyền Bí: Tội Ác Của Grindelwald', 'Fantastic Beasts: The Crimes of Grindelwald', 2018, '<p>Trong một nỗ lực để ngăn chặn các kế hoạch nâng cao những phù thủy máu tinh khiết của Grindelwald để cai trị tất cả những sinh vật không ma thuật, Albus Dumbledore đã tranh thủ Scamander Newt của mình, người đồng ý giúp đỡ, mặc dù anh ta không biết về những nguy hiểm nằm ở phía trước. Các dòng được vẽ như tình yêu và lòng trung thành được thử nghiệm, ngay cả trong số những người bạn và gia đình thật nhất, trong một thế giới phù thủy ngày càng chia rẽ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/sinh-vat-huyen-bi-toi-ac-cua-grindelwald-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sinh-vat-huyen-bi-toi-ac-cua-grindelwald-poster.jpg', '2024-02-10 17:58:29', 8, '', 0, 0),
(174, 'Quản lý sử dụng nhân viên nữ', 'Managers Use Of Female Employees', 2022, '<p>Em Nào Anh Cũng Xơi : Anh chàng đẹp trai với mục tiêu xơi hết gái trong công ty ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/quan-ly-su-dung-nhan-vien-nu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quan-ly-su-dung-nhan-vien-nu-poster.jpg', '2024-02-10 17:58:31', 8, '', 91, 0),
(175, 'Trò chơi gọi hồn 2', 'Ouija: Origin of Evil', 2016, '<p>Tại California, vào những năm 1960, con gái một bà đồng rởm toan gọi hồn người cha quá cố qua Bàn cầu cơ nhưng lại vô tình giải phóng quỷ dữ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tro-choi-goi-hon-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tro-choi-goi-hon-2-poster.jpg', '2024-02-10 17:58:35', 8, '', 139, 0),
(176, 'Chìa Khóa Xương Người', 'The Skeleton Key', 2005, '<p>Nurse Caroline Ellis rời khỏi công việc của mình để chăm sóc người cao tuổi Ben Devereux, người đã bị đột quỵ và không thể nói chuyện. Khi cô đến nhà anh ở Giáo xứ Terrebonne, Louisiana, cô gặp vợ của Ben Violet, người có hành động đáng ngờ và đáng sợ. Luật sư của gia đình, Luke Marshall, thuyết phục Caroline ở lại. Cô ấy đi đến gác mái và tìm thấy một căn phòng bí mật có đầy đủ các phép thuật, tóc và xương được sử dụng để luyện tập Hoodoo, nhưng Violet nói rằng cô chưa bao giờ thấy căn phòng bí mật này. Caroline muốn giúp Ben, nghĩ rằng Violet đã đưa ra một câu thần chú lên anh ta. Cô ấy biết Hoodoo không thể làm tổn thương một người không tin vào điều đó. Caroline có thể cứu Ben, hoặc cuối cùng cô ấy sẽ là người cần phải được cứu?</p>', 0, 'https://img.ophim11.cc/uploads/movies/chia-khoa-xuong-nguoi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chia-khoa-xuong-nguoi-poster.jpg', '2024-02-10 17:58:38', 8, '', 0, 0),
(177, 'Chiến Dịch Sinh Tử', 'Argo', 2012, '<p>Argo dựa trên một sự kiện có thật, Argo ghi chép lại một chiến dịch sinh tử bí mật có nhiệm vụ giải cứu 6 người Mỹ, điều đã vén lên bức màn của cuộc khủng hoảng con tin Iran – sự thật đã được che giấu cả thập kỉ. Vào ngày 4/11/1979, lúc mà cuộc Cách mạng Iran đang lên đến đỉnh điểm, các dân quân đã tấn công vào đại sứ quán Mỹ ở Tehran, bắt 52 người Mĩ làm con tin.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-dich-sinh-tu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-dich-sinh-tu-poster.jpg', '2024-02-10 17:58:40', 8, '', 0, 0),
(178, 'Không Dấu Vết', 'Backtrace', 2018, '<p>Một tay trộm sống sót sau vụ cướp xe chở tiền nhưng trí nhớ thì không còn. Một cuộc đào thoát được sắp xếp mà những kẻ thực hiện chỉ với mục đích là tìm kiếm số tiền còn lại. Nhưng việc này vô tình lại kéo theo cuộc điều tra, truy lùng của cảnh sát, cùng với đó là những đặc vụ FBI biến chất.</p>', 0, 'https://img.ophim11.cc/uploads/movies/khong-dau-vet-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/khong-dau-vet-poster.jpg', '2024-02-10 17:58:43', 8, '', 0, 0),
(179, 'Những Đứa Trẻ To Xác 1', 'Grown Ups', 2010, '<p>Sau nhiều năm xa cách, nhóm 5 người bạn thân từ khi tham gia đội bóng hồi trung học đã gặp lại nhau. Gần 3 thập kỷ đã trôi qua, cả 5 người đều đã lập gia đình và có con. Khi biết tin huấn luyện viên năm xưa qua đời, họ quay trở về New England để tham dự lễ tang. Mặc dù giờ đây mọi thứ đã thay đổi rất nhiều nhưng có một điều mà cả 5 anh bạn chí thân không bao giờ thay đổi. Chẳng ai trong số họ thực sự trưởng thành.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-dua-tre-to-xac-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-dua-tre-to-xac-1-poster.jpg', '2024-02-10 17:58:47', 8, '', 0, 0),
(180, 'Ngài Không Ngã Rẽ', 'Mr. Nobody', 2010, '<p>Thuộc thể loại tâm lý, viễn tưởng do đạo diễn tài ba người Bỉ Jaco Van Dormael viết kịch bản và đạo diễn, \"Mr. Nobody\" là bộ phim nghệ thuật đích thực để lại cho khán giả nhiều cảm xúc và chút bâng khuâng trước câu hỏi: \"Liệu con đường ta đã chọn là con đường đúng đắn nhất?\"</p>', 0, 'https://img.ophim11.cc/uploads/movies/ngai-khong-nga-re-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ngai-khong-nga-re-poster.jpg', '2024-02-10 17:58:51', 8, '', 0, 0),
(181, 'Chiến Binh Gợi Cảm', 'Sucker Punch', 2011, '<p>Câu chuyện kể về nhân vật Baby Doll, một cô gái bị cha dượng rắp tâm tẩy não. Trong nỗ lực thoát khỏi thế giới ảo ảnh do phương pháp điều khiển trí não gây ra, cô cùng một nhóm nữ chiến binh khác vạch kế hoạch thoát khỏi nơi giam giữ họ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/chien-binh-goi-cam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-binh-goi-cam-poster.jpg', '2024-02-10 17:58:55', 8, '', 0, 1),
(182, 'Từ Khi Có Polly', 'Along Came Polly', 2004, '<p>“Từ khi có Polly” từng được xếp hạng 10 phim ăn khách nhất khu vực Bắc Mỹ trong đầu năm 2004. Phim có sự tham gia của hai ngôi sao nổi tiếng của Hollywood là Ben Stiller (vai Reuben Feffer) và Jennifer Aniston (Polly). Là người kinh doanh bảo hiểm, Reuben Feffer luôn tính toán kỹ lưỡng, đề phòng trước mọi rủi ro. Thế nhưng, ngay trong ngày đầu tiên của tuần trăng mật, anh gặp một vận rủi đen đủi không ngờ: Vợ anh ngoại tình với một tay thợ lặn người Pháp Sau cú sốc đau đớn ấy, Reuben tình cờ gặp lại cô bạn học cũ, Polly. Bộ phim mang đến những tiếng cười đầy lãng mạn thông qua những tình huống tréo ngoe. Cô gái đầy cá tính Polly quyết tâm “tẩy não” Reuben bằng những cuộc phiêu lưu rắc rối, những trò thể thao mạo hiểm, những điệu nhảy quay cuồng… và hơn cả là những giây phút lãng mạn khó quên…</p>', 0, 'https://img.ophim11.cc/uploads/movies/tu-khi-co-polly-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tu-khi-co-polly-poster.jpg', '2024-02-10 17:58:59', 8, '', 0, 0),
(183, 'Hương Vị Của Ba Em Gái Xinh Đẹp', 'Taste Of Shellfish', 2021, '<p>Myeong-soo người đã mở một phòng karaoke mới. Họ bán bánh gạo cho phụ nữ địa phương và quảng bá cửa hàng.<br>Vì muốn gạ gẫm Myeong-soo, những cô nàng xinh đẹp hàng xóm bắt đầu một cuộc gạ tình. Myeong-soo chịu hết nổi, vì vậy anh ấy để lại cửa hàng cho đàn em Yoon-il của mình, và Yoon-il lúc đầu cũng rất vui vì được chén cùng lúc ba nàng…</p>', 0, 'https://img.ophim11.cc/uploads/movies/huong-vi-cua-ba-em-gai-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/huong-vi-cua-ba-em-gai-xinh-dep-poster.jpg', '2024-02-10 17:59:04', 8, '', 90, 2),
(184, 'Cô Nàng Ướt Át', 'Nonton Watery Woman', 2022, '<p>Một cô nàng với thân hình tuyệt đẹp do luyện tập và cách để xơi được cô nàng...</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-nang-uot-at-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-nang-uot-at-poster.jpg', '2024-02-10 17:59:08', 8, '', 60, 1),
(185, 'Vẻ Đẹp Mỹ', 'American Beauty', 1999, '<p>Sau cái chết của anh ta vào lúc 43 năm thứ 43, Lester Burnham ngoại ô đã kể về vài tuần cuối đời, trong đó anh ta không biết về sự thông qua sắp xảy ra của mình. Ông là một người chồng đối với đại lý bất động sản Carolyn Burnham và cha đến học sinh trung học Jane Burnham. Mặc dù Lester và Carolyn từng yêu nhau, giờ họ chỉ chịu đựng nhau. Wallflower Jane điển hình cũng ghét cả bố mẹ cô; Cả ba đau khổ riêng trong sự im lặng trong cuộc sống gia đình của họ. Jane cố gắng tránh xa cả cha mẹ cô. Carolyn, tương đối mới đối với kinh doanh bất động sản, muốn tạo ra nhân cách thành công để tiếp tục sự nghiệp, tham vọng cuộc sống chuyên nghiệp của Buddy Kane, Vua của kinh doanh bất động sản trong khu phố của họ. Lester chỉ đi bộ vô tư suốt cuộc đời, bao gồm cả công việc của mình trong quảng cáo. Công ty của anh ta đang thu hẹp, và anh ta, giống như tất cả các nhân viên khác, phải biện minh cho vị trí của mình cho chuyên gia hiệu quả mới được thuê để giữ cho công việc của mình. Mọi thứ thay đổi cho Lester khi anh ta yêu nhau từ cái nhìn đầu tiên với bạn cùng lớp giàu kinh nghiệm của Jane, Angela Hayes. Cả Janie và Angela đều có thể nhìn thấy sự mê đắm tình dục của Lester với Angela, người đã chú ý những người đàn ông như một dấu hiệu mà cô là người mẫu vật chất, cô đã từng xuất hiện trong mười bảy và là một nghề nghiệp mà cô khao khát. Sự mê đắm của Lester với Angela mang đến cho anh ta một cái nhìn tái tạo về cuộc sống, nơi anh ta cởi mở không quan tâm nữa những gì bất cứ ai nghĩ về những gì anh ta làm, bất cứ ai ngoại trừ Angela. Sự mê đắm này trùng khớp với những kẻ liên lạc di chuyển trong cửa bên cạnh: kỷ luật đồng tính dân tộc Mỹ Đại tá Frank Funts, người cai trị ngôi nhà với một nắm đấm quân sự (nắm đấm đó là cả nghĩa bóng và nghĩa đen), người vợ bán hôn hôn của anh ta, và sự lật đổ sáng và lặng lẽ của họ Con trai 18 tuổi Ricky Fitts, người công khai tuân thủ các quy tắc của cha mình trong khi hậu trường sống theo quan điểm khá khác biệt của chính mình. Giống như sự mê đắm của Lester, Ricky ngay lập tức bị mê đắm với Jane; Ông coi các cô gái như Angela là bình thường. Sự xâm nhập của Angela và các mối quan hệ vào cuộc sống của Burnhams cuối cùng dẫn đến từng cầu thủ đối mặt với những gì thực sự trong trái tim anh ấy hoặc cô ấy.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ve-dep-my-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ve-dep-my-poster.jpg', '2024-02-10 17:59:11', 8, '', 0, 0),
(186, 'Người Tình Năm 17 Tuổi', 'Nonton Girl 17', 2022, '<p>Jung-wook cô đơn đang tìm một người phụ nữ để nói chuyện lúc đi dạo trong khu phố. Sau đó, bóng lưng của một người phụ nữ xinh đẹp đập vào mắt anh ta. Khi đến gần để nói chuyện, cô gái đó không ai khác chính là Ji-hyun, bạn gái cũ của anh ta. Ji-hyeon rất vui khi thấy Jung-wook như vậy, điều mà anh ấy chưa từng thấy trước đây, và bắt đầu nói chuyện với anh ấy sau một thời gian dài. Cả hai, những người đắm chìm trong ký ức và tận hưởng, cuối cùng đã chén nhau. Jung-wook muốn có một mối quan hệ mới với Ji-hyeon sau sự việc này</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-tinh-nam-17-tuoi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-tinh-nam-17-tuoi-poster.jpg', '2024-02-10 17:59:12', 8, '', 90, 0),
(187, 'Ác Mộng Bóng Đêm', 'Lights Out', 2016, '<p>Phim Ác Mộng Bóng Đêm - Lights Out 2016: Một người phụ nữ bị ám bởi một sinh vật chỉ xuất hiện khi ánh đèn bị tắt. Một tác phẩm được phát triển từ phim ngắn năm 2013 \"Lights Out\" của David Sandberg.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ac-mong-bong-dem-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ac-mong-bong-dem-poster.jpg', '2024-02-10 17:59:17', 8, 'https://www.youtube.com/watch?v=6LiKKFZyhRU', 0, 0),
(188, 'Bấp Bênh (Phần 1)', 'Insecure (Season 1)', 2016, '<p>Theo dõi những trải nghiệm khó xử và những khổ nạn khó khăn của một phụ nữ Mỹ gốc Phi thời hiện đại.</p>', 1, 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-1-poster.jpg', '2024-02-10 17:59:52', 8, 'https://www.youtube.com/watch?v=YdKqUMZi5-I', 30, 0),
(189, 'Điệp Vụ Milano', 'Mission Milano', 2016, '<p>Phim Điệp Vụ Milano với cái tên tiếng anh là Mission Milano. Tuy không phải là một bộ phim đình đám nhưng nó đủ sức hút để mọi người chú ý đến. Điệp Vụ Milano có sự tham gia của hai ngôi sao hàng đầu hoa ngữ thời điểm hiện tại là trai đẹp Huỳnh Hiểu Minh và tài tử Lưu Đức Hoa. Bộ phim được biết đến là một dự án điện ảnh có kinh phí khá lớn do đạo diễn lừng danh Vương Tinh chỉ đạo, tên tuổi của ông được mọi người biết đến qua loạt phim điện ảnh thần bài hay là bộ phim ăn khách trường học Uy Long, những thước phim này cũng đánh dấu tên tuổi của vua hài Châu Tinh Trì. Ngoài ra, phim còn có sự tham gia của một số diễn viên nổi tiếng khác như: Vương Tổ Lam, Âu Dương Na Na…Trong Điệp Vụ Milano, Huỳnh Hiểu Minh sẽ vào vai một siêu đạo chích tinh quái và anh phải đối đầu với tay thám tử hài hước do Lưu Đức Hoa thủ vai. Lúc đầu, khi chưa biết đối thủ của mình thế nào, 2 người chiến đấu giống như một sống một còn nhưng chính những lần đối đầu đó khiến 2 người hiểu nhau hơn và dần dần trở thành cặp đôi hoàn hảo.</p>', 0, 'https://img.ophim11.cc/uploads/movies/diep-vu-milano-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/diep-vu-milano-poster.jpg', '2024-02-10 18:00:14', 8, 'https://www.youtube.com/watch?v=e6XFRQQbZZs', 0, 1),
(190, 'Thợ Săn Thành Phố', 'City Hunter', 1993, '<p>Một điều tra viên tư nhân tự mãn có thể lướt trên một con tàu du lịch đầy những khách hàng quen giàu có, phụ nữ lộng lẫy, những kẻ khủng bố giết người và thực phẩm khan hiếm.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tho-san-thanh-pho-1993-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tho-san-thanh-pho-1993-poster.jpg', '2024-02-10 18:00:17', 8, '', 13935, 0),
(191, 'Bắt cóc Stella', 'Kidnapping Stella', 2019, '<p>Bị bắt cóc trên đường để đòi tiền chuộc, cô gái trẻ bị trói và bịt miệng, nhưng vẫn tận dụng sức lực nhỏ bé để tìm cách phá hỏng kế hoạch của hai tên đeo mặt nạ xấu xa.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bat-coc-stella-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bat-coc-stella-poster.jpg', '2024-02-10 18:00:31', 8, '', 129, 0),
(192, 'Paris và Texas', 'Paris, Texas', 1984, '<p>Travis trở về sau 4 năm mất tích, anh xuất hiện trong một sa mạc vùng biên giới Mexico, trong tình trạng rách rưới, đói khát và hầu như không nhớ được điều gì. Sau khi xộc vào một quán rượu tìm nước, anh ngã quỵ xuống. Một bác sĩ đã cứu sống anh. Theo địa chỉ ghi trong một tờ giấy nhét sâu trong ví, người ta gọi cho em trai anh - Walt - một nhân viên thiết kế biển quảng cáo. Travis bắt đầu cuộc hành trình làm quen trở lại với đứa con trai đã lên 7 và đi tìm người vợ trẻ đã bỏ rơi anh - Jane.</p>', 0, 'https://img.ophim11.cc/uploads/movies/paris-va-texas-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/paris-va-texas-poster.jpg', '2024-02-10 18:00:33', 8, 'https://www.youtube.com/watch?v=9e590FeeGCM', 0, 0),
(193, 'Khách Tham Quan', 'Sightseers', 2012, '<p>Bắt đầu bằng một chuyến đi ngọt ngào để tìm hiểu về cuộc sống của nhau, Chris và Tina tưởng rằng mình sẽ đắm chìm trong hạnh phúc. Nào ngờ họ gặp phải những kẻ phá đám không ngờ đến và cuộc hành trình trở nên rắc rối hơn bao giờ hết!</p>', 0, 'https://img.ophim11.cc/uploads/movies/khach-tham-quan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/khach-tham-quan-poster.jpg', '2024-02-10 18:00:37', 8, '', 0, 0),
(194, 'Cô Nàng May Mắn', 'Good Looking Girl', 2022, '<p>Dojin đang học và làm việc với tư cách là một gia sư của Jooyeon và họ có tình cảm với nhau. Do-jin khẳng định rằng cô ấy sẽ làm điều đó lần cuối và tận hưởng tình dục với học sinh của mình...</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-nang-may-man-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-nang-may-man-poster.jpg', '2024-02-10 18:00:41', 8, '', 70, 1),
(195, 'Những Cô Gái Xinh Đẹp Thích Cảm Giác Lạ', 'Another breeding: Undeleted', 2021, '<p>Nam chính dùng tiền và đi mua gái về để hướng dẫn họ xếp hình, anh ta đã bắt đầu bằng việc mua Bo-yeon...</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-co-gai-xinh-dep-thich-cam-giac-la-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-co-gai-xinh-dep-thich-cam-giac-la-poster.jpg', '2024-02-10 18:00:45', 8, '', 91, 1),
(196, 'Vụng Trộm Với Hai Em Gái Xinh Đẹp', 'Girls Delinquency', 2021, '<p>Tae-soo là một người đàn ông trung niên lái taxi vào ban ngày và làm việc bán thời gian tại một cửa hàng tiện lợi vào ban đêm. Công việc kinh doanh bị hủy hoại, cả gia đình không còn, và ông muốn bảo vệ con gái mình, Ah-ra, như một viên ngọc quý. Ngày tháng trôi qua, Ah-ra trở nên quanh co như một cô gái mới lớn, phớt lờ và khiến cha mình xấu hổ. Trong khi đó, Tae-soo, người sống một mình trong studio, thường lang thang trước cửa hàng tiện lợi, nói rằng Hye-ran, một phụ nữ trẻ đẹp, không có chỗ nào để ngủ. Tae-soo, người đã nghĩ đến con gái của mình, đã cho Hye-ran một phòng trong một đêm và cô ấy sẵn lòng chấp nhận lời đề nghị của anh ta.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vung-trom-voi-hai-em-gai-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vung-trom-voi-hai-em-gai-xinh-dep-poster.jpg', '2024-02-10 18:00:48', 8, '', 90, 0),
(197, 'Vụng trộm Với Sếp', 'Stream Younger Sister', 2022, '<p>Hành trình vượt khó của nam thanh niên với sếp để được thăng chức</p>', 0, 'https://img.ophim11.cc/uploads/movies/vung-trom-voi-sep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vung-trom-voi-sep-poster.jpg', '2024-02-10 18:00:52', 8, '', 62, 1),
(198, 'Em Phục Vụ Xinh Đẹp Ở Trung Tâm Karaoke', 'Karaoke Housewives', 2022, '<p>Yeon-seo,vì không được thỏa mãng tình dục nên đã bắt đầu công việc bán thời gian như một người phục vụ quán karaoke cùng với người bạn của cô ấy là Joo-yeon. Do được truyền miệng là có thể cosplay trang phục với vòng một và vòng ba nên phòng karaoke chật kín khách hàng nam đặt trước ...&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/em-phuc-vu-xinh-dep-o-trung-tam-karaoke-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/em-phuc-vu-xinh-dep-o-trung-tam-karaoke-poster.jpg', '2024-02-10 18:00:55', 8, '', 61, 1),
(199, 'Hai Em Gái Dâm Đãng', 'Sweet Scandal', 2021, '<p>kể về cuộc sống của hai cô gái xinh đẹp người hàn và mối quan hệ của các cô với các chàng trai lạ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hai-em-gai-dam-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hai-em-gai-dam-dang-poster.jpg', '2024-02-10 18:00:59', 8, '', 90, 2),
(200, 'Ba Cô Em Gái Đảm Đang', 'Covert Report Of Allegations', 2022, '<p>Vì biết em gái sống chung không thích đàn ông nên nam chính đã lên kế hoạch huấn luyện thể xác cho các em gái của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ba-co-em-gai-dam-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ba-co-em-gai-dam-dang-poster.jpg', '2024-02-10 18:01:01', 8, '', 57, 3),
(201, 'Cô Em Gái Đảm Đang', 'Weird Relative of the Family', 2022, '<p>Jin Ah nhìn thấy Tae Yeong tại cửa hàng của bạn trai Cheol Min và đem lòng yêu gương mặt điển trai của anh ấy. Để gặp Tae Yeong, Jin Ah mời anh và Cheol Min đến nhà cô. Cheol Min phát hiện ra rằng Jin Ah thích Tae Yeong, và anh ấy rất ghen tị. Cuối cùng, Tae Yeong bỏ đi và đến nhà Jin Ah một mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-em-gai-dam-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-em-gai-dam-dang-poster.jpg', '2024-02-10 18:01:02', 8, '', 91, 1),
(202, 'Thịt Gái Xinh Cỡ F', 'Woman Biting Tight', 2022, '<p>Cô nàng với bộ ngực cúp F và cặp mông khủng có thể kẹp chặt con cừu của đàn ông, đưa họ đến đỉnh cao khoái lạc</p>', 0, 'https://img.ophim11.cc/uploads/movies/thit-gai-xinh-co-f-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thit-gai-xinh-co-f-poster.jpg', '2024-02-10 18:01:04', 8, '', 60, 2),
(203, 'Cầu Thủ Bóng Bầu Dục (Phần 5)', 'Ballers (Season 5)', 2015, '<p>Phần 1 theo chân nhiều cầu thủ bóng đá trong quá khứ và hiện tại khi họ điều hướng cuộc sống bên ngoài sân cỏ. Dẫn đầu nhóm là Spencer, một siêu sao đã nghỉ hưu đang cố gắng tìm chỗ đứng với tư cách là người quản lý tài chính cho những người chơi hiện tại. Trong vòng tròn bên trong của anh ấy là Charles người nhận tài năng nhưng hay thay đổi; một người xếp hàng đã nghỉ hưu miễn cưỡng đấu tranh để thích nghi với cuộc sống sau trận đấu; và cảm giác tân binh Vernon, người rơi vào tình thế khó khăn về tài chính.</p>', 1, 'https://img.ophim11.cc/uploads/movies/cau-thu-bong-bau-duc-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cau-thu-bong-bau-duc-phan-1-poster.jpg', '2024-02-10 18:01:08', 8, 'https://www.youtube.com/watch?v=OQOJwcMCAqI', 30, 0),
(204, 'Bấp Bênh (Phần 5)', 'Insecure (Season 5)', 2021, '<p>Theo dõi những trải nghiệm khó xử và những khổ nạn khó khăn của một phụ nữ Mỹ gốc Phi thời hiện đại.</p>', 1, 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-5-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-5-poster.jpg', '2024-02-10 18:01:16', 8, 'https://www.youtube.com/watch?v=YdKqUMZi5-I', 30, 0),
(205, 'Bấp Bênh (Phần 4)', 'Insecure (Season 4)', 2020, '<p>Theo dõi những trải nghiệm khó xử và những khổ nạn khó khăn của một phụ nữ Mỹ gốc Phi thời hiện đại.</p>', 1, 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-4-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-4-poster.jpg', '2024-02-10 18:01:17', 8, 'https://www.youtube.com/watch?v=YdKqUMZi5-I', 30, 0),
(206, 'Bấp Bênh (Phần 3)', 'Insecure (Season 3)', 2018, '<p>Trong phần 3, Issa cố gắng lấy lại cuộc sống của mình, làm tài xế chia sẻ chuyến đi trong khi đâm vào chiếc ghế dài của Daniel.</p>', 1, 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-3-poster.jpg', '2024-02-10 18:01:19', 8, 'https://www.youtube.com/watch?v=YdKqUMZi5-I', 30, 0),
(207, 'Bấp Bênh (Phần 2)', 'Insecure (Season 2)', 2017, '<p>Phần 2 mở đầu với cảnh Issa vật lộn sau khi chia tay với Lawrence, đồng thời đối mặt với những thách thức ở một nhiệm vụ công việc mới.</p>', 1, 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bap-benh-phan-2-poster.jpg', '2024-02-10 18:01:21', 8, 'https://www.youtube.com/watch?v=YdKqUMZi5-I', 30, 0),
(208, 'Hành Trình Nam Mỹ', 'The Motorcycle Diaries', 2004, '<p>Năm 1952, sinh viên y khoa hai mươi ba tuổi Ernesto Guevara de la Serna - Fuser cho bạn bè và sau đó được biết đến với \'Ernesto Che Guevara\' - một học kỳ xa lễ tốt nghiệp, quyết định hoãn học kỳ cuối cùng của mình để đi cùng hai mươi chín năm Người bạn sinh hóa cũ \'Alberto Granado\' - mial cho bạn bè của mình - trong bốn tháng, chuyến đi xe mô tô dài 8.000 km trong suốt Nam Mỹ bắt đầu từ nhà của họ ở Buenos Aires. Nhiệm vụ của họ là nhìn thấy những thứ mà họ chỉ đọc về những cuốn sách về lục địa mà họ sống, và kết thúc nhiệm vụ đó vào sinh nhật thứ ba của Alberto ở phía bên kia lục địa trong Bán đảo Guajira ở Venezuela. Không phải tất cả trong chuyến đi này diễn ra theo chương trình sơ bộ của họ do một chiếc xe máy bị phá vỡ, một sự thiếu tiền liên tục (họ thường kéo dài sự thật để có được sự ưu ái của nhiều người lạ để giúp đỡ họ), lập luận giữa hai người thường xuyên Cô lập chỉ với nhau, ham muốn libidos đang hoành hành mà đôi khi khiến chúng gặp rắc rối và đối phó với hen suyễn mạn tính của Fuser. Nhưng một cơ hội gặp gỡ với một vài người cộng sản ở sa mạc Chile và một chuyến thăm kéo dài đến Thuộc địa San Pablo Leper trong lưu vực Amazon Perúvian trong số những thứ khác ảnh hưởng sâu sắc đến những gì mỗi người sẽ muốn làm với cuộc sống của mình và trái phiếu từng có với người khác .</p>', 0, 'https://img.ophim11.cc/uploads/movies/hanh-trinh-nam-my-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hanh-trinh-nam-my-poster.jpg', '2024-02-10 18:04:42', 8, '', 0, 0),
(209, 'Những Bí Mật Của Người Vợ', 'The Secret Mound Of A Fearless And Hopeless New Wife', 2022, '<p>kể về bí mật của cô gái xinh đẹp trẻ trung.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-bi-mat-cua-nguoi-vo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-bi-mat-cua-nguoi-vo-poster.jpg', '2024-02-10 18:04:43', 8, '', 54, 3),
(210, 'Ma Thổi Đèn: Mộ Hoàng Bì Tử', 'Mojin: The Tomb of Weasel', 2021, '<p>Để giải cứu cô thôn nữ Họa My bị bệnh, Hồ Bát Nhất cùng một số thanh niên trai tráng ở miền quê Đông Bắc, đã liên kết với cùng với chú thợ săn họ Triệu tìm đến hang động của người gấu tuyết trong rừng để tìm thuốc giải. Không ngờ đột nhiên lại bị người tuyết tấn công, buộc phải trốn vào trong khu nhà Hoàng Bì dưới lòng đất, từ đây bao nhiêu sự kiện ly kỳ trong khu nhà Hoàng Bì này liên tiếp xảy đến, từ ảo ảnh trùng trùng. Hồ Bát nhất và đám người đi cùng đã phá giải được những quỷ kế mê tín, nhổ cỏ tận gốc, tìm ra chân tướng kẻ đứng sau mọi chuyện, cuối cùng đã giải cứu được dân làng thoát khỏi địa phủ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ma-thoi-den-mo-hoang-bi-tu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ma-thoi-den-mo-hoang-bi-tu-poster.jpg', '2024-02-10 18:04:47', 8, '', 0, 2),
(211, 'Bí Mật Với Thầy Dạy Trượt Băng', 'Secret Knee to Knee', 2021, '<p>Vì biết chồng ngoại tình nên Ja-yeong đã rất hận thù anh ta và quyết định làm tình với người dạy trượt băng để trả thù</p>', 0, 'https://img.ophim11.cc/uploads/movies/bi-mat-voi-thay-day-truot-bang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bi-mat-voi-thay-day-truot-bang-poster.jpg', '2024-02-10 18:04:49', 8, '', 61, 0),
(212, 'Những Người Bạn Thực Tập Sinh Của Em Gái Tôi', 'My Sisters Idol Trainee Friends', 2022, '<p>Jae-hoon đến ở với em gái của Eun-ju, anh ấy là một thần tượng của các thực tập sinh sau khi phục vụ trong quân đội vài năm. Ngôi nhà cũng có hai người bạn thực tập sinh nhỏ tuổi là Hyeon-joo và Yeon-ju, những người thích Jae-hoon đẹp trai. Khi cuộc chiến giữa hai người phụ nữ để giành lấy Jae-hoon bắt đầu, Jae-hoon cảm thấy xấu hổ và đưa ra một lời đề nghị độc đáo cho Hyeon-joo và Yeon-ju</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-nguoi-ban-thuc-tap-sinh-cua-em-gai-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-nguoi-ban-thuc-tap-sinh-cua-em-gai-toi-poster.jpg', '2024-02-10 18:04:53', 8, '', 91, 0),
(213, 'Cô Giúp Việc Gợi Tình', 'Housekeeper Mopping', 2022, '<p>Một cặp đôi trong chuyến du lịch đến một biệt thự hẻo lánh . Một người giúp việc xinh đẹp chào đón họ.Bắt đầu từ đây, cô giúp việc xinh đẹp bắt đầu gạ tình người chồng và họ đã...</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-giup-viec-goi-tinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-giup-viec-goi-tinh-poster.jpg', '2024-02-10 18:04:55', 8, '', 59, 1),
(214, 'Hướng Dẫn Em Gái Xinh Đẹp Làm Tình', 'New home sex manual', 2021, '<p>Cuối cùng cô cũng có được ngôi nhà đầu tiên trong đời, cô bước vào nhà với tâm thế hạnh phúc. Đúng lúc đó, tôi nghe thấy tiếng bước chân ... Tại sao lại có một người đàn ông mà tôi không biết trong nhà tôi?! Sau một cuộc trò chuyện chậm rãi, một người phụ nữ đã bị lừa bởi một hợp đồng ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/huong-dan-em-gai-xinh-dep-lam-tinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/huong-dan-em-gai-xinh-dep-lam-tinh-poster.jpg', '2024-02-10 18:05:00', 8, '', 62, 1),
(215, 'Người Tình Của Bố', 'Dad\'s Girlfriend', 2021, '<p>Wooyeol và Nara, những người thường thích quan hệ tình dục, uống rượu và ngủ tại nhà của Nara. Kang-hyeon, một người cha giàu có, đưa bạn gái Ha-yeon vào nhà của mình để quan hệ tình dục. Ha-yeon tình cờ gặp Woo-yeol ở nhà, và Ha-yeon, người đã quan hệ tình dục với Woo-yeol, rất ngạc nhiên và đưa Woo-yeol đi. Ha-yeon yêu cầu Woo-yeol giữ bí mật mà cô đã gặp, và Woo-yeol yêu cầu quan hệ tình dục thay vì giữ bí mật.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-tinh-cua-bo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-tinh-cua-bo-poster.jpg', '2024-02-10 18:05:01', 8, '', 91, 1),
(216, 'Nữ Phóng Viên Dự Báo Thời Tiết Ướt Át', 'Today\'s Weather Wet', 2022, '<p>Dayoung, một phát thanh viên thời tiết đang trở nên nóng bỏng với hình ảnh quyến rũ của mình. Nhà sản xuất Dohyuk hỏi Dayoung rằng nếu cô ấy không muốn vươn lên vị trí cao hơn thì phải làm theo yêu cầu của anh ta, nhưng Dayoung đã né tránh . Sau đó, nhận ra rằng số tiền của cô ấy đang giảm đi không giống như trước đây, cô ấy đã đến địa điểm ghi hình vào một ngày không có quay phim và tìm thấy một phát thanh viên thời tiết mới đang phục vụ anh ta, và Dayoung đã đưa ra quyết định mớ</p>', 0, 'https://img.ophim11.cc/uploads/movies/nu-phong-vien-du-bao-thoi-tiet-uot-at-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nu-phong-vien-du-bao-thoi-tiet-uot-at-poster.jpg', '2024-02-10 18:05:03', 8, '', 91, 0),
(217, 'Cashback', 'Cashback', 2006, '<p>Khi sinh viên nghệ thuật Ben Willis chia tay với bạn gái Suzy, anh ta phát triển chứng mất ngủ mạn tính sau khi tìm hiểu xem cô ấy nhanh lên như thế nào. Để vượt qua nhiều giờ trong đêm, anh ta bắt đầu làm việc ca đêm muộn tại siêu thị địa phương. Ở đó, ông gặp một dàn nhân vật đầy màu sắc, tất cả những người đều có \'nghệ thuật\' của riêng mình trong việc đối phó với sự nhàm chán của một ca làm việc tám giờ. Nghệ thuật của Ben là anh ấy tưởng tượng mình đang dừng thời gian. Bằng cách này, anh ta có thể đánh giá cao vẻ đẹp nghệ thuật của thế giới đông lạnh và những người trong đó - đặc biệt là Sharon, cô gái kiểm tra xinh đẹp và yên tĩnh, có lẽ có câu trả lời để giải quyết vấn đề mất ngủ của Ben.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cashback-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cashback-poster.jpg', '2024-02-10 18:05:07', 8, '', 0, 0),
(218, 'Mẹ Kế Xinh Đẹp', 'Stepmom', 2021, '<p>Một bộ phim 18+ nói về mối quan hệ giữa con trai với bạn gái và người mẹ kế trẻ tuổi của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/me-ke-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/me-ke-xinh-dep-poster.jpg', '2024-02-10 18:05:08', 8, '', 57, 2),
(219, 'Mối Tình Với Cô Hàng Xóm Xinh Đẹp', 'Rice Cake With The Girl Next Door', 2022, '<p>kể về mối tình của cô gái xinh đẹp và anh hàng xóm.</p>', 0, 'https://img.ophim11.cc/uploads/movies/moi-tinh-voi-co-hang-xom-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/moi-tinh-voi-co-hang-xom-xinh-dep-poster.jpg', '2024-02-10 18:05:11', 8, '', 58, 0),
(220, '90 Phút Kinh Hoàng', 'The Terror Live', 2013, '<p>Bộ phim tâm lý tội phạm ăn khách của Hàn Quốc! MC đài truyền hình đã kết nối với kẻ khủng bố trong thời gian phát sóng trực tiếp! Rốt cuộc ai là hung thủ? Chính nghĩa vẫn sẽ xuất hiện sao?</p>', 0, 'https://img.ophim11.cc/uploads/movies/90-phut-kinh-hoang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/90-phut-kinh-hoang-poster.jpg', '2024-02-10 18:05:13', 8, '', 13756, 1),
(221, 'Anh Em Cuồng Dâm', 'Sexy Tutoring Class', 2022, '<p>Chị dâu Seo-yul không hài lòng chuyện giường chiếu với chồng của mình là Kang-hyeon và thường thủ dâm một mình. “Tôi cố gắng ngủ với Kang-hyeon một lần nữa, nhưng tôi vẫn không hài lòng”, và Kang-hyeon cũng thất vọng với Seo-yul. Em trai của Kang-hyeon là Woo-yeol đang học với gia sư của mình là Jo-ah, hôm nay đến nhà để dạy phụ đạo cho Woo-yeol, và câu chuyện phát sinh từ đây …</p>', 0, 'https://img.ophim11.cc/uploads/movies/anh-em-cuong-dam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/anh-em-cuong-dam-poster.jpg', '2024-02-10 18:05:15', 8, '', 61, 1),
(222, 'Một Ngày Để Yêu', 'One Day', 2011, '<p>Emma và Dexter gặp nhau vào đêm tốt nghiệp đại học. Chúng tôi nhìn thấy chúng hàng năm vào ngày kỷ niệm ngày đó - ngày 15 tháng 7. Emma là thông minh nhưng thành công không đến nhanh với cô ấy, trong khi Dexter, thành công và phụ nữ đến rất dễ dàng. Qua những năm họ lớn lên khi cuộc sống của họ có những hướng khác nhau và họ gặp người khác. Nhưng khi chúng phát triển từ những người khác và cuộc sống của họ bắt đầu bắt đầu ngược lại, Emma và Dexter thấy rằng họ thuộc về nhau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/one-day-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/one-day-poster.jpg', '2024-02-10 18:05:18', 8, '', 0, 0),
(223, 'Tuyệt đỉnh công phu', 'Kung Fu Hustle', 2004, '<p>Tinh, một kẻ lưu manh ở Trung Quốc vào những năm 1940, giả dạng thành viên của bang Lưỡi Rìu, một băng đảng xã hội đen thống trị Hồng Kông lúc đó, để diễu võ giương oai.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tuyet-dinh-cong-phu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tuyet-dinh-cong-phu-poster.jpg', '2024-02-10 18:05:19', 8, '', 138, 2),
(224, 'Anh Thợ Sửa Ống Nước Và Cô Chủ Nhà Dâm Đãng', 'Between the legs of Daemul men and real women', 2019, '<p>Nhà JinJung bị mất nước vì thế cô đã gọi cho anh thợ đến để kiểm tra, anh thợ vô tình thấy cô thủ dâm và sau đó...</p>', 0, 'https://img.ophim11.cc/uploads/movies/anh-tho-sua-ong-nuoc-va-co-chu-nha-dam-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/anh-tho-sua-ong-nuoc-va-co-chu-nha-dam-dang-poster.jpg', '2024-02-10 18:05:22', 8, '', 43, 0),
(225, 'Những Cô Người Yêu Gợi Cảm', 'Delicious Destiny', 2022, '<p>Ba anh chàng cùng quê quyết định trao đổi người yêu với nhau ....</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-co-nguoi-yeu-goi-cam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-co-nguoi-yeu-goi-cam-poster.jpg', '2024-02-10 18:05:24', 8, '', 91, 2),
(226, 'Crazy Love', '蜜桃成熟時', 1993, '<p>Những gì được cho là trường học mùa hè ở Anh trở thành một cuộc hành trình kỳ lạ và lãng mạn đầy phiêu lưu của một cô gái tuổi teen xinh đẹp. [from the Tai Seng Catalog] Một câu chuyện hay về một cô gái trẻ có tinh thần tự do (hoặc tùy theo quan điểm của bạn, hay trêu chọc) trong một hành trình khám phá ngắn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/crazy-love-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/crazy-love-poster.jpg', '2024-02-10 18:05:27', 8, '', 77, 0),
(227, 'Điều kỳ diệu ở phòng giam số 7', 'Miracle in Cell No.7  / Number 7 Room\'s Gift (literal title)', 2013, '<p>Miracle In Cell No.7 là bộ phim tình cảm gia đình xoay quanh nhân vật Yong Goo bị kết án tử hình vì bị kẻ xấu vu cho tội sát nhân. Ước mơ cuối cùng của ông là được nhìn thấy con gái mình - Ye Seung . Tuy nhiên, cánh cửa nhà tù nơi ông đang bị giam giữ lại không bao giờ mở cho người nhà vào thăm. Vì vậy, những người cùng phòng giam đã lên kế hoạch để 2 cha con họ có thể hội ngộ... Liệu những người từng phạm tội ấy có làm nên được điều kỳ diệu? Hai cha con Yong Goo có được gặp lại nhau? Miracle In Cell No.7 là bộ phim hài hước nhưng lại mang ý nghĩa sâu sắc, đằng sau những con người đều ẩn sâu trong đó lòng trắc ẩn, tình thương và sự đồng cảm. Dù là tội phạm, dù là tử tù nhưng họ đều có \"nhân tính\". Bộ phim chuyển tải một thông điệp: \"Nhân chi sơ, tính bổn thiện\".</p>', 0, 'https://img.ophim11.cc/uploads/movies/dieu-ky-dieu-o-phong-giam-so-7-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dieu-ky-dieu-o-phong-giam-so-7-poster.jpg', '2024-02-10 18:05:32', 8, 'http://www.youtube.com/watch?v=qTyNrtkQOA4', 127, 0),
(228, 'Những Cô Người Mẫu Xinh Đẹp', 'Invitation Girl 1', 2021, '<p>Kể về những cô người mẫu xinh đẹp đại diện cho Hàn Quốc trong cuộc thi nhan sắc</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-co-nguoi-mau-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-co-nguoi-mau-xinh-dep-poster.jpg', '2024-02-10 18:05:44', 8, '', 58, 0),
(229, 'Nước mắt mặt trời', 'Tears of the Sun', 2003, '<p>Khi một cuộc đảo chính biến Nigeria thành bể máu, người lính đặc nhiệm hải quân phải giải cứu một bác sĩ làm việc trong rừng – và tất cả những người cô chăm sóc.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nuoc-mat-mat-troi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nuoc-mat-mat-troi-poster.jpg', '2024-02-10 18:05:45', 8, '', 21, 0),
(230, 'Cảm Giác Khi Yêu', 'Love With A Singularity', 2022, '<p>Em gái tôi, Seo-young, người lớn lên cùng tôi ở nông thôn, được chỉ định làm giáo viên tại trường tiểu học duy nhất trong làng. Baek-goo nhận ra rằng Seo-young có nỗi đau không thể nói ra, và cuộc đấu tranh ngoạn mục cho tình yêu của Baek-goo bắt đầu.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cam-giac-khi-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cam-giac-khi-yeu-poster.jpg', '2024-02-10 18:05:49', 8, '', 90, 2),
(231, 'Cô Bạn Gái Seung-ha', 'Seungha\'s Friend Room', 2021, '<p>Bong-sik đang lãng phí cuộc đời mình chỉ để chơi game. Một ngày nọ, anh ta được mời đến một phòng trò chuyện trò chơi và phát hiện ra rằng anh ta có thể bán những bức ảnh bị lộ bí mật ở đó.<br>Nhiều hình ảnh phơi bày khác nhau như hình cô bạn gái ngủ khỏa thân và hình ảnh cô em gái đang thay quần áo đang được bán với giá cao.</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-ban-gai-seung-ha-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-ban-gai-seung-ha-poster.jpg', '2024-02-10 18:06:06', 8, '', 91, 0),
(232, 'Nữ Thư Ký Riêng Xinh Đẹp', 'Female Secretary\'s Hot Report', 2022, '<p>Mi-yeong, người bị ông chủ Young-guk lạm dụng hàng ngày, quyết định trả thù anh ta và sử dụng chồng mình là Jong-sung để quay lén cuộc sống riêng tư của Yeong-gyeong để tống tiền anh ta.Một ngày nọ, Mi-yeong chứng kiến ​​cảnh quan hệ tình dục thô bạo giữa Yeong-gyeong và vợIn-ae của anh ấy, và cơ thể cô ấy bắt đầu nóng lên. Mi-yeong bắt đầu thay đổi quyết định khi mọi kế hoạch của cô ấy trở nên tồi tệ</p>', 0, 'https://img.ophim11.cc/uploads/movies/nu-thu-ky-rieng-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nu-thu-ky-rieng-xinh-dep-poster.jpg', '2024-02-10 18:06:09', 8, '', 90, 1),
(233, 'Grizzy và hội lemmut (Phần 3)', 'Grizzy and the Lemmings (Season 3)', 2023, '<p>Chú gấu Grizzy thích ăn vặt và thư giãn trong một căn nhà gỗ ở khu rừng thuộc Canada. Cũng tại đó, hội lemmut đáng yêu và mê cảm giác mạnh lúc nào cũng gây náo loạn.</p>', 1, 'https://img.ophim11.cc/uploads/movies/grizzy-va-hoi-lemmut-phan-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/grizzy-va-hoi-lemmut-phan-3-poster.jpg', '2024-02-10 18:06:11', 8, '', 7, 0),
(234, 'Hội chứng yêu', 'Down for Love', 2023, 'Là hành trình kiếm tìm tình yêu đầy ấm áp, chương trình thực tế yêu đời này theo chân một số người mắc hội chứng Down khi họ xoay xở với những thăng trầm của việc hẹn hò.', 1, 'https://img.ophim11.cc/uploads/movies/hoi-chung-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoi-chung-yeu-poster.jpg', '2024-02-10 18:06:13', 8, '', 46, 0),
(235, 'Xứ Sở Các Nguyên Tố', 'Elemental', 2023, 'Xứ Sở Các Nguyên Tố từ Disney và Pixar lấy bối cảnh tại thành phố các các nguyên tố, nơi lửa, nước, đất và không khí cùng chung sống với nhau. Câu chuyện xoay quanh nhân vật Ember, một cô nàng cá tính, thông minh, mạnh mẽ và đầy sức hút. Tuy nhiên, mối quan hệ của cô với Wade - một anh chàng hài hước, luôn thuận thế đẩy dòng - khiến Ember cảm thấy ngờ vực với thế giới này.', 0, 'https://img.ophim11.cc/uploads/movies/xu-so-cac-nguyen-to-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/xu-so-cac-nguyen-to-poster.jpg', '2024-02-10 18:06:15', 8, 'https://www.youtube.com/watch?v=-cT495xKvvs', 102, 0),
(236, 'Trường Tương Tư', 'Lost You Forever', 2023, '<p>Chuyện tình trải qua nhiều gian truân của Tiểu Yêu và Đồ Sơn Cảnh. Sinh ra đã chịu nhiều thiệt thòi, không biết cha thật sự của mình là ai, rời xa mẹ từ khi còn tấm bé, Tiểu Yêu lưu lạc chân trời góc bể. Trong quãng thời gian sống dưới danh nghĩa Văn Tiểu Lục - nam nhân hành nghề thầy thuốc ở Hồi Xuân Đường, Tiểu Yêu tình cờ cứu Đồ Sơn Cảnh - chủ tộc tương lai của dòng họ Đồ Sơn. Câu chuyện cứ thế bắt đầu.</p>', 1, 'https://img.ophim11.cc/uploads/movies/truong-tuong-tu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/truong-tuong-tu-poster.jpg', '2024-02-10 18:06:25', 8, 'https://www.youtube.com/watch?v=LGCwVXX-31w', 45, 5),
(237, 'Câu Lạc Bộ Những Kẻ Mất Ngủ', 'Insomniacs After School', 2023, 'Nakami là một học sinh trung học siêng năng nhưng luôn cáu kỉnh và chống đối xã hội. Tuy nhiên, thái độ tồi tệ ấy của cậu xuất phát từ việc bị rối loạn giấc ngủ và thường xuyên thức trắng đêm. Một ngày nọ, cậu được nhờ đến đài quan sát thiên văn của trường để lấy đồ, một nơi được cho là bị ma ám. Cũng tại đây, cậu tình cờ phát hiện người bạn cùng lớp là Magari Isaki cũng đang mượn nơi này để chợp mắt. Hai con người giống nhau, cùng che giấu những vấn đề về chứng mất ngủ đã tìm đến đài quan sát như một chốn để bù đắp cho những đêm dài thao thức... Liệu họ có tìm thấy sự an yên mà bấy lâu nay vẫn kiếm tìm?', 1, 'https://img.ophim11.cc/uploads/movies/cau-lac-bo-nhung-ke-mat-ngu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cau-lac-bo-nhung-ke-mat-ngu-poster.jpg', '2024-02-10 18:06:27', 8, 'https://www.youtube.com/watch?v=vFqI9r7-CAo', 24, 0),
(238, 'Chiếc Taxi Chuyên Săn Gái Đẹp', 'Married Woman Hunting Car Sex', 2021, '<p>Chiếc xe chuyên đi săn các cô gái xinh đẹp và sau đó làm theo ý muốn của các cô gái ấy ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/chiec-taxi-chuyen-san-gai-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chiec-taxi-chuyen-san-gai-dep-poster.jpg', '2024-02-10 18:06:34', 8, '', 59, 0),
(239, 'Nữ Phóng Viên Xinh Đẹp', '예쁜 리포터', 2021, '<p>PD Jang, người làm việc cho truyền hình du lịch, đi quay phim ở nước ngoài với phóng viên Sohee, và đi cùng bạn gái Lisa của anh ấy.<br>Giám đốc của công ty đến quay phim ở nước ngoài, và PD Jang chứng kiến cơ thể tuyệt vời của phóng viên Sohee.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nu-phong-vien-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nu-phong-vien-xinh-dep-poster.jpg', '2024-02-10 18:06:36', 8, '', 68, 0),
(240, 'Bạn Gái Xinh Đẹp Của Em Rể', '처남의 여자친구', 2021, '<p>Chae-won sống với chồng, Geum-cheol, và em trai, Dong-jun. Ngày nào chị cũng phải đau đầu vì chồng và anh trai ăn chơi sa đọa ở nhà. Một ngày nọ, Dong-jun mời bạn gái đến thăm nhà anh. Sau ngày hôm đó, Geum-cheol phải lòng bạn gái của anh rể mình. Ngày hôm sau, Geum-cheol, người tình cờ chứng kiến ​​cảnh cô ngoại tình với một người đàn ông khác, lấy cớ này để ép ô ấy vào nhà nghỉ với anh ta ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/ban-gai-xinh-dep-cua-em-re-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ban-gai-xinh-dep-cua-em-re-poster.jpg', '2024-02-10 18:06:37', 8, '', 91, 1),
(241, 'Thỏa Thuận Bán Thân', 'Dangerous Memorandum Signed By The Body', 2021, '<p>Nữ chính nợ nam chính một khoản tiền lớn, cô ấy không có khả năng chi trả. Vì vậy, cô ấy đã quyết định cho nam chính làm tình với mình để trả nợ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/thoa-thuan-ban-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thoa-thuan-ban-than-poster.jpg', '2024-02-10 18:06:41', 8, '', 55, 2),
(242, 'Bí Mật Với Bạn Của Vợ', '몰래 먹는 그녀', 2021, '<p>Na-hee và Tae-seong là bạn của nhau. Hai người có một khoảng thời gian đẹp đẽ.&nbsp;<br>Nhưng vợ của Tae-seong là người quen của Na-hee, Mi-yeon. Na-hee hành động như một bà chủ mỗi khi Mi-yeon không có ở nhà.&nbsp;<br>Tae-seong thấy Na-hee rất gợi tình, và khi vợ anh không có ở nhà 2 người đã…</p>', 0, 'https://img.ophim11.cc/uploads/movies/bi-mat-voi-ban-cua-vo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bi-mat-voi-ban-cua-vo-poster.jpg', '2024-02-10 18:06:42', 8, '', 64, 3),
(243, 'Tình Yêu Tuổi 30', '3분안에 3발 빼주는 30대 미시녀들', 2021, '<p>Nam chính năm nay 30 tuổi, và anh ấy mới bắt đầu biết yêu. Một hôm anh ấy và bạn gái đang tâm sự thì chợt nói đến chuyện tình dục, và sau đó…</p>', 0, 'https://img.ophim11.cc/uploads/movies/tinh-yeu-tuoi-30-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tinh-yeu-tuoi-30-poster.jpg', '2024-02-10 18:06:45', 8, '', 55, 0),
(244, 'Em Dâu Và Anh Rể', 'Different Brother In Law', 2022, '<p>Dongwoo sau khi làm tình với người yêu thì đã thú nhận rằng anh ta sẽ đi xa một thời gian, nhưng không ngờ rằng trong lúc mình khong có mặt, người yêu của mình lại cưới annh trai của mình, câu chuyện bắt đầu từ đây ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/em-dau-va-anh-re-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/em-dau-va-anh-re-poster.jpg', '2024-02-10 18:06:46', 8, '', 71, 4);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(245, 'Cô Gia Sư Ở Phố 69', '69th Street Tutor Yuk Deokjin', 2021, '<p>Đừng chỉ nhìn vào cơ thể của tôi, hãy nhìn vào sách đi ~ Min-young nhắc Dae-jin, Min-young là em của Soo-jin, Dae-jin đã mắc lỗi với Su-jin, làm tổn thương lòng tự trọng của cô ấy. Dae-jin nói điều này với Min-ho, bạn thân cùng lớp với Soo-jin. Trên thực tế, Minho là bạn trai cũ của Sujin. Min-ho ra khỏi nhà của Dae-jin và nhìn thấy Min-yeong, đang là gia sư của Dae-jin. Một ngày nọ, Dae-jin, đang uống rượu với Su-jin và Min-young, rất phấn khích và uống hết sức, rồi chuyện gì sẽ đến với cô gia sư trẻ tuổi và anh chàng học trò?</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-gia-su-o-pho-69-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-gia-su-o-pho-69-poster.jpg', '2024-02-10 18:06:49', 8, '', 90, 0),
(246, 'Thanh Trừng', 'Hugas', 2022, '<p>Các thành viên cũ của băng đảng và cặp vợ chồng mới cưới Al và Liezl chạy trốn với một túi tiền lớn, nhưng ông chủ cũ của họ sẽ đi đến tận cùng trái đất để tìm họ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/thanh-trung-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thanh-trung-poster.jpg', '2024-02-10 18:06:52', 8, '', 99, 0),
(247, 'Trí Thủy Uy Hổ Sơn', 'The Taking of Tiger Moutain', 2021, '<p>Mùa đông năm 1947, phân đội 203 thuộc liên quân Dân chủ Đông Bắc dưới sự chỉ huy của thủ trưởng Thiếu Kiếm Ba (Lâm Canh Tân đóng), tiếp nhận mệnh lệnh của thượng cấp bảo vệ an toàn cho dân chúng khỏi nạn cướp bóc hoành hành trên cánh đồng tuyết Lâm Hải.Trinh sát viên Dương Tử Vinh (Trương Hàm Dư đóng) và nhân viên y tế Bạch Như (Đồng Lệ Á đóng) gấp rút tiếp viện cho tiền tuyến. Để triệt phá hoàn toàn thế lực của thổ phỉ, Dương Tử Vinh khăng khăng đề nghị cải trang trà trộn vào hang ổ của thổ phỉ: núi Uy Hổ.&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/tri-thuy-uy-ho-son-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tri-thuy-uy-ho-son-poster.jpg', '2024-02-10 18:06:58', 8, '', 140, 1),
(248, 'Trợ Lý Tình Dục', '섹스 도우미', 2021, '<p>Min-hyeok, người có nhiều tiền và thời gian, gọi người hầu của mình vào buổi sáng và buổi tối. Anh ta dành một ngày với hai người phụ nữ tuyệt đối tuân theo các quy tắc mà anh ta tạo ra. Đó là một quy tắc mà bạn phải phục vụ khỏa thân khi anh ta nằm xuống, nhưng không ai phàn nàn về điều đó. Min-hyeok, người lạm dụng hai người phụ nữ theo ý mình, muốn có nhiều phụ nữ hơn ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/tro-ly-tinh-duc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tro-ly-tinh-duc-poster.jpg', '2024-02-10 18:07:02', 8, '', 63, 3),
(249, 'Người Phụ Nữ Có Ham Muốn Bùng Nổ', 'Explosive Sexual Desire Women Radical No-Con Sex', 2021, '<p>Cô ấy là nhân viên trong một công ty lớn, dù tuổi đã ngoài đôi mươi nhưng ham muốn tình dục của cô vẫn rất lớn, cô luôn gạ tình anh trưởng phòng thân thiện và cuối cùng điều đó cũng sảy ra…</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-phu-nu-co-ham-muon-bung-no-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-phu-nu-co-ham-muon-bung-no-poster.jpg', '2024-02-10 18:07:04', 8, '', 55, 0),
(250, 'Lá Phiếu Mua Hàng', '섹스 이용권', 2022, '<p>Hai người gặp lại nhau và cuối cùng vượt qua giới hạn.Da-hee lo lắng về mối quan hệ của cô với Min-cheol sau khi quan hệ tình dục và lương tâm của cô đau đớn.Min-cheol tình cờ thích hẹn hò với Eun-jin, giấu Eun-jin điều gì đó và hẹn cô ấy với Min-cheol vẫn tình cảm như trước ...Eun-jin hét lên với Min-cheol khi buổi hẹn hò kết thúc.</p>', 0, 'https://img.ophim11.cc/uploads/movies/la-phieu-mua-hang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/la-phieu-mua-hang-poster.jpg', '2024-02-10 18:07:05', 8, '', 91, 1),
(251, 'Bỡ Ngỡ Lần Đầu Tiên', '유부녀의 사정일지', 2022, '<p>Một bộ phim khiêu dâm mô tả sự trả thù của một cặp đôi bị lừa bởi những thú vui thể xác của một cặp vợ chồng tại nơi làm việc.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhat-ki-ngoai-tinh-cua-co-nang-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhat-ki-ngoai-tinh-cua-co-nang-xinh-dep-poster.jpg', '2024-02-10 18:07:07', 8, '', 90, 2),
(252, 'Titanic', 'Titanic', 1997, '<p>Một quý tộc mười bảy tuổi rơi vào tình yêu với một nghệ sĩ tốt bụng nhưng nghèo trên tàu sang trọng, xấu xa r.M.S. Titanic.</p>', 0, 'https://img.ophim11.cc/uploads/movies/titanic-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/titanic-poster.jpg', '2024-02-10 18:07:09', 8, '', 0, 0),
(253, 'Sống Cùng Mẹ Kế', '새엄마 하숙집', 2021, '<p>Hyun Woo sống với mẹ kế của mình, quyết định tìm một người giúp việc và tuyển dụng Nassi, &nbsp;bạn gái cũ của Hyun Woo . Mẹ kế Hyun Woo đối xử với cô ấy như con của mình. Mỗi đêm, anh ấy tưởng tượng quan hệ tình dục với mẹ kế của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/song-cung-me-ke-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/song-cung-me-ke-poster.jpg', '2024-02-10 18:07:10', 8, '', 90, 4),
(254, 'Làm Tình', 'Mate', 2022, '<p>Min-hyeok và Sang-mi là một cặp từ thời trung học. Họ chưa bao giờ quan hệ tình dục cho đến khi họ trưởng thành. Min-hyeok hay tưởng tượng khi xem video khiêu dâm. Min-hyeok đã sẵn sàng và quyết định yêu cầu Sang-mi quan hệ tình dục lần đầu tiên. Tuy nhiên, Sang-mi không muốn lần đầu là với Min-hyeok. Cô nghĩ đó sẽ là một trải nghiệm khó quên kể từ khi họ yêu nhau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/lam-tinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/lam-tinh-poster.jpg', '2024-02-10 18:07:13', 8, '', 90, 1),
(255, 'Tiếng Động Lạ Từ Nhà Em Gái Hàng Xóm', 'Jumped At The Sound Of The Girl Next Door', 2019, '<p>Anh ấy là một doanh nhân thành đạt, chính vì thế với sự giàu có của anh ta, anh đã chịch được rất nhiều em gái mới lớn non tơ…cùng nghe anh ta kể về câu chuyện tình dục của cuộc đời mình nào.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tieng-dong-la-tu-nha-em-gai-hang-xom-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tieng-dong-la-tu-nha-em-gai-hang-xom-poster.jpg', '2024-02-10 18:11:15', 8, '', 61, 0),
(257, 'Phúc Nhị Đại', 'Regenerate', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/phuc-nhi-dai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phuc-nhi-dai-poster.jpg', '2024-02-10 18:11:19', 8, '', 1336, 0),
