(259, 'Mỹ Hầu Vương: Thật Giả Tôn Ngộ Không', 'The Monkey King: The True Sun Wukong', 2019, '<p>Hai con linh hầu ở Hoa Quả Sơn vốn là huynh đệ thân thiết. Lục Nhĩ vô tình gặp được Long Như Ý và có được chuỗi tràng hạt. Vì tìm phép thuật bảo vệ Hoa Quả Sơn, chúng không quản đường sá xa xôi đến Thiên Trụ, gặp lại Long Như Ý. Lục Nhĩ bị xà yêu dẫn dụ, giết chết Lão Hầu khiến huynh đệ trở mặt. Tiểu Long Nữ không tuân theo thiên quy bị thiên đình trừng phạt hoá thành Định Hải Thần Châm. Hầu Cát được Bồ Tát cảm hoá, bảo vệ Đường Tăng đi Tây Thiên thỉnh kinh. Khi Hầu Cát bị sư phụ đuổi đi, Lục Nhĩ nhân cơ hội này trà trộn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/my-hau-vuong-that-gia-ton-ngo-khong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/my-hau-vuong-that-gia-ton-ngo-khong-poster.jpg', '2024-02-10 18:11:26', 8, '', 11219, 0),
(260, 'Mùa Hè', 'My Last Summer', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/mua-he-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mua-he-poster.jpg', '2024-02-10 18:11:29', 8, '', 1305, 1),
