(262, 'Chuyện Ngoại Tình Của Cô Vợ Xinh Đẹp', '아내의 이중생활', 2021, '<p>Yoon-ju, người đã có một cuộc sống người mẫu hào nhoáng. Anh ấy kết hôn thông qua sự tán tỉnh dai dẳng của một người đàn ông giàu có, Jeong-hyeon. Mặc dù rất giàu có về tài chính nhưng Yoon-ju vẫn cô đơn hàng đêm vì người chồng bận rộn với công việc kinh doanh. Với sự giới thiệu của đàn em thân thiết Eun-jung, cô bắt đầu làm người mẫu trở lại và gặp gỡ những người đàn ông mà chồng cô không hề hay biết. Cuộc sống hai mặt của cô bắt đầu ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/chuyen-ngoai-tinh-cua-co-vo-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chuyen-ngoai-tinh-cua-co-vo-xinh-dep-poster.jpg', '2024-02-10 18:11:44', 8, '', 89, 2),
(263, 'Người Vợ Bí Mật', 'Another Wife', 2022, '<p>Eong-hoon đã chia tay mối tình đầu Seo-yeong do bị bố mẹ phản đối. Anh không còn lựa chọn nào khác ngoài việc kết hôn với Mi-na, người mà cha mẹ cô giới thiệu, và Seo-yeong tự tử vì không thể vượt qua nỗi đau chia ly. Mặc dù rất nhiều thời gian đã trôi qua, Jeong-hoon cố gắng quên Seo-yeong và rơi vào ảo tưởng rằng anh ấy đang sống với Seo-yeong, người đã qua đời vì cú sốc tình cảm. Mi-na cảm thấy khó có thể chịu đựng được hành vi của Jeong-hoon. Cô muốn tìm cớ để danh chính ngôn thuận bỏ người chồng này. Sau đó, cô đã dụ dỗ Jae-hee, một người chuyển phát nhanh, để cho Jeong-hoon gặp gỡ và thực hiện hành vi ngoại tình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-vo-bi-mat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-vo-bi-mat-poster.jpg', '2024-02-10 18:11:47', 8, '', 92, 0),
(264, 'Bạn Tình Chớp Nhoáng', '속궁합 짝꿍', 2021, '<p>Kyung-sik người thích mê tín và thường xuyên đến gặp thầy bóiđể tìm kiếm tình yêu của cuộc đời. Kyung-sik gặp một số phụ nữ, nhưng người bạn của anh ấy \'Hyo-joo\', người sống trong nhà anh ấy, anh ấy bắt đầu để mắt đến cô ấy&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/ban-tinh-chop-nhoang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ban-tinh-chop-nhoang-poster.jpg', '2024-02-10 18:11:50', 8, '', 63, 1),
(265, 'Thần Tình Dục', 'Sexy: God of Sex', 2021, '<p>Na-hee, người luôn thích Tae-seong, người luôn quan tâm và tốt bụng, lẻn vào nhà Tae-seong. Khi Tae-seong phát hiện ra rằng Na-hee và Mi-yeon thích anh ấy, hành vi của anh ấy thay đổi ngay lập tức .. Anh ấy đuổi Na-hee đi và đưa Mi-yeon, người thích anh ấy, đến nhà anh ấy. Mi-yeon, người không biết gì, chỉ thích đến nhà Tae-seong.</p>', 0, 'https://img.ophim11.cc/uploads/movies/than-tinh-duc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/than-tinh-duc-poster.jpg', '2024-02-10 18:11:58', 8, '', 62, 0),
(266, 'Cô Con Gái Riêng Xinh Đẹp Và Bố Dượng Dâm Đãng', '새아빠와 모녀', 2021, '<p>Seo, một phụ nữ thanh lịch đến từ Louisiana, đã kết hôn với một doanh nhân, Kyung-han, một doanh nhân hợm hĩnh và làm bất cứ điều gì vì tiền. Kyung-hwan có một mối quan hệ lãng mạn với Mi-yeon, người là bà chủ của quán bar, nhưng sau khi kết hôn với Seo-ra, cô ấy đã nói lời chia tay với Mi-yeon, nói rằng cô ấy sẽ sống thanh lịch như một doanh nhân. Tuy nhiên, Kyunghwan đã gặp phải một vấn đề ở chỗ khi nhìn thấy quần áo không lộ đường ống quần, ham muốn tình dục của anh ấy rất mãnh liệt và anh ấy phát điên. Một ngày nọ, con gái ruột của Seo-ra, Yoon-a, xuất hiện tại ngôi nhà mới cưới của Kyung-hwan với một chiếc váy ngắn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-con-gai-rieng-xinh-dep-va-bo-duong-dam-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-con-gai-rieng-xinh-dep-va-bo-duong-dam-dang-poster.jpg', '2024-02-10 18:11:59', 8, '', 65, 0),
