(273, 'Thiếu Niên Đột Nhiên', 'Sudden Youth', 2019, '<p>Tại bữa tiệc sinh nhật 36 tuổi, Vương Khải uống quá chén, trong mơ, anh ấy quay lại sân trường trung học của 20 năm về trước. Nơi đó có “hảo dũng đấu ngoan” Từ Tiểu Bân, “nhành cỏ quý tộc” Trương Thạc, “háo sắc tham ăn” Lưu Vũ, “nữ thần tình đầu” Tỉnh Y cùng cả “hương tan ngọc nát” Lưu Sảng. Thời gian thấm thoắt trôi qua, ký ức như càng sâu đậm, Vương Khải vẫn luôn nhớ về những con người đó.</p>', 0, 'https://img.ophim11.cc/uploads/movies/thieu-nien-dot-nhien-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thieu-nien-dot-nhien-poster.jpg', '2024-02-10 18:12:20', 8, '', 13434, 0),
(274, 'Thẩm Thành Kì Văn Lục', 'Monster Hunt', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/tham-thanh-ki-van-luc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tham-thanh-ki-van-luc-poster.jpg', '2024-02-10 18:12:24', 8, '', 1410, 0),
(275, 'Tân Phong Thần: Na Tra Náo Hải', 'Nezha Conquers the Dragon King', 2019, '<p>Thời nhà Thương thảo, Thần vị Thiên giới thiếu trống, Nhân gian ma quỷ lộng hành, Lê dân chịu vàn khổ cực. Trong đêm Trần Đường quan, Xà tinh Thạc Tị vào một hộ dân, đại khai sát giới,trong lúc cướp đi con nhỏ của nhà này, thì Lí Tịnh nghe tin xông tới, Kéo cung càn khôn bắn ba múi tên, mũi thứ ba bắn lật xà tinh, Xà tinh trọng thương độn thổ đi mất. Lí Tịnh không bắt đước xà tinh, nản lòng. Xà tinh trốn ở một chỗ trị thương ,trong lòng thù hận vô cùng , tìn thời cơ báo thù.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tan-phong-than-na-tra-nao-hai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tan-phong-than-na-tra-nao-hai-poster.jpg', '2024-02-10 18:12:27', 8, '', 13525, 1),
(276, 'Quỷ Thổi Đèn: Vu Hiệp Quan Sơn', 'Mojin', 2019, '<p>Hồ Bá Nhất,Shirley Dương.Vương mập vô tình nhiễm phải một căn bệnh chỉ có thể số 40 năm, thông qua lời mời của khảo cổ của tiến sĩ Tôn, mới biết được di tích trong làng cổ Đại Tiên, có thuốc giải độc,vì có thuốc giải ba người tham gia vào nhóm mạo hiểm vào núi, trải qua bai nhiêu mạo hiểm mới phát hiện ra âm mưu của giáo sư Tôn, sau chiến đấu nhóm ba người mới thoát ra được.</p>', 0, 'https://img.ophim11.cc/uploads/movies/quy-thoi-den-vu-hiep-quan-son-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quy-thoi-den-vu-hiep-quan-son-poster.jpg', '2024-02-10 18:12:34', 8, '', 12024, 1),
(277, 'Bão Trắng 3: Thiên Đàng Hay Địa Ngục', 'The White Storm 3: Heaven or Hell', 2023, 'Quách Phú Thành, Cổ Thiên Lạc cùng truy quét ông trùm hàng tr.ắ.ng Lưu Thanh Vân cực căng từ Hongkong đến lãnh địa chất cấm vùng Tam Giác Vàng. Câu chuyện càng lắt léo khi cảnh sát chìm lại được Trùm hàng tr.ắ.ng cứu mạng, liệu kẻ nào sẽ đổi phe?', 0, 'https://img.ophim11.cc/uploads/movies/bao-trang-3-thien-dang-hay-dia-nguc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bao-trang-3-thien-dang-hay-dia-nguc-poster.jpg', '2024-02-10 18:12:45', 8, 'https://www.youtube.com/watch?v=jhx-vpcgkMM', 125, 0),
(278, 'Cô Người Mẫu LiveStream', '친구커플 떡칠때 옆에서 생중계', 2022, '<p>kể về cô gái xinh đẹp dễ thương đang tiến hành Live video của mình khi cô đang làm điều đó.</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-nguoi-mau-livestream-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-nguoi-mau-livestream-poster.jpg', '2024-02-10 18:17:15', 8, '', 56, 0),
(279, 'Hương Vị Của Chị Dâu Xinh Đẹp', '내로남불2:형수는 내 여자', 2022, '<p>Dong-jin, người điều hành một công ty thành công, sống trong nhà của anh trai mình, Dong-soo, và anh rể Seo-rin, người luôn thất bại. Mặc dù chồng cô là một người chồng khiêm tốn, nhưng người vợ tận tụy của anh, Seo-rin, lại mất trái tim trước Dong-jin, người đang tiếp cận cô một cách nồng nhiệt.</p>', 0, 'https://img.ophim11.cc/uploads/movies/huong-vi-cua-chi-dau-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/huong-vi-cua-chi-dau-xinh-dep-poster.jpg', '2024-02-10 18:17:18', 8, '', 92, 0),
(280, 'Em Rể Mới Lớn Và Chị Dâu Đảm Đang', '애인 2명 불륜하는 막장 유부녀', 2019, '<p>Em trai sinh đôi chưa trưởng thành thèm muốn người phụ nữ của anh trai một cách bí mật. Bạn gái của Hyung hỏi tại sao hôm nay anh làm tốt hơn ... Một mối quan hệ bí mật giữa hai người bắt đầu.</p>', 0, 'https://img.ophim11.cc/uploads/movies/em-re-moi-lon-va-chi-dau-dam-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/em-re-moi-lon-va-chi-dau-dam-dang-poster.jpg', '2024-02-10 18:17:21', 8, '', 61, 1),
(281, 'Cô Vợ Xinh Đẹp Và Đồng Nghiệp Của Chồng', '남편 몰래 오빠들 빨아 주는 어린 와이프', 2022, '<p>Yeong-joon yêu một người phụ nữ bí ẩn tên là Seo-ra đã thành công trong việc thay đổi quá khứ bằng cách đến thăm một người phụ nữ có sức mạnh bí ẩn. Tuy nhiên, bây giờ cô đã kết hôn với một kẻ cho vay nặng lãi tên Cheol-jae trong quá khứ đã thay đổi. Cheol-jae sống trong cảnh bị giam cầm dưới quyền của Seo-ra và lên kế hoạch cho một tình yêu và cuộc sống mới, trong khi Yeong-jun đau đớn vì hạnh phúc của Seo-ra. Số phận của những người đàn ông và phụ nữ đã thay đổi quá khứ của họ, mở ra.</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-vo-xinh-dep-va-dong-nghiep-cua-chong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-vo-xinh-dep-va-dong-nghiep-cua-chong-poster.jpg', '2024-02-10 18:17:23', 8, '', 60, 1),
(282, 'Mối Tinh Lãng Mạng', 'Happy Ending', 2022, '<p>Yeong-joon yêu một người phụ nữ bí ẩn tên là Seo-ra đã thành công trong việc thay đổi quá khứ bằng cách đến thăm một người phụ nữ có sức mạnh bí ẩn. Tuy nhiên, bây giờ cô đã kết hôn với một kẻ cho vay nặng lãi tên Cheol-jae trong quá khứ đã thay đổi. Cheol-jae sống trong cảnh bị giam cầm dưới quyền của Seo-ra và lên kế hoạch cho một tình yêu và cuộc sống mới, trong khi Yeong-jun đau đớn vì hạnh phúc của Seo-ra. Số phận của những người đàn ông và phụ nữ đã thay đổi quá khứ của họ, mở ra.</p>', 0, 'https://img.ophim11.cc/uploads/movies/moi-tinh-lang-mang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/moi-tinh-lang-mang-poster.jpg', '2024-02-10 18:17:25', 8, '', 67, 2),
(283, 'Mối Tình Đầu Của Con Trai', 'Son\'s First Love', 2021, '<p>Sang-woo, người có mẹ kế là mối tình đầu của mình đã kể cho anh trai mình mọi thứ. Tuy nhiên, em trai Bong-soo thú nhận rằng anh biết Sang-woo ngủ với mẹ kế của họ. Ba người biết đã quan hệ với nhau liền bảo nhau cẩn thận kẻo bị bố bắt quả tang. Sang-woo gửi em trai Beacon của mình đến một phòng mát xa để dành thời gian một mình với mẹ kế Soo-ji của mình. Bong-soo, người đến phòng mát-xa, nói với So-ra, bạn gái của anh làm việc tại một cửa hàng tiện lợi đừng làm việc nữa. Sang-woo đưa Bong-soo trở về nhà.</p>', 0, 'https://img.ophim11.cc/uploads/movies/moi-tinh-dau-cua-con-trai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/moi-tinh-dau-cua-con-trai-poster.jpg', '2024-02-10 18:17:33', 8, '', 90, 0),
(284, 'Mẹ Trẻ Hồi Xuân', 'Young Mom Reboot', 2021, '<p>Min-woo, người có tiền, đánh cắp trái tim phụ nữ bằng sự giàu có và quyến rũ của mình, và ngủ với mỗi ngày một cô gái khác nhau.<br>Trong số đó có Stella, một người mẹ trẻ đã đánh cắp trái tim của Min-woo, xuất hiện ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/me-tre-hoi-xuan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/me-tre-hoi-xuan-poster.jpg', '2024-02-10 18:17:36', 8, '', 91, 0),
(285, 'Tình yêu của vua khỉ', '西游外传之爱上美猴王', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/tinh-yeu-cua-vua-khi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tinh-yeu-cua-vua-khi-poster.jpg', '2024-02-10 18:17:41', 8, '', 16, 1),
(286, 'Tiếp xúc', 'Touch', 2016, '', 0, 'https://img.ophim11.cc/uploads/movies/tiep-xuc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tiep-xuc-poster.jpg', '2024-02-10 18:17:48', 8, '', 11723, 0),
(287, 'Thôi Miên Để Thịt Em Gái Xinh Đẹp', '너도 먹고 나도 먹고 무삭제판', 2022, '<p>Một bộ phim khiêu dâm nói về những thú vui thể xác của một người đàn ông và một người phụ nữ trở thành nô lệ cho tình dục bằng phép thuật phù thủy.</p>', 0, 'https://img.ophim11.cc/uploads/movies/thoi-mien-de-thit-em-gai-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thoi-mien-de-thit-em-gai-xinh-dep-poster.jpg', '2024-02-10 18:17:53', 8, '', 91, 1),
(288, 'Hương Vị Em Gái Trẻ Tuổi Và Cô Gái Đã Kết Hôn', 'An Affair Married Woman And A Lewd Old Virgin', 2022, '<p>Người đàn ông lên xe chuẩn bị làm lễ lấy lòng bạn gái cũ sau khi kiếm được công việc ổn định sau khi bị bạn gái 7 năm ruồng bỏ vì không có việc làm ổn định . Và tôi đến ở trọ vì nghĩ rằng mình không thể tập trung vì ở nhà một mình học bài. Trong khi đó, cô chủ nhà trọ sinh ra ở nông thôn không biết gì ở tuổi 20 đã kết hôn với một người đàn ông lớn tuổi và đến Seoul, sau khi nhìn thấy một cậu học sinh trẻ tuổi xuất hiện trước mặt mình, cô đã yêu anh chàng nội trú đó. và thầm yêu cô nội trú vì thân hình và ngoại hình so với chồng lớn tuổi, cuối cùng thì tai bay vạ gió, cả hai cao chạy xa bay. Trong khi đó, người chú biết tin vợ mình đã bỏ trốn đã hét lên trong tiếng reo hò vui mừng. Nguyên nhân là do anh ta ngoại tình với bạn gái mà vợ không hề hay biết.</p>', 0, 'https://img.ophim11.cc/uploads/movies/huong-vi-em-gai-tre-tuoi-va-co-gai-da-ket-hon-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/huong-vi-em-gai-tre-tuoi-va-co-gai-da-ket-hon-poster.jpg', '2024-02-10 18:17:56', 8, '', 91, 1),
(289, 'Hai Em Gái Ghét Dùng Bao Cao Su', '2 Married Women Who Hate Condoms', 2022, '<p>Có hai người phụ nữ đang đợi một người đàn ông có cây kiếm thịt cực kì gợi cảm</p>', 0, 'https://img.ophim11.cc/uploads/movies/hai-em-gai-ghet-dung-bao-cao-su-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hai-em-gai-ghet-dung-bao-cao-su-poster.jpg', '2024-02-10 18:17:57', 8, '', 58, 4),
(290, 'Em Gái Văn Phòng', 'Women Who Really Put You In The Office', 2021, '<p>Nhân viên nữ chỉ muốn quan hệ tình dục để thỏa mãng chính mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/em-gai-van-phong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/em-gai-van-phong-poster.jpg', '2024-02-10 18:17:59', 8, '', 62, 1),
(291, 'Cô Bạn Gái Nghịch Ngợm', '음란한 여자친구', 2022, '<p>Bora đang đi dạo vui vẻ một mình. Anh thở dài khi nhận được điện thoại từ Dong-min, người luôn làm phiền anh. Cuối cùng, anh ấy gọi cho người bạn thân của mình là Woo-hyun và uống rượu với anh ấy. Woohyun thú nhận với Bora, người có vẻ ngoài khó tính, và cả hai đã uống rất nhiều và quan hệ tình dục. Woo-hyeon rất vui mừng về mối quan hệ của anh ấy với Bora, nhưng Bora đã đá anh ấy vì cô ấy xin lỗi. Trong lòng thất vọng, Woo-hyeon gọi Mi-young vì thất vọng. Mi-young bắt đầu làm việc ngay khi thấy Woo-hyun say rượu. Liệu Woohyun có vượt qua được không?</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-ban-gai-nghich-ngom-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-ban-gai-nghich-ngom-poster.jpg', '2024-02-10 18:18:03', 8, '', 64, 2),
(292, 'Con Trai Và Mẹ Kế Đảm Đang', '사위사랑은 장모님', 2022, '<p>Bố và con trai đang uống rượu ở một quán bar, trong lúc nhậu thì gọi điện cho vợ và mẹ. Bà mẹ kế mặc đồ gợi cảm đi vào, từ lâu bà đã thèm được làm tình,cậu con trai bị bà mẹ kế dâm đãng dắt đi.</p>', 0, 'https://img.ophim11.cc/uploads/movies/con-trai-va-me-ke-dam-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/con-trai-va-me-ke-dam-dang-poster.jpg', '2024-02-10 18:18:04', 8, '', 61, 0),
(293, 'Chơi Nhầm Mẹ Vợ', '만취해 넣고보니 장모님', 2022, '<p>Họ nói với vợ rằng họ sẽ đến muộn để đi ăn tối ở công ty, và họ đến nơi làm việc của nhau. Khi người đàn ông trở về nhà, anh ta cưng nựng người phụ nữ trên giường, nhưng khi đèn bật sáng, anh ta nhìn thấy mẹ vợ khỏa thân. Người đàn ông có lỗi lớn xin lỗi mẹ vợ và bước vào phòng của anh ấy...</p>', 0, 'https://img.ophim11.cc/uploads/movies/choi-nham-me-vo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/choi-nham-me-vo-poster.jpg', '2024-02-10 18:18:07', 8, '', 60, 1),
(294, 'Anh Rể Và Em Dâu Xinh Đẹp', '형부 내꺼 할래', 2022, '<p>“Tôi thích anh ấy trước và tôi biết anh rể tôi trước! Tại sao tôi luôn phải nhường nhịn em gái mình?! ” Anh ấy trở thành mối tình đầu của tôi và anh rể của tôi. Tình cờ chúng tôi yêu nhau rồi rơi vào lối mòn không rõ.Niềm hy vọng nhất thời “tôi có được không?” Đã vụt tắt trong khuôn khổ gia đình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/anh-re-va-em-dau-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/anh-re-va-em-dau-xinh-dep-poster.jpg', '2024-02-10 18:18:10', 8, '', 93, 2),
(295, 'Những Em Gái Dễ Dãi', '싸면 뭐하니? 무삭제', 2022, '<p>Woo-yeol và Miho, những người làm việc bán thời gian trong một nhà nghỉ, là một cặp vợ chồng và sống bán thời gian trong một nhà nghỉ. Tuy nhiên, Mi-ho có một cuộc gặp bí mật với Ji-sung, ông chủ, bí mật vì lợi ích của cấp trên, và Suzy, người nhìn thấy điều này, đến gặp anh ta và thông báo cho anh ta sự thật. Suzy gặp và an ủi Woo-yeol tội nghiệp, và Woo-yeol cẩn thận hỏi Mi-ho, nhưng cuối cùng quyết định tin tưởng Mi-ho và giữ bí mật mối quan hệ của cô với Ji-sung.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nhung-em-gai-de-dai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-em-gai-de-dai-poster.jpg', '2024-02-10 18:18:13', 8, '', 90, 1),
(296, 'Chăm Sóc Em Dâu Xinh Đẹp', '무삭제 대리섹스: 형수를 부탁해', 2022, '<p>Yoon-ju, người khá chủ động trong chuyện quan hệ tình dục và Jin-seok, lại là người thụ động, họ tổ chức một sự kiện tình dục đặc biệt mỗi ngày. Jinseok luôn cảm thấy như địa ngục và lo lắng về ngày hôm đó. Hye-kyung, em trai của Yoon-ju, vào nhà một lúc vì công việc, và Jin-seok cảm thấy cảm xúc kỳ lạ khi cô ấy nhìn thấy Hye-kyung. Jin-seok cũng mời anh họ Young-min vào nhà để cắt đứt quan hệ tình dục với Ji-hyeon. Jin-seok rất vui vì sự kiện quan hệ tình dục với Ji-hyeon bị giảm bớt do sự chú ý của những người khác, cố gắng chiếm được nhiều hơn người anh họ Young-min của mình. Trong khi đó, Yoon-ju không hài lòng với ham muốn của mình, đã dụ dỗ và hãm hiếp anh họ của chồng cô, Young-min. Trong khi đó, Young-min yêu Hye-kyung và cùng nhau rời khỏi nhà.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cham-soc-em-dau-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cham-soc-em-dau-xinh-dep-poster.jpg', '2024-02-10 18:18:14', 8, '', 98, 1),
(297, 'Đường Cong Của Chị Dâu', '매력적인 큰 엄마', 2022, '<p>Bộ phim về người chị dâu với những đường cong quyến rũ và cậu em trai sinh viên đại học</p>', 0, 'https://img.ophim11.cc/uploads/movies/duong-cong-cua-chi-dau-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/duong-cong-cua-chi-dau-poster.jpg', '2024-02-10 18:18:16', 8, '', 65, 0),
(298, 'Buổi Cắm Trại Với Các Em Gái Xinh Đẹp', '맛집:친구 엄마 무삭제', 2022, '<p>Một cô gái cắm trại bỏ trốn đến địa điểm cắm trại vì cô ấy mắc nợ, và vì vậy cô ấy đã đi cắm trại trong một thời gian dài. Tuy nhiên, cuộc sống của cô tại địa điểm cắm trại không hề dễ dàng. Cô lại rơi vào cảnh nợ nần do Sin Ha-seong, chủ sở hữu của khu cắm trại. Cô ấy bắt đầu làm việc chăm chỉ để kiếm tiền tại địa điểm cắm trại. Chủ sở hữu ăn cắp tiền của cô ấy và giữ chúng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/buoi-cam-trai-voi-cac-em-gai-xinh-dep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/buoi-cam-trai-voi-cac-em-gai-xinh-dep-poster.jpg', '2024-02-10 18:18:17', 8, '', 64, 1),
(299, 'Học Trò Của Vợ Tôi', '내아내의제자들', 2021, '<p>Tình trạng ốm nghén của vợ tôi trở nên tồi tệ hơn do mang thai.Vì thế học trò cũ của cô đấy đã đến giúp đỡ ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoc-tro-cua-vo-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoc-tro-cua-vo-toi-poster.jpg', '2024-02-10 18:18:20', 8, '', 60, 1),
(300, 'Chị Dâu Nguy Hiểm', '위험한 처제', 2022, '<p>Một thỏa thuận bí mật giữa người đàn ông và chị dâu sống chung với nỗi đau chia tay ... Vào lúc bình minh, chị dâu cũ của tôi đến gặp tôi và đưa ra một yêu cầu khó tin ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/chi-dau-nguy-hiem-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chi-dau-nguy-hiem-poster.jpg', '2024-02-10 18:18:26', 8, '', 64, 3),
(301, 'Chương Trình Truyền Hình Khỏa Thân', '찰진 육덕녀들의 누드 방송', 2019, '<p>Một thỏa thuận bí mật giữa người đàn ông và chị dâu sống chung với nỗi đau chia tay ... Vào lúc bình minh, chị dâu cũ của tôi đến gặp tôi và đưa ra một yêu cầu khó tin ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/chuong-trinh-truyen-hinh-khoa-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chuong-trinh-truyen-hinh-khoa-than-poster.jpg', '2024-02-10 18:18:29', 8, '', 62, 1),
(302, 'Khu Rừng Thần Bí', 'The Spiderwick Chronicles', 2008, '<p>Ngày xửa ngày xưa, khi di chuyển vào bất động sản Spiderwick chạy xuống với mẹ của họ Helen (Mary-Louise Parker), Twin Brothers Jared (Freddie Highmore) và Simon Grace (Freddie Highmore), cùng với chị gái Mallory (Sarah Bolger), thấy mình bị kéo vào một thế giới thay thế đầy các nàng tiên và các sinh vật khác. Không thể giải thích sự mất tích và tai nạn kỳ lạ dường như đang diễn ra hàng ngày, gia đình đổ lỗi cho tất cả trên Jared. Khi anh, Simon và Mallory điều tra những gì đang thực sự xảy ra, họ phát hiện ra sự thật tuyệt vời của bất động sản Spiderwick và các sinh vật cư ngụ với nó.</p>', 0, 'https://img.ophim11.cc/uploads/movies/khu-rung-than-bi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/khu-rung-than-bi-poster.jpg', '2024-02-10 18:24:08', 8, '', 0, 0),
(303, 'House of Hummingbird', 'House of Hummingbird', 2018, '<p>Seoul 1994, trong năm, cầu Seongsu sụp đổ, Eunhee 14 tuổi lang thang trong thành phố đang tìm kiếm tình yêu.</p>', 0, 'https://img.ophim11.cc/uploads/movies/house-of-hummingbird-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/house-of-hummingbird-poster.jpg', '2024-02-10 18:24:09', 8, '', 0, 0),
(304, 'Hot Summer Nights', 'Hot Summer Nights', 2017, '<p>Vào mùa hè năm 1991, một cậu bé tuổi teen trú ẩn đến tuổi trong một mùa hè hoang dã, anh ta dành cho Cape Cod trở nên giàu có từ việc bán nồi đến Bọn xã hội đen, lần đầu tiên yêu, tiệc tùng và cuối cùng nhận ra rằng anh ta đang ở trong đầu.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hot-summer-nights-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hot-summer-nights-poster.jpg', '2024-02-10 18:24:10', 8, '', 0, 0),
(305, 'Gulliver Du Ký', 'Gulliver\'s Travels', 2010, '<p>Lemuel Gulliver (Jack Black) đã làm việc trong phòng thư của một tờ báo hàng ngày New York trong mười năm qua. Sợ để đưa mình ra khỏi đó, anh coi mình là một kẻ thua cuộc, cũng như tất cả các đồng nghiệp của mình. Một ngày nọ, sau khi cuối cùng đã có đủ, anh ta quyết định tuyên bố tình yêu của mình với Darcy Silverman xinh đẹp (Amanda Peet), biên tập viên du lịch của tờ báo và một trong những người bạn duy nhất của Gulliver, chỉ để gà ra vào phút cuối và thay vào đó hãy nói với cô ấy rằng anh ta \'D thích thử tay viết một cột. Darcy chấp nhận và gửi cho anh ta một nhiệm vụ cho Tam giác Bermuda. Ở đó, Gulliver trở nên đắm tàu và kết thúc trên đảo Liliput, nơi anh cao gấp mười hai lần so với người đàn ông cao nhất. Lần đầu tiên, Gulliver có những người nhìn lên anh ta.</p>', 0, 'https://img.ophim11.cc/uploads/movies/gulliver-du-ky-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/gulliver-du-ky-poster.jpg', '2024-02-10 18:24:11', 8, '', 0, 0),
(306, 'Extra Ordinary', 'Extra Ordinary', 2019, '<p>Rose, một người hướng dẫn lái xe lớn nhất là ngọt ngào và cô đơn, phải sử dụng tài năng siêu nhiên của mình để cứu con gái của Martin (cũng chủ yếu là ngọt ngào và cô đơn) từ một ngôi sao nhạc rock rửa trôi, đang sử dụng cô ấy trong một hiệp ước satanic để thống trị sự nổi tiếng của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/extra-ordinary-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/extra-ordinary-poster.jpg', '2024-02-10 18:24:13', 8, '', 0, 0),
(307, 'Evolution', 'Evolution', 2001, '<p>Khi một thiên thạch rơi xuống trái đất hai giáo sư đại học, Tiến sĩ Ira Kane và Giáo sư Harry Phineas Block, được chỉ định công việc kiểm tra trang web. Tại trang web, họ khám phá các sinh vật không phải của hành tinh này. Chẳng mấy chốc, trang web được chính phủ tiếp quản, buộc Ira và Harry sang một bên. Khi những hình thức sống mới bắt đầu phát triển và bắt đầu ngày càng nguy hiểm, đó là hai giáo sư để cứu hành tinh.</p>', 0, 'https://img.ophim11.cc/uploads/movies/evolution-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/evolution-poster.jpg', '2024-02-10 18:24:14', 8, '', 0, 0),
(308, 'Driveways', 'Driveways', 2019, '<p>Một cậu bé cô đơn đi cùng với mẹ của mình trong một chuyến đi để dọn dẹp nhà của dì vào cuối, và cuối cùng tạo thành một tình bạn bất ngờ với người về hưu sống bên cạnh.</p>', 0, 'https://img.ophim11.cc/uploads/movies/driveways-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/driveways-poster.jpg', '2024-02-10 18:24:15', 8, '', 0, 0),
(309, 'Thir13en Ghosts', 'Thir13en Ghosts', 2001, '<p>Arthur và hai đứa con của mình, Kathy và Bobby, thừa hưởng bất động sản của chú Cyrus: một ngôi nhà thủy tinh phục vụ như một nhà tù đến 12 bóng ma. Khi gia đình, kèm theo Nanny của Bobby và một luật sư, vào nhà, họ thấy mình bị mắc kẹt trong một chiếc máy độc ác \"được thiết kế bởi ác quỷ và được cung cấp bởi người chết\" để mở mắt về địa ngục. Được đưa ra bởi Dennis, một thợ săn ma, và đối thủ của ông Kalina, một nhà hoạt động quyền ma để đặt bóng ma miễn phí, nhóm phải làm những gì họ có thể để thoát khỏi ngôi nhà còn sống</p>', 0, 'https://img.ophim11.cc/uploads/movies/thir13en-ghosts-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thir13en-ghosts-poster.jpg', '2024-02-10 18:24:16', 8, '', 0, 0),
(310, 'The Blackout', 'The Blackout', 2019, '<p>Không có thiên thạch đánh trái đất, không có những kẻ khủng bố nào đưa thế giới gặp nguy hiểm, không có chiến tranh nguyên tử nào được bắt đầu, nhưng một cái gì đó đã sai. Liên lạc giữa hầu hết các thị trấn trên trái đất đã bị cắt đứt. Một khu vực nhỏ giống như chiếc nhẫn ở Đông Âu vẫn còn điện, và thậm chí cả cuộc sống cũng được báo cáo từ không gian. Những lực lượng quân sự tìm thấy bên ngoài chiếc nhẫn đang gây sốc. Có những xác chết đã chết ở khắp mọi nơi: Trong các cửa hàng, trong ô tô, trên đường, trong các bệnh viện và trạm xe lửa. Ai hoặc những gì đang phá hủy tất cả cuộc sống trên trái đất? Lostpost cuối cùng của nhân loại sẽ tồn tại bao lâu?</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-blackout-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-blackout-poster.jpg', '2024-02-10 18:24:18', 8, '', 0, 0),
(311, 'The Basketball Diaries', 'The Basketball Diaries', 1995, '<p>Bộ phim chuyển thể của đường phố Jim Carroll khó khăn về phong cách vạn hoa miễn phí rơi vào thế giới nghiện ma túy. Là một thành viên của một đội bóng rổ trường trung học dường như bất bại, giữa cuộc sống của Jim xung quanh sân bóng rổ và tòa án trở thành một phép ẩn dụ cho thế giới trong tâm trí anh ta. Một người bạn tốt nhất đang chết vì bệnh bạch cầu, một huấn luyện viên (\"Swifty\"), người có những pha tự do không thể chấp nhận được với các chàng trai trong đội của mình, Angst tình dục tuổi teen và một sự thèm ăn không lành mạnh cho heroin - tất cả những điều này bắt đầu lấn chiếm giấc mơ của Jim Jim Trở thành một ngôi sao bóng rổ. Chẳng mấy chốc, những con đường tối của New York trở thành nơi ẩn náu từ mối quan tâm gắn kết của mẹ mình đối với con trai mình. Anh ta không thể về nhà và lối thoát duy nhất của anh ta khỏi thực tế trên đường phố là heroin mà anh ta đánh cắp, cướp và gái dâm. Chỉ với sự giúp đỡ của Reggie, một người bạn hàng xóm lớn tuổi mà Jim \"đã chọn một trò chơi\" ngay bây giờ và sau đó, anh ta có thể bắt đầu cuộc hành trình dài trở lại Sanity.</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-basketball-diaries-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-basketball-diaries-poster.jpg', '2024-02-10 18:24:19', 8, '', 0, 0),
(312, 'Sayonara', 'Sayonara', 1957, '<p>Major Lloyd Gruver, một cuộc chiến tranh Chiến tranh Triều Tiên được phân công lại với Nhật Bản, ủng hộ sự phản đối của quân đội đối với các cuộc hôn nhân giữa quân đội Mỹ và phụ nữ Nhật Bản. Nhưng đó là trước khi Gruver trải nghiệm một tình yêu thách thức những định kiến thành công sâu sắc của mình ... và lao vào anh ta vào xung đột với lực lượng không quân Hoa Kỳ và những điều cấm kị văn hóa của Nhật Bản.</p>', 0, 'https://img.ophim11.cc/uploads/movies/sayonara-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sayonara-poster.jpg', '2024-02-10 18:24:20', 8, '', 0, 0),
(313, 'Sát Thủ Kiểu Mỹ', 'American Assassin', 2017, '<p>Hai mươi mitch ba tuổi đã mất cha mẹ vào một tai nạn xe hơi bi thảm ở tuổi mười bốn, và bạn gái của anh ta để một cuộc tấn công khủng bố giống như họ đã tham gia. Tìm kiếm sự trả thù, anh ta bị Phó Giám đốc CIA nhập ngũ Irene Kennedy là một tuyển dụng Black Ops. Kennedy sau đó phân công cựu chiến binh lạnh lùng Stan Hurley để đào tạo Mitch. Họ cùng nhau sẽ điều tra một làn sóng các cuộc tấn công ngẫu nhiên rõ ràng vào các mục tiêu quân sự và dân sự. Việc phát hiện ra một mô hình trong bạo lực dẫn họ đến một nhiệm vụ chung với một đại lý Thổ Nhĩ Kỳ gây chết người để ngăn chặn một ý định hoạt động bí ẩn khi bắt đầu một cuộc chiến tranh thế giới ở Trung Đông.</p>', 0, 'https://img.ophim11.cc/uploads/movies/sat-thu-kieu-my-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sat-thu-kieu-my-poster.jpg', '2024-02-10 18:24:22', 8, '', 0, 0),
(314, 'Polaroid', 'Polaroid', 2019, '<p>Polaroid được tạo kiểu trong tĩnh mạch của chiếc nhẫn và điểm đến cuối cùng và trung tâm trên một cô đơn trường trung học, Bird Fitcher, người vấp ngã trên một máy ảnh Polaroid cổ điển. Chim sớm biết rằng máy ảnh chứa một bí mật khủng khiếp: bất cứ ai có hình ảnh của họ được chụp bởi nó gặp một kết thúc bi thảm và bạo lực. Cô gái và những người bạn của cô phải sống sót sau một đêm nữa khi họ chạy đua để giải quyết bí ẩn của Polaroid bị ma ám trước khi nó giết chết tất cả.</p>', 0, 'https://img.ophim11.cc/uploads/movies/polaroid-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/polaroid-poster.jpg', '2024-02-10 18:24:23', 8, '', 0, 0),
(315, 'Pinocchio', 'Pinocchio', 2019, '<p>Sáng tạo múa rối của Goodcarver Geoppetto, Pinocchio, kỳ diệu đến với cuộc sống với những giấc mơ trở thành một cậu bé thực sự. Dễ dàng dẫn dắt Astray, Pinocchio giảm xuống từ một sai lầm này sang một sai lầm khác khi anh ta bị lừa, bị bắt cóc và đuổi theo tên cướp.</p>', 0, 'https://img.ophim11.cc/uploads/movies/pinocchio-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/pinocchio-poster.jpg', '2024-02-10 18:24:24', 8, '', 0, 0),
(316, 'Pandemic', 'Pandemic', 2009, '<p>Tsuyoshi Matsuoka, một bác sĩ tại một bệnh viện Tokyo, đã chẩn đoán căn bệnh của bệnh nhân như một cái lạnh thông thường. Nhưng sau cái chết đột ngột của bệnh nhân, anh ta nhận ra rằng bệnh rất nghiêm trọng, có thể tạo ra một dân số tuyệt chủng, vì vậy anh ta vật lộn để tìm ra nguyên nhân gây bệnh với bác sĩ Eiko Kobayashi</p>', 0, 'https://img.ophim11.cc/uploads/movies/pandemic-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/pandemic-poster.jpg', '2024-02-10 18:24:25', 8, '', 0, 0),
(317, 'Nữ Thần Rắn 2', 'Nakee 2', 2018, '<p>Một thám tử mới đã được gửi đến để điều tra các sự kiện bất thường ở một ngôi làng nông thôn ở phía đông bắc Thái Lan được cho là có liên quan đến con rắn khổng lồ huyền thoại tên là Nakee.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nu-than-ran-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nu-than-ran-2-poster.jpg', '2024-02-10 18:24:27', 8, '', 0, 0),
(318, 'Nguồn Nước Chết', 'Deranged', 2012, '<p>Jae-hyuk là một người đàn ông bình thường ở độ tuổi 40. Ông làm việc như một nhân viên y tế vật nuôi và bị bác sĩ rắc rối cả ngày. Anh trai Jae-Pil là một thám tử không phải là tất cả những gì quan tâm đến an toàn công cộng và dành phần lớn thời gian rên rỉ về thị trường chứng khoán. Việc phát hiện ra một loạt các cơ thể động cơ nổi, khủng khiếp trên khắp đất nước gây bệnh cuồng loạn. Ủy viên cảnh sát bị băn khoăn khi thấy cảnh quay CCTV của những người nhảy vào nước như thể họ bị chiếm hữu, và chìm đắm mình. Thời gian trôi qua và hàng trăm trường hợp tương tự được báo cáo, khiến các quan chức bị bối rối về nguyên nhân của cái chết. Chính phủ tuyên bố một trường hợp khẩn cấp quốc gia. Jae-POL tham gia cuộc điều tra lớn và gặp thị trưởng của một thị trấn nhỏ tuyên bố rằng ông đã chứng kiến ​​một số người đàn ông trong đồng phục làm việc đổ những con chó bị nhiễm vào suối và nhận ra rằng có một âm mưu đằng sau ổ dịch. Trong khi đó, vợ và con của Jae-hyuk đang thể hiện các triệu chứng giống như các nạn nhân, dẫn đến một cuộc tìm kiếm y học điên cuồng. Thông qua Jae-PIL, anh ta biết về một nhà kho chứa một phương pháp chữa trị tiềm năng trong hàng ngàn và hàng ngàn liều và đầu không có ý tưởng về những gì anh ta hướng vào</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguon-nuoc-chet-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguon-nuoc-chet-poster.jpg', '2024-02-10 18:24:28', 8, '', 0, 0),
(319, 'Tuyên Ngôn Dôc Thân', 'How to Be Single', 2016, '<p>Có một cách đúng đắn để độc thân, một cách sai lầm để độc thân, và sau đó ... có Alice. Và robin. Lucy. Meg. Tom. David. Thành phố New York đầy những trái tim cô đơn đang tìm kiếm trận đấu phù hợp, hãy là một kết nối tình yêu, một cái móc, hoặc một cái gì đó ở giữa. Và một nơi nào đó giữa các văn bản trêu chọc và khán đài một đêm, những gì mà tất cả những người chưa kết hôn này đều có nhu cầu học cách độc thân trong một thế giới chứa đầy các định nghĩa mãi mãi về tình yêu. Ngủ xung quanh trong thành phố mà không bao giờ ngủ không bao giờ là rất nhiều niềm vui.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tuyen-ngon-doc-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tuyen-ngon-doc-than-poster.jpg', '2024-02-10 18:24:29', 8, '', 0, 0),
(321, 'Vùng Đất Quỷ Dữ: Báo Thù', 'Resident Evil: Retribution', 2012, '<p>Alice thức dậy ở nhà với con gái Becky và chồng. Nhưng chẳng mấy chốc, cô nhận ra rằng cô thực sự đang ở trong một cơ sở ngầm của Tập đoàn Ô dù. Ra khỏi màu xanh, hệ thống an ninh máy tính tắt và Alice chạy trốn đến phòng điều khiển trung tâm của cơ sở. Cô gặp Ada Wong, người làm việc với Albert Wesker, và cô biết rằng một đội ngũ năm người đã được Wesker gửi đến để giải cứu họ. Tuy nhiên, nữ hoàng màu đỏ gửi Jill Valentine và Rain để săn lùng chúng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vung-dat-quy-du-bao-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vung-dat-quy-du-bao-thu-poster.jpg', '2024-02-10 18:24:32', 8, '', 0, 0),
(322, 'Vùng Đất Quỷ Dữ: Tuyệt Diệt', 'Resident Evil: Extinction', 2007, '<p>Nhiều năm sau thảm họa thành phố gấu trúc, Alice tự mình; Nhận thức được rằng cô ấy đã trở thành một trách nhiệm và có thể gây nguy hiểm cho những người xung quanh, cô ấy đang vật lộn để sống sót và đưa xuống tập đoàn ô do Sinister Albert Wesker và nghiên cứu trưởng của Tiến sĩ Isaacs lãnh đạo. Trong khi đó, đi qua sa mạc Nevada và tàn tích của Las Vegas, Carlos Olivera, LJ và những người sống sót mới K-Mart, Claire Redfield và Y tá Betty phải chiến đấu để tồn tại sự tuyệt chủng đối với lũ zombie, những con quạ giết người và những sinh vật đáng kinh ngạc nhất được tạo ra là kết quả của T-Virus chết chóc đã giết chết hàng triệu người.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vung-dat-quy-du-tuyet-diet-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vung-dat-quy-du-tuyet-diet-poster.jpg', '2024-02-10 18:24:33', 8, '', 0, 0),
(323, 'Vùng Đất Quỷ Dữ: Khải Huyền', 'Resident Evil: Apocalypse', 2004, '<p>Alice thức tỉnh từ một giấc ngủ khủng khiếp để tìm thấy nỗi sợ hãi tồi tệ nhất của cô đã nhận ra - sự bất tử khát máu, mà cô và đội quân của quân đội ưu tú hiện đang chiến đấu để tiêu diệt, đã được tung ra thành phố bao quanh cơ sở bí mật của Tổng công ty Umbrella. Khám phá cô là một thí nghiệm ô, Alice đã được tăng cường sinh học với những điểm mạnh, cảm giác và khéo léo mới - và cô sẽ cần chúng. Ở trung tâm của thành phố Raccoon bị tàn phá, một nhóm nhỏ những người không bị nhiễm bệnh, bao gồm Jill Valentine, một thành viên bị hạ cấp gần đây của nhóm dịch vụ cứu hộ và chiến thuật đặc biệt ưu tú của thành phố Raccoon, và Cán bộ an ninh của Tập đoàn Ô tô Carlos Oliveira, chiến đấu với cuộc sống của họ chống lại một bầy đàn Undead và những liếm Deadlier và nhanh hơn. Chạy ra khỏi may mắn và tài nguyên, nhóm được Alice giải cứu, và họ bắt đầu đánh một trận chiến thú vị để sống sót và trốn thoát trước khi tập đoàn ô bị xóa thử nghiệm từ mặt đất. Hy vọng duy nhất của họ nằm ở đâu đó trong thành phố Raccoon - Tiến sĩ Charles Ashford, một trong những nhà khoa học hàng đầu cho Tập đoàn Umbrella, sẽ giúp Alice và những người khác thoát khỏi thành phố một cách an toàn - nếu họ tìm thấy con gái mình. Angie Ashford trở nên tách biệt khỏi cha cô và bây giờ trốn trong sợ hãi. Alice, Jill và Carlos sẽ phải chiến đấu theo cách của họ thông qua một đội quân Undead để cứu cô. Tất cả những gì, một nemesis có tên mã vũ khí bí mật đã được thay đổi thử nghiệm với những sửa đổi lớn hơn Alice và đã được lập trình để theo dõi và tiêu diệt chúng. Họ sẽ cần tất cả những điểm mạnh và kỹ năng của họ để chiến đấu với trận chiến cuộc sống của họ chống lại cái ác vô tâm đã lây nhiễm vào thành phố và các lực lượng mạnh mẽ giải phóng nó trên nhân loại.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vung-dat-quy-du-khai-huyen-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vung-dat-quy-du-khai-huyen-poster.jpg', '2024-02-10 18:24:34', 8, '', 0, 0),
(324, 'Ánh Sáng Đô Thị', 'City Lights', 1931, '<p>Một tramp rơi vào tình yêu với một cô gái mù xinh đẹp. Gia đình cô gặp rắc rối về tài chính. Tình bạn trong và ngoài của Tramp với một người đàn ông giàu có cho phép anh ta trở thành ân nhân và người cầu hôn của cô gái.</p>', 0, 'https://img.ophim11.cc/uploads/movies/anh-sang-do-thi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/anh-sang-do-thi-poster.jpg', '2024-02-10 18:24:35', 8, '', 0, 0),
(325, 'Đêm Chơi Nhớ Đời', 'Game Night', 2018, '<p>Cặp vợ chồng cạnh tranh kết hôn Max và Annie đang cố gắng sinh con, nhưng những nỗ lực của họ không thành công do sự căng thẳng của Max xung quanh cảm giác không thỏa đáng khi so sánh với anh trai thành công, hấp dẫn của anh Brooks. Trong đêm trò chơi cuối tuần thường xuyên của Max và Annie với bạn bè của họ Ryan và vợ chồng Kevin và Michelle, Brooks xuất hiện Max bằng cách đến một Corvette Stingray (chiếc xe mơ ước của Max) và chia sẻ một câu chuyện thời thơ ấu đáng xấu hổ về Max. Brooks cung cấp để tổ chức đêm trò chơi tiếp theo tại một ngôi nhà mà anh ta thuê trong khi anh ta ở trong thị trấn. Trong khi đó, Max và Annie đang cố gắng giữ bí mật đêm trò chơi của họ từ người hàng xóm Gary, một sĩ quan cảnh sát khó xử sau khi ly hôn từ người bạn của họ Debbie ..</p>', 0, 'https://img.ophim11.cc/uploads/movies/dem-choi-nho-doi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dem-choi-nho-doi-poster.jpg', '2024-02-10 18:24:37', 8, '', 0, 0),
(326, 'Tan Vỡ 2006', 'The Break-Up', 2006, 'Sau khi cãi nhau một trận ầm ĩ, Brooke quyết định chia tay với người bạn trai Gary của mình, nhưng dù vậy cả hai người không ai chịu rời khỏi căn hộ họ đã thuê chung với nhau. Brooke và Gary từ đó bắt đầu một cuộc chiến ngầm nhằm đuổi đối phương ra khỏi nhà, nhưng rồi sau đó họ nhận ra những điều họ làm là để giữ lại người kia cho mình hơn là căn nhà.', 0, 'https://img.ophim11.cc/uploads/movies/tan-vo-2006-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tan-vo-2006-poster.jpg', '2024-02-11 02:55:02', 8, 'https://www.youtube.com/watch?v=SfTaJUh3_J4', 106, 0),
(327, 'Nature\'s Great Events', 'Nature\'s Great Events', 2009, 'Documentary series looking at the most dramatic wildlife spectacles on our planet, showing how life responds to natural events which can dramatically transform entire landscapes.', 1, 'https://img.ophim11.cc/uploads/movies/natures-great-events-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/natures-great-events-poster.jpg', '2024-02-11 02:55:07', 8, 'https://www.youtube.com/watch?v=KLZcAAparsw', 49, 0),
(328, 'David Attenborough\'s Rise of Animals: Triumph of the Vertebrates', 'David Attenborough\'s Rise of Animals: Triumph of the Vertebrates', 2013, 'David Attenborough embarks on a remarkable 500 million-year journey revealing the extraordinary group of animals that dominate our world, and how their evolution defines our human bodies.', 1, 'https://img.ophim11.cc/uploads/movies/david-attenboroughs-rise-of-animals-triumph-of-the-vertebrates-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/david-attenboroughs-rise-of-animals-triumph-of-the-vertebrates-poster.jpg', '2024-02-11 02:55:10', 8, '', 60, 0),
(329, 'Cáo Tinh Ranh', 'The Artful Dodger', 2023, '<p>Vào những năm 1850 ở Úc, tại thuộc địa sôi động Port Victory, Jack Dawkins hay còn gọi là The Artful Dodger, đã chuyển những ngón tay nhanh nhẹn của mình như một kẻ móc túi sang những ngón tay nhanh nhẹn điêu luyện của một bác sĩ phẫu thuật. Quá khứ của Dodger quay trở lại ám ảnh anh khi Fagin xuất hiện, lôi kéo anh trở lại thế giới tội phạm. Một mối đe dọa lớn hơn - đối với trái tim của Dodger - là Lady Belle, con gái của Thống đốc, quyết tâm trở thành nữ bác sĩ phẫu thuật đầu tiên của thuộc địa.</p>', 1, 'https://img.ophim11.cc/uploads/movies/the-artful-dodger-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-artful-dodger-poster.jpg', '2024-02-11 02:55:12', 8, 'https://www.youtube.com/watch?v=kKkqiSZv8D8', 49, 8);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(330, 'Trò Chơi Sinh Tử', 'Death\'s Game', 2023, '<p>Bộ phim khắc họa câu chuyện về một nhân vật bắt đầu cuộc sống mới bằng cái chết.</p>', 1, 'https://img.ophim11.cc/uploads/movies/deaths-game-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/deaths-game-poster.jpg', '2024-02-11 02:55:15', 8, '', 60, 8),
(331, 'Ngoại Cảm Ngàn Sao', 'Stardust Telepath', 2023, 'Konohoshi Umika là một nữ sinh trung học không giỏi giao tiếp với mọi người.\n\nMột ngày nọ, cô gặp Akeuchi Yu, một cô bé tự xưng là người vũ trụ, hứa với cô sẽ cùng cô hướng tới vũ trụ.\n\nSau đó họ gặp lớp phó Takaragi Haruno và Raimon Matataki, một cô bé không chịu đến trường.\n\nMột câu chuyện về tuổi thanh xuân về các nữ sinh chế tạo tên lửa và hướng tới vũ trụ.', 1, 'https://img.ophim11.cc/uploads/movies/ngoai-cam-ngan-sao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ngoai-cam-ngan-sao-poster.jpg', '2024-02-11 02:55:21', 8, 'https://www.youtube.com/watch?v=3b2zD_CcAao', 24, 0),
(332, '100 cô bạn gái yêu bạn rất rất rất rất rất nhiều', 'The 100 Girlfriends Who Really, Really, Really, Really, REALLY Love You', 2023, 'Rentaro Aijo đã trải qua 100 lần thất tình hồi còn học sơ trung. Khi vừa lên cao trung, cậu đã đến một đền thờ và ước rằng \"tôi muốn có người yêu\". Thần tình yêu xuất hiện và phán rằng \"tại cao trung, con sẽ gặp được 100 người định mệnh của mình\". Tuy nhiên, theo vị thần, những người gặp một nửa định mệnh của mình phải yêu nhau và cảm thấy hạnh phúc, bằng không họ sẽ chết. Gặp gỡ liên tiếp những con người định mệnh của mình, Rentaro sẽ làm thế nào đây? Điều gì sẽ đến với 100 cô bạn gái của cậu?', 1, 'https://img.ophim11.cc/uploads/movies/100-co-ban-gai-yeu-ban-rat-rat-rat-rat-rat-nhieu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/100-co-ban-gai-yeu-ban-rat-rat-rat-rat-rat-nhieu-poster.jpg', '2024-02-11 02:55:25', 8, 'https://www.youtube.com/watch?v=ls2VNcSifi4', 24, 0),
(333, 'Sự Trỗi Dậy Của Khiên Hiệp Sĩ (Phần 3)', 'The Rising of the Shield Hero Season 3', 2023, '<p>Iwatani Naofumi bị triệu hồi vào thế giới song song cùng với 3 thằng đực rựa khác. Mỗi đứa đều được trang bị 4 thanh Huyền Khí khi được triệu hồi, Naofumi được nhận Huyền Thuẫn. Tiếc cái ở cái thế giới này lại tôn thờ Tam Đại Thánh Khí (chém đó) bao gồm Thương, Cung, Kiếm và tất nhiên Khiên lại được cho là thứ tà giáo. Naofumi vừa được triệu hồi sẽ phải đối mặt với sự phản bội, sự tàn bạo, sự chà đạp,... của chính những kẻ gọi là con người ở đây. Liệu Naofumi sẽ chấp nhận cuộc sống không bằng người đó hay sẽ đứng dậy luyện khí bứt phá đập chết tụi nó?</p>', 1, 'https://img.ophim11.cc/uploads/movies/su-troi-day-cua-khien-hiep-si-phan-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/su-troi-day-cua-khien-hiep-si-phan-3-poster.jpg', '2024-02-11 02:55:30', 8, 'https://www.youtube.com/watch?v=rKnyi3TRznA', 24, 0),
(334, 'CON GÁI TÔI ĐÃ ĐẾN THỦ ĐÔ VÀ TRỞ THÀNH MẠO HIỂM GIẢ HẠNG S', '冒険者になりたいと都に出て行った娘がＳランクになってた', 2023, 'Sau khi mất chân lúc còn là một tân mạo hiểm gia, ông đã nghỉ hưu, trở về quê hương của mình ở nông thôn. Làm những việc như thu thập dược thảo, tiêu diệt ma thú và dã thú, giúp đỡ công việc đồng án của dân làng, thật khó để quyết định nên gọi nhân vật chính của chúng ta là một nhà mạo hiểm hay một người tháo vác nữa. Và cứ làm như thế cho đến khi ông gần 30 tuổi.\n\nMột ngày nọ, trong khi lên núi để tìm thảo dược, anh phát hiện ra một đứa trẻ bị bỏ rơi. Tự nhủ bản thân không thể bỏ mặc đứa bé, anh mang nó về nhà và nuôi nấng nó cho đến tuổi bốn mươi.\n\nĐứa con gái trưởng thành của anh giờ cũng muốn trở thành một mạo hiểm giả, nhờ dõi theo cha mình từ nhỏ đến giờ. Mặc dù cha cô đã dạy cô kiếm thuật để tự vệ khi còn nhỏ, nhưng tài năng của cô quả thật rất ấn tượng. Nghĩ rằng sẽ tốt hơn nếu cô ấy không bị mắc kẹt ở làng quê này trong suốt quãng đời còn lại của mình, nhân vật chính của chúng ta đã gửi cô ấy đến hội mạo hiểm giả ở thủ đô.\n\nCon gái ông chính thức trở thành một mạo hiểm giả.\n\nSau năm năm, nhân vật chính, hiện nay ở tuổi bốn mươi, vẫn đóng vai trò là một cựu mạo hiểm giả ở vùng nông thôn. Tuy nhiên, con gái của anh bây giờ là một mạo hiểm giả hạng S nổi tiếng và vẫn chưa trở về nhà được một lần nào…\n\n“Khi nào tôi mới được gặp lại cha đây… !?”', 1, 'https://img.ophim11.cc/uploads/movies/con-gai-toi-da-den-thu-do-va-tro-thanh-mao-hiem-gia-hang-s-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/con-gai-toi-da-den-thu-do-va-tro-thanh-mao-hiem-gia-hang-s-poster.jpg', '2024-02-11 02:55:33', 8, '', 24, 0),
(335, 'Vương Phi Tiến Công', 'Attack On! Princess', 2023, 'Vu nữ Thái Kê Tô Mộ Yên là hậu duệ của Vu tộc Bắc Lương. Theo khế ước của hoàng thất và Vu tộc, cô được ban hôn cho Cửu hoàng tử Phong Lạc Thần, người tuy không được trọng dụng nhưng lại có cơ thể thuần dương. Mặc dù trước đó ba vị vương phi mà Phong Lạc Thần đã cưới về đều không rõ tung tích, đồn rằng cả ba đều bị Phong Lạc Thần sát hại. Vì để mở linh căn nên Tô Mộ Yên đã đi cứu người trong lòng của mình bị giam ở Nam Dương, Bát vương gia Phong Khải Ngọc, cùng Sát thần vương gia bắt đầu một cuộc hôn nhân khế ước. Dựa vào Vu thuật lung tung lộn xộn của mình và tấm lòng chân thành, Tô Mộ Yên dần dần bắt được Phong Lạc Thần, dần dần rung động với y, làm sáng tỏ âm mưu xoay xung quanh y. Hai người đều là những người bị ghét bỏ trong thế giới của mình, cứu chuộc lấy nhau. Chàng gọi ta thức tỉnh, ta đưa chàng lên ngôi.', 1, 'https://img.ophim11.cc/uploads/movies/vuong-phi-tien-cong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vuong-phi-tien-cong-poster.jpg', '2024-02-11 02:55:34', 8, '', 10, 0),
(336, 'Chỉ Là Quan Hệ Ly Hôn', 'Crush on My Ex-Husband', 2023, 'Trong thời gian hòa giải ly hôn, cuộc hôn nhân hào môn vốn đã tan vỡ, nhưng vì người vợ Khương Thi Thi bỗng dưng tỉnh ngộ, bắt đầu con đường trả thù vừa chống lại người thảo mai vừa diệt trừ âm mưu, Kỳ Quân Dạ đã cảm nhận được sức hấp dẫn khác biệt của vợ mình. Hai người bắt tay nhau lật đổ vai phản diện, diễn một vở tổng giám đốc bá đạo theo đuổi vợ yêu, cuối cùng nối lại duyên xưa.', 1, 'https://img.ophim11.cc/uploads/movies/chi-la-quan-he-ly-hon-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chi-la-quan-he-ly-hon-poster.jpg', '2024-02-11 02:55:38', 8, '', 10, 4),
