(348, 'Reacher (Phần 1)', 'Reacher (Season 1)', 2022, '<p>Jack Reacher đã bị bắt vì tội giết người và bây giờ cảnh sát cần sự giúp đỡ của anh ta. Dựa trên những cuốn sách của Lee Child.</p>', 1, 'https://img.ophim11.cc/uploads/movies/reacher-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/reacher-phan-1-poster.jpg', '2024-02-11 05:52:06', 8, 'https://www.youtube.com/watch?v=GSycMV-_Csw', 55, 0),
(349, 'Thử thách Trò chơi con mực', 'Squid Game: The Challenge', 2023, '<p>Bước vào thế giới của \"Trò chơi con mực\", 456 người chơi thực thử thách các kỹ năng và cá tính của họ trong cuộc cạnh tranh khó khăn để giành giải thưởng đổi đời 4,56 triệu USD.</p>', 1, 'https://img.ophim11.cc/uploads/movies/thu-thach-tro-choi-con-muc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thu-thach-tro-choi-con-muc-poster.jpg', '2024-02-11 05:52:09', 8, 'https://www.youtube.com/watch?v=O61C8zc8Znk', 50, 1),
(350, 'Tam Thập Lục Kỵ', 'Thirty Six Cavalry ', 2023, '<p>Câu chuyện xảy ra vào thời Hán Minh đế, vì chuyện huynh trưởng gánh tội thay cha mà huynh muội Ban Siêu, Ban Chiêu đi đến Lạc Dương. Ở nơi đó, Ban Siêu dùng mưu trí cứu huynh trưởng đại náo đài Du Dã, cuối cùng nhận yến phù của Hán Minh đế chuẩn bị đi sứ Tây Vực. Ban Siêu tập hợp người tài ba dị sĩ lập thành đoàn đi về phía tây, đồn thời triển khai trận chiến thành Y Ngô. Sau đó, tam thập lục kỵ chia cách đại quân Đậu Cố ở Y Ngô, quân hán hướng về phía bắc công thành phá trại, tam thập lục kỵ hướng về phía nam phạt giao phạt mưu.</p>', 1, 'https://img.ophim11.cc/uploads/movies/tam-thap-luc-ky-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tam-thap-luc-ky-poster.jpg', '2024-02-11 05:52:10', 8, '', 25, 0),
