(371, 'Đấu Phá Thương Khung: Thức Tỉnh', 'Fights Break Sphere', 2023, '<p>Tiêu Viêm (Mã Bá Khiên đóng) là con trai thứ ba của một trong ba gia tộc lớn nhất thành Ô Thản, vì đấu khí không cao mà trở thành trò cười của mọi người. Khi bị đại đệ tử của Vân Lam Tông là Nạp Lan Yên Nhiên (Cận Dương Dương đóng) hủy hôn, Tiêu Viêm không chịu được sự sỉ nhục đã lập ra giao hẹn ba năm với Yên Nhiên, ba năm sau sẽ tỷ thí để quyết định hôn ước. Để nâng cao đấu khí, Tiêu Viêm đã đến rặng núi ma thú, kết bạn với Tiểu Y Tiên (Từ Y đóng), nhưng rồi cũng bị vướng vào trận tranh chấp của binh đoàn Đầu Sói. Khi trốn chạy sự truy đuổi của binh đoàn Đầu Sói, Tiêu Viêm đã vô tình bắt gặp Đấu hoàng Vân Chi (Hồ Tĩnh đóng) và Dực sư vương Tử Tinh đang giao đấu với nhau. Vân Chi không thể đánh bại Dực sư, Tiêu Viêm đã cứu Vân Chi. Sau một vài biến cố, hai người quyết định đi thách đấu Dực sư một lần nữa. Hai người chia nhau ra hành động, sau cùng giành thắng lợi. Vân Chi âm thầm rời đi, Tiêu Viêm cũng quyết định rời khỏi rặng núi ma thú, hướng đến sa mạc của Xà tộc....</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/dau-pha-thuong-khung-thuc-tinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dau-pha-thuong-khung-thuc-tinh-poster.jpg', '2024-02-11 05:53:07', 8, '', 93, 0),
(372, 'Truyền thuyết về Chang\'\'e', 'Legend of Chang\'\'e', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/truyen-thuyet-ve-change-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/truyen-thuyet-ve-change-poster.jpg', '2024-02-11 05:53:19', 8, '', 11342, 0),
(373, 'Chloe', 'Chloe', 2009, '<p>Catherine và David, cô là một bác sĩ, ông là một giáo sư, ban đầu nhìn thoáng qua cặp đôi hoàn hảo. Hạnh phúc kết hôn với một đứa con trai tuổi teen tài năng, họ dường như có cuộc sống hoàn hảo. Nhưng khi David bỏ lỡ một chuyến bay và bữa tiệc sinh nhật bất ngờ của anh, những nghi ngờ sôi nổi dài của Catherine đã vươn lên bề mặt. Nghi ngờ sự không chung thủy, cô quyết định thuê một người hộ tống để quyến rũ chồng và kiểm tra lòng trung thành của mình. Catherine tìm thấy mình \'chỉ đạo\' những cuộc gặp gỡ của Chloe của Chloe với David và sự cuối cùng của Chloe là báo cáo lại, các mô tả ngày càng trở nên đồ họa như các cuộc họp nhân lên.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chloe-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chloe-poster.jpg', '2024-02-11 05:56:09', 8, '', 0, 0),
(374, 'Con Tàu Tuyệt Mệnh', 'c', 2006, '<p>Đó là đêm giao thừa, và hơn 2.000 hành khách &amp; phi hành đoàn đang đổ chuông trong năm mới trên tàu du lịch khổng lồ \'Poseidon\' khi nó lật úp trên biển rộng ở giữa Bắc Đại Tây Dương! Một nhóm nhỏ những người sống sót thấy mình là những đồng minh không có khả năng trong một trận chiến cho cuộc sống của họ. Thích kiểm tra tỷ lệ cược một mình, con bạc nghề nghiệp Dylan Johns bỏ qua các đơn đặt hàng của đội trưởng để chờ bên dưới để giải cứu có thể và đặt ra để tìm đường đến nơi an toàn. Những gì bắt đầu như một nhiệm vụ solo sẽ sớm thu hút người khác, vì Dylan được theo sau bởi một người cha tuyệt vọng tìm kiếm con gái của mình và vị hôn thê của mình - một cặp vợ chồng trẻ giờ trước khi không thể triệu tập sự can đảm để nói với anh ta rằng họ đã tham gia và bây giờ phải đối mặt với nhiều graver thách thức. Trên đường đi, họ được tham gia bởi một người mẹ đơn thân và người con trai rộng rãi của mình, một người yêu năm của mình, một người chiến đấu lo lắng và một hành khách đồng nghiệp tuyệt vọng đã lên tàu không chắc chắn anh ta muốn sống nhưng bây giờ biết anh ta không muốn chết. Quyết tâm chiến đấu theo cách của họ lên bề mặt, nhóm tập tin lướt qua mê cung mất phương hướng của thép xoắn trong đống đổ nát lộn ngược. Khi tàu không ổn định nhanh chóng lấp đầy với nước, mỗi chiếc phải vẽ về các kỹ năng và điểm mạnh mà họ thậm chí không biết họ sở hữu, chiến đấu chống lại thời gian cho sự sống còn của chính họ và cho nhau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/con-tau-tuyet-menh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/con-tau-tuyet-menh-poster.jpg', '2024-02-11 05:56:11', 8, '', 0, 0),
(375, 'Cuốn Theo Chiều Gió', 'Gone with the Wind', 1939, '<p>Scarlett là một phụ nữ có thể đối phó với một quốc gia trong chiến tranh, Atlanta Burning, Quân đội Liên minh thực hiện tất cả mọi thứ từ Tara yêu dấu của cô, những người tham gia cuộc chiến đến sau chiến tranh. Scarlett rất đẹp. Cô ấy có sức sống. Nhưng Ashley, người đàn ông cô ấy đã muốn rất lâu, sẽ kết hôn với anh em họ nhau của mình, Melanie. Mammy cảnh báo Scarlett cư xử với bản thân trong bữa tiệc tại Mười hai Oaks. Có một người đàn ông mới ở đó vào ngày hôm đó, ngày cuộc nội chiến bắt đầu. Rhett Butler. Scarlett không biết mình đang ở trong phòng khi cô cầu xin Ashley chọn cô thay vì Melanie.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cuon-theo-chieu-gio-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuon-theo-chieu-gio-poster.jpg', '2024-02-11 05:56:12', 8, '', 0, 0),
(376, 'Dao Buoc Tren May', 'A Walk in the Clouds', 1995, '<p>Một người lính trẻ của Mỹ đã kết hôn, Paul, trở về nhà sau Thế chiến II và gặp một cô gái, Victoria, trên đường đi. Victoria đang mang thai và sợ hãi về việc trở về nhà đến gia đình Mexico của mình, nơi cô ấy nghiêm khắc về người cha bảo vệ chắc chắn sẽ không chấp nhận cô ấy mất thai. Muốn giúp đỡ, Paul đề nghị đặt ra khi chồng làm dịu mọi thứ cho đến khi thời gian như vậy, anh ta tự do rời đi một lần nữa nhưng khi họ dành thời gian bên nhau, họ bắt đầu yêu nhau. Tuy nhiên, Paul vẫn kết hôn và họ phải giữ mình lại trước khi định mệnh sẽ can thiệp và bi kịch sẽ xảy ra sau đó và cuối cùng họ sẽ ở bên nhau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/dao-buoc-tren-may-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dao-buoc-tren-may-poster.jpg', '2024-02-11 05:56:13', 8, '', 0, 0),
(377, 'Diều Hâu Gãy Cánh', 'Black Hawk Down', 2001, '<p>Phim hành động / chiến tranh dựa trên cuốn sách bán chạy nhất chi tiết một nhiệm vụ gần kẻ tai hại ở Somalia vào ngày 3 tháng 10 năm 1993. Vào ngày này, gần 100 Rangers Quân đội Hoa Kỳ, được chỉ huy bởi Capt. Mike Steele, đã bị đánh bại bởi máy bay trực thăng vào thủ đô của Mogadishu để nắm bắt hai trung úy hàng đầu của một Harlord Somalia. Điều này dẫn đến một trận hỏa hoạn lớn và rút ra giữa quân đội, lực lượng đặc biệt của Hoa Kỳ và hàng trăm tay súng Somalia; dẫn đến sự phá hủy của hai máy bay trực thăng Hawk Black Usk. Bộ phim tập trung vào những nỗ lực anh hùng của nhiều người kiểm lâm khác nhau để đến với Hawks đen bị hạ gục, tập trung vào SSG Eversmann, dẫn đầu đơn vị kiểm lâm bốn đến trang web vụ tai nạn Black Hawk đầu tiên, Giám đốc bảo hành trưởng Durant, người được chụp sau khi là người sống sót duy nhất của Tai nạn Hawk đen thứ hai, cũng như nhiều người khác đã tham gia.</p>', 0, 'https://img.ophim11.cc/uploads/movies/dieu-hau-gay-canh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dieu-hau-gay-canh-poster.jpg', '2024-02-11 05:56:14', 8, '', 0, 0),
(378, 'The Personal History of David Copperfield', 'The Personal History of David Copperfield', 2019, '<p>Một cuộc câu chuyện cổ điển của Charles Dickens về một đứa trẻ mồ côi trẻ có thể chiến thắng nhiều chướng ngại vật.</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-personal-history-of-david-copperfield-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-personal-history-of-david-copperfield-poster.jpg', '2024-02-11 05:56:16', 8, '', 0, 0),
(379, 'The Secret Scandal', 'The Secret Scandal', 2013, '<p>Một nữ diễn viên chết. Một phóng viên sau đó điều tra vụ việc và một công tố nữ tìm kiếm công lý. Để tiết lộ sự thật đằng sau cái chết của nữ diễn viên, phóng viên và nữ công tố viên bắt đầu chiến đấu chống lại một nhóm năng lượng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-secret-scandal-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-secret-scandal-poster.jpg', '2024-02-11 05:56:17', 8, '', 0, 0),
(380, 'The Secret of NIMH', 'The Secret of NIMH', 1982, '<p>Để cứu con trai con trai của mình, một con chuột dã chiến phải tìm kiếm sự trợ giúp của một thuộc địa của chuột, người mà cô ấy có một liên kết sâu hơn bao giờ bị nghi ngờ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-secret-of-nimh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-secret-of-nimh-poster.jpg', '2024-02-11 05:56:18', 8, '', 0, 0),
(381, 'The Starving Games', 'The Starving Games', 2013, '<p>Đặt trong góc đáng buồn nhất của một tương lai hậu tận thế, nữ anh hùng Kantmiss Evershot (Maiara Walsh) tình nguyện viên để đưa vị trí của em gái mình thao túng của cô ấy trong bảy mươi lăm trò chơi đói khát hàng năm. Khi làm như vậy, cô phải để lại phía sau Dale-a-bạn bè của mình (Brant Daugherty) và hợp tác với con trai của Bakey Baker Peter Malarkey (Cody Allen Christian) trong một cuộc chiến cho cuộc sống của cô. Nhưng xin chờ chút nữa! Cô ấy cũng có thể giành được một ham già, một phiếu giảm giá cho một phụ dài bằng chân với giá sáu inch, và một người dưa chua ăn một phần! Trong các trò chơi đói khát, Friedberg và Seltzer\'s Sixth\'s Cinematic Cinematic of Office Hit, The Preific Parody Duo có các điểm tham quan được đào tạo về bom tấn phiêu lưu The Hunger Games! Đó là tất cả những lời cười và một nửa lượng calo khi chúng kéo hàng chục mũi tên bị rắn, gai tại các bộ phim khoa học, hành động và tưởng tượng từ những nhân vật và những người nổi tiếng vĩ đại và mạnh mẽ đến Pop như Harry Potter và Taylor Swift.</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-starving-games-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-starving-games-poster.jpg', '2024-02-11 05:56:20', 8, '', 0, 0),
(382, 'Thám Tử Thú Cưng', 'Ace Ventura: Pet Detective', 1994, '<p>Để trở thành một thám tử thú cưng, bạn phải hiểu cả tội phạm và động vật. Ace Ventura đi xa hơn nữa, anh ta cư xử như một động vật hình sự. Khi linh vật của đội bóng đá (một con cá heo) bị đánh cắp ngay trước Superbowl, Ace Ventura được đưa vào vụ án. Bây giờ, ai muốn ăn cắp một con cá heo, và tại sao?</p>', 0, 'https://img.ophim11.cc/uploads/movies/tham-tu-thu-cung-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tham-tu-thu-cung-poster.jpg', '2024-02-11 05:56:21', 8, '', 0, 0),
(383, 'Tám Hận Thù', 'The Hateful Eight', 2015, '<p>Một thời gian sau cuộc nội chiến, một stagecoach làm hài lòng qua cảnh quan Wealry Wyoming. Bounty Hunter John Ruth và cuộc đua Daisy Daisy bị bắt giữ của mình về phía thị trấn Red Rock, nơi Ruth sẽ mang Daisy đến công lý. Dọc theo con đường, họ gặp phải hầu tước Marquis Warren (một thợ săn tiền thưởng khét tiếng) và Chris Mannix (một người đàn ông tuyên bố là cảnh sát trưởng mới của Red Rock). Mất trong một trận bão tuyết, Bunch tìm nơi ẩn náu tại Minnie\'s Haberderdy. Khi họ đến họ được chào đón bởi những gương mặt xa lạ: Bob, người tuyên bố sẽ chăm sóc nơi này trong khi Minnie biến mất; Oswaldo Mobray, Hangman of Red Rock; Joe Gage, một cú đấm bò; và Liên minh Sanford Smithers. Khi cơn bão vượt núi sườn núi, tám khách du lịch đến để biết rằng họ có thể không làm cho Red Rock sau tất cả ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/tam-han-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tam-han-thu-poster.jpg', '2024-02-11 05:56:22', 8, '', 0, 0),
(384, 'Vitalina Varela', 'Vitalina Varela', 2019, '<p>Vitalina Varela lấy danh hiệu từ tên của nữ diễn viên chính của mình, một người phụ nữ Cape Verdean, như thường lệ với các diễn viên không chuyên nghiệp của Costa, chơi một phiên bản hư cấu của chính mình. Vitalina lần đầu tiên xuất hiện trong một tập phim trong bộ phim trước đây của đạo diễn, tiền ngựa (bước sóng 2015), trong đó cô kể lại cách chồng cô đã rời khỏi quê hương gần 25 năm trước để làm việc ở Lisbon - một sự tách biệt đã trở thành vĩnh viễn khi cuối cùng cô đến lục địa , ba ngày sau đám tang của mình. Ở Vitalina Varela, Costa khúc xạ và mở rộng tập phim mà tập luyện chắc chắn trong quan điểm khắc kỷ của nữ anh hùng của mình, chiếm được sức mạnh và khả năng phục hồi phi thường của cô ấy khi cô ấy điều hướng những dấu vết vật lý ỏi của cô ấy bị bỏ lại, phát hiện ra bí mật, cuộc sống bất hợp pháp, và gặp phải Những cuộc sống khác làm tối những cái bóng của các fontainhas mà một lần là.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vitalina-varela-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vitalina-varela-poster.jpg', '2024-02-11 05:56:24', 8, '', 0, 0),
(385, 'Vòng Tròn Tử Thần', 'Rings', 2017, '<p>Julia trở nên lo lắng về bạn trai, Holt, khi ông khám phá huyền thoại đô thị đen tối của một video bí ẩn đã nói để giết người canh gác bảy ngày sau khi xem. Cô hy sinh mình để cứu bạn trai của mình và làm như vậy tạo ra một khám phá kinh hoàng: Có một \"bộ phim trong bộ phim\" mà không ai từng thấy trước đây.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vong-tron-tu-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vong-tron-tu-than-poster.jpg', '2024-02-11 05:56:25', 8, '', 0, 0),
(386, 'Vòng Tròn Định Mệnh', 'The Ring', 2002, '<p>Rachel Keller là một nhà báo điều tra một băng video có thể đã giết chết bốn thanh thiếu niên (bao gồm cả cháu gái của cô). Có một huyền thoại đô thị về băng này: người xem sẽ chết bảy ngày sau khi xem nó. Nếu huyền thoại là chính xác, Rachel sẽ phải chạy ngược thời gian để cứu con trai mình và cuộc sống của chính mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vong-tron-dinh-menh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vong-tron-dinh-menh-poster.jpg', '2024-02-11 05:56:26', 8, '', 0, 0),
(387, 'Lòng Nhân Từ', 'Just Mercy', 2019, '<p>Một câu chuyện thực sự mạnh mẽ và suy nghĩ, \"chỉ lòng thương xót\" theo luật sư trẻ Bryan Stevenson (Jordan) và trận chiến lịch sử của ông cho công lý. Sau khi tốt nghiệp Harvard, Bryan có thể đã có những công việc sinh lợi. Thay vào đó, anh ta hướng đến Alabama để bảo vệ những người bị lên án sai, với sự hỗ trợ của người ủng hộ địa phương Eva Angley (Larson.) Một trong những người đầu tiên, và hầu hết những người gây cháy, các trường hợp là của Walter McMillian (Foxx,), vào năm 1987, đã bị kết án Chết vì vụ giết một cô gái 18 tuổi, mặc dù có một sự vượt trội của bằng chứng chứng minh sự vô tội của mình và thực tế là chứng ngôn duy nhất chống lại anh ta đến từ một tên tội phạm với một động cơ để nói dối. Trong những năm sau đó, Bryan bị lôi kéo vào một mê cung của các cơ động hợp pháp và chính trị và sự phân biệt chủng tộc và phân biệt chủng tộc khi anh ta chiến đấu cho Walter, và những người khác thích anh ta, với tỷ lệ cược và hệ thống xếp chồng lên nhau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/long-nhan-tu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/long-nhan-tu-poster.jpg', '2024-02-11 05:56:28', 8, '', 0, 0),
(388, 'Naked Gun 33 1/3: The Final Insult', 'Naked Gun 33 1/3: The Final Insult', 1994, '<p>Nếm thử quả lao động của mình với vợ Jane Spencer (Priscilla Presley), Maladroit và hiện đã nghỉ hưu đội đội cảnh sát, Frank drebin (Leslie Nielsen), bí mật mơ ước những giấc mơ trở lại trong hành động. Chẳng bao lâu, đối tác cũ của ông, Ed Hocken (George Kennedy) và Nordberg (OJ Simpson), sẽ phải tranh thủ sự giúp đỡ của người bạn đại bác lỏng lẻo của họ, khi Rocco (Fred Ward), kẻ khủng bố loạn trí, dự định sẽ thổi bay học viện hàng năm Lễ trao giải cho thợ rèn. Một lần nữa, Drebin vẫn bí mật, thẩm vấn bom bạc vàng nguy hiểm, và đưa cuộc hôn nhân quý báu, nhưng mong manh của mình trong Jeopardy. Oscar năm nay đã cam chịu thảm họa?</p>', 0, 'https://img.ophim11.cc/uploads/movies/naked-gun-33-13-the-final-insult-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/naked-gun-33-13-the-final-insult-poster.jpg', '2024-02-11 05:56:29', 8, '', 0, 0),
(389, 'New World', 'New World', 2013, '<p>Là tổ chức tội phạm lớn nhất của Hàn Quốc \'Goldmoon\' mở rộng quyền hạn của mình, Kang, Trưởng phòng Kế hoạch điều tra cảnh sát, đặt hàng COP JA-SEOUNG của Undercover để tham gia dự án \"Thế giới mới\", điều đó sẽ hạ gục \'Goldmoon\'. Ja-Seong phải chọn theo đơn đặt hàng của Kang như một cảnh sát hoặc giữ trung thành với Jeong Cheong, ông chủ của Tổ chức tội phạm \'Goldmoon\'.</p>', 0, 'https://img.ophim11.cc/uploads/movies/new-world-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/new-world-poster.jpg', '2024-02-11 05:56:30', 8, '', 0, 0),
(390, 'Nghịch Lý Cloverfield', 'The Cloverfield Paradox', 2018, '<p>Trong tương lai gần, có một cuộc khủng hoảng năng lượng trên trái đất. Trạm Cloverfield với một phi hành đoàn đa quốc gia sẽ kiểm tra bộ tăng tốc hạt Shepard đang mong đợi tạo ra năng lượng cho tất cả các quốc gia giải quyết vấn đề năng lượng. Tuy nhiên, thí nghiệm sai, gây thiệt hại cho trạm và mở một cổng vào một chiều khác với một trái đất song song. Họ cũng tìm thấy một người phụ nữ bị cuốn đi với dây phía sau một vách ngăn của nhà ga và họ học cách cô ấy làm việc trong một trạm Cỏ ba lá giống hệt nhau ở một chiều hướng khác. Bây giờ các nhà khoa học cần tìm cách trở về khía cạnh của chính họ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nghich-ly-cloverfield-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nghich-ly-cloverfield-poster.jpg', '2024-02-11 05:56:31', 8, '', 0, 0),
(391, 'Old Yeller', 'Old Yeller', 1957, '<p>Soil Travis Coates còn lại để chăm sóc trang trại gia đình với mẹ và em trai trong khi cha anh ta đi trên một con gia súc lái xe vào những năm 1860. Khi một người Mongrel màu vàng đến với một kỳ nghỉ không mời với gia đình, Travis miễn cưỡng nhận nuôi chó. Sau một loạt các vết xạ liên quan đến gấu trúc, rắn, gấu, lợn rừng và sói, Travis phát triển để yêu và tôn trọng Yeller Old, người có ảnh hưởng sâu sắc đến cuộc sống của cậu bé.</p>', 0, 'https://img.ophim11.cc/uploads/movies/old-yeller-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/old-yeller-poster.jpg', '2024-02-11 05:56:33', 8, '', 0, 0),
(392, 'Phi Vụ Rắc Rối', 'Meet Dave', 2008, '<p>Một tàu vũ trụ có hình dạng như một vùng đất của con người đối mặt với Đảo Liberty. Phi hành đoàn của nó (chúng sinh nhỏ, thông minh và unemotion) đang tìm kiếm một quả cầu được gửi từ hành tinh của nó để chiết xuất muối của đại dương, điều này sẽ hủy hoại trái đất. Quả cầu đang sở hữu Josh, con trai lớp năm của một người mẹ duy nhất có xe tấn công tàu vũ trụ ngoài hành tinh cứu thương và làm tê liệt nguồn điện của nó. Phi hành đoàn có 48 giờ để phục hồi quả cầu, ném nó vào Đại Tây Dương và rời khỏi Trái đất. Trong suốt hai ngày, phi hành đoàn của tàu trải nghiệm sự hỗn loạn và cảm xúc ở New York. Làm người khổng lồ của Trái đất - Josh và mẹ của anh ấy - có gì để dạy những người ngoài hành tinh bũng cảm này không? Trong khi đó, Mutiny đang diễn ra và cảnh sát đang đóng cửa.</p>', 0, 'https://img.ophim11.cc/uploads/movies/phi-vu-rac-roi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phi-vu-rac-roi-poster.jpg', '2024-02-11 05:56:34', 8, '', 0, 0),
(393, 'Romeo + Juliet', 'Romeo + Juliet', 1996, '<p>Câu chuyện kinh điển về Romeo và Juliet, được đặt trong một thành phố hiện đại của Bãi biển Verona. Các Montagues và Capulets là hai gia đình phong kiến, có con gặp và yêu. Họ phải che giấu tình yêu của họ từ thế giới bởi vì họ biết rằng cha mẹ của họ sẽ không cho phép họ ở bên nhau. Có những trở ngại trên đường, giống như anh em họ của Juliet, Tybalt và bạn của Romeo Mercutio, và nhiều trận đánh. Nhưng mặc dù nó được đặt trong thời hiện đại, nó vẫn là một câu chuyện vô tận của \"những người yêu thích ngôi sao chéo\".</p>', 0, 'https://img.ophim11.cc/uploads/movies/romeo-juliet-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/romeo-juliet-poster.jpg', '2024-02-11 05:56:35', 8, '', 0, 0),
(394, 'Saint Frances', 'Saint Frances', 2019, '<p>Sau khi mang thai do tai nạn biến mất, một bà mẹ bế tắc tìm thấy một tình bạn không thể xảy ra với đứa trẻ sáu tuổi, cô bị buộc tội bảo vệ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/saint-frances-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/saint-frances-poster.jpg', '2024-02-11 05:56:37', 8, '', 0, 0),
(395, 'Shorts', 'Shorts', 2009, '<p>Một đứa trẻ đang phát hiện ra một tảng đá đầy màu sắc, mong muốn gây ra sự hỗn loạn ở thị trấn ngoại ô của Black of Black Falls khi những đứa trẻ ghen tị và những người trưởng thành giống nhau giống nhau để đưa tay lên nó.</p>', 0, 'https://img.ophim11.cc/uploads/movies/shorts-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/shorts-poster.jpg', '2024-02-11 05:56:38', 8, '', 0, 0),
(396, 'Biệt Đội Cơ Động - Không Lối Thoát ', 'Biệt Đội Cơ Động - Không Lối Thoát ', 2008, '<p>After a late-night triad dispute leads to the death of an innocent civilian, PTU officers take action by investigating triad activities in the area.</p>', 0, 'https://img.ophim11.cc/uploads/movies/biet-doi-co-dong-khong-loi-thoat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/biet-doi-co-dong-khong-loi-thoat-poster.jpg', '2024-02-11 06:09:04', 8, '', 130, 2),
(397, 'Đội Đặc Nhiệm Cơ Động PTU ', 'Đội Đặc Nhiệm Cơ Động PTU ', 2008, '<p>Tensions flare between PTU officers and the Complaints Against Police Officers unit when a security camera captures a triad member being brutalized by PTU officers</p>', 0, 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-co-dong-ptu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-co-dong-ptu-poster.jpg', '2024-02-11 06:09:07', 8, '', 130, 0),
(398, 'Biệt Đội Cơ Động - Bản Chất Con Người ', 'Biệt Đội Cơ Động - Bản Chất Con Người ', 2008, '<p>CID officer Tong gets himself entangled with a gang of killers from mainland China, who are out killing criminals to rob them of their money, and using an ideological basis to justify the killings as protecting mainland China from the criminal scum of Hong Kong.</p>', 0, 'https://img.ophim11.cc/uploads/movies/biet-doi-co-dong-ban-chat-con-nguoi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/biet-doi-co-dong-ban-chat-con-nguoi-poster.jpg', '2024-02-11 06:09:09', 8, '', 128, 3),
(399, 'Đội Đặc Nhiệm Cơ Động - Đối Tác ', 'Đội Đặc Nhiệm Cơ Động - Đối Tác ', 2009, '<p>Rumor has it that “Black Moly”, the Indian head of a gang has returned. His former subordinate Velu is released from prison, he refuses to follow the same path as before. But he is misconstrued by his buddy, Sonu that Velu betrays him. Sonu accepts the task for killing PTU’s Team Head. Sam and May from PTU and Velu can’t easily leave themselves out of account.</p>', 0, 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-co-dong-doi-tac-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-co-dong-doi-tac-poster.jpg', '2024-02-11 06:09:12', 8, '', 131, 2),
(400, 'Chúng Tôi Đơn Giản Là Gấu Con (Phần 2)', 'We Baby Bears Season 2', 2023, 'Follow Grizz, Panda and Ice Bear – as their younger baby selves – traveling in a magical box to fantastic new worlds searching for a place to call home. Along the way, they meet new friends, learn a few lessons and discover that “home” can mean wherever they are, as long as they’re together.', 1, 'https://img.ophim11.cc/uploads/movies/chung-toi-don-gian-la-gau-con-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chung-toi-don-gian-la-gau-con-phan-2-poster.jpg', '2024-02-11 06:09:14', 8, 'https://www.youtube.com/watch?v=j3qoY533JrU', 12, 0),
(401, 'Phản Công Nhanh', 'Quick Counterattack', 2023, '<p>Tại một thị trấn nhỏ ven biển, các nhóm tội phạm lừa đảo dựa vào bạo lực mạng để phát triển chuỗi ngành tội phạm mạng bao gồm các khoản cho vay trực tuyến bất hợp pháp, nội dung khiêu dâm, cờ bạc và mại dâm. Do tính ảo của Internet có thể che giấu được danh tính, cảnh sát đã tìm kiếm cơ hội để tiêu diệt các nhóm tội phạm đồng thời đột phá từng nhóm một, cùng lúc đó, Mã Húc Đông, người đã làm công tác an ninh ở nước ngoài nhiều năm, quay trở lại Trung Quốc truy lùng những kẻ đứng sau hoạt động \"cho vay trực tuyến\", không rõ tung tích con gái, đối mặt với một nhóm tội phạm hung ác, cảnh sát và Mã Húc Đông bắt đầu trò chơi sinh tử với bọn tội phạm, và cuối cùng đã phát hiện và phá hủy chuỗi tội phạm mạng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/phan-cong-nhanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phan-cong-nhanh-poster.jpg', '2024-02-11 06:10:02', 8, 'https://www.youtube.com/watch?v=g4f7viaFp6Q', 84, 0),
(402, 'Dĩ Ái Vi Doanh', 'Only for Love', 2023, 'Phim thuộc thể loại ngôn tình hiện đại chuyển thể từ tiểu thuyết Trêu Nhầm của tác giả Kiều Diêu. Phim kể về chuyện tình hài hước bắt nguồn từ một hiểu lầm giữa tổng tài bá đạo Thời Yến (Vương Hạc Đệ) và phóng viên tài chính tinh anh Trịnh Thư Ý (Bạch Lộc). Phim có sự tham gia của nhiều diễn viên nổi tiếng như Ngụy Triết Minh, Thẩm Vũ Khiết, Lưu Đông Thấm, Khương Bội Dao, Vương Vi. Phim hứa hẹn mang đến cho khán giả những phút giây cười sảng khoái và lãng mạn', 1, 'https://img.ophim11.cc/uploads/movies/di-ai-vi-doanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/di-ai-vi-doanh-poster.jpg', '2024-02-11 06:10:10', 8, '', 46, 1),
(403, 'Nương Tử Tại Thượng', 'Wife Above All', 2023, '<p>Ở kinh thành, người đứng đầu cửa hàng thuốc Tần Thảo Đường là Tần Trọng Lâu và đại tướng quân Vân Tử Long cùng nhau xin ý kiến của Hoàng đế về việc xin ban hôn với con gái của Mạc gia y quán. Tuy nhiên, trong Mạc gia có hai người con gái, con gái cả là Mạc Tĩnh Dư và người con thứ là con gái vợ lẽ tên là Mạc Bán Hạ. Hoàng đế ra lệnh cho họ chọn vận may bằng cách rút được chiếc túi may mắn để quyết định ai là sẽ làm vợ chồng ai. Tần Trọng Lâu bị bệnh ở chân, nghe nói Mạc Tĩnh Dư có tài nghệ y thuật cao, rất mong muốn cô ấy có thể chữa khỏi cho mình. Trong khi đó Vân Tử Long lại mang trong mình một mối thù sâu sắc, cha của anh đã phạm sai lầm trong một lần vận chuyển quân dược, cả gia đình bị kết tội, anh là người duy nhất sống sót, và lô dược liệu đó là do Mạc Tương gửi từ Mạc gia y quán gửi đến. Anh nghe nói Mạc Tương rất yêu quý Mạc Bán Hạ nên muốn lợi dụng cô để lấy bằng chứng cho thấy Mạc Tương đã cố tình gài bẫy Vân gia, trả thù cho cả gia đình. Để chọn đúng người mình muốn, Tần Trọng Lâu đã hối lộ người có khả năng can thiệp vào túi may mắn. Tuy nhiên, ý trời ko muốn vậy, túi may mắn vẫn bị chọn sai, Tần Trọng Lâu kết hôn với Mạc Bán Hạ, còn Vân Tử Long phải lấy Mạc Tĩnh Dư. Hai cặp vợ chồng bất đắc dĩ bắt đầu cuộc sống hôn nhân và sau khi kết hôn, họ phát hiện ra rằng họ rất hợp nhau...</p>', 1, 'https://img.ophim11.cc/uploads/movies/nuong-tu-tai-thuong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nuong-tu-tai-thuong-poster.jpg', '2024-02-11 06:10:16', 8, '', 10, 0),
(404, 'Cuộc Hôn Nhân Hoàn Hảo', 'Perfect Marriage Revenge', 2023, '<p>Bộ phim truyền hình nổi tiếng của Hàn Quốc, kể về cuộc sống của Han Yi Joo, một họa sĩ nghệ thuật. Cô đã được nhận nuôi bởi Han Jin Woong và Lee Jung Hye, người làm chủ của tập đoàn tài chính Hanwool. Tuy nhiên, Han Yi Joo không bao giờ được yêu thương bởi cha mẹ nuôi hoặc em gái Han Yoo Ra. Cô luôn bị cô lập khỏi gia đình. Hiện tại, Han Yi Joo đã kết hôn với Jung Se Hyeok. Tuy nhiên, cô phát hiện ra rằng chồng mình, Jung Se Hyeok, yêu em gái của cô, Han Yoo Ra, chứ không phải cô. Trong cùng ngày đó, Han Yi Joo gặp tai nạn xe hơi và qua đời. Nhưng khi Han Yi Joo tỉnh dậy, cô thấy mình đã quay trở lại thời điểm cô đính hôn với Jung Se Hyeok. Để thay đổi số phận và trả thù gia đình mình, cô quyết định chấm dứt mối quan hệ hôn nhân với Jung Se Hyeok. Sau đó, cô tiếp cận Seo Do Guk, người mà em gái Han Yoo Ra muốn kết hôn. Seo Do Guk là cháu trai của người sáng lập Taeja Group, một chàng trai thông minh và điển trai. Han Yi Joo muốn ký kết một hợp đồng hôn nhân giả với Seo Do Guk và anh ta đồng ý, nhưng điều anh muốn là hợp đồng hôn nhân đó trở thành một cuộc hôn nhân thực sự. Cuộc hôn nhân này đầy những bí mật, âm mưu, và trái tim đau khổ, nơi mà Han Yi Joo phải đối mặt với nhiều thách thức khó khăn để trả thù và thay đổi số mệnh. Cuộc Hôn Nhân Hoàn Hảo - Perfect Marriage Revenge 2023 VietSub hứa hẹn sẽ mang đến cho khán giả những bất ngờ và cung bậc cảm xúc trong câu chuyện về tình yêu, trả thù, và cuộc hành trình để thay đổi số phận.</p>', 1, 'https://img.ophim11.cc/uploads/movies/cuoc-hon-nhan-hoan-hao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuoc-hon-nhan-hoan-hao-poster.jpg', '2024-02-11 06:10:20', 8, 'https://www.youtube.com/watch?v=46bYitkYbvI', 70, 0),
