(425, 'Alvin & The Chipmunks: Sóc chuột du hí', 'Alvin and the Chipmunks: The Road Chip', 2015, '<p>Trong phần phim tiếp theo này, bộ ba lông lá Alvin, Simon và Theodore đang có chuyến đi xuyên quốc gia để ngăn người giám hộ Dave của họ cầu hôn bạn gái.</p>', 0, 'https://img.ophim11.cc/uploads/movies/alvin-andamp-the-chipmunks-soc-chuot-du-hi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/alvin-andamp-the-chipmunks-soc-chuot-du-hi-poster.jpg', '2024-02-11 06:12:03', 8, '', 132, 0),
