(427, 'Đường tới HiGH&LOW', 'Road To High & Low', 2016, '<p>Ba người bạn chí cốt bị giằng xé khi một trong số họ trở thành thành viên của một tổ chức tội phạm hung ác, đe dọa đàn áp băng nhóm của hội bạn cũ của cậu.</p>', 0, 'https://img.ophim11.cc/uploads/movies/duong-toi-highandamp-low-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/duong-toi-highandamp-low-poster.jpg', '2024-02-11 06:12:08', 8, '', 134, 0),
(428, 'Kẻ Ẩn Danh', 'Bad Blood', 2023, 'Lâm - một người đàn ông từng là xã hội đen nhưng lại mất trí nhớ và nay đang lẩn trốn như một người bình thường, kiếm sống bằng lao động chân tay. Lâm sống cùng vợ - Hạnh và con gái riêng của cô là Hiền. Hiền vẫn chưa chấp nhận tình yêu thương của chú Lâm dành cho mình. Hiền lớn lên với sự bốc đồng và bị dụ dỗ bởi Tiến - một thanh niên đạo đức giả chuyên dụ dỗ những cô gái vào nhà thổ để trở thành gái mại dâm. Xuyên suốt bộ phim là hành trình đi tìm con gái của Lâm', 0, 'https://img.ophim11.cc/uploads/movies/ke-an-danh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ke-an-danh-poster.jpg', '2024-02-11 06:12:10', 8, '', 97, 3),
