(447, 'Bất Khả Chiến Bại (Phần 2)', 'Invincible', 2023, 'Invincible là series hoạt hình siêu anh hùng dành cho người lớn được chuyển thể từ truyện tranh cùng tên của Skybound/Image Comic do Robert Kirkman sáng tác. Phim được lên kế hoạch kéo dài trong 3 mùa và sẽ phát sóng thông qua nền tảng Amazon Prime Video.\n\nInvincible là câu chuyện xoay quanh Mark Grayson, con trai của anh hùng mạnh nhất hành tinh - Omni-Man. Sau khi vừa tròn 17 tuổi, Mark bắt đầu thức tỉnh sức mạnh của riêng mình. Dưới sự giám hộ của Omni-Man, Mark dấn thân vào con đường trở thành siêu anh hùng và đối đầu với thử thách cam go.', 1, 'https://img.ophim11.cc/uploads/movies/bat-kha-chien-bai-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bat-kha-chien-bai-phan-2-poster.jpg', '2024-02-11 06:13:09', 8, 'https://www.youtube.com/watch?v=JuMiq7eg91M', 45, 0),
(448, 'Bánh Quy Ma Thuật', 'High Cookie', 2023, '<p>Chỉ với một miếng cắn, chiếc bánh quy bí ẩn tự làm biến giấc mơ thành hiện thực, nhưng nó lại chiếm lĩnh ngôi trường trung học ưu tú và những hậu quả chết người đang chờ đợi.</p>', 1, 'https://img.ophim11.cc/uploads/movies/high-cookie-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/high-cookie-poster.jpg', '2024-02-11 06:13:12', 8, '', 35, 21),
(449, 'Đấu La Đại Lục 2: Tuyệt Thế Đường Môn', 'Soul Land 2: The Peerless Tang Clan', 2023, '<p>Nơi đây không có ma pháp, không có hơn thua, không có võ thuật, nhưng lại có võ hồn. Đường Môn suy thoái sau khi đã thành lập được vạn năm ở Đấu La Đại Lục. Một lớp anh tài xuất hiện, liệu thế hệ Thất quái Sử Lai Khắc mới này có chấn hưng được Đường Môn, viết nên bài ca tuyệt thế Đường Môn hay không? Hồn thú triệu năm, Tử Linh Thánh Pháp Thần nắm giữ Nhật Nguyệt Trích Tinh, hệ thống Hồn Đạo Khí hoàn toàn mới khiến Đường Môn suy yếu. Tất cả thần khí đều sẽ lần lượt xuất hiện. Ám khí Đường Môn liệu có chấn hưng được uy phong, Đường Môn có thể tái hiện được huy hoàng hay không?</p>', 1, 'https://img.ophim11.cc/uploads/movies/dau-la-dai-luc-2-tuyet-the-duong-mon-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dau-la-dai-luc-2-tuyet-the-duong-mon-poster.jpg', '2024-02-11 14:32:07', 8, '', 21, 0),
(450, 'Nghịch Lý Kẻ Sát Nhân', 'A Killer Paradox', 2024, '<p>Khi vụ vô ý giết người dẫn đến vụ giết người khác, một chàng trai bình thường mắc kẹt trong cuộc rượt đuổi mèo vờn chuột không hồi kết với vị thám tử sắc sảo.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/nghich-ly-ke-sat-nhan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nghich-ly-ke-sat-nhan-poster.jpg', '2024-02-11 14:32:08', 8, 'https://www.youtube.com/watch?v=X2rXQ0rEfPI', 0, 23),
(451, 'Có Thuốc Trị Mùa 2', 'Are You OK? Season 2', 2023, 'Câu chuyện diễn ra trong một thế giới tưởng tượng được gọi là Đại Lương, nơi nhiều người dân sau khi qua đời, linh hồn của họ lại bị chiếm đoạt bởi các linh hồn từ hai ngàn năm sau, biến họ trở thành những xuyên không giả. Những xuyên không giả này không chỉ mang đến cho Đại Lương kiến thức và kinh nghiệm tiên tiến, mà còn khiến Hoàng đế thời đó sợ hãi và thận trọng. Trong bão táp thăng trầm, Lâu Chủ -một xuyên không giả ủng hộ hòa bình đã gặp gỡ và kết thân với thiếu chủ Tả Vân của Bàng Môn, cố gắng tìm con đường tiến bộ và sự hòa hợp cho tất cả mọi người. Tuy nhiên, mâu thuẫn giữa triều đình và những người đi xuyên thời gian dòng cách nguy hiểm đã leo thang. Trong một vụ nổ, Lâu Chủ, vì để ngăn cản họ xem xét bị thương mà không may bị vùi dưới đống đổ nát, và từ đó về sau, không ai biết ông còn sống hay đã chết. Nửa năm trôi qua một cách nhanh chóng. Dựa vào cơ hội từ vụ nổ, Hoàng đế chính thức ra lệnh loại bỏ tất cả những người đi xuyên thời gian, trong khi tổ chức “Tiên phong” do Tiêu Giao Nhiên dẫn đầu có ý định lật đổ quyền lực hoàng gia và dựa vào vũ khí hiện đại để dẫn đầu trong chiến tranh. Cả hai bên đều tập trung vào một mục tiêu quan trọng - Lâu Chủ, nhân vật chính trong những câu chuyện tra dư tửu hậu chốn giang hồ…', 1, 'https://img.ophim11.cc/uploads/movies/co-thuoc-tri-mua-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-thuoc-tri-mua-2-poster.jpg', '2024-02-11 14:32:13', 8, '', 28, 0),
(452, 'Thần Ấn Vương Toạ', 'Throne of Seal', 2022, '<p>6000 năm trước, hoàng đế Ma Thần Phong Tú và 72 Ma Thần Trụ giáng xuống, tất cả sinh vật bị nhiễm hơi thở của Ma Thần Trụ, lập tức biến thành Ma Vật, loài người bước vào thời đại đen tối. Sau đó, những kẻ mạnh của loài người đã lập thành Lục Đại Thánh Điện ngăn chặn Ma Vật, hình thành cục diện người và ma quỷ cùng tồn tại. Long Hạo Thiên một trong Lục Đại Thánh Điện, trở thành kỵ sĩ chỉ để cứu mẹ. Hạo Thiên từng bước trưởng thành, liên tiếp trải qua những cuộc gặp gỡ kỳ lạ, âm mưu quỷ kế, tình yêu và tình bạn định mệnh. Hạo Thiên tuân thủ tinh thần kỵ sĩ, nhận được sự công nhận của người khác nhờ vào nhân cách và sự nỗ lực của bản thân, cùng những nhân tài khác của Lục Đại Thánh Điện thành lập “Săn Ma Đoàn số 1” để đấu với Ma Vật, đấu tranh cho sự sống còn và tôn nghiêm của loài người.</p>', 1, 'https://img.ophim11.cc/uploads/movies/than-an-vuong-toa-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/than-an-vuong-toa-poster.jpg', '2024-02-11 14:32:15', 8, '', 20, 0),
(453, 'Thần Võ Thiên Tôn', 'The  Legend of  Sky Lord', 2020, '<p>Ta từ hư không mà tới, nhấc tay trời phải sập, lật tay hủy Hoàng tuyền. Ta là ma, là thần, là tiên, là người. Ta là Tiêu Thần, là vạn vật, cũng là chúa tể!</p>', 1, 'https://img.ophim11.cc/uploads/movies/than-vo-thien-ton-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/than-vo-thien-ton-poster.jpg', '2024-02-11 14:32:17', 8, '', 10, 0),
(454, 'Nốt Trầm Đời Bác Sĩ', 'Doctor Slump', 2024, '<p>Một thời là đối thủ ở trường, nay hai bác sĩ xuất sắc tình cờ gặp lại – mỗi người đối mặt với nốt trầm tồi tệ nhất trong cuộc sống và bất ngờ tìm thấy niềm an ủi ở nhau.</p>', 1, 'https://img.ophim11.cc/uploads/movies/not-tram-doi-bac-si-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/not-tram-doi-bac-si-poster.jpg', '2024-02-11 14:32:19', 8, 'https://www.youtube.com/watch?v=oGyWHLCf4NQ', 45, 2),
(455, 'Tầng 19', '19th Floor', 2024, 'Chunyu, a college student who has been estranged from his father since childhood, was involved in a game called \"19th Floor\" that he couldn\'t escape. In the game, Chunyu met the smart and calm Gao Xuan, the powerful Doudou, and the funny Yang Bawan and others. She and her friends experienced levels such as a \"ghost building\" full of shadow puppets and a deserted village pursued by leather figurines. Her friends failed to pass levels at different game stages and fell into a coma in reality.', 1, 'https://img.ophim11.cc/uploads/movies/tang-19-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tang-19-poster.jpg', '2024-02-11 14:32:23', 8, '', 0, 9),
(456, 'Một Chương Hạnh Phúc', 'My Happy Ending', 2023, 'Một Chương Hạnh Phúc - My Happy Ending kể về Seo Jae won (do Jang Na ra thủ vai) là một CEO thành đạt với cuộc sống vợ chồng tưởng chừng như rất hạnh phúc, có người cha dượng yêu chiều hết mực, có tất cả mọi thứ để người khác ghen tị. Nhưng một ngày nọ, cô phát hiện ra chồng của mình đang ngoại tình với người bạn thân nhất của mình, người cha dượng là người đã giết hại mẹ cô và cô đồng nghiệp đã theo dõi cô trong nhiều năm. Cô bị sốc và dường như không thể tin tưởng bất cứ ai, Jae won đã bắt đầu làm sáng tỏ những bí mật gây sốc xung quanh cô.', 1, 'https://img.ophim11.cc/uploads/movies/mot-chuong-hanh-phuc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mot-chuong-hanh-phuc-poster.jpg', '2024-02-11 14:32:26', 8, 'https://www.youtube.com/watch?v=6z59wtqdpok', 45, 25),
(457, 'Hoa Nở Về Đêm', 'Knight Flower', 2024, '<p>Hoa Nở Về Đêm - Knight Flower kể về Cho Yeo Hwa, người phụ nữa đã góa chồng 15 năm. Cô là phu nhân trong một gia đình quý tộc danh giá nhất vùng. Ban ngày, cô sống rất lặng lẽ và không bao giờ tiếp xúc với bên ngoài. Cô thể hiện mình là một phu nhân rất chỉnh chu và có gia phép. Tuy nhiên, trong đêm, Cho Yeo Hwa đã lẻn ra ngoài và giúp đỡ những người có hoàn cảnh khó khăn. Trong thời gian này, cô đã vô tình gặp Soo Ho, một cảnh vệ trong thành, có ngoại hình ưa nhìn và rất ưu tú. Soo Ho luôn xuất hiện để giúp đỡ Yeo Hwa mỗi khi cô gặp khó khăn.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/hoa-no-ve-dem-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoa-no-ve-dem-poster.jpg', '2024-02-11 14:32:30', 8, '', 70, 0),
(458, 'Cô Ấy Độc Nhất Hữu Nhị', 'My Special Girl', 2024, '<p>Phim mang đến câu chuyện về sự trưởng thành của kỹ sư AI Cố Cửu Lễ và cô gái thực tập giáo dục mầm non, với hai thân phận khác nhau. Cố Cửu Lễ (do Trương Vân Long thủ vai) là một kỹ sư AI, sáng lập công ty Cửu Thiên Khoa Học, đam mê nghiên cứu và phát triển robot chăm sóc. Trong khi đó, Hác Tịnh (do Tống Y Nhân thủ vai) là một sinh viên vừa tốt nghiệp chuyên ngành giáo dục mầm non, đam mê ca hát nhưng không được mẹ ủng hộ. Mẹ cô chỉ hy vọng Hác Tịnh có thể tìm được một công việc ổn định và thành công, do đó cô chỉ có thể trở thành một streamer hát trực tiếp vào ban đêm và làm thực tập sinh tại công ty Cửu Lễ vào ban ngày. Với hai thân phận khác nhau, Hạo Tinh với những tính cách khác nhau, Cửu Lễ không nhận ra rằng hai người này thực chất là cùng một người. Điều này dẫn đến một loạt tình huống hài hước.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/co-ay-doc-nhat-huu-nhi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-ay-doc-nhat-huu-nhi-poster.jpg', '2024-02-11 14:32:34', 8, '', 45, 0),
(459, 'Tuyệt Sắc Tiểu Thần Y', 'Ms. Fantastic Miracle Doctor', 2023, 'Trong sự cố rò điện của bệnh viện, Giản Mạch - bác sĩ châm cứu nổi tiếng thời hiện đại - vô tình xuyên không vào Nguyệt Vô Nhan của Phượng Loan quốc, khi tỉnh dậy phát hiện mình trúng đao trên bụng, nằm gục nơi đồng hoang, còn vô tình quen biết nam chính Phong Khuynh Thành, từ đây mở ra một mối tình hài hước đầy yếu tố ngẫu nhiên. Khi bác sĩ hiện đại có y thuật cao minh gặp công tử tà mị bí ẩn, nữ giả nam trang quyền mưu cung đình, tình yêu sai chỗ đã âm thầm bước đến.', 1, 'https://img.ophim11.cc/uploads/movies/tuyet-sac-tieu-than-y-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tuyet-sac-tieu-than-y-poster.jpg', '2024-02-11 14:32:38', 8, '', 0, 0),
(460, 'Hỉ Quyển Thường Lạc Thành', 'The Happy Seven in Changan', 2024, '<p>Tạ Toàn Giai đến thành Trường Lạc tìm cha, bất ngờ trở thành con gái duy nhất của phú ông Lý Thiên Địa nhưng thứ mà cô thừa kế không phải là gia tài giàu có, mà là khoản nợ khổng lồ. Thượng Quan Cổ Xuyên đến đòi nợ, Phạm Trọng Cử vào kinh đi thi và thiếu hiệp Lưu Lãng Tề đến báo ân đều tề tựu ở Lý phủ. Tạ Toàn Giai một mặt sắp xếp chỗ ở cho mọi người, một mặt cho thuê phòng để giải quyết nợ nần. Từ đó, ai nấy đều dồn sức lập nghiệp ở Trường Lạc, sống một cuộc sống đầy sóng gió nhưng vui vẻ.</p>', 1, 'https://img.ophim11.cc/uploads/movies/hi-quyen-thuong-lac-thanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hi-quyen-thuong-lac-thanh-poster.jpg', '2024-02-11 14:32:40', 8, '', 40, 12),
(461, 'Chỉ Là Chồng Sắp Cưới', 'Life Is Drama', 2024, '<p>Sau khi gia đình gặp biến cố, Thượng Quan Sơ Hạ mất trí nhớ và được nhận nuôi, đổi tên thành Phùng Đông Đông. Cô tình cờ quen biết Vân Tô và bất ngờ nhớ lại thân thế của mình. Để điều tra chân tướng, cô đóng giả làm người hầu chua ngoa, chỉnh đốn lại nhà họ Thượng Quan và hợp tác với Vân Tô - chồng chưa cưới theo hợp đồng của mình để đưa hung thủ ra trừng trị trước pháp luật. Trong quá trình tiếp xúc, hai người dần cảm nhận được tìm cảm đối phương dành cho mình.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/chi-la-chong-sap-cuoi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chi-la-chong-sap-cuoi-poster.jpg', '2024-02-11 14:32:44', 8, '', 5, 0),
(462, 'Thăng Cấp Một Mình', 'Chỉ mình tôi thăng cấp, Solo Leveling', 2024, '<p>Thợ săn hạng E Jinwoo Sung là người yếu nhất trong số họ. Bị mọi người coi thường, anh ta không có tiền, không có khả năng nói và không có triển vọng công việc nào khác. Vì vậy, khi nhóm của anh ấy tìm thấy một hầm ngục ẩn giấu, anh ấy quyết tâm sử dụng cơ hội này để thay đổi cuộc sống của mình tốt hơn... nhưng cơ hội mà anh ấy tìm thấy hơi khác so với những gì anh ấy nghĩ trong đầu! Source: VuiGhe</p><p>&nbsp;</p>', 1, 'https://img.ophim13.cc/uploads/movies/thang-cap-mot-minh-thumb.jpg', 'https://img.ophim13.cc/uploads/movies/thang-cap-mot-minh-poster.jpg', '2024-02-11 14:32:46', 8, 'https://www.youtube.com/watch?v=YvGSK8mIlt8', 23, 0),
(463, 'Ác Nữ', 'Lost in Perfection', 2023, '<p>Một biên tập viên nghi ngờ vị hôn thê của bố cô có thể là kẻ lừa đảo giết người, nhưng việc cố gắng chứng minh điều đó đẩy cô vào tình thế nguy hiểm.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/ac-nu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ac-nu-poster.jpg', '2024-02-11 14:32:50', 8, '', 114, 0),
(464, 'Transit Love (Phần 3)', 'EXchange', 2023, '<p>Nội dung: Bốn cặp người yêu cũ sống chung dướt một mái nhà trong ba tuần để tìm một tình yêu mới hoặc quay lại với nhau. Biết người yêu cũ của nhau đang ở trong nhà chung, nhưng họ phải che giấu không để lộ người yêu cũ của mình. Đồng thời khi giữ bí mật này, họ cũng thử tìm hiểu những người khác và xây dựng các mối quan hệ mới. Thông qua hệ thống EX-REVIEW và EX-CHAT, mọi người có cơ hội tìm hiểu về bạn cặp mới của mình thông qua người yêu cũ của người đó. Những mối quan hệ mới nào sẽ bắt đầu? Hay những cặp đôi cũ sẽ lại nhen nhóm tình cảm?</p>', 1, 'https://img.ophim11.cc/uploads/movies/transit-love-phan-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/transit-love-phan-3-poster.jpg', '2024-02-11 14:32:57', 8, '', 114, 0),
(465, 'Nam Lai Bắc Vãng', 'Always on the Move', 2024, '<p>\"Nam Lai Bắc Vãng\" là một bộ phim truyền hình thể loại tình cảm lịch sử do Trịnh Hiểu Long (\"Hậu Cung Chân Hoàn Truyện\") và Lưu Chương Mục (\"Hành Động Phá Băng\") đồng đạo diễn. Phim có sự tham gia của Bạch Kính Đình (\"Tân Xuyên Nhật Thường\"), Kim Thần (\"Được Ăn Cả Ngã Về Không\"), và Đinh Dũng Đại (\"Phong Thần 1: Tam Bộ Khúc\") đảm nhận các vai chính. Vào cuối thập kỷ 1970, trên chuyến tàu hơi nước từ Ninh Dương đến cáp Nhĩ Tân, Uông Tân (do Bạch Kính Đình thủ vai), một thanh niên làm công việc kiểm soát trên tàu, đang chăm chỉ thực hiện nhiệm vụ giữ trật tự giữa đám đông hối hả. Anh nhầm lẫn Mã Khôi (do Đinh Dũng Đại thủ vai), một cựu cảnh sát đường sắt là một kẻ đang chạy trốn, cả hai mở đầu một mối quan hệ thầy trò không mấy dễ dàng. Từ việc ban đầu không thích nhau, đến sự đồng cảm và tôn trọng lẫn nhau, Uông Tân và Mã Khôi đồng lòng chiến đấu tại tuyến đầu của cảnh sát đường sắt.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/nam-lai-bac-vang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nam-lai-bac-vang-poster.jpg', '2024-02-11 14:32:59', 8, '', 45, 6),
(466, 'Đếm Ngược Ba Giây Để Yêu Em', 'Falling In Love With Me', 2023, 'Đồng Vũ Tâm sở hữu một sợi dây chuyền thần kỳ khiến cho người khác phải lòng cô trong một giờ đồng hồ. Nụ hôn ngoài ý muốn giữa cô và Đường Vũ Đồng khiến sợi dây chuyền chuyển qua người đối phương. Đồng Vũ Tâm mất đi phép thuật phải trở về nguyên trạng, nóng lòng muốn tiếp cận Đường Vũ Đồng để lấy lại sợi dây chuyền. Một bài học lãng mạn về tình yêu và âm nhạc cứ thế bắt đầu, quá khứ về mối tình đầu gửi gắm nhầm chỗ cũng được đưa ra ánh sáng.', 1, 'https://img.ophim11.cc/uploads/movies/dem-nguoc-ba-giay-de-yeu-em-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dem-nguoc-ba-giay-de-yeu-em-poster.jpg', '2024-02-11 14:33:05', 8, '', 10, 0),
(467, 'Sorbet Nam Việt Quất', 'Kızılcık Şerbeti', 2022, '<p>Kıvılcım (Evrim Alasya), một phụ nữ có học thức, thực tế và hiện đại, đã đứng vững sau khi ly hôn với chồng và nuôi dạy cả hai cô con gái theo những giá trị mà cô tin tưởng. Cô con gái út Çimen (Selin Türkmen) vẫn đang học trung học, trong khi cô con gái lớn Doğa (Sıla Türkoğlu) đang học nha khoa tại trường đại học. Mong muốn duy nhất của Kıvılcım là được nhìn thấy các con của mình thành công và hạnh phúc trong tương lai. Kıvılcım, người đã rất thất vọng khi Doğa kết hôn với bạn trai vào năm nhất đại học, đã trải qua cú sốc đầu đời khi con gái gặp gia đình chồng. Gia đình của chồng Doğa là Fatih (Doğukan Güngör) là một gia đình bảo thủ. Cô cho rằng con gái mình không thể sống với một gia đình có cái nhìn khác về cuộc sống như vậy. Nature tin rằng tình yêu của họ sẽ vượt qua mọi khác biệt. Đó là một câu chuyện tình yêu giữa hai gia đình cực đoan với cùng một sự thật nhưng cách thức khác nhau.</p>', 1, 'https://img.ophim.live/uploads/movies/sorbet-nam-viet-quat-thumb.jpg', 'https://img.ophim.live/uploads/movies/sorbet-nam-viet-quat-poster.jpg', '2024-02-11 14:33:08', 8, '', 2, 0),
(468, 'Lập nghiệp đi, tuổi trẻ', 'Start A Business! Guy', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/lap-nghiep-di-tuoi-tre-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/lap-nghiep-di-tuoi-tre-poster.jpg', '2024-02-11 14:35:13', 8, '', 11637, 0),
(469, 'Đòn bẩy (Phần 1)', 'Leverage: Redemption (Season 1)', 2021, '<p>The Hitter, Hacker, Grifter và Thief lại cùng nhau, lần này với sự giúp đỡ từ một thiên tài công nghệ mới và người sửa chữa công ty, để đối đầu với một loại nhân vật phản diện mới. Từ người đàn ông đã tạo ra cuộc khủng hoảng opioid từ sự thoải mái trong phòng họp của mình cho đến công ty bảo mật mờ ám giúp che giấu những bí mật nguy hiểm phải trả giá - khi ai đó cần giúp đỡ, họ sẽ cung cấp... Đòn bẩy.</p>', 1, 'https://img.ophim11.cc/uploads/movies/leverage-redemption-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/leverage-redemption-phan-1-poster.jpg', '2024-02-11 14:35:15', 8, 'https://www.youtube.com/watch?v=CPOeC78AV4M', 50, 15),
