(489, 'Cạm Bẫy Ngọt Ngào', 'Sweet Trap', 2024, '<p>Bếp trưởng kém tiếng tăm Khương Giới và cô học trò đầy sức sống Lý Nại từng là thanh mai trúc mã, nhiều năm sau trùng phùng lại trở thành đối thủ mang mối hận “đoạt đao”. Để trả thù Khương Giới đoạt đao, Lý Nại đành thâm nhập “nằm vùng” ở nhà hàng của Khương Giới. Từ thuở đầu không ưa nhau đến khi hiểu được lòng mình rồi hướng về phía nhau, cả hai cùng gặt hái được tình yêu và trưởng thành qua những cuộc đọ sức tài nấu bếp.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/cam-bay-ngot-ngao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cam-bay-ngot-ngao-poster.jpg', '2024-02-11 14:35:57', 8, '', 35, 0),
(490, 'Thôn Tính Bầu Trời', 'Swallowed Star', 2020, '<p>Trên Trái đất, một thảm họa đã gây ra sự biến đổi của muôn loài. Kẻ thượng đẳng sống sót và kẻ thấp kém bị tuyệt chủng. Trong hoàn cảnh đó, Luo Feng được thừa kế từ chủ nhân của Ngôi sao Yunmo và trở thành một trong ba người mạnh nhất trên Trái đất. Anh ta bị mất thịt của mình trong cuộc chiến chống lại con quái vật khổng lồ bị nuốt chửng nhưng sau đó anh ta đã lấy thịt của con quái vật. Trong xác thịt, anh ta đã phát triển một cơ thể người. Sau đó, anh bước ra khỏi Trái đất và hướng đến vũ trụ.</p>', 1, 'https://img.ophim.live/uploads/movies/thon-tinh-bau-troi-thumb.jpg', 'https://img.ophim.live/uploads/movies/thon-tinh-bau-troi-poster.jpg', '2024-02-11 14:35:59', 8, '', 24, 0),
(491, 'Con Gái Ngài Đại Sứ', 'Sefirin Kizi', 2019, '<p>\"The Ambassador\'s Daughter\" (tiếng Thổ Nhĩ Kỳ: \"Sefirin Kızı\") là một series phim truyền hình của Thổ Nhĩ Kỳ được phát sóng từ tháng 12 năm 2019. Bộ phim này kể về câu chuyện tình yêu giữa Sancar, con trai của một đại sứ, và Nare, con gái của một đại sứ khác. Câu chuyện tập trung vào tình yêu sâu đậm nhưng đầy thử thách và rắc rối giữa hai nhân vật chính, với nhiều bí mật gia đình, âm mưu và sự phản bội.</p><p>Bộ phim phản ánh sâu sắc về văn hóa, xã hội, và các mối quan hệ gia đình trong bối cảnh đương đại của Thổ Nhĩ Kỳ, đồng thời khám phá các chủ đề như lòng trung thành, tình yêu, sự tha thứ và sức mạnh của số phận. \"The Ambassador\'s Daughter\" nhận được sự chú ý không chỉ từ khán giả trong nước mà còn từ cả khán giả quốc tế, nhờ vào cốt truyện cuốn hút và diễn xuất xuất sắc của dàn diễn viên.</p>', 1, 'https://img.ophim.live/uploads/movies/con-gai-ngai-dai-su-thumb.jpg', 'https://img.ophim.live/uploads/movies/con-gai-ngai-dai-su-poster.jpg', '2024-02-11 14:37:58', 8, '', 120, 0),
(492, 'Chim Lửa', 'Ateş Kuşları', 2023, '<p>“Chúng ta là đủ cho nhau. Chúng ta là những con chim lửa được sinh ra từ đống tro tàn…”<br>Khi chúng ta bước vào năm 2000, 5 đứa trẻ lang thang trong tay một người đàn ông đi xin con: Ali, Mercan, Harpoon, Sabit, Kara... Họ trở thành anh em bằng cách bất chấp mọi sự phản bội của thế giới. Vì không có gốc rễ bám vào nên chúng dính mắc vào nhau gọi là vô gốc.</p><p>Số phận của những người không có nguồn gốc bị thay đổi khi họ tìm thấy một đứa trẻ trong thùng rác vào một đêm nọ. San hô trở thành mẹ của những người không có rễ khi còn nhỏ. Ali cũng là cha… Những người mất gốc, không thể tự chăm sóc bản thân quyết định nuôi nấng đứa bé này bằng những thứ nhặt được từ đống rác. Nhưng nó sẽ không được dễ dàng. Bởi vì cùng một đêm mang thai tội lỗi lớn. Bí mật mà những kẻ mất gốc sẽ mang trên lưng suốt đời này sẽ khiến Ali đau lòng nhất. Cả Çatal đã cầu xin họ và bí mật của đêm đó sẽ không bỏ mặc họ. Đối với những đứa trẻ đường phố sống sót bằng cách ôm nhau, bức màn bí mật 23 năm sẽ lại được mở ra khi Gülayşe yêu và Ủy viên Barbaros bước vào cuộc đời chúng...</p>', 1, 'https://img.ophim.live/uploads/movies/chim-lua-tho-nhi-ky-thumb.jpg', 'https://img.ophim.live/uploads/movies/chim-lua-tho-nhi-ky-poster.jpg', '2024-02-11 14:38:04', 8, '', 150, 0),
(493, 'Giấu Em', 'Sakla Beni', 2023, '<p>Mete và Naz là những đứa con cưng của những gia đình giàu có và quyền lực. Cả hai đều được chiều chuộng và quen với việc đạt được mọi thứ họ muốn trong cuộc sống. Câu chuyện của họ, bắt đầu từ lời hứa của gia đình họ thời thơ ấu, ngày nay tiến tới hôn nhân với việc họ không thể rời xa nhau. Nhưng khi cô hầu gái Bible của Naz, người đã ở bên anh từ khi còn nhỏ, đột nhiên xuất hiện trước mặt Mete, Mete đặt câu hỏi về tất cả những quyết định mà anh đã đưa ra trong cuộc đời. Liệu cuộc gặp gỡ giữa İncila và Mete này có thay đổi hướng câu chuyện mà Naz đã viết bằng tất cả sự bướng bỉnh của mình và giúp Mete tìm được tình yêu đích thực?</p>', 1, 'https://img.ophim11.cc/uploads/movies/giau-em-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giau-em-poster.jpg', '2024-02-11 14:38:19', 8, '', 135, 0),
(494, 'Hoang Dã', 'Yabani', 2023, '<p>Phim kể về câu chuyện của một đứa trẻ bị bắt cóc từ một gia đình có truyền thống lâu đời và rơi xuống đường, và cuộc đấu tranh để tái tạo lại bản thân sau nhiều năm trở về nhà.</p>', 1, 'https://img.ophim11.cc/uploads/movies/hoang-da-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoang-da-poster.jpg', '2024-02-11 14:38:25', 8, 'https://www.youtube.com/watch?v=pgvYnvBT8no', 120, 0),
(495, 'Tình Ca Ảo Mộng', 'Love Song For Illusion', 2024, '<p>Tình Ca Ảo Mộng - Love Song For Illusion kể về câu chuyện tình yêu của Sajo Huyn (người có 2 tính cách trái ngược nhau) và Yeon Wol - một nữ sát thủ. Ban đầu nữ sát thủ muốn sát hại Sajo Huyn nhưng sau đã đem lòng yêu mến và có tỉnh cảm với chàng. Thái tử Sajo Huyn là một người đa tài, tri thức, đã sử dụng khả năng nghệ thuật của mình để mở một tiệm y phục trong thành nhưng lại che dấu danh tính thái tử của mình. Thái tử có một vết thương lòng khi còn nhỏ đã bị người cha áp bức. Nhân cách khác của Sajo Huyn, là một người vô cùng quyến rũ, có thể dễ dàng quyến rũ người khác tuy nhiên anh lại bị lời nguyền sẽ cảm thấy đau đớn khi chạm vào cơ thể người khác. Yeon Wol sống một cuộc đời với nhiều biến cố, từ một sát thủ rồi trở thành vợ lẽ. Yeon Wol là hậu duệ hoàng gia của triều đại Yeon đã sụp đổ và là con gái duy nhất của Yeon Poong Hak. Yeon Wol che giấu danh tính và trở thành sát thủ Gye Ra để trả thù cho gia đình cô. Trong khi cô cố gắng ám sát nhà Sajo Huyn, cô đã rơi vào bẫy do 1 kẻ lạ mặt sắp đặt từ trước và hôm sau tỉnh dậy không còn chút ký ức nào về quá khứ của mình.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/tinh-ca-ao-mong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tinh-ca-ao-mong-poster.jpg', '2024-02-11 14:38:31', 8, '', 49, 11),
(496, 'Ted', 'Ted', 2024, '<p>Là năm 1993 và khoảnh khắc nổi tiếng của chú gấu Ted đã qua, khiến anh phải sống cùng với người bạn thân nhất của mình, John Bennett, 16 tuổi, trong một ngôi nhà thuộc tầng lớp lao động ở Boston cùng với bố mẹ và anh em họ của mình. Ted có thể không phải là ảnh hưởng tốt nhất đối với John, nhưng khi mọi việc trở nên nghiêm trọng, anh sẵn lòng làm mọi thứ để giúp đỡ bạn bè và gia đình của mình.</p>', 1, 'https://img.ophim11.cc/uploads/movies/ted-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ted-poster.jpg', '2024-02-11 14:38:36', 8, 'https://www.youtube.com/watch?v=aq2Vt7OvQG0', 50, 0),
(497, 'Nguyệt Đao Dị Giới (Phần 2)', 'Tsukimichi -Moonlit Fantasy- Season 2 / Tsuki ga Michibiku 2', 2024, '<p>Makoto Misumi chỉ là một học sinh trung học bình thường sống một cuộc sống bình thường, nhưng đột nhiên bị triệu hồi đến thế giới khác để trở thành một “anh hùng”. Tuy nhiên, nữ thần của thế giới đó đã lăng mạ anh ta vì sự khác biệt và tước bỏ danh hiệu “anh hùng” của anh ta, trước khi tống cổ anh ta đến vùng hoang dã ở rìa thế giới. Khi đi lang thang trong vùng hoang dã, Makoto chạm trán với rồng, nhện, Orc, người lùn và đủ loại bộ tộc không phải con người. Bởi vì Makoto đến từ một thế giới khác, anh ta có thể giải phóng sức mạnh ma thuật và kỹ năng chiến đấu ngoài sức tưởng tượng. Nhưng anh ấy sẽ xử lý như thế nào khi gặp nhiều loài sinh vật khác nhau và tồn tại trong một môi trường mới?</p>', 1, 'https://img.ophim11.cc/uploads/movies/nguyet-dao-di-gioi-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguyet-dao-di-gioi-phan-2-poster.jpg', '2024-02-11 14:38:41', 8, 'https://www.youtube.com/watch?v=U8T63kIny7E', 24, 0),
(498, 'Kỳ Kim Triêu', 'Sword and Fairy', 2024, '<p>Việt Kim Triêu và Việt Kỳ sống cùng nhau ở thôn Ô Nham ba năm, có mối quan hệ \"cộng hưởng\" kỳ diệu, nhưng lại không hay biết gì về thân thế của nhau. Hai người cùng nhau xông pha giang hồ, mong có thể tìm lại ký ức về quá khứ. Cả hai bị cuốn vào một loạt sự kiện bí ẩn như cuộc nổi loạn của thánh tông Khải Hồn và vụ huyết tế của thành Lạc gia... Trong quá trình chiến đấu chống lại thánh tông, ký ức và tình cảm bị phong ấn của Việt Kỳ đã vô tình được mở ra... Theo các sự kiện, Việt Kim Triêu và Việt Kỳ quen được cặp song sinh của thành Lạc gia là Lạc Mai Danh và Lạc Chiêu Ngôn, Lang yêu ngàn năm Nhàn Khanh, thầy trò Cố Hàn Giang và Minh Tú, Cư Thập Phương… cùng nhiều nhân sĩ giang hồ khác, thân phận thực sự của hai người cũng dần được hé lộ. Các thế lực lớn như Chính Vũ Minh, thánh tông Khải Hồn, Hoành Đạo Chúng, tộc Ngu Yêu lần lượt kéo đến, ai mới là kẻ đứng sau gài bẫy? Trong kế có kế, trong bẫy có bẫy, không tiếc xả thân đổi vận, chỉ để gặp lại hôm nay.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/ky-kim-trieu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ky-kim-trieu-poster.jpg', '2024-02-11 14:38:42', 8, '', 45, 6),
(499, 'Không Biết Cốt Truyện Cũng Không Sao', 'It Doesn\'t Matter if You Don\'t Know the Plot', 2024, '<p>Zhang Yimeng, người sống ở thời hiện đại, tin chắc rằng cô là một công chúa du hành xuyên thời gian từ Vương quốc Tây, và đang thử mọi cách có thể để quay về quá khứ. Một cơn choáng váng bất ngờ thực sự đã đưa cô trở lại đất nước Xi cổ xưa, nơi xung quanh vừa quen mà lại vừa xa lạ. Tuy nhiên, đây thực chất là một phương pháp điều trị do cha cô và bác sĩ tâm thần Jing Cheng lên kế hoạch cho cô! Cái nào đúng hay sai, mọi thứ đều đầy sự đảo ngược!</p>', 1, 'https://img.ophim11.cc/uploads/movies/khong-biet-cot-truyen-cung-khong-sao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/khong-biet-cot-truyen-cung-khong-sao-poster.jpg', '2024-02-11 14:38:47', 8, '', 10, 0),
(500, 'Thua Lỗ Thành Thủ Phủ Từ Trò Chơi', '亏成首富从游戏开始', 2024, 'Thua Lỗ Thành Thủ Phủ Từ Trò Chơi', 1, 'https://img.ophim11.cc/uploads/movies/thua-lo-thanh-thu-phu-tu-tro-choi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thua-lo-thanh-thu-phu-tu-tro-choi-poster.jpg', '2024-02-11 14:38:49', 8, '', 20, 0),
(501, 'Máu Lạnh', 'The Two Sisters | In Cold Blood', 2024, '<p><br>Hai chị em Lee Hye Won và Lee Hye Ji rất thân thiết khi còn nhỏ. Sau khi bố mẹ họ ly hôn, họ đã bị chia cắt. Lee Hye Won đi sống với cha, còn Lee Hye Ji đi sống với mẹ. Cuộc sống của họ đi theo những con đường khác nhau, nhưng cả hai đều trải qua những thời kỳ khó khăn.</p><p>Khi trưởng thành, Hye Won trông có vẻ hoàn hảo, nhưng cô ấy mang những vết thương tinh thần. Cuộc sống của cô bị chi phối bởi mẹ kế. Hôn phu của cô là Yoon Ji Chang, và họ sắp kết hôn. Yoon Ji Chang là con trai của Yoon Yi Cheol, chủ tịch Tập đoàn JY.</p><p>Trong khi đó, Hye Ji đã sống qua những ngày tháng nghèo khó, cô đơn và bạo lực gia đình do mẹ và cha dượng của mình. Cô rất muốn thay đổi cuộc đời mình và đã lấy tên mới là Bae Do Eun. Sau đó, cô gặp Yi Cheol, chủ tịch của Tập đoàn JY. Để khởi đầu lại cuộc đời, cô bắt đầu một mối quan hệ với Yi Cheol. Rồi, cô gặp lại chị gái Hye Won, lần đầu tiên kể từ khi họ còn nhỏ.</p>', 1, 'https://img.ophim11.cc/uploads/movies/mau-lanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mau-lanh-poster.jpg', '2024-02-11 14:38:50', 8, '', 60, 0),
(502, 'I Am Bruce Lee', 'I Am Bruce Lee', 2012, 'Bruce Lee is universally recognized as the pioneer who elevated martial arts in film to an art form, and this documentary will reveal why Bruce Lee\'s flame burns brighter now than the day he died over three decades ago. The greatest martial artists, athletes, actors, directors, and producers in the entertainment business today will share their feelings about the one who started it all. We will interview the people whose lives, careers, and belief systems were forever altered by the legendary \"Father of Martial Arts Cinema\". Rarely seen archival footage and classic photos will punctuate the personal testimonials. Prepare to be inspired.', 0, 'https://img.ophim11.cc/uploads/movies/i-am-bruce-lee-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/i-am-bruce-lee-poster.jpg', '2024-02-11 14:38:54', 8, 'https://www.youtube.com/watch?v=jQgjo9Wm0sg', 94, 0),
(503, 'Madagascar: Africa\'s Galapagos', 'Madagascar: Africa\'s Galapagos', 2019, 'This film reveals some of Madagascar\'s secretive and rarely filmed inhabitants, from the apex predator, the fossa, to the aye aye – possibly the weirdest creature on earth.', 0, 'https://img.ophim11.cc/uploads/movies/madagascar-africas-galapagos-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/madagascar-africas-galapagos-poster.jpg', '2024-02-11 14:39:00', 8, '', 44, 0),
(504, 'Chim Bói Cá', 'Yali Çapkini', 2022, '<p>Halis Ağa là chủ sở hữu của một đế chế đồ trang sức lớn và là người đứng đầu gia tộc Korhan. Mặc dù con trai ông Orhan và cháu trai lớn Fuat điều hành hầu hết công việc kinh doanh, ông vẫn đưa ra những quyết định quan trọng nhất trong công ty. Cháu trai Ferit của ông, người hoàn toàn trái ngược với anh trai Fuat của mình, là một cử nhân trẻ tuổi rất vô trách nhiệm, người vừa trở về từ nước ngoài nơi ông đến học. Halis không thể chịu được nữa về sự liều lĩnh của Ferit và anh ta buộc tội con dâu góa chồng Ifakat của mình là phải tìm cho anh ta một cô gái đẹp để kết hôn.</p><p>Tin tức rằng Halis Ağa đang tìm một cô dâu cho cháu trai của mình, đến như một tia sáng từ màu xanh vào biệt thự của Kazım ở Gaziantep. Niềm hy vọng làm giàu duy nhất của Kazım là những cô con gái xinh đẹp của mình, Suna và Seyran. Sau khi Ifakat nhìn thấy Suna và quyết định cô ấy là cô gái phù hợp với Ferit, gia đình đã đến Gaziantep để yêu cầu Suna kết hôn. Nhưng trước buổi lễ, Ferit và Seyran gặp nhau mà không nhận ra rằng họ được cho là trở thành anh trai và em dâu, và Ferit đã bị cô ấy say mê.</p><p>Cuộc sống của hai chị em thay đổi mãi mãi khi Ferit quyết định kết hôn với Seyran thay vì Suna. Trong khi Kazım vui mừng vì đã có được một khối tài sản lớn thì Seyran sẽ là cô dâu mới trong một gia đình đầy rẫy những phản bội, dối trá và bí mật. Trong khi Suna sẽ bắt đầu thực hiện kế hoạch trả thù để lấy lại tương lai bị đánh cắp của mình, cuộc sống tại biệt thự sẽ còn khó khăn hơn với những xung đột quyền lực của hai anh em.</p>', 1, 'https://img.ophim11.cc/uploads/movies/chim-boi-ca-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chim-boi-ca-poster.jpg', '2024-02-11 14:39:02', 8, '', 230, 0),
(505, 'Hoa Mãn Lâu Chi Tuyệt Thế Hoa Khôi', 'Blossom Dumping World', 2023, 'Bộ phim kể về cô nàng sự nghiệp Hạ Tiểu Thanh, trong một lần uống say đã xuyên không trở thành hoa khôi thời cổ đại. Trong lúc trải nghiệm cuộc sống cổ đại, nguy hiểm cũng lặng lẽ ập đến. Cô nàng không ngừng nỗ lực Hạ Tiểu Thanh phải lựa chọn giữa tình yêu nam nữ và đại nghĩa nước nhà, dựa vào năng lực bản thân để hóa giải bao hiểm nguy, tìm được tình yêu và tự chuộc bản thân. Sau khi quay về hiện thực, cuối cùng cô cũng hiểu được ý nghĩa cuộc đời mình.', 1, 'https://img.ophim11.cc/uploads/movies/hoa-man-lau-chi-tuyet-the-hoa-khoi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoa-man-lau-chi-tuyet-the-hoa-khoi-poster.jpg', '2024-02-11 14:39:58', 8, '', 10, 0),
(506, 'Nhúng Chàm', 'Indulgence', 2024, 'Chàng trai và cô gái chơi với nhau từ nhỏ vì một vụ tai nạn giao thông mà bỏ lỡ nhau rất nhiều năm. Ấy thế mà khi gặp lại họ đã trở thành chị em không phải ruột thịt gì. Cả hai đi từ thăm dò lẫn nhau đến giằng xé tâm can, vùng vẫy đấu tranh giữa tình yêu và hận thù gia tộc có thể xảy ra. Sau khi lần theo manh mối, họ cùng nhau tìm ra sự thật về vụ tai nạn giao thông đó, hai người yêu nhau đi đến kết cục viên mãn.', 1, 'https://img.ophim11.cc/uploads/movies/nhung-cham-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhung-cham-poster.jpg', '2024-02-11 14:39:59', 8, '', 10, 0),
(507, 'Được Ăn Cả Ngã Về Không', 'No More Bets', 2023, '<p>Một lập trình viên chán nản (do Zhang Yixing thủ vai) và một người mẫu (do Jin Chen thủ vai) quyết định ra ngoài tìm vàng vì cơ hội việc làm có vẻ tốt, nhưng họ lại vô tình dính vào một vụ lừa đảo được lên kế hoạch kỹ lưỡng trên Internet. .</p>', 0, 'https://img.ophim11.cc/uploads/movies/duoc-an-ca-nga-ve-khong-trung-quoc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/duoc-an-ca-nga-ve-khong-trung-quoc-poster.jpg', '2024-02-11 14:40:01', 8, 'https://www.youtube.com/watch?v=gcJ6srb6PbY', 100, 1),
(508, 'Người hành pháp: Bass Reeve', 'Lawmen: Bass Reeves', 2023, '<p>Câu chuyện về Bass Reeves, luật sư huyền thoại của miền Tây hoang dã, được tái hiện sống động. Reeves làm việc trong thời kỳ hậu Tái thiết với tư cách là sĩ quan hòa bình liên bang ở Lãnh thổ Da đỏ, bắt giữ hơn 3.000 tên tội phạm nguy hiểm nhất mà không hề bị thương — và được cho là nguồn cảm hứng cho The Lone Ranger.</p>', 1, 'https://img.ophim11.cc/uploads/movies/nguoi-hanh-phap-bass-reeve-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-hanh-phap-bass-reeve-poster.jpg', '2024-02-11 14:40:05', 8, 'https://www.youtube.com/watch?v=ehkbn36ohCY', 60, 0),
(509, 'Tears in the Amazon', 'Tears in the Amazon', 2010, 'A documentary about environment destruction in the Amazon and the tribes living there. Produced for the 48th anniversary of MBC, Korea. A brilliant records of the itinerary for 250 days through the Amazon.', 0, 'https://img.ophim11.cc/uploads/movies/tears-in-the-amazon-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tears-in-the-amazon-poster.jpg', '2024-02-11 14:40:10', 8, '', 98, 1),
(510, 'Cô hầu gái (bản Việt Nam)', 'Cô hầu gái', 2016, '<p><strong>Phim Cô Hầu Gái (bản Việt Nam) – The Housemaid (2016)</strong> không đặc biệt độc đáo hay sáng tạo nhưng với những cảnh quay đẹp mắt của Việt Nam, đây hóa ra là một biến thể rất đáng xem về một chủ đề. Nội thất chính của ngôi nhà thuộc địa tuyệt vời cũng tạo nên một khung cảnh xa hoa. Một điều hơi khó chịu đối với khán giả người Anh là sự pha trộn giữa những người nói tiếng Việt và tiếng Anh địa phương thực sự đại diện cho người bản địa và quân xâm lược Pháp vào thời điểm xảy ra xung đột vào đầu những năm 50 ở nơi được gọi là Đông Dương.</p>', 0, 'https://img.ophim11.cc/uploads/movies/co-hau-gai-ban-viet-nam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-hau-gai-ban-viet-nam-poster.jpg', '2024-02-11 14:40:12', 8, '', 145, 2),
(511, 'Gia Đình', 'Aile', 2023, '<p>Chiếc bàn là nơi duy nhất nhắc nhở người Soykan rằng họ là \'gia đình\'. Ngày hôm đó, trong khi đang dọn bàn để cả gia đình quây quần, Aslan có mặt trên chuyến bay đến Izmir để giải quyết một trong những chuyện \"đen tối\" liên quan đến chú của mình.</p><p>Nhà tâm lý học Devin và Aslan gặp nhau trên hành trình này. Devin cũng sẽ đến Izmir để giải quyết một rắc rối mới mà em gái anh ấy vướng phải. Rất rõ ràng rằng họ là những người thuộc các thế giới khác nhau. Nhưng không mất nhiều thời gian để họ phát hiện ra \'vết thương\' chung của mình; những gia đình của họ.</p><p>Aslan đã phá vỡ một quy tắc rất quan trọng của Hiến pháp Soykan đối với Devin ngay từ đêm đầu tiên. Điều này là đủ để mẹ cô là Hülya, người luôn cảm thấy có một sự gắn bó ám ảnh với Aslan, nhận ra mối nguy hiểm lớn đang đến gần; Devin.</p><p>Công việc của Hülya, người đã nhiều lần thể hiện rằng cô ấy có thể làm mọi cách để ngăn con trai mình rời xa gia đình, sẽ không còn dễ dàng như trước vào thời điểm này. Tuy nhiên, Hülya không phải là người duy nhất có công việc không dễ dàng. Cuộc chạm trán trên máy bay Izmir sẽ chỉ là khởi đầu của con đường khó khăn mà những anh hùng bị thương của chúng ta sẽ đi để thành lập gia đình của riêng họ.</p>', 1, 'https://img.ophim11.cc/uploads/movies/gia-dinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/gia-dinh-poster.jpg', '2024-02-11 14:40:16', 8, '', 120, 0),
(512, 'Bất Tử Bất Diệt: Thiếu Niên Xuất Sơn', 'The Eternal Strife', 2023, '<p>Trong nỗ lực tìm hiểu các nguyên tắc cơ bản của võ thuật, một chàng trai trẻ bình thường ở một thị trấn nhỏ bị ai đó lừa gạt, trải qua một mối quan hệ lãng mạn khủng khiếp và bị lôi kéo vào sự bất đồng trong cộng đồng võ thuật. Những người khác sai lầm anh ta vì anh ta là ai. Anh bắt đầu hành trình chiến đấu với thiên đường trong khi chiến đấu để sinh tồn và dần lấy lại ký ức về kiếp trước của mình. Anh ấy có được tình yêu vô giá nhất và tình bạn sâu sắc nhất trong suốt cuộc hành trình này. Anh ta phải chịu đựng vô số khó khăn và khả năng phải chết, nhưng anh ta không bao giờ từ bỏ con người thật của mình. Dù đối thủ có ghê gớm đến đâu, anh cũng không bao giờ lùi bước trong cuộc đấu tranh vì công lý, bản thân và số phận của mình.(Bstation)</p>', 1, 'https://img.ophim11.cc/uploads/movies/bat-tu-bat-diet-thieu-nien-xuat-son-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bat-tu-bat-diet-thieu-nien-xuat-son-poster.jpg', '2024-02-11 14:40:18', 8, '', 18, 0),
(513, 'Chặng đường Pon', 'ぽんのみち', 2024, 'Nashiko Jippensha, một nữ sinh trung học sống ở thành phố Onomichi, tỉnh Hiroshima, gặp rắc rối sau khi bị đuổi ra khỏi nhà. Cô nói: “Tôi không có nơi nào để đi chơi với bạn bè…” Khi Naoko biết được rằng phòng khách mà cha cô từng điều hành giờ đã bị bỏ trống, cô quyết định xây lại nó thành nơi mọi người có thể tụ tập.', 1, 'https://img.ophim11.cc/uploads/movies/chang-duong-pon-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chang-duong-pon-poster.jpg', '2024-02-11 14:40:23', 8, '', 24, 2),
(514, 'a sheep in wolf\'s clothing', '披着狼皮的羊', 2023, 'a sheep in wolf&#39;s clothing', 1, 'https://img.ophim11.cc/uploads/movies/a-sheep-in-wolfs-clothing-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/a-sheep-in-wolfs-clothing-poster.jpg', '2024-02-11 14:40:25', 8, '', 19, 0),
(515, 'Chiến Tranh 	Goryeo-Khitan', 'Korea-Khitan War', 2023, '<p>Vua Hyeonjong và Kang Kam-chan dẫn dắt Chiến tranh Triều Tiên-Khitan kéo dài 26 năm đến thắng lợi và bắt đầu kỷ nguyên hòa bình ở Đông Á và thịnh vượng ở Cao Ly.</p>', 1, 'https://img.ophim11.cc/uploads/movies/chien-tranh-goryeo-khitan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chien-tranh-goryeo-khitan-poster.jpg', '2024-02-11 14:41:19', 8, '', 80, 12);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(516, 'Như Hoa Trên Cát', 'Like Flowers in Sand', 2023, '<p>Vật lộn tìm kiếm thành công, cựu thần đồng đấu vật nọ suýt bỏ cuộc cho đến khi gặp lại một người bạn cũ giúp khơi dậy đam mê của anh.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/nhu-hoa-tren-cat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhu-hoa-tren-cat-poster.jpg', '2024-02-11 14:41:32', 8, 'https://www.youtube.com/watch?v=ZHyQb0xFYLg', 45, 0),
(517, 'Tiên Kiếm Kỳ Hiệp 4 ', 'Sword and Fairy 4', 2024, 'This fourth season took place prior to the \"Chinese Paladin 3\" season.\n\nYun Tian He, a young man who had been living alone on a mountain peak, was on a regular boar hunting trip when he came across the young woman Han Ling Sha, from a clan of short-lived tomb raiders, attempting to break into his parents\' tomb, culminating in the destruction of the tomb, and setting him on a journey alongside Ling Sha to the outside world to uncover his parents\' past. On the journey, they encountered and befriended the adopted daughter of the magistrate of Shouyang, Liu Meng Li, who seemed to have connections to Tian He\'s father, and a skilled and kind swordmaster who trained at Mt. Kunlun\'s Qionghua School since a young age, Murong Zi Ying.', 1, 'https://img.ophim11.cc/uploads/movies/tien-kiem-ky-hiep-4-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tien-kiem-ky-hiep-4-poster.jpg', '2024-02-11 14:41:41', 8, '', 40, 7),
(518, 'Phong Thần Lôi Chấn Tử', 'League of Gods: Leizhenzi', 2024, '<p>Vào những năm cuối thời nhà Thương, Trụ Vương cai trị ngang ngược, bị yêu hồ Tô Đát Kỷ dụ dỗ trở thành vị vua dâm đãng, ma quỷ và tai họa hoành hành ở thành n Thương. Con trai nuôi của Cơ Xương là Lôi Chấn Tử đã gây ra một trận đại náo ở động hồ ly khiến Đát Kỷ cảm thấy hận anh ta. Lôi Chấn Tử đã chiến đấu quyết liệt với Đát Kỷ, phá hết mọi âm mưu của Đát Kỷ, đánh bại lũ quỷ và trở thành một huyền thoại mới...</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/phong-than-loi-chan-tu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phong-than-loi-chan-tu-poster.jpg', '2024-02-11 14:41:50', 8, '', 64, 0),
(519, 'Họa Giang Hồ: Bất Lương Soái', 'The Story of Yuan Tiangang', 2024, '<p>Ba trăm năm trước, Thiếu niên xuất sắc Viên Thiên Cương, do số mệnh tự nhiên bị bỏ rơi, từ nhỏ đã giết chết những người thân xung quanh mình. Từ đó, anh quyết định sử dụng nghệ thuật chiêm tinh \"Châm Cốt Chiêm Mệnh\", chuyên sát hại những người có số mệnh không nên chấm dứt. Lúc đó, là cuối thời kỳ nhà Tùy, khi đất nước hỗn loạn Viên Thiên Cương sẽ làm thế nào để thay đổi số phận và trở thành một tướng quân mà mọi người kính trọng?</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoa-giang-ho-bat-luong-soai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoa-giang-ho-bat-luong-soai-poster.jpg', '2024-02-11 14:41:57', 8, 'https://www.youtube.com/watch?v=5NnH2yWQNq8', 0, 1),
(520, 'Hồ Sơ Tội Phạm', 'Criminal Record', 2024, 'Ở trung tâm London, một cuộc điện thoại ẩn danh đã thu hút hai thanh tra tài giỏi — một phụ nữ trẻ đang ở giai đoạn đầu sự nghiệp và một người đàn ông có giao thiệp tốt quyết tâm bảo vệ di sản của mình — tham gia vào cuộc chiến sửa sai một vụ án oan cũ.', 1, 'https://img.ophim11.cc/uploads/movies/ho-so-toi-pham-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ho-so-toi-pham-poster.jpg', '2024-02-11 14:42:11', 8, 'https://www.youtube.com/watch?v=G_sohSQWHvg', 45, 1),
(521, 'Đại Giang Đại Hà (Phần 3)', 'Like a Flowing River', 2024, '<p>Tháng 6 năm 1993, sự hợp tác quốc tế giữa Công ty Hóa chất Đông Hải và Công ty Lạc Đạt đang diễn ra hết sức sôi nổi, và người chủ chốt đưa ra quyết định hợp tác này là Tống Vận Huy, hiện đang đẩy mạnh quá trình cải tiến công nghệ tại Nhà máy Thuốc trừ sâu Phương Diện thuộc Đông Hải, cùng với đội ngũ công nhân. Sau những thăng trầm lớn từ Đông Hải đến Phương Diện, nơi mà Tống Vận Huy không hiểu biết về ngành công nghiệp thuốc trừ sâu, anh vẫn giữ vững tinh thần chiến đấu ban đầu, kiên trì dẫn dắt mọi người trong quá trình nghiên cứu và phát triển thuốc trừ sâu hiệu quả và an toàn, giúp những nhà máy thuốc trừ sâu nhỏ lẻ nơi mà đã bị cấm hoạt động trở lại. Lôi Đông Bảo, dẫn dắt nhà máy dây điện Đăng Phong, hợp nhất các nhà máy nhỏ, thành lập tập đoàn dây cáp Lôi Đình, thiết lập quy tắc, tham gia đấu thầu, phát triển thương mại quốc tế, thu hút đầu tư, trải qua những gian khổ và trái ngược của đời sống, anh vẫn đặt lợi ích của cộng đồng và dân làm chủ hàng đầu. Dương Tuân và Lương Tư Thân hợp tác xây dựng một trung tâm thương mại, phát triển mối quan hệ với Lương gia. Trong bóng tối của thị trường kinh doanh, anh ta lần lữa giữa việc làm người tốt hay làm người xấu, nhưng cuối cùng vẫn làm những điều mà lòng an tâm. Lương Tư Thân cố gắng cân bằng lợi ích giữa Lạc Đạt và Đông Hải trong dự án liên doanh, nhưng đồng nghiệp từ Lạc Đạt đã làm lớn chuyện trong một cuộc xung đột quốc tế, tận dụng cơ hội đưa ra điều kiện để Lương Tư Thân từ chức. Cuối cùng, Lương Tư Thân nhượng bộ, sử dụng sự rút lui của mình để Đông Hải có thể khôi phục sản xuất an toàn. Từ việc tránh né ban đầu đến dần dần mở lời lòng, Tống Vận Huy và Lương Tư Thân trao đổi tâm tư, cùng nhau đối mặt với những thách thức của tương lai.Con đường đã có những thăng trầm, hoàn cảnh có thay đổi nhưng điều không t</p>', 1, 'https://img.ophim11.cc/uploads/movies/like-a-flowing-river-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/like-a-flowing-river-poster.jpg', '2024-02-11 14:42:26', 8, '', 45, 14),
(522, 'Tàng Dược Lệnh', 'The Divine Healer', 2024, '<p>Xiao Lan, yêu tinh thảo dược ở Làng Thảo Dược, đã bất ngờ cứu được A Cửu, một sĩ quan quân y, người có khả năng vượt qua \"ranh giới\" của Làng Thảo Dược. Cô không hề hay biết rằng A Cửu, không chỉ được tôn vinh với danh hiệu \"Thần Y Jiu\", mà còn có một danh tính bí mật - là chỉ huy của Cục Thượng Thanh, nhiệm vụ của ông là bắt giữ yêu tinh thảo mộc Jiu Ming.</p><p>Xiao Lan và A Cửu, thông qua những bước ngoặt của số phận, đã tạo nên một mối liên kết đặc biệt, nơi họ chia sẻ cuộc sống và những vết thương của mình, dẫn đến một trò chơi mèo vờn chuột và hé lộ số phận chằng chịt của họ trong cuộc sống quá khứ và hiện tại.</p>', 1, 'https://img.ophim11.cc/uploads/movies/tang-duoc-lenh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tang-duoc-lenh-poster.jpg', '2024-02-11 14:42:31', 8, '', 10, 0),
(523, 'My Universe: Vũ Trụ Của Tôi', 'My Universe', 2023, '<p>My Universe: Vũ Trụ Của Tôi</p>', 1, 'https://img.ophim11.cc/uploads/movies/my-universe-vu-tru-cua-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/my-universe-vu-tru-cua-toi-poster.jpg', '2024-02-11 14:42:32', 8, '', 45, 0),
