(544, 'Thực Tập Sinh Trong Trái Tim Tôi', 'Intern in my heart', 2024, '<p>Ray là một thực tập sinh có khả năng đặc biệt để nhìn ra danh tính thực sự của sếp mình, Rin, người mà mọi người coi là ác quỷ. Tuy nhiên, anh sẽ làm mọi cách để chiếm được trái tim cô.</p>', 1, 'https://img.ophim11.cc/uploads/movies/thuc-tap-sinh-trong-trai-tim-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thuc-tap-sinh-trong-trai-tim-toi-poster.jpg', '2024-02-11 14:46:18', 8, 'https://www.youtube.com/watch?v=UH1cGslrSNg', 25, 0),
(545, 'Người Phiên Dịch Của Chúng Tôi', 'Our Interpreter', 2024, '<p>\"Người Phiên Dịch Của Chúng Tôi\" là bộ phim tình cảm do đạo diễn Trương Đồng chỉ đạo, với sự tham gia của Tống Thiến (đóng phim \"Phong Khởi Lạc Dương\") và Trần Tinh Húc (đóng phim \"Đông Cung\") làm vai chính. Ngoài ra, còn có sự xuất hiện của Phí Khải Minh (đóng phim \"Vụ Án Lụa Duyên Dưới Kính Hiển Vi của Đại Minh\"), Lâm Tử Lộ (đóng phim \"Thế Giới Mới Của Bà\"), và Ư Sa Sa (đóng phim \"Thế Giới Mới Của Bà\").<br>Câu chuyện xoay quanh Lâm Tây, một chuyên gia phiên dịch xuất sắc và cuộc gặp gỡ lại với người yêu cũ Tiêu Nhất Thành. Tám năm trước, để theo đuổi giấc mơ nghề nghiệp mà mẹ cô chưa thể hoàn thành, Lâm Tây chấp nhận chia tay với Tiêu Nhất Thành để trở thành một chuyên gia phiên dịch tại Liên Hợp Quốc. Sau tám năm, Lâm Tây đã trở thành chuyên gia phiên dịch hàng đầu và \"Nữ Hoàng Hiệu Suất\" trẻ nhất tại Hoa Thanh, trong khi Tiêu Nhất Thành đã trở thành Giám đốc Công nghệ hàng đầu tại Language World.<br>Để chiếm lấy hợp đồng của Tiêu Nhất Thành, Lâm Tây phải đối đầu với anh. Mặc dù ban đầu có vẻ như Tiêu Nhất Thành đang trả thù, nhưng anh không chỉ là tàn nhẫn mà còn dành tình cảm cho cô. Trong quá trình làm việc và tiếp xúc, tình cảm mạnh mẽ từ quá khứ của họ được nhen nhóm trở lại. Tiêu Nhất Thành dần hiểu rõ về lý do chia tay của Lâm Tây và thấy nỗ lực không ngừng của cô trên con đường theo đuổi giấc mơ. Anh quyết định trở thành điểm tựa vững chắc cho cô, động viên và ở bên khi cô gặp khó khăn.<br>Qua sự thấu hiểu và đồng lòng, hai người cuối cùng trở thành đôi và thực hiện giấc mơ nghề nghiệp đại diện cho đất nước.</p>', 1, 'https://img.ophim11.cc/uploads/movies/nguoi-phien-dich-cua-chung-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-phien-dich-cua-chung-toi-poster.jpg', '2024-02-11 14:46:34', 8, 'https://www.youtube.com/watch?v=B1MSPexIDiI', 45, 1),
(546, 'Mật Vụ Ong', 'The Beekeeper', 2024, 'One man’s campaign for vengeance takes on national stakes after he is revealed to be a former operative of a powerful and clandestine organization known as Beekeepers.', 0, 'https://img.ophim11.cc/uploads/movies/mat-vu-ong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mat-vu-ong-poster.jpg', '2024-02-11 14:46:41', 8, 'https://www.youtube.com/watch?v=SzINZZ6iqxY', 105, 0),
(547, 'Tấn Văn Công Truyền Kỳ ', 'Tấn Văn Công Truyền Kỳ ', 1989, '<p><i>Tấn Văn Công Truyền Kỳ dựa trên một cổ truyện của Xuân Thu Chiến Quốc, nội dung phim xoay quanh vị vua thứ 24 của nước Tấn tên là Tấn Văn Công, thời đó nước Tấn là chư hầu của nhà Chu. Vua Tấn Hiến Công có 3 người con trai là Trùng Nhĩ, Tân Sanh và Di Ngô. Trong khi Tân Sanh là người đam mê y thuật nên từ đầu tới cuối không có chút ham muốn với ngôi vị cao nhất của quốc gia thì người anh Di Ngô (Huỳnh Tử Dương) có dã tâm rất lớn, có thể làm mọi thứ để có thể kế vị ngôi vua. Lúc này, Trùng Nhĩ (Lê Minh) vì không muốn xảy ra bất hòa với anh em trong việc tranh giành kế vị nên cậu quyết định xuất ngoại du lịch từ đó mà quen biết được với công chúa Dinh Hoài (La Huệ Quyên) của nước Tần. Tuy nhiên, vì thời thế loạn lạc mà 2 người không thể nên duyên vợ chồng. Không lâu sau, vua Hiến Công băng hà, gian phi đã cử con là Cơ Khê Tề lên ngôi, việc này khiến cho bá quan văn võ trong triều không phục, Di Ngô chính là người được ủng hộ về nước giành lại ngôi và tìm cách hãm hại Trùng Nhĩ. Nhĩ sau đó phải lưu vong đến Xích Địch Quốc được công chúa củng cố thế lực. Một thời gian sau, tình hình triều chính của nước Tấn ngày càng lục đục, Trùng Nhĩ trở về để chủ trì đại cuộc, rồi được phong lên làm vua, hiệu là Tấn Văn Công. Cũng nhờ có Tấn Văn Công mà tiên tổ nước Triệu, nước Ngụy và nước Hàn dần có thế lực, kết quả là tạo nên 3 quốc gia Tam Tấn nổi tiếng thời Chiến Quốc.</i></p>', 1, 'https://img.ophim11.cc/uploads/movies/tan-van-cong-truyen-ky-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tan-van-cong-truyen-ky-poster.jpg', '2024-02-11 14:47:03', 8, '', 45, 17),
(548, 'Truyền Thuyết Mỹ Nhân Ngư', 'The Beauty Mermaid', 2000, '<p>Truyền Thuyết Mỹ Nhân Ngư xoay quanh chuyện tình cảm động giữa giới tiên và người phàm trần. Tiểu Liên là con cá chép tinh ẩn mình trong hồ phủ tể tướng. Nàng và mẫu thân đêm ngày tu luyện để mong ngày phi thăng tiên giới. Tiểu Liên một lần nghịch ngợm ra ngoài chơi, được chàng thư sinh Trương Tử Du cứu được, từ đó số phận của nàng và chàng thư sinh đã gắn kết với nhau.</p>', 1, 'https://img.ophim11.cc/uploads/movies/truyen-thuyet-my-nhan-ngu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/truyen-thuyet-my-nhan-ngu-poster.jpg', '2024-02-11 14:47:18', 8, '', 45, 0),
(549, 'Không Một Ai Biết', 'Kimse Bilmez', 2019, '<p>Sevda là một cô gái rất xinh đẹp và năng động, mơ ước trở thành một ngôi sao. Ali có một quá khứ bí ẩn. Câu chuyện tình yêu phi thường của Ali và Sevda.</p>', 1, 'https://img.ophim11.cc/uploads/movies/khong-mot-ai-biet-tnk-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/khong-mot-ai-biet-tnk-poster.jpg', '2024-02-11 14:47:20', 8, '', 138, 0),
(550, 'Thám Tử Chân Chính (Phần 4)', 'True Detective Season 4', 2024, 'Là một series mới được đánh giá khá cao của HBO, kể về hai thám tử Rust Cohle và Martin Hart trong cuộc săn lùng tên sát nhân giết người hàng loạt kéo dài 17 năm ở Louisiana.', 1, 'https://img.ophim11.cc/uploads/movies/tham-tu-chan-chinh-phan-4-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tham-tu-chan-chinh-phan-4-poster.jpg', '2024-02-11 14:47:38', 8, 'https://www.youtube.com/watch?v=fVQUcaO4AvE', 60, 0),
(551, 'Phù Thủy Và Quái Thú', 'The Witch and the Beast', 2024, '<p>Guideau: một cô gái hoang dã với những chiếc răng nanh dài và đôi mắt của quái thú. Ashaf: một người đàn ông có giọng nói nhẹ nhàng, nét mặt thanh tú và chiếc quan tài buộc sau lưng. Một ngày nọ, cặp đôi đáng ngại này xuất hiện tại một thị trấn đang bị một phù thủy mê hoặc, người đã thuyết phục người dân thị trấn rằng cô là anh hùng của họ. Nhưng Ashaf và Guideau biết rõ hơn. Họ có những vấn đề cần giải quyết và họ sẽ không ngần ngại loại bỏ bất kỳ ai cản đường mình... (Source: VuiGhe)</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/phu-thuy-va-quai-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phu-thuy-va-quai-thu-poster.jpg', '2024-02-11 14:47:53', 8, '', 24, 0),
(552, 'Nữ Phụ Phản Diện Cấp 99: Tôi là trùm cuối nhưng không phải Ma Vương', 'Villainess Level 99: I May Be the Hidden Boss but I\'m Not the Demon Lord', 2024, 'Một tựa game otome nhất định diễn ra trong Vương quốc Varschein, nơi mà tóc đen bị đánh đồng một cách không bình thường. Eumiella Dolkness là con gái của một bá tước, bị ghét bỏ ngay từ khi còn nhỏ do mái tóc đen huyền của mình - và cô ấy cũng chính là \"hidden boss\" (đối thủ mạnh mẽ nhưng ẩn dật) trong trò chơi! Trong một sự thay đổi bất ngờ, ở tuổi năm, Eumiella nhớ lại kí ức của kiếp sống trước ở Nhật Bản. Không quan tâm đến khía cạnh lãng mạn của trò chơi gốc, cô ấy bắt đầu tập trung đào tạo kỹ thuật ma thuật độc đáo của mình.', 1, 'https://img.ophim11.cc/uploads/movies/nu-phu-phan-dien-cap-99-toi-la-trum-cuoi-nhung-khong-phai-ma-vuong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nu-phu-phan-dien-cap-99-toi-la-trum-cuoi-nhung-khong-phai-ma-vuong-poster.jpg', '2024-02-11 14:48:15', 8, 'https://www.youtube.com/watch?v=XHGxK08RGHU', 24, 0),
(553, 'Ngày May Mắn Của Bạn', 'Your Lucky Day', 2023, 'Sau khi tranh chấp về tờ vé số trúng thưởng trở thành tình huống bắt giữ con tin chết người, các nhân chứng phải quyết định chính xác họ sẽ đi bao xa—và họ sẵn sàng đổ bao nhiêu máu—để có được số tiền 156 triệu USD.', 0, 'https://img.ophim11.cc/uploads/movies/ngay-may-man-cua-ban-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ngay-may-man-cua-ban-poster.jpg', '2024-02-11 14:48:29', 8, 'https://www.youtube.com/watch?v=2xMsdJvY0gk', 89, 0),
(554, 'The Parasite Doctor Suzune: Genesis', 'The Parasite Doctor Suzune: Genesis', 2011, 'The city is infested with mysterious parasites that bore into their human hosts to increase their host\'s power and sexual desires. A beautiful girl, Suzune Arizono is a vet with a specialty in parasites, and who fights daily to end the plague. Before long, she learns that an evil organization, the Kito Zaibatsu, is behind the explosive growth of this ferocious parasite. She also learns that her long-missing father, Dr. Arizono, is also involved. In order to crush the Kito Zaibatsu\'s ambition and to see her father again, Suzune takes on the fight without regard to the danger involved.', 0, 'https://img.ophim11.cc/uploads/movies/the-parasite-doctor-suzune-genesis-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-parasite-doctor-suzune-genesis-poster.jpg', '2024-02-11 14:48:48', 8, '', 72, 0),
(555, 'The Parasite Doctor Suzune: Evolution', 'The Parasite Doctor Suzune: Evolution', 2011, 'Set within a city where parasites rage, the parasites settled into their human hosts and increases their power and sexual desires. Dr. Suzune is a parasite expert who works daily to kill the parasites. A sinister demon organization exists behind the parasites. Dr. Suzune also realizes that her father, who went missing when she was a young child, is somehow connected with the group. Violence and madness awaits for her ...', 0, 'https://img.ophim11.cc/uploads/movies/the-parasite-doctor-suzune-evolution-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-parasite-doctor-suzune-evolution-poster.jpg', '2024-02-11 14:49:09', 8, 'https://www.youtube.com/watch?v=_zxf6bVn2w8', 72, 0),
(556, 'The Wasted Times', 'The Wasted Times', 2016, '<p>Shanghai gangsters grapple with lust and loyalty on the eve of war with Japan as they try to navigate an alliance with the enemy\'s army.</p>', 0, 'https://img.ophim11.cc/uploads/movies/the-wasted-times-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-wasted-times-poster.jpg', '2024-02-11 14:49:10', 8, '', 23, 0),
(557, 'Lối Sống Đồi Trụy', 'Trainspotting', 1996, 'Heroin addict Mark Renton stumbles through bad ideas and sobriety attempts with his unreliable friends -- Sick Boy, Begbie, Spud and Tommy. He also has an underage girlfriend, Diane, along for the ride. After cleaning up and moving from Edinburgh to London, Mark finds he can\'t escape the life he left behind when Begbie shows up at his front door on the lam, and a scheming Sick Boy follows.', 0, 'https://img.ophim11.cc/uploads/movies/loi-song-doi-truy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/loi-song-doi-truy-poster.jpg', '2024-02-11 14:49:18', 8, 'https://www.youtube.com/watch?v=KhGT6itWByA', 94, 0),
(558, 'Quán ăn quỷ đói', 'Hungry Ghost Diner', 2023, 'Mắc kẹt ở quê nhà trong thời gian phong tỏa vì đại dịch, Bonnie đến ở nhờ tại quán cà phê cũ của gia đình và phát hiện hàng loạt bất ngờ rùng rợn.', 0, 'https://img.ophim11.cc/uploads/movies/quan-an-quy-doi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quan-an-quy-doi-poster.jpg', '2024-02-11 14:49:43', 8, '', 155, 0),
(559, 'Good Grief', 'Good Grief', 2024, 'Đang đau buồn vì mất đi người chồng nhà văn nổi tiếng, nghệ sĩ nọ đưa hai người bạn thân đi du lịch Paris. Tại đó, họ lật mở những bí mật rối ren và sự thật phũ phàng.', 0, 'https://img.ophim11.cc/uploads/movies/good-grief-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/good-grief-poster.jpg', '2024-02-11 14:49:59', 8, '', 140, 0),
(560, 'Thời Đại Kim Hoàng (Phần 2)', 'The Gilded Age Season 2', 2023, '<p>It’s 1882 and the Gilded Age is in full swing when Marian Brook, a young orphaned daughter of a Southern general, moves in with her rigidly conventional aunts in New York City. With the help of Peggy Scott, an African-American woman masquerading as her maid, Marian gets caught up in the dazzling lives of her rich neighbors as she struggles to decide between adhering to the rules or forging her own path.</p>', 1, 'https://img.ophim11.cc/uploads/movies/thoi-dai-kim-hoang-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thoi-dai-kim-hoang-phan-2-poster.jpg', '2024-02-11 14:50:15', 8, 'https://www.youtube.com/watch?v=wKj1cMz3yfI', 45, 0),
(561, 'Đá Vàng (Phần 2)', 'Yellowstone (Season 2)', 2019, '<p>Trong bối cảnh các liên minh đang thay đổi và danh sách kẻ thù ngày càng gia tăng, di sản của gia đình Dutton đang bị đe dọa hơn bao giờ hết và chắc chắn sẽ bị trừng phạt.</p>', 1, 'https://img.ophim11.cc/uploads/movies/da-vang-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/da-vang-phan-2-poster.jpg', '2024-02-11 14:59:35', 8, 'https://www.youtube.com/watch?v=suobrMPBLlo', 45, 0),
(562, 'Đá Vàng (Phần 1)', 'Yellowstone (Season 1)', 2018, 'Theo dõi thế giới bạo lực của gia đình Dutton, người kiểm soát trang trại tiếp giáp lớn nhất ở Hoa Kỳ. Được lãnh đạo bởi tộc trưởng John Dutton, gia đình bảo vệ tài sản của họ trước sự tấn công liên tục của các nhà phát triển đất đai, khu bảo tồn của người da đỏ và Công viên Quốc gia đầu tiên của Hoa Kỳ.', 1, 'https://img.ophim11.cc/uploads/movies/da-vang-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/da-vang-phan-1-poster.jpg', '2024-02-11 14:59:52', 8, 'https://www.youtube.com/watch?v=suobrMPBLlo', 45, 0),
(563, 'Băng Qua Biển Giận Dữ', 'Across the Furious Sea', 2023, '<p>Bộ phim kể về hành trình trả thù của một người cha, Lao Jin, sau khi con gái ông bị giết hại. Lao Jin, một ngư dân, phát hiện ra con gái mình bị sát hại trong khi đang học tập tại Nhật Bản và quyết tâm tìm kiếm công lý. Trong khi đó, Li Miao Miao, bạn trai của nạn nhân và cũng là nghi phạm chính, đã trốn tránh sự truy tố bằng cách trở về Trung Quốc với sự giúp đỡ của cha mẹ mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bang-qua-bien-gian-du-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bang-qua-bien-gian-du-poster.jpg', '2024-02-11 14:59:53', 8, '', 144, 0),
(564, 'maboroshi', 'maboroshi', 2023, '<p>Khi một vụ nổ nhà máy khiến thị trấn nhỏ rơi vào tình trạng đóng băng vĩnh viễn, cậu bé 14 tuổi Masamune cùng bạn bè vật lộn với thực tế nhanh chóng tồi tệ đi.</p>', 0, 'https://img.ophim11.cc/uploads/movies/maboroshi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/maboroshi-poster.jpg', '2024-02-11 15:00:00', 8, 'https://www.youtube.com/watch?v=Z2BDnTE6bDE', 111, 0),
(565, 'Pit Babe The Series', 'Pit Babe The Series', 2023, 'Bộ phim kể về mối quan hệ phức tạp giữa Babe-tay đua xe nổi tiếng với danh hiệu, vua đường đua, và Charlie- một mọt sách gợi cảm với ước mơ được gia nhập một đội đua. Charlie muốn tham gia đội đua đến mức đồng ý với lời đề nghị kỳ lạ của Babe để là trở thành nô lệ của cậu. Khi Babe đánh mất trái tim của mình cho Charlie, cậu ta liên tục phát hiện ra rằng mối quan hệ không như cậu mong đợi, và mục đích thực sự của Charlie khi tiếp cận cậu là để tiêu diệt cậu.', 1, 'https://img.ophim11.cc/uploads/movies/pit-babe-the-series-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/pit-babe-the-series-poster.jpg', '2024-02-11 15:00:02', 8, '', 48, 0),
(566, 'For Him', 'For Him', 2023, 'Mối quan hệ của tôi và anh ấy bắt đầu như tình một đêm, nhưng anh ấy không muốn nó kết thúc như vậy. Anh ấy ngày càng bước vào cuộc sống của tôi nhiều hơn và chẳng bao lâu sau, tôi nghĩ mình đã đầu hàng anh ấy. Được chuyển thể từ tiểu thuyết For Him (ยอมเป็นของฮิม) của newaccount.', 1, 'https://img.ophim11.cc/uploads/movies/for-him-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/for-him-poster.jpg', '2024-02-11 15:00:14', 8, '', 48, 0),
(567, 'Dead Friend Forever', 'Dead Friend Forever - DFF: Uncovered Version', 2023, 'DFF: Dead Friend Forever xoay quanh câu chuyện về những người bạn cùng nhau đi du lịch đến một ngôi nhà nghỉ dưỡng giữa rừng để chia tay một người bạn sắp lên đường du học. Chuyến đi chia tay này khiến họ nhớ lại quá khứ và không thể ngờ rằng nó lại mang đến nhiều sự cố nguy hiểm đến tính mạng. Chẳng bao lâu, họ nhận ra đây không phải là một chuyến đi chia tay như đơn giản bình thường mà là một chuyến đi khủng khiếp với những thảm họa đang chờ đợi họ ở phía trước.', 1, 'https://img.ophim11.cc/uploads/movies/dead-friend-forever-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dead-friend-forever-poster.jpg', '2024-02-11 15:00:27', 8, '', 50, 0),
(568, 'Mashle: Ma thuật và Cơ bắp (Phần 2)', 'MASHLE: MAGIC AND MUSCLES Season 2', 2024, '<p>Đây là một thế giới của phép thuật, nơi phép thuật được sử dụng cho mọi thứ. Nhưng sâu trong khu rừng tồn tại một chàng trai dành thời gian của mình để tập luyện. Anh chàng không thể sử dụng phép thuật, nhưng anh ấy tận hưởng một cuộc sống yên bình với cha mình. Nhưng một ngày nọ, cuộc sống của anh ấy bị đe dọa! Liệu cơ thể vạm vỡ của anh ấy có bảo vệ anh ấy khỏi những kẻ sử dụng ma thuật? Cơ bắp được rèn luyện mạnh mẽ sẽ nghiền nát ma thuật khi ảo tưởng ma thuật bất thường này bắt đầu!</p>', 0, 'https://img.ophim11.cc/uploads/movies/mashle-ma-thuat-va-co-bap-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mashle-ma-thuat-va-co-bap-phan-2-poster.jpg', '2024-02-11 15:00:46', 8, 'https://www.youtube.com/watch?v=AwQJLqJAUBI', 24, 0),
(569, 'Nhạc Trưởng Maestra: Sợi Dây Chân Lý', 'Maestra: Strings of Truth', 2023, '<p>Maestra, một trong 5% nữ nhạc trưởng trên thế giới tìm kiếm sự thật về vụ việc xung quanh dàn nhạc trong khi che giấu bí mật của mình.</p>', 1, 'https://img.ophim11.cc/uploads/movies/nhac-truong-maestra-soi-day-chan-ly-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nhac-truong-maestra-soi-day-chan-ly-poster.jpg', '2024-02-11 15:00:47', 8, 'https://www.youtube.com/watch?v=78AwHRcZTIo', 60, 25),
(570, 'Sonic Prime (Phần 3)', 'Sonic Prime Season 3', 2024, 'Khi một trận chiến bùng nổ với tiến sĩ Eggman tàn phá vũ trụ, Sonic gấp rút băng qua nhiều chiều không gian song song để tìm lại bạn bè và cứu thế giới.', 1, 'https://img.ophim11.cc/uploads/movies/sonic-prime-phan-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sonic-prime-phan-3-poster.jpg', '2024-02-11 15:00:57', 8, 'https://www.youtube.com/watch?v=2rShZls4Ffw', 25, 6),
