(600, 'Tái sinh', 'Reborn', 2024, '<p>Tại lễ tưởng niệm Phí Khả (Tỉnh Bách Nhiên đóng), nữ phóng viên Hà San (Châu Y Nhiên đóng) được mời cùng với bốn người lạ mặt khác. Tất cả họ đều có quá khứ mà ít người hay biết với Phí Khả, nhưng họ phát hiện ra rằng Phí Khả mà họ biết không phải là cùng một người. Rốt cuộc Phí Khả là ai? Mọi người bắt đầu hồi tưởng lại và dần dần tiết lộ sự thật về Phí Khả...</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/tai-sinh-2024-thumb.jpg', 'https://img.ophim.live/uploads/movies/tai-sinh-2024-poster.jpg', '2024-02-11 15:30:17', 8, '', 40, 3),
(601, 'Tầm xuân nở', 'Mother-in-law in Town', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/tam-xuan-no-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tam-xuan-no-poster.jpg', '2024-02-11 15:30:20', 8, '', 12450, 3),
(602, 'Tần tặc hữu đạo', 'Righteous Thieves', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/tan-tac-huu-dao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tan-tac-huu-dao-poster.jpg', '2024-02-11 15:30:22', 8, '', 1823, 0),
(603, '60 Minuten', 'Sixty Minutes', 2024, 'Desperate to keep custody of his daughter, a mixed martial arts fighter abandons a big match and races across Berlin to attend her birthday party.', 0, 'https://img.ophim11.cc/uploads/movies/60-minuten-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/60-minuten-poster.jpg', '2024-02-11 15:30:23', 8, 'https://www.youtube.com/watch?v=uiyZW82Rxf8', 89, 0),
(604, 'Thập Phương Võ Thánh', 'The Invincible', 2023, 'Tận Thế hoang thổ, Thế Tông năm thứ ba, thiên hạ đại loạn, dân chúng lầm than.\n\nTrung ương hoàng triều tan vỡ, các nơi quần hùng cắt cứ, môn phái độc lập. Ma môn yêu đảng giấu ở chỗ tối làm loạn, bang phái lẫn nhau chinh phạt, hỗn loạn không chịu nổi.\n\nThiên tai liên tục, đại hạn, rét căm căm, mưa xối xả, nạn sâu bệnh, nhân dân khổ sở giãy dụa, khát cầu hi vọng cùng cứu rỗi.\n\nĐại loạn trong, các môn các phái dồn dập xuất thế, tranh cướp tài nguyên địa bàn, thành lập độc thuộc về tự mình thống trị.\n\nCó dã tâm người nỗ lực tịch quyển thiên hạ, thành lập vương triều, cũng có đại nghĩa người, ý đồ cứu lại muôn dân, xây dựng lại gia viên.\n\nBắp thịt, võ đạo, tiên pháp, từng vị võ đạo cực hạn cường giả, ở truyền thuyết trong thu được dường như tiên phật danh hào.\n\nNgụy Hợp nắm giữ có thể đột phá cảnh giới Phá Cảnh châu, xuyên qua loạn thế, từng bước một khai sáng thuộc về tự mình truyền thuyết.', 1, 'https://img.ophim11.cc/uploads/movies/thap-phuong-vo-thanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thap-phuong-vo-thanh-poster.jpg', '2024-02-11 15:30:34', 8, '', 18, 0),
(605, 'Monsters 103 Mercies Dragon Damnation', 'Monsters 103 Mercies Dragon Damnation', 2024, 'A samurai\'s path leads him to a young waitress whose hometown was destroyed by a dragon. He doesn\'t want any trouble — but it finds them anyway.', 0, 'https://img.ophim11.cc/uploads/movies/monsters-103-mercies-dragon-damnation-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/monsters-103-mercies-dragon-damnation-poster.jpg', '2024-02-11 15:30:37', 8, 'https://www.youtube.com/watch?v=Q6tmyHjEFcE', 25, 0),
(606, 'Vượt Đại Dương Để Yêu Em', 'You\'ll Never Walk Alone', 2023, 'Hạ Duyên là quản lý cấp cao của một công ty, cô chuẩn bị đính hôn với người bạn trai Tống Hàng Vũ vào sinh nhật lần thứ 30 của mình, có thể nói là cuộc sống viên mãn về cả công việc lẫn tình yêu. Nhưng tới buổi lễ đính hôn, chồng chưa cưới bỗng dưng mất tích. Hạ Duyên biết được tin Tống Hàng Vũ cắt đứt tất cả để ra nước ngoài, cô quyết định buông bỏ mọi thứ để tìm cho mình một câu trả lời. Trong khi đó, Hách Vị Lai, người từng có mâu thuẫn với Hạ Duyên bị bố anh sắp xếp ra nước ngoài để rèn luyện. Diệp Tư Kỳ là cô gái GenZ, cô kết hôn “chớp nhoáng” và ly hôn “thần tốc” với Kiều Bân. Diệp Tư Kỳ trong lúc bốc đồng muốn tìm cuộc sống mới cũng đã quyết định lên đường rời xa quê hương. Kiều Bân hối hận vì đã ly hôn, cũng theo chân Diệp Tư Kỳ ra nước ngoài. Bốn người vô tình trở thành bạn đồng hành. Trong một năm này, bốn người làm thêm ở rất nhiều nơi như nông trường, quán ăn, quán rượu, khu vui chơi.', 1, 'https://img.ophim11.cc/uploads/movies/vuot-dai-duong-de-yeu-em-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vuot-dai-duong-de-yeu-em-poster.jpg', '2024-02-11 15:30:41', 8, '', 45, 0),
(607, 'Người Yêu Của Tôi Là Thần Tình Yêu', 'My Man Is Cupid', 2023, '<p>Đây là bộ phim hài lãng mạn kể về một nàng tiên rơi vào lưới tình sau khi bị chính mũi tên của mình bắn trúng và một người phụ nữ mất đi tri kỷ sau khi vướng vào tình huống này. Tiên nữ Cheon Sang Hyuk là chủ sở hữu lâu năm của Sarangbang, chuỗi nhà hàng Hàn Quốc cao cấp ở Jongno, Seoul. Anh ta mất tích sau khi làm thám tử tại Sở cảnh sát Jongno. Anh ta là một người đàn ông đã xây dựng một bức tường bất khả xâm phạm giữa anh ta và phụ nữ và một nàng tiên đã đốt cháy đôi cánh của anh ta trong 500 năm.</p>', 1, 'https://img.ophim11.cc/uploads/movies/nguoi-yeu-cua-toi-la-than-tinh-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-yeu-cua-toi-la-than-tinh-yeu-poster.jpg', '2024-02-11 15:30:43', 8, '', 60, 0),
(608, 'Nhà phẫu thuật bất lương: Tình yêu dưới lưỡi dao', 'Bad Surgeon: Love Under the Knife', 2023, 'Bác sĩ Paolo Macchiarini nổi tiếng thế giới với ca cấy ghép khí quản bằng tế bào gốc mang tính cách mạng. Chỉ có một vấn đề: các bệnh nhân của ông liên tục tử vong.', 1, 'https://img.ophim11.cc/uploads/movies/nha-phau-thuat-bat-luong-tinh-yeu-duoi-luoi-dao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nha-phau-thuat-bat-luong-tinh-yeu-duoi-luoi-dao-poster.jpg', '2024-02-11 15:31:39', 8, '', 53, 0),
(609, 'Đúng là độc thoại', 'Verified Stand-Up', 2023, '10 cây hài. 10 tiết mục sinh động. 2 tập. Hãy tìm ra tiết mục hài yêu thích mới của bạn khi những người trình diễn hàng đầu lên sân khấu tại Webster Hall ở Thành phố New York.', 1, 'https://img.ophim11.cc/uploads/movies/dung-la-doc-thoai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dung-la-doc-thoai-poster.jpg', '2024-02-11 15:31:41', 8, '', 50, 0),
(610, 'Đấu trường hài kịch', 'Comedy Royale', 2023, 'Quy tụ trong cuộc cạnh tranh đầy khốc liệt để giành cơ hội dẫn một chương trình của Netflix, hai mươi cây hài đình đám nhất Hàn Quốc mang đến tiếng cười sảng khoái không ngớt.', 1, 'https://img.ophim11.cc/uploads/movies/dau-truong-hai-kich-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dau-truong-hai-kich-poster.jpg', '2024-02-11 15:31:47', 8, '', 28, 0),
(611, 'Chú mèo thông minh hôm nay lại u sầu', 'The Masterful Cat Is Depressed Again Today', 2023, 'Nhân viên văn phòng Saku nhận nuôi một con mèo đen đi lạc và gọi nó là Yukichi. Lạ kỳ thay, mèo ta dần to như một con gấu và trở thành người bạn cùng nhà hơn là thú cưng!', 1, 'https://img.ophim11.cc/uploads/movies/chu-meo-thong-minh-hom-nay-lai-u-sau-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chu-meo-thong-minh-hom-nay-lai-u-sau-poster.jpg', '2024-02-11 15:31:53', 8, '', 23, 0),
(612, 'Bữa tiệc tối Giáng sinh', 'Catering Christmas', 2022, 'Khi một nhà cung cấp dịch vụ ăn uống đang gặp khó khăn đồng ý nấu ăn cho tiệc Giáng sinh của quỹ địa phương, cô tìm được mối quan hệ không ngờ với người cháu đẹp trai của chủ tiệc.', 0, 'https://img.ophim11.cc/uploads/movies/bua-tiec-toi-giang-sinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bua-tiec-toi-giang-sinh-poster.jpg', '2024-02-11 15:32:02', 8, '', 125, 0),
(613, 'Ảo thuật gia đường phố', 'Sleight', 2016, 'Một mình chật vật nuôi em gái nhỏ, anh chàng ảo thuật gia đường phố chuyển sang buôn bán ma túy nhưng nào hay biết người bán của mình có thể tàn nhẫn đến mức nào.', 0, 'https://img.ophim11.cc/uploads/movies/ao-thuat-gia-duong-pho-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ao-thuat-gia-duong-pho-poster.jpg', '2024-02-11 15:32:07', 8, '', 129, 2),
(614, 'Nét vẽ Giáng sinh', 'A Brush with Christmas', 2022, 'Một đầu bếp đam mê nghệ thuật có cơ hội tìm được tình yêu đích thực khi bức tranh bị vứt đi của cô lọt vào mắt xanh của một họa sĩ minh họa nổi tiếng ở thị trấn trong kỳ nghỉ lễ.', 0, 'https://img.ophim11.cc/uploads/movies/net-ve-giang-sinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/net-ve-giang-sinh-poster.jpg', '2024-02-11 15:32:13', 8, '', 124, 0),
(615, 'Thật mừng đã đến Giáng sinh', 'I\'m Glad It\'s Christmas', 2022, 'Vẫn đang chờ bước đột phá lớn, cô nàng đầy hi vọng ở sân khấu Broadway đồng ý biểu diễn ở một chương trình Giáng Sinh tại địa phương. Nhưng liệu cô có sẵn sàng yêu đương trở lại?', 0, 'https://img.ophim11.cc/uploads/movies/that-mung-da-den-giang-sinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/that-mung-da-den-giang-sinh-poster.jpg', '2024-02-11 15:32:18', 8, '', 127, 0),
(616, 'Tyler Perry: Những cô gái bé bỏng của bố', 'Daddy\'s Little Girls', 2007, 'Mất quyền nuôi con gái, người bố chăm chỉ nọ bèn nhờ một luật sư quyền lực giúp đỡ. Nhưng rồi vị luật sư đó thách thức những kỳ vọng và cả trái tim của anh.', 0, 'https://img.ophim11.cc/uploads/movies/tyler-perry-nhung-co-gai-be-bong-cua-bo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tyler-perry-nhung-co-gai-be-bong-cua-bo-poster.jpg', '2024-02-11 15:32:22', 8, '', 140, 0),
(617, 'Jon Batiste: Bản giao hưởng Hoa Kỳ', 'American Symphony', 2023, 'Trong bộ phim tài liệu vô cùng sâu sắc này, nhạc sĩ Jon Batiste nỗ lực sáng tác một bản giao hưởng khi vợ ông, nhà văn Suleika Jaouad, đang điều trị ung thư.', 0, 'https://img.ophim11.cc/uploads/movies/jon-batiste-ban-giao-huong-hoa-ky-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/jon-batiste-ban-giao-huong-hoa-ky-poster.jpg', '2024-02-11 15:32:31', 8, '', 143, 0),
(618, 'Mùa đông đầy ắp tình yêu', 'Fall Into Winter', 2023, 'Khi người cô thầm thích thời cấp 3 bất ngờ đầu tư vào công việc kinh doanh kẹo của gia đình cô, cô không mấy vui vẻ khi làm việc với anh. Nhưng liệu điều đó có thay đổi?', 0, 'https://img.ophim11.cc/uploads/movies/mua-dong-day-ap-tinh-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mua-dong-day-ap-tinh-yeu-poster.jpg', '2024-02-11 15:32:33', 8, '', 123, 0),
(619, 'Lời chúc Giáng sinh an lành', 'A Merry Christmas Wish', 2022, 'Quyết tâm thực hiện di nguyện của ông chú, vị giám đốc tiếp thị ở New York hợp tác với một nông dân đẹp trai để cứu lễ hội ở quê nhà của họ.', 0, 'https://img.ophim11.cc/uploads/movies/loi-chuc-giang-sinh-an-lanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/loi-chuc-giang-sinh-an-lanh-poster.jpg', '2024-02-11 15:32:38', 8, '', 125, 0),
(620, 'Vùng đất Giáng sinh', 'Christmas Land', 2015, 'Khi một người New York bận rộn thừa kế mảnh đất của bà mình, cô phải lựa chọn giữa việc bán hoặc khôi phục trang trại cây thông Nô-en cùng ngôi làng lễ hội.', 0, 'https://img.ophim11.cc/uploads/movies/vung-dat-giang-sinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vung-dat-giang-sinh-poster.jpg', '2024-02-11 15:32:44', 8, '', 125, 0),
(621, 'High on the Hog: Ẩm thực Mỹ gốc Phi đã thay đổi Hoa Kỳ như thế nào (Phần 2)', 'High on the Hog: How African American Cuisine Transformed America (Season 2)', 2023, 'Ẩm thực người da đen chính là ẩm thực Mỹ. Cùng đầu bếp kiêm nhà văn Stephen Satterfield theo dấu món ngon xuyên suốt từ châu Phi đến Texas trong loạt phim tài liệu này.', 1, 'https://img.ophim11.cc/uploads/movies/high-on-the-hog-am-thuc-my-goc-phi-da-thay-doi-hoa-ky-nhu-the-nao-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/high-on-the-hog-am-thuc-my-goc-phi-da-thay-doi-hoa-ky-nhu-the-nao-phan-2-poster.jpg', '2024-02-11 15:32:49', 8, '', 51, 0),
(622, 'Giáng sinh ở Silver Peak', 'B&B Merry', 2022, 'Một blogger đánh giá một nhà nghỉ ở thị trấn nhỏ vào dịp Giáng sinh, rồi nhận ra mình đang giúp đỡ những người chủ đang gặp khó khăn tại đó và phải lòng con trai họ.', 0, 'https://img.ophim11.cc/uploads/movies/giang-sinh-o-silver-peak-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giang-sinh-o-silver-peak-poster.jpg', '2024-02-11 15:32:51', 8, '', 122, 0);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(623, 'Giáng sinh ở rạp chiếu bóng ngoài trời', 'Christmas at the Drive-In', 2022, 'Kế hoạch của luật sư nọ để cứu một nhà hát lịch sử kịp dịp lễ bỗng trở nên phức tạp khi cô kết nối lại với tình cũ và cũng là người đàn ông đang cố bán nơi này.', 0, 'https://img.ophim11.cc/uploads/movies/giang-sinh-o-rap-chieu-bong-ngoai-troi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giang-sinh-o-rap-chieu-bong-ngoai-troi-poster.jpg', '2024-02-11 15:32:54', 8, '', 127, 0),
(624, 'Trả Thù', 'Ganti-Ganti', 2023, '<p>Bốn cuộc đời trở nên gắn bó với nhau vì một mục tiêu - trả thù. Mọi chuyện trở nên đẫm máu và hỗn loạn hơn khi tất cả đều nhận ra kẻ chủ mưu thực sự là ai.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/tra-thu-2023-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tra-thu-2023-poster.jpg', '2024-02-11 15:33:00', 8, 'https://www.youtube.com/watch?v=wQuteON5Y0o', 92, 0),
(625, 'Diva Của Đảo Hoang', 'Castaway Diva', 2023, '<p>Mười lăm năm sau khi bị mắc kẹt trên một hòn đảo xa xôi, một ca sĩ đầy tham vọng tái hòa nhập xã hội - không dừng lại ở việc theo đuổi ước mơ trở thành diva.</p>', 1, 'https://img.ophim11.cc/uploads/movies/diva-cua-dao-hoang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/diva-cua-dao-hoang-poster.jpg', '2024-02-11 15:33:07', 8, 'https://www.youtube.com/watch?v=Qieu0vtPaKc', 45, 13),
(626, 'Con Đường Kẹo', 'Candy Cane Lane', 2023, '<p>Một người đàn ông quyết tâm giành chiến thắng trong cuộc thi trang trí Giáng sinh hàng năm của khu phố, đã lập một hiệp ước với một yêu tinh để giúp anh ta giành chiến thắng. Tuy nhiên, yêu tinh đã làm phép khiến mười hai ngày Giáng sinh trở nên sống động, mang đến sự hỗn loạn cho thị trấn nhỏ mà không bị nghi ngờ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/con-duong-keo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/con-duong-keo-poster.jpg', '2024-02-11 15:33:11', 8, 'https://www.youtube.com/watch?v=j8H4JGqIiV0', 117, 1),
(627, 'Gia Đình Đại Loạn', 'Family Switch', 2023, '<p>Những ngày trước Giáng sinh, một gia đình rơi vào hỗn loạn khi một sự kiện vũ trụ hiếm gặp khiến hai phụ huynh nọ hoán đổi thân xác với hai người con tuổi teen của họ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/gia-dinh-dai-loan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/gia-dinh-dai-loan-poster.jpg', '2024-02-11 15:33:17', 8, 'https://www.youtube.com/watch?v=SWh4c9EVqGM', 101, 1),
(628, 'Đội đặc nhiệm say xỉn', 'Obliterated', 2023, 'Một đội lực lượng đặc biệt ngăn chặn một âm mưu chết chóc ở Thành phố tội lỗi và các phe liên quan. Nhưng khi mối đe dọa thực sự xuất hiện, họ phải tỉnh táo để cứu Las Vegas.', 1, 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-say-xin-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-say-xin-poster.jpg', '2024-02-11 15:33:23', 8, 'https://www.youtube.com/watch?v=6MNfBHFhnNs', 45, 0),
(629, 'Anh Hùng Vô Lệ', 'Heroes Shed No Tears', 1986, '<p>The Thai government hires a group of Chinese mercenaries to capture a powerful drug lord from the Golden Triangle. The mercenaries manage to capture the drug lord, but soon find themselves pursued by his forces, and the forces of a bitter Thai officer. The Chinese mercenaries are vastly outnumbered, and as their numbers begin to dwindle, their desperation pulls them into a corner as their enemies close in on them.</p>', 0, 'https://img.ophim11.cc/uploads/movies/anh-hung-vo-le-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/anh-hung-vo-le-poster.jpg', '2024-02-11 15:33:29', 8, '', 128, 0),
(630, 'Fallout', 'Fallout', 2024, 'The story of haves and have-nots in a world in which there’s almost nothing left to have. 200 years after the apocalypse, the gentle denizens of luxury fallout shelters are forced to return to the irradiated hellscape their ancestors left behind — and are shocked to discover an incredibly complex, gleefully weird, and highly violent universe waiting for them.', 1, 'https://img.ophim11.cc/uploads/movies/fallout-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/fallout-poster.jpg', '2024-02-11 15:33:32', 8, 'https://www.youtube.com/watch?v=0kQ8i2FpRDk', 90, 0),
(631, 'Cuộc đời Pepe Mujica', 'El Pepe, a Supreme Life', 2018, '<p>Bộ phim tài liệu chân thực này theo chân cựu tổng thống Uruguay José \"Pepe\" Mujica khi ông chia sẻ về những bài học trong tù, lý tưởng và tương lai.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cuoc-doi-pepe-mujica-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuoc-doi-pepe-mujica-poster.jpg', '2024-02-11 15:33:54', 8, '', 113, 0),
(632, 'Cuộc săn tử thần', 'Killing Season', 2013, '<p>Một cựu quân nhân Mỹ từng tham chiến ở Bosnia tìm sự thanh thản giữa thiên nhiên hoang dã ở Appalachia, cho đến khi một du khách châu Âu bí ẩn đến tìm ông.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cuoc-san-tu-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuoc-san-tu-than-poster.jpg', '2024-02-11 15:33:56', 8, '', 131, 1),
(633, 'Đất phương Nam', 'Song of the South', 1997, 'Đất phương Nam là một bộ phim truyền hình Việt Nam chuyển thể từ tiểu thuyết Đất rừng phương Nam của nhà văn Đoàn Giỏi, do Hãng phim Truyền hình Thành phố Hồ Chí Minh sản xuất năm 1997 trên chất liệu băng từ VHS, nghệ sĩ nhân dân Phạm Khắc là giám đốc sản xuất và chỉ đạo nghệ thuật. Bộ phim do nghệ sĩ ưu tú Nguyễn Vinh Sơn đạo diễn và viết kịch bản nhân dịp kỷ niệm 300 năm Sài Gòn-Thành phố Hồ Chí Minh. Đây là bộ phim dài tập thứ hai do TFS sản xuất, sau Người đẹp Tây Đô, và được xem là thử nghiệm thành công nhất của hãng trong việc sản xuất phim truyền hình nhiều tập, là một trong những phim truyền hình chuyển thể thành công từ tác phẩm văn học. Trong nước, sau hơn 10 năm ra đời, bộ phim vẫn liên tục được trình chiếu trên nhiều kênh truyền hình địa phương.\n\nĐất phương Nam cũng là phim dài tập đầu tiên của Việt Nam được xuất khẩu sang Mỹ và được đón nhận đông đảo.', 1, 'https://img.ophim11.cc/uploads/movies/dat-phuong-nam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dat-phuong-nam-poster.jpg', '2024-02-11 15:33:58', 8, '', 0, 0),
(634, 'Chuyện hai nhà bếp', 'A Tale of Two Kitchens', 2019, '<p>Ngôi sao nhà hàng thành phố Mexico, Gabriela Cámara, khai trương thêm nhà hàng cùng hệ thống, Cala, ở San Francisco, với thực đơn quen thuộc và văn hóa bếp cực kỳ cởi mở.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chuyen-hai-nha-bep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chuyen-hai-nha-bep-poster.jpg', '2024-02-11 15:36:08', 8, '', 29, 0),
(635, 'Chuyện phức tạp', 'A Complicated Story', 2013, '<p>Một sinh viên Trung Quốc đại lục túng tiền kí hợp đồng đẻ thuê cho một cặp vợ chồng người Hong Kong, nhưng hợp đồng bất ngờ bị chấm dứt khiến cuộc sống của cô bị đảo lộn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chuyen-phuc-tap-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chuyen-phuc-tap-poster.jpg', '2024-02-11 15:36:10', 8, '', 148, 1),
(636, 'Người Yêu Dấu (Phần 2)', 'My Dearest (Season 2)', 2023, 'Người Yêu Dấu - My Dearest diễn ra trong triều đại Joseon, kể về câu chuyện của Lee Jang Hyun - người đàn ông bí ẩn đột nhiên xuất hiện tại làng Neunggeun. Sau khi trải qua những biến cố lớn, Jang Hyun từng tuyên bố sẽ không kết hôn, thế nhưng, tại Neunggeun, anh lại bị thu hút mạnh mẽ bởi Yoo Gil Chae. Là con gái thứ 2 trong một gia đình quý tộc, Gil Chae nhận được sự giáo dục tốt, song cô luôn tự cho bản thân là trung tâm của thế giới và tin rằng tình yêu của tất cả đàn ông trên đời cũng là của mình. Những suy nghĩ của cô dần thay đổi và trưởng thành hơn trải qua sự khốc liệt của thời chiến cũng như tình yêu với Jang Hyun.', 1, 'https://img.ophim11.cc/uploads/movies/nguoi-yeu-dau-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-yeu-dau-phan-2-poster.jpg', '2024-02-11 15:36:12', 8, '', 70, 11),
(637, 'Bản Giao Hưởng Gợi Tình', 'Erotic Symphony', 1980, 'Jess Franco film about a woman returning home from an insane asylum only to discover her husband is now living with a man. The two men eventually find a nun who\'s been raped and the three come up with a plot to kill the wife for her money.', 0, 'https://img.ophim11.cc/uploads/movies/ban-giao-huong-goi-tinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ban-giao-huong-goi-tinh-poster.jpg', '2024-02-11 15:36:18', 8, '', 80, 0),
(638, 'Men in Hope', 'Men in Hope', 2011, 'Charming bon vivant Rudolf is convinced that infidelity is the basis for a happy marriage, since, after all, a woman does not want to be bored with her partner.', 0, 'https://img.ophim11.cc/uploads/movies/men-in-hope-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/men-in-hope-poster.jpg', '2024-02-11 15:36:24', 8, '', 115, 0),
(639, 'See No Evil', 'See No Evil', 2006, 'A group of delinquents are sent to clean the Blackwell Hotel but little do they know reclusive psychopath Jacob Goodnight has holed away in the rotting hotel. When one of the teens is captured, those who remain band together to survive against the brutal killer.', 0, 'https://img.ophim11.cc/uploads/movies/see-no-evil-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/see-no-evil-poster.jpg', '2024-02-11 15:36:30', 8, 'https://www.youtube.com/watch?v=ey5LtoCV-80', 84, 1),
(640, 'Tình yêu của Siam', 'Love of Siam ', 2007, '<p>Two young boys are best friends living quiet family lives in Bangkok. Their lives are disrupted when one boy\'s older sister goes missing on a jungle trip. The shattered family moves away, separating the boys. Years later, now in their late teens, the boys meet again. One of them is now the leader of an aspiring boy band whose managing assistant bears a striking resemblance to the lost sister. The boys must deal with their family and social lives and their feelings for each other.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tinh-yeu-cua-siam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tinh-yeu-cua-siam-poster.jpg', '2024-02-11 15:36:36', 8, '', 234, 1),
(641, 'Scott Pilgrim cất cánh', 'Scott Pilgrim Takes Off', 2023, 'Scott Pilgrim gặp cô nàng trong mơ Ramona Flowers nhưng rồi nhận ra 7 người yêu cũ xấu xa của cô nàng đang cản trở chuyện tình yêu của họ.', 1, 'https://img.ophim11.cc/uploads/movies/scott-pilgrim-cat-canh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/scott-pilgrim-cat-canh-poster.jpg', '2024-02-11 15:36:38', 8, 'https://www.youtube.com/watch?v=dLvRvqByxUI', 29, 8),
(642, 'Độc Chiến 2', 'Believer 2', 2023, '<p>Một thanh tra kiên định tiếp tục tìm kiếm sự thật đằng sau tổ chức ma túy lớn nhất châu Á và ông trùm giấu mặt – kẻ vẫn còn ân oán dang dở với anh.</p>', 0, 'https://img.ophim11.cc/uploads/movies/doc-chien-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doc-chien-2-poster.jpg', '2024-02-11 15:36:44', 8, 'https://www.youtube.com/watch?v=BglW4ogv6ds', 116, 2),
(643, 'Gia Đình Linh Thiêng (Phần 2)', 'Holy Family', 2023, '<p>Đang che giấu một bí mật động trời, gia đình nọ bắt đầu lại ở Madrid. Tại đó, các mối quan hệ mới làm phức tạp kế hoạch của họ và quá khứ của họ bắt đầu bị vạch trần.</p>', 1, 'https://img.ophim11.cc/uploads/movies/gia-dinh-linh-thieng-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/gia-dinh-linh-thieng-phan-2-poster.jpg', '2024-02-11 15:36:48', 8, 'https://www.youtube.com/watch?v=_YiHIA5Zln0', 40, 0),
(644, 'Bố trưởng', 'Chief Daddy', 2018, '<p>Khi một người đàn ông giàu có – người đứng đầu một gia tộc – bất ngờ qua đời, gia đình, bạn bè và đám nhân viên tham lam lao vào tranh giành khối tài sản kếch xù của ông.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bo-truong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bo-truong-poster.jpg', '2024-02-11 15:37:01', 8, '', 138, 0),
(645, 'Amanda Knox', 'Amanda Knox', 2016, '<p>Hai lần bị buộc tội giết người rồi lại trắng án, Amanda Knox và những người tường tận về vụ án nhất sẽ vén bức màn sự thật trong bộ phim tài liệu này.</p>', 0, 'https://img.ophim11.cc/uploads/movies/amanda-knox-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/amanda-knox-poster.jpg', '2024-02-11 15:37:04', 8, '', 132, 0),
(646, 'BoBoiBoy', 'BoBoiBoy', 2011, '<p>Sát cánh cùng bạn bè, cậu nhóc có siêu năng lực nguyên tố chiến đấu chống lại đám người ngoài hành tinh thèm muốn cacao và muốn chinh phục hành tinh này.</p>', 0, 'https://img.ophim11.cc/uploads/movies/boboiboy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/boboiboy-poster.jpg', '2024-02-11 15:37:05', 8, '', 142, 0),
(647, 'Bom xịt', 'Bomb Scared', 2017, '<p>Trong lúc Tây Ban Nha sắp sửa giành chức vô địch World Cup thì đâu đó tại Basque, băng khủng bố ngược đời đang mòn mỏi chờ đợi nhiệm vụ mới.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bom-xit-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bom-xit-poster.jpg', '2024-02-11 15:37:08', 8, '', 129, 0),
(648, 'Các chàng trai anh đào', 'Cherry Boys', 2018, '<p>Cuộc sống của một trai tân 25 tuổi chẳng thú vị chút nào. Ba người bạn này cần thay đổi cuộc chơi để từ đó thay đổi cuộc sống. Chắc chắn không có rắc rối gì đâu.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cac-chang-trai-anh-dao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cac-chang-trai-anh-dao-poster.jpg', '2024-02-11 15:37:10', 8, '', 153, 0),
(649, 'Cái bẫy của sự nổi tiếng', 'The American Meme', 2018, '<p>Các ngôi sao mạng xã hội như Paris Hilton, Josh Ostrovsky, Brittany Furlan, Kirill Bichutsky hối hả tăng sức ảnh hưởng trên mạng và đối mặt với cạm bẫy của sự nổi tiếng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cai-bay-cua-su-noi-tieng-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cai-bay-cua-su-noi-tieng-poster.jpg', '2024-02-11 15:37:13', 8, '', 138, 0),
(650, 'Cái ôm 3 phút', 'A 3 Minute Hug', 2019, '<p>Phim tài liệu này ghi lại niềm vui, nỗi buồn của các gia đình vốn bị chia cắt bởi biên giới Mỹ-Mexico, cùng dự một buổi đoàn tụ ngắn, vui buồn lẫn lộn vào năm 2018.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cai-om-3-phut-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cai-om-3-phut-poster.jpg', '2024-02-11 15:37:16', 8, '', 28, 0),
(651, 'Phiêu du đại dương đến gặp em', 'We are Meant to Meet', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/phieu-du-dai-duong-den-gap-em-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phieu-du-dai-duong-den-gap-em-poster.jpg', '2024-02-11 15:37:17', 8, '', 1641, 0),
(652, 'Sự trở lại của điệp viên bí mật', 'the Return of the Secret Agent', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/su-tro-lai-cua-diep-vien-bi-mat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/su-tro-lai-cua-diep-vien-bi-mat-poster.jpg', '2024-02-11 15:37:20', 8, '', 16, 0),
(653, 'Thà tôi ra ngài cảnh sát trưởng máu lạnh', 'Let Me Go', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/tha-toi-ra-ngai-canh-sat-truong-mau-lanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tha-toi-ra-ngai-canh-sat-truong-mau-lanh-poster.jpg', '2024-02-11 15:37:22', 8, '', 1301, 2),
(654, 'Thanh xuân của anh trôi đi có em ở đó', 'You Are in My Beautiful Youth', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/thanh-xuan-cua-anh-troi-di-co-em-o-do-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thanh-xuan-cua-anh-troi-di-co-em-o-do-poster.jpg', '2024-02-11 15:37:24', 8, '', 1153, 0),
(655, 'Bắt cóc tôi đi', 'Take Me', 2017, '<p>Chủ một công ty mô phỏng bắt cóc làm ăn bết bát chợt nhận được yêu cầu bắt cóc cuối tuần, và phát hiện ra công việc đó không hề như ông tưởng tượng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bat-coc-toi-di-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bat-coc-toi-di-poster.jpg', '2024-02-11 15:37:25', 8, '', 124, 0),
(656, 'Thích khách triều Minh', 'The Ming Dynasty Assassin', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/thich-khach-trieu-minh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thich-khach-trieu-minh-poster.jpg', '2024-02-11 15:37:28', 8, '', 1291, 0),
(657, 'Thoát Dũng Năng Xuất', 'Swimming Upstream', 2018, '', 0, 'https://img.ophim11.cc/uploads/movies/thoat-dung-nang-xuat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thoat-dung-nang-xuat-poster.jpg', '2024-02-11 15:37:30', 8, '', 11030, 2),
(658, 'Bát hỉ lâm môn', 'My Family', 1986, '<p>Các mối quan hệ và chuyện tình của một gia đình huyên náo rơi vào hỗn loạn khi người mẹ đi thử vai cho một vở kịch tại địa phương.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bat-hi-lam-mon-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bat-hi-lam-mon-poster.jpg', '2024-02-11 15:37:32', 8, '', 126, 3),
(659, 'Bắt trùm cho vay', 'Shark Busters', 2002, '<p>Trước mũi dùi của truyền thông vào khoản nợ khổng lồ của mình, sĩ quan cảnh sát dẫn đầu cuộc điều tra những kẻ cho vay nặng lãi đứng sau một kế hoạch cho vay nham hiểm.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bat-trum-cho-vay-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bat-trum-cho-vay-poster.jpg', '2024-02-11 15:37:34', 8, '', 131, 0),
(660, 'Bên bờ dân chủ', 'The Edge of Democracy', 2019, '<p>Phim tài liệu chính trị và hồi ký cá nhân đan xen trong hành trình nhằm đi sâu tìm hiểu sự thật phức tạp phía sau sự sụp đổ của hai nhiệm kỳ tổng thống Brazil.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ben-bo-dan-chu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ben-bo-dan-chu-poster.jpg', '2024-02-11 15:37:37', 8, '', 21, 0),
(661, 'Bump Up Business: Kế Hoạch Thăng Cấp Idol', 'Bump Up Business', 2023, '<p>Sau 5 năm huấn luyện, Ethan, người sắp bước vào con đường nghệ thuật, gặp gỡ Chul - một ngôi sao cùng công ty. Ethan nhìn Chul và quyết định trở thành một người nổi tiếng hơn. Tuy nhiên, Ethan nghe nói rằng chỉ có cách họ hợp tác với nhau dưới tư cách những người nghệ sĩ đồng tính mới có thể debut. Ethan muốn từ chối thực tế này, nhưng để theo đuổi ước mơ bấy lâu nay của mình, anh ấy đã phải tuân theo chính sách của công ty và tham gia ra mắt. Ethan trở thành một thần tượng có biệt danh Sư Tâm nhưng anh ta cảm thấy khó chấp nhận với việc tham gia vào các buổi biểu diễn đồng tính thương mại.</p><p>Trái lại, Chul lại rất tự nhiên gần gũi, chọc ghẹo Ethan. Mặc dù hai người vẫn hay tranh luận nhưng thời gian họ ở cùng nhau càng lúc càng nhiều và mối quan hệ giữa họ cũng trở nên thân thiết hơn. Đồng thời, với sự xuất hiện của các ngôi sao hàng đầu là Hyun Bin và Jae, sự hiểu lầm giữa Ethan và Chul bắt đầu hình thành... Liệu họ có thể loại bỏ những hiểu lầm này và khám phá tình cảm của họ đối với nhau không?</p>', 1, 'https://img.ophim11.cc/uploads/movies/bump-up-business-ke-hoach-thang-cap-idol-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bump-up-business-ke-hoach-thang-cap-idol-poster.jpg', '2024-02-11 15:37:38', 8, '', 17, 0),
(662, 'Thơ Ngây (Bản Hàn)', 'Mischievous Kiss', 2010, '<p>Một nữ sinh trung học vụng về - Oh Ha-ni - đứng cuối lớp và cô đã phải lòng thiên tài nổi tiếng Baek Seung-Jo kể từ lần đầu tiên cô để mắt đến anh ấy.</p>', 1, 'https://img.ophim11.cc/uploads/movies/tho-ngay-ban-han-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tho-ngay-ban-han-poster.jpg', '2024-02-11 15:37:40', 8, '', 64, 16),
(663, 'Hội Nhẫn', 'Halka', 2019, '<p>Hội Nhẫn là một tổ chức tội phạm cai quản thế giới đen tối ở Thổ Nhĩ Kỳ. Bất cứ khi nào một thành viên trở nên quá mạnh, những người cai trị The Circle quyết định giết anh ta.</p><p>25 năm trước, một thủ lĩnh mafia Eren Karabulut trở thành mối đe dọa cho Hội Nhẫn và anh ta bị sập bẫy. Đứa con mới chào đời của anh ấy bị bắt cóc bởi các thành viên của Hội Nhẫn. Để cứu đứa con của mình, Eren Karabulut đến khu vực hội họp nhưng anh đã bị giết ở đó.</p><p>Vợ của Eren Karabulut, Humeyra (Nazan Kesal) không thể tìm thấy đứa con của chính mình. Đứa con Cihangir của cô bị một thành viên mafia lớn Ilhan (Burak Sergen) bắt đi và đổi lại đứa con sơ sinh Kaan được giao cho Humeyra. Humeyra hiểu rằng cô ấy sẽ không thể có được đứa con của chính mình, vì vậy cô ấy chấp nhận niềm tin của mình và quyết định nuôi dạy Kaan như thể con ruột của mình.</p>', 1, 'https://img.ophim11.cc/uploads/movies/hoi-nhan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoi-nhan-poster.jpg', '2024-02-11 15:37:45', 8, '', 140, 0),
(664, 'The Thorn Birds', 'The Thorn Birds', 1983, 'The story based on a novel by Colleen McCullough focuses on three generations of the Cleary family living on a sheep station in the Australian outback.', 1, 'https://img.ophim11.cc/uploads/movies/the-thorn-birds-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/the-thorn-birds-poster.jpg', '2024-02-11 15:37:50', 8, '', 121, 0),
(665, 'Người Tình Của Khang Hy ', 'Người Tình Của Khang Hy ', 2016, '<p>Bộ phim là câu chuyện tình yêu đầy sóng gió giữa Khang Hy và Lương Nhi. Thuở nhỏ, hai người có mối lương duyên cùng nhau trải qua kiếp nạn sinh tử, nhưng Lương Nhi gặp tai nạn mất trí nhớ. Sau đó, cô mang cái tên khác là Vệ Lâm Lan. Chuyện tình giữa hai người rồi sẽ đi đến đâu? &nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/nguoi-tinh-cua-khang-hy-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-tinh-cua-khang-hy-poster.jpg', '2024-02-11 15:37:57', 8, '', 45, 0),
(666, 'Paw Patrol: Đội đặc nhiệm siêu đẳng', 'Paw Patrol: The Movie', 2021, 'Không thành phố nào quá lớn, không tiếng sủa nào quá nhỏ! Ryder và đội cún dũng cảm đến Thành phố Phiêu Lưu sau khi Thị trưởng Humdinger tham lam lên nắm quyền và bắt đầu gây rối.', 0, 'https://img.ophim11.cc/uploads/movies/paw-patrol-doi-dac-nhiem-sieu-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/paw-patrol-doi-dac-nhiem-sieu-dang-poster.jpg', '2024-02-11 16:53:13', 8, '', 129, 0),
(667, 'Ngôi đền phim ảnh:  Kỷ niệm 100 năm Egyptian Theatre', 'Temple of Film: 100 Years of the Egyptian Theatre', 2023, 'Guillermo del Toro, Rian Johnson và các ngôi sao điện ảnh khác nhìn lại Nhà hát Ai Cập lịch sử của Los Angeles khi nơi này trở lại thời huy hoàng của cung điện điện ảnh trước đây.', 0, 'https://img.ophim11.cc/uploads/movies/ngoi-den-phim-anh-ky-niem-100-nam-egyptian-theatre-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ngoi-den-phim-anh-ky-niem-100-nam-egyptian-theatre-poster.jpg', '2024-02-11 16:53:21', 8, '', 11, 0),
(668, 'Nghệ thuật tinh tế của việc đếch quan tâm', 'The Subtle Art of Not Giving a F*ck', 2023, 'Trong bộ phim tài liệu dựa trên sách bán chạy của ông, tác giả Mark Manson khám phá tình trạng của con người và cách tiếp cận phản trực giác để tìm thấy niềm vui đích thực.', 0, 'https://img.ophim11.cc/uploads/movies/nghe-thuat-tinh-te-cua-viec-dech-quan-tam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nghe-thuat-tinh-te-cua-viec-dech-quan-tam-poster.jpg', '2024-02-11 16:53:28', 8, '', 137, 1),
(669, 'Mãi mãi', 'Forever', 2023, 'Mối liên kết từng không thể phá vỡ giữa các tín đồ bóng đá tuổi teen Mila và Kia bắt đầu trở nên căng thẳng khi cựu tuyển thủ chuyên nghiệp khó tính nọ trở thành HLV mới của họ.', 0, 'https://img.ophim11.cc/uploads/movies/mai-mai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mai-mai-poster.jpg', '2024-02-11 16:53:31', 8, '', 143, 0),
(670, 'LEGO Ninjago: Những con rồng trỗi dậy', 'LEGO Ninjago: Dragons Rising', 2023, 'Hai thiếu niên đến từ hai thế giới khác nhau sử dụng sức mạnh Ninja mới được phát hiện để bảo vệ rồng khỏi những kẻ hung ác muốn sử dụng sinh khí cho mục đích xấu xa.', 1, 'https://img.ophim11.cc/uploads/movies/lego-ninjago-nhung-con-rong-troi-day-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/lego-ninjago-nhung-con-rong-troi-day-poster.jpg', '2024-02-11 16:53:36', 8, '', 23, 1),
(671, 'Lắm Chuyện (Phần 7)', 'Big Mouth (Season 7)', 2023, 'Các bạn tuổi teen thấy cuộc sống đảo ngược bởi những điều kỳ diệu và kinh hoàng tuổi dậy thì trong bộ phim hài hước sắc sảo của Nick Kroll và Andrew Goldberg.', 1, 'https://img.ophim11.cc/uploads/movies/lam-chuyen-phan-7-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/lam-chuyen-phan-7-poster.jpg', '2024-02-11 16:53:40', 8, '', 26, 15),
(672, 'Kẻ sát nhân', 'Murderer', 2014, 'Đang ở ẩn, sát nhân hàng loạt nọ nung nấu âm mưu độc ác khi con trai hắn kết bạn với cô bé biết bí mật rùng rợn của hắn.', 0, 'https://img.ophim11.cc/uploads/movies/ke-sat-nhan-2014-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ke-sat-nhan-2014-poster.jpg', '2024-02-11 16:53:48', 8, '', 115, 0),
(673, 'ISHIKO và HANEO: Bạn kiện tôi đấy à?', 'ISHIKO and HANEO: You\'re Suing Me?', 2022, 'Một trợ lý luật sư tốt nghiệp trường danh tiếng hợp tác với một luật sư khác thường. Họ nhận những vụ án nhỏ kỳ quặc tại văn phòng luật nhỏ ở khu vực.', 1, 'https://img.ophim11.cc/uploads/movies/ishiko-va-haneo-ban-kien-toi-day-a-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ishiko-va-haneo-ban-kien-toi-day-a-poster.jpg', '2024-02-11 16:53:52', 8, '', 59, 0),
(674, 'Erin và Aaron', 'Erin & Aaron', 2023, 'Tên của Erin và Aaron nghe có vẻ giống nhau, nhưng họ lại hết sức đối lập. Thông qua âm nhạc, hai chị em kế mới này học cách chung sống hòa thuận.', 1, 'https://img.ophim11.cc/uploads/movies/erin-va-aaron-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/erin-va-aaron-poster.jpg', '2024-02-11 16:54:03', 8, '', 26, 0),
(675, 'Động vật bé cưng trên camera', 'Baby Animal Cam', 2023, 'Dõi theo thói quen thường ngày, tập tính kỳ quặc và môi trường sống ấm cúng của một số bé động vật tại Cleveland Metroparks. Chương trình được quay trực tiếp bằng tiếng Anh.', 1, 'https://img.ophim11.cc/uploads/movies/dong-vat-be-cung-tren-camera-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dong-vat-be-cung-tren-camera-poster.jpg', '2024-02-11 16:54:07', 8, '', 228, 0),
(676, 'Chúa ơi ở đâu? Tôi là Margaret', 'Are You There God? It\'s Me, Margaret', 2023, 'Những năm 1970, cô bé 11 tuổi Margaret xoay xở với tình bạn mới, cuộc sống gia đình, câu hỏi về đức tin... và nỗi khổ sở khi chờ đợi tuổi dậy thì rốt cuộc cũng đến.', 0, 'https://img.ophim11.cc/uploads/movies/chua-oi-o-dau-toi-la-margaret-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chua-oi-o-dau-toi-la-margaret-poster.jpg', '2024-02-11 16:54:12', 8, '', 146, 0),
(677, 'Chọn Tình Yêu', 'Choose Love', 2023, '<p>Bạn trai ổn định. Người đã bỏ đi. Ngôi sao nhạc rock quyến rũ. Cami sẽ chọn ai? Trong bộ phim hài lãng mạn tương tác này, cuộc sống tình yêu của cô ấy nằm trong tay bạn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chon-tinh-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chon-tinh-yeu-poster.jpg', '2024-02-11 16:54:18', 8, '', 117, 0),
(678, 'Châu báu đời tôi', 'My Precious', 2023, 'Bị phạt vì chơi khăm, kẻ gây rối trong lớp phải chịu sự giám sát của một học sinh gương mẫu. Nhưng rồi cả hai sớm nảy sinh tình cảm với nhau.', 0, 'https://img.ophim11.cc/uploads/movies/chau-bau-doi-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chau-bau-doi-toi-poster.jpg', '2024-02-11 16:54:24', 8, '', 2, 0),
(679, 'Bê bối Bettencourt: Nữ tỷ phú, người quản gia và bạn trai', 'The Billionaire, The Butler, and the Boyfriend', 2023, 'Làm thế nào mà xung đột giữa người phụ nữ giàu nhất thế giới và con gái lại trở thành vụ bê bối quốc gia? Loạt phim tài liệu hấp dẫn này sẽ cho ta biết chân tướng câu chuyện.', 1, 'https://img.ophim11.cc/uploads/movies/be-boi-bettencourt-nu-ty-phu-nguoi-quan-gia-va-ban-trai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/be-boi-bettencourt-nu-ty-phu-nguoi-quan-gia-va-ban-trai-poster.jpg', '2024-02-11 16:54:34', 8, '', 48, 0),
(680, 'Sóng Gió Khách Sạn', 'Sóng Gió Khách Sạn', 2005, 'Bộ phim xoay quanh câu chuyện gia đình họ Vương và khách sạn Hoàng Đình với những tranh chấp, mưu đồ trong giới kinh doanh.\n\nAnh em nhà họ Vương mỗi người một ý, suốt ngày chỉ biết kèn cựa, đấu đá nhau. Cho đến một ngày khi kẻ thù chung xuất hiện, họ mới tỉnh ngộ và đoàn kết lại.', 1, 'https://img.ophim11.cc/uploads/movies/song-gio-khach-san-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/song-gio-khach-san-poster.jpg', '2024-02-11 16:54:37', 8, '', 45, 0),
(681, 'Dưới sáu tấc đất (Phần 4)', 'Six Feet Under (Season 4)', 2001, '<p>Khi cậu con trai hoang đàng Nate Fisher trở về nhà vào dịp nghỉ lễ khi nhận được tin cha mình qua đời, gia đình phải học cách đối phó với cái chết của một người trong số họ — đồng thời tìm ra cách tiếp tục công việc mưu sinh.</p>', 1, 'https://img.ophim11.cc/uploads/movies/duoi-sau-tac-dat-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/duoi-sau-tac-dat-phan-1-poster.jpg', '2024-02-11 16:54:52', 8, 'https://www.youtube.com/watch?v=E3gYi-KvKug', 50, 12),
(682, 'Đội cứu hộ Tokyo MER', 'Tokyo MER: Mobile Emergency Room', 2021, 'Trong đơn vị cấp cứu di động công nghệ cao, vị bác sĩ tận tâm dẫn đầu một đội gồm những nhân viên cứu hộ dũng cảm lao vào nguy hiểm để cứu công dân gặp khó khăn.', 1, 'https://img.ophim11.cc/uploads/movies/doi-cuu-ho-tokyo-mer-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-cuu-ho-tokyo-mer-poster.jpg', '2024-02-11 16:54:59', 8, '', 18, 0),
(683, 'Đến khi án mạng chia lìa đôi ta: Soering và Haysom', 'Till Murder Do Us Part: Soering vs. Haysom', 2023, 'Jens Soering đã sát hại bố mẹ bạn gái mình vào năm 1985, hay chính cô mới là sát nhân? Loạt phim tài liệu này đào sâu những câu hỏi vẫn chưa được giải đáp về vụ án.', 1, 'https://img.ophim11.cc/uploads/movies/den-khi-an-mang-chia-lia-doi-ta-soering-va-haysom-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/den-khi-an-mang-chia-lia-doi-ta-soering-va-haysom-poster.jpg', '2024-02-11 16:55:13', 8, '', 52, 0),
