(704, 'Đi tìm san hô', 'Chasing Coral', 2017, '<p>Thợ lặn, nhà khoa học và nhiếp ảnh gia trên khắp thế giới thực hiện một chiến dịch hoành tráng dưới nước nhằm ghi lại sự biến mất của các rạn san hô.</p>', 0, 'https://img.ophim11.cc/uploads/movies/di-tim-san-ho-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/di-tim-san-ho-poster.jpg', '2024-02-11 16:56:39', 8, '', 129, 0),
(705, '7 năm', '7 años', 2016, '<p>Lòng trung thành đứng trước thử thách và mưu mô dần lộ diện khi bốn người bạn làm ăn tranh cãi gay gắt về việc ai sẽ là kẻ đứng ra chịu tội.</p>', 0, 'https://img.ophim11.cc/uploads/movies/7-nam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/7-nam-poster.jpg', '2024-02-11 16:56:41', 8, '', 117, 1),
(706, 'Độc Mã Vượt Ngàn Dặm', 'Riding Alone for Thousands of Miles', 2005, '<p>Để nối lại tình cảm với con trai – một nhà sản xuất phim sắp chết – người ngư dân Nhật Bản lớn tuổi vượt hàng ngàn dặm để quay một vở kinh kịch quan trọng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/doc-ma-vuot-ngan-dam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doc-ma-vuot-ngan-dam-poster.jpg', '2024-02-11 16:56:43', 8, '', 148, 0),
(707, 'Điệp vụ Tokyo', 'Tokyo Raiders', 2000, '<p>Bị vị hôn phu Ken bỏ rơi trong lễ cưới, Macy cùng nhà thiết kế nội thất tới Tokyo tìm anh. Nhưng theo thám tử tư và nữ phụ tá họ thuê, Ken lại dính líu đến xã hội đen.</p>', 0, 'https://img.ophim11.cc/uploads/movies/diep-vu-tokyo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/diep-vu-tokyo-poster.jpg', '2024-02-11 16:56:47', 8, '', 140, 1),
(708, 'Điệp vụ tiền xu', 'Coin Heist', 2017, '<p>Khi cơn khủng hoảng đe dọa phải đóng cửa ngôi trường trung học của họ, bốn thiếu niên ấp ủ kế hoạch gây quỹ 10 triệu đô. Bước một sẽ là gì? Đột nhập Sở đúc tiền Hoa Kỳ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/diep-vu-tien-xu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/diep-vu-tien-xu-poster.jpg', '2024-02-11 16:56:49', 8, '', 137, 0),
(709, 'Lãng mạn trong nhà để xe', 'Romantic in Garage', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/lang-man-trong-nha-de-xe-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/lang-man-trong-nha-de-xe-poster.jpg', '2024-02-11 16:56:52', 8, '', 1352, 0),
