(713, 'Monkey King: Náo động cung điện rồng', 'Monkey King: Uproar in Dragon Palace', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/monkey-king-nao-dong-cung-dien-rong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/monkey-king-nao-dong-cung-dien-rong-poster.jpg', '2024-02-11 16:57:01', 8, '', 12230, 2),
(714, 'Samurai mắt xanh', 'BLUE EYE SAMURAI', 2023, 'Khát khao trả thù những kẻ đã khiến cô bị ruồng bỏ ở Nhật Bản thời Edo, nữ chiến binh trẻ nọ dấn thân vào con đường đẫm máu dẫn tới số mệnh của mình.', 1, 'https://img.ophim11.cc/uploads/movies/samurai-mat-xanh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/samurai-mat-xanh-poster.jpg', '2024-02-11 16:57:03', 8, 'https://www.youtube.com/watch?v=nJ1yQn17lbE', 48, 0),
(715, 'Chút Nắng Ấm Mỗi Ngày', 'Daily Dose of Sunshine', 2023, '<p>Làm việc trong lĩnh vực tâm thần học, nữ y tá tốt bụng luôn nỗ lực hết mình để mang lại hi vọng cho những người mà cô đang chăm sóc, bất chấp nhiều thử thách tìm đến cô.</p>', 1, 'https://img.ophim11.cc/uploads/movies/chut-nang-am-moi-ngay-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chut-nang-am-moi-ngay-poster.jpg', '2024-02-11 16:57:08', 8, 'https://www.youtube.com/watch?v=a81i3lenqp4', 68, 0),
(716, 'Năm Đêm Kinh Hoàng', 'Five Nights at Freddy\'s', 2023, 'Nhân viên bảo vệ Mike bắt đầu làm việc tại Freddy Fazbear\'s Pizza. Trong đêm làm việc đầu tiên, anh nhận ra mình sẽ không dễ gì vượt qua được ca đêm ở đây. Chẳng mấy chốc, anh sẽ vén màn sự thật đã xảy ra tại Freddy\'s.', 0, 'https://img.ophim11.cc/uploads/movies/nam-dem-kinh-hoang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nam-dem-kinh-hoang-poster.jpg', '2024-02-11 16:57:10', 8, 'https://www.youtube.com/watch?v=9fJtM5z0g7M', 110, 0),
(717, 'Upload (Phần 3)', 'Upload (Season 3)', 2023, '<p>Trong phần ba, chúng ta quay lại với Nora và Nathan mới tải xuống khi họ điều hướng mối quan hệ của mình trong khi chạy đua để ngăn chặn âm mưu bí ẩn đe dọa hủy diệt hàng triệu sinh mạng.</p>', 1, 'https://img.ophim11.cc/uploads/movies/upload-phan-3-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/upload-phan-3-poster.jpg', '2024-02-11 16:57:18', 8, 'https://www.youtube.com/watch?v=0ZfZj2bn_xg', 30, 0),
(718, 'Long Môn Phi Giáp', 'The Flying Swords of Dragon Gate', 2011, '<p>Flying Swords Of Dragon Gate lấy bối cảnh triều đại nhà Minh dưới thời kỳ của vua Minh Hiến Tông. Hoàng đế lúc bấy giờ chỉ lo đam mê tửu sắc, bỏ mặc triều đình cho thái giám lộng quyền. Câu chuyện của Flying Swords Of Dragon Gate dẫn dắt người xem theo cuộc hành trình nghĩa hiệp, tiêu diệt bọn thái giám độc ác của đại hiệp Triệu Hoài An và bước chân trốn chạy của cung nữ Huệ Dung người mang trong mình long chủng của hoàng đế, khỏi sự truy lùng của Vũ Hoa Điền, người đứng đầu đại nội mật thám Tây Xưởng...</p>', 0, 'https://img.ophim11.cc/uploads/movies/long-mon-phi-giap-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/long-mon-phi-giap-poster.jpg', '2024-02-11 16:57:22', 8, '', 0, 0),
(719, 'Phồn Thành Chi Hạ', 'Ripe Town', 2023, 'Năm Vạn Lịch thứ 37 thời nhà Minh, tại huyện thành Đố Huyện ở Giang Nam liên tiếp xảy ra những vụ án giết người. Những nạn nhân này có thân phận khác biệt, không liên quan đến nhau, xác chết được xếp thành hình thù quái lạ, mà ở tất cả các hiện trường vụ án đều để lại một câu. Là đồ đệ của nạn nhân đầu tiên, tiểu bổ khoái Khúc Tam Canh đã cùng nhóm bạn điều tra phá án. Trong quá trình đi sâu điều tra, mọi hạng người, mọi tầng lớp người lần lượt xuất hiện, trong màn sương mù dày đặc, vụ án cũ mười năm trước dần dần được hé lộ. Rốt cuộc hung thủ là ai, và mục đích của hắn là gì?', 1, 'https://img.ophim11.cc/uploads/movies/phon-thanh-chi-ha-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phon-thanh-chi-ha-poster.jpg', '2024-02-11 16:57:25', 8, '', 50, 14),
(720, 'Gen V', 'Gen V', 2023, '<p>Tại trường đại học duy nhất dành cho siêu anh hùng ở Mỹ, những sinh viên tài năng đặt ra những ranh giới đạo đức để kiểm tra, cạnh tranh để giành thứ hạng cao nhất của trường đại học và có cơ hội gia nhập đội siêu anh hùng ưu tú của The Seven, Vought International. Khi những bí mật đen tối của trường được đưa ra ánh sáng, họ phải quyết định xem mình muốn trở thành loại anh hùng nào.</p>', 1, 'https://img.ophim11.cc/uploads/movies/gen-v-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/gen-v-poster.jpg', '2024-02-11 16:57:27', 8, 'https://www.youtube.com/watch?v=aDyDg04x1W0', 55, 0),
(721, 'Giấc mộng tây du 2: Thiết phiến công chúa', 'Dream Journey 2: Princess Iron Fan', 2017, '<p>Để khôi phục phép thuật của quạt Ba Tiêu, Tôn Ngộ Không du hành 500 năm về quá khứ và bắt tay với Thiết Phiến công chúa.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giac-mong-tay-du-2-thiet-phien-cong-chua-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giac-mong-tay-du-2-thiet-phien-cong-chua-poster.jpg', '2024-02-11 16:57:33', 8, '', 134, 0),
(722, 'Giấc mơ Mỹ - Một, từ nhiều', 'Out of Many, One', 2018, '<p>Trong phim tài liệu ngắn này, một nhóm nam nữ đa dạng bàn luận về hành trình của riêng mình khi chuẩn bị cho bài kiểm tra nhập quốc tịch Mỹ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giac-mo-my-mot-tu-nhieu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giac-mo-my-mot-tu-nhieu-poster.jpg', '2024-02-11 16:57:35', 8, '', 34, 0),
(723, 'Giấc mơ khởi nghiệp', 'Upstarts', 2019, '<p>Hi vọng có thể làm việc tốt trong lúc kiếm hàng triệu đô, ba chàng cử nhân bắt tay khởi nghiệp. Nhưng việc kinh doanh khởi sắc thì tình bạn của họ lại bắt đầu rạn vỡ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giac-mo-khoi-nghiep-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giac-mo-khoi-nghiep-poster.jpg', '2024-02-11 16:57:37', 8, '', 152, 0),
(724, 'Giấc mơ đế quốc', 'Imperial Dreams', 2014, '<p>Một ông bố trẻ về nhà sau khi mãn hạn tù muốn được chăm lo cho con trai và trở thành nhà văn, nhưng tội ác, nghèo đói và chính quyền thối nát đã ngăn trở kế hoạch đó.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giac-mo-de-quoc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giac-mo-de-quoc-poster.jpg', '2024-02-11 16:57:39', 8, '', 126, 0),
(725, 'Gia đình tạm bợ', 'Temporary Family', 2014, '<p>Bốn thanh niên sinh sống ở Hong Kong đầu cơ mù quáng vào lĩnh vực bất động sản, bị mắc bẫy đầu cơ và giờ phải sống chung trong một căn hộ mới.</p>', 0, 'https://img.ophim11.cc/uploads/movies/gia-dinh-tam-bo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/gia-dinh-tam-bo-poster.jpg', '2024-02-11 16:57:42', 8, '', 139, 0),
(726, 'Free to Play', 'Free to Play', 2014, '<p>Phim tài liệu này theo chân ba game thủ chuyên nghiệp khi họ cạnh tranh trong một giải đấu quốc tế với giải thưởng là 1 triệu đô.</p>', 0, 'https://img.ophim11.cc/uploads/movies/free-to-play-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/free-to-play-poster.jpg', '2024-02-11 17:08:12', 8, '', 115, 0),
(727, 'Fan cuồng', 'Fanatic', 2016, '<p>Để hồi sinh nhạc hard-rock mà mình thương nhớ, một fan cuồng đã trở về năm 1996 để ngăn ca sĩ nhạc rock có tầm ảnh hưởng lựa chọn tình yêu thay vì sự nghiệp.</p>', 0, 'https://img.ophim11.cc/uploads/movies/fan-cuong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/fan-cuong-poster.jpg', '2024-02-11 17:08:15', 8, '', 143, 0),
(728, 'Evelyn', 'Evelyn', 2019, '<p>Bị ám ảnh bởi vụ tự sát của em trai, một đạo diễn cùng gia đình đi bộ xuyên nước Anh trong hành trình thử thách giàu cảm xúc mà đẹp mê hồn để chữa lành nỗi đau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/evelyn-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/evelyn-poster.jpg', '2024-02-11 17:08:22', 8, '', 136, 0),
(729, 'E-Team', 'E-Team', 2014, '<p>Các điều tra viên can đảm của E-Team thuộc Tổ chức Giám sát Nhân quyền liều mạng để ghi lại những cuộc tấn công vào thường dân phi pháp của các nhà độc tài tàn nhẫn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/e-team-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/e-team-poster.jpg', '2024-02-11 17:08:24', 8, '', 129, 0),
(730, 'Đội cứu hộ Malibu', 'Malibu Rescue', 2019, '<p>Tyler gặp rắc rối với danh sách dài các hành vi tai quái của mình. Cậu buộc phải vận đồ và dành mùa hè để luyện tập cho chương trình nhà cứu hộ trẻ ưu tú.</p>', 0, 'https://img.ophim11.cc/uploads/movies/doi-cuu-ho-malibu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-cuu-ho-malibu-poster.jpg', '2024-02-11 17:08:25', 8, '', 19, 0),
(731, 'Good Burger', 'Good Burger', 1997, '<p>Hai người bạn tuổi teen làm việc tại một tiệm đồ ăn nhanh trong khu phố. Họ cố gắng cứu nơi này khi một hãng burger lớn gây ra cuộc cạnh tranh gắt gao.</p>', 0, 'https://img.ophim11.cc/uploads/movies/good-burger-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/good-burger-poster.jpg', '2024-02-11 17:08:32', 8, '', 135, 0),
(732, 'Hajwala 2: Nhiệm vụ bí ẩn', 'Hajwala 2: Mysterious Mission', 2018, '<p>Trong phần hậu truyện này, một nhóm tài xế chuyên nghiệp giỏi lạng lách và đua xe tốc độ cao được tuyển mộ để thực hiện những nhiệm vụ mờ ám cho một băng đảng bí ẩn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hajwala-2-nhiem-vu-bi-an-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hajwala-2-nhiem-vu-bi-an-poster.jpg', '2024-02-11 17:08:39', 8, '', 155, 0),
(733, 'Handsome: Bộ phim bí ẩn của Netflix', 'Handsome: A Netflix Mystery Movie', 2017, '<p>Thám tử điều tra án mạng Gene Handsome quyết tâm làm sáng tỏ vụ sát hại một phụ nữ trong khi đi tìm lời giải cho những gì còn thiếu trong cuộc sống cá nhân của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/handsome-bo-phim-bi-an-cua-netflix-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/handsome-bo-phim-bi-an-cua-netflix-poster.jpg', '2024-02-11 17:08:46', 8, '', 121, 2),
(734, 'Hành trình tìm anh trai', 'Papua in Love The Movie', 2015, '<p>Thay mặt bố, người con trai đã lớn cố tìm lại anh song sinh thất lạc từ lâu khi anh gặp một người sẵn sàng giúp đỡ mình, cũng là người đàn ông đang chạy trốn bọn đòi nợ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hanh-trinh-tim-anh-trai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hanh-trinh-tim-anh-trai-poster.jpg', '2024-02-11 17:08:54', 8, '', 135, 3),
(735, 'Hành trình tới Greenland', 'Journey to Greenland', 2016, '<p>Hai diễn viên bán thời gian rời Paris đến một ngôi làng hẻo lánh ở Greenland. Họ trở nên đắm chìm trong văn hóa Inuit cổ và tạo nên những kết nối bất ngờ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hanh-trinh-toi-greenland-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hanh-trinh-toi-greenland-poster.jpg', '2024-02-11 17:09:01', 8, '', 138, 0),
(736, 'Hậu trường - Pha lê đen: Kỷ nguyên kháng chiến', 'The Crystal Calls Making the Dark Crystal: Age of Resistance', 2019, '<p>Khám phá hậu trường cùng các ngôi sao, nghệ sĩ múa rối và tác giả khi họ đưa thế giới phép thuật Thra của Jim Henson bước vào đời thực trong loạt phim kỳ ảo hấp dẫn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hau-truong-pha-le-den-ky-nguyen-khang-chien-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hau-truong-pha-le-den-ky-nguyen-khang-chien-poster.jpg', '2024-02-11 17:09:07', 8, '', 122, 0),
(737, 'Giáng Sinh của Rush', 'Holiday Rush', 2019, '<p>Một DJ radio góa vợ và bốn đứa con bị chiều hư phải thắt lưng buộc bụng và nương tựa lẫn nhau khi cuộc sống xa hoa tan biến ngay trước Giáng Sinh.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giang-sinh-cua-rush-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giang-sinh-cua-rush-poster.jpg', '2024-02-11 17:09:15', 8, '', 134, 0),
(738, 'Giang hồ máu lệ', 'Feng yu tong lu', 1990, '<p>Anh cớm chìm kết thân với kẻ từng là trùm xã hội đen – người đang vướng vào một vụ cướp trang sức trong khi kẻ chủ mưu thực sự dần tiếp cận bọn họ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giang-ho-mau-le-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giang-ho-mau-le-poster.jpg', '2024-02-11 17:09:22', 8, '', 138, 0),
(739, 'Giang hồ long hổ đấu', 'The Flaming Brothers', 1987, '<p>Lớn lên trên đường phố, hai anh em Tien và Alan như hình với bóng. Nhưng bây giờ khi đã trưởng thành, cuộc sống của họ rẽ sang những hướng khác nhau.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giang-ho-long-ho-dau-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giang-ho-long-ho-dau-poster.jpg', '2024-02-11 17:09:26', 8, '', 142, 1),
(740, 'Giấc mộng tây du: Kỳ ngộ Nữ nhi quốc', 'Dream Journey 3: The Land of Many Perfumes', 2017, '<p>Sau khi đến Nữ Nhi quốc, Đường Tăng đem lòng yêu nữ vương và quyết định thực hiện hành động hi sinh đầy cao thượng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giac-mong-tay-du-ky-ngo-nu-nhi-quoc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giac-mong-tay-du-ky-ngo-nu-nhi-quoc-poster.jpg', '2024-02-11 17:09:30', 8, '', 139, 2);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(741, 'Hoàng tử Peoria: Phép màu Giáng Sinh', 'Prince of Peoria: A Christmas Moose Miracle', 2018, '<p>Teddy chưa bao giờ bỏ lỡ Lễ hội Đèn, nhưng khu bowling đã bị tuyết rơi trắng xóa! Đừng lo – Emil quả quyết tuần lộc Giáng Sinh sẽ cứu vãn tình thế.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoang-tu-peoria-phep-mau-giang-sinh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoang-tu-peoria-phep-mau-giang-sinh-poster.jpg', '2024-02-11 17:09:32', 8, '', 29, 0),
(742, 'Hoành tài 30 triệu', 'The Thirty Million Rush', 1987, '<p>Một nhân viên ngân hàng nhờ vả bạn bè và một cựu tù để ăn trộm những bao tiền cũ đáng lẽ đã được thiêu hủy, bị cảnh sát và ma sơ truy đuổi gắt gao.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoanh-tai-30-trieu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoanh-tai-30-trieu-poster.jpg', '2024-02-11 17:09:38', 8, '', 134, 1),
(743, 'Hội quái siêu cấp và Ngôi sao ước', 'Super Monsters and the Wish Star', 2018, '<p>Điều ước Giáng sinh thành hiện thực với Lobo, khi người anh họ cậu thích ghé thăm bất ngờ, và với Glorb, cậu ước có thể cùng lúc ở mọi nơi!</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoi-quai-sieu-cap-va-ngoi-sao-uoc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoi-quai-sieu-cap-va-ngoi-sao-uoc-poster.jpg', '2024-02-11 17:09:41', 8, '', 27, 0),
(744, 'Hội quái siêu cấp: Giải cứu Halloween', 'Super Monsters Save Halloween', 2018, '<p>Hội Quái Siêu Cấp dùng năng lực của họ để giúp những hàng xóm có tinh thần Halloween, rồi giúp một người bạn hay lo lắng thấy rằng chẳng có gì phải sợ cả.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoi-quai-sieu-cap-giai-cuu-halloween-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoi-quai-sieu-cap-giai-cuu-halloween-poster.jpg', '2024-02-11 17:09:48', 8, '', 24, 0),
(745, 'Hội quái siêu cấp: Tri kỷ Quái vật', 'Super Monsters Furever Friends', 2019, '<p>Vào đêm đầu tiên của mùa xuân, các Siêu quái vật tụ họp để ăn uống và vui chơi trong công viên – cũng như để gặp mặt các thú cưng dễ thương mới!</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoi-quai-sieu-cap-tri-ky-quai-vat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoi-quai-sieu-cap-tri-ky-quai-vat-poster.jpg', '2024-02-11 17:09:49', 8, '', 58, 0),
(746, 'Giáng sinh kiểu Murray', 'A Very Murray Christmas', 2015, '<p>Bill Murray tập hợp dàn diễn viên toàn ngôi sao cho buổi biểu diễn âm nhạc, hài kịch và khiêu vũ thân mật, tạo nên một nét khác lạ cho chương trình tạp kỹ lễ hội này.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giang-sinh-kieu-murray-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giang-sinh-kieu-murray-poster.jpg', '2024-02-11 17:09:51', 8, '', 56, 0),
(747, 'Giáo viên dạy nhạc', 'Music Teacher', 2019, '<p>Một giáo viên dạy nhạc ở thị trấn nhỏ buồn tẻ chìm trong cảm giác tội lỗi và hối hận khi một học sinh cũ từng yêu anh trở về nhà với ánh hào quang mà anh hằng mơ ước.</p>', 0, 'https://img.ophim11.cc/uploads/movies/giao-vien-day-nhac-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/giao-vien-day-nhac-poster.jpg', '2024-02-11 17:09:57', 8, '', 141, 0),
(748, 'GO! Bữa tiệc không thể quên', 'GO! The Unforgettable Party', 2019, '<p>Kỳ nghỉ của Mía với cha xáo động bởi sự xuất hiện bất ngờ của Lupe, Mercedes, Juanma và Álvaro, kéo theo những thị phi chốn học đường đến khu bờ hồ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/go-bua-tiec-khong-the-quen-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/go-bua-tiec-khong-the-quen-poster.jpg', '2024-02-11 17:10:04', 8, '', 1, 0),
(749, 'Góc khuất cuộc đời nữ danh ca', 'What Happened, Miss Simone?', 2015, '<p>Câu chuyện về ca sĩ và nhà hoạt động huyền thoại Nina Simone sử dụng những bản ghi âm chưa từng nghe, thước phim tư liệu hiếm và những bài hát nổi tiếng nhất của cô.</p>', 0, 'https://img.ophim11.cc/uploads/movies/goc-khuat-cuoc-doi-nu-danh-ca-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/goc-khuat-cuoc-doi-nu-danh-ca-poster.jpg', '2024-02-11 17:10:12', 8, '', 142, 0),
(750, 'Gọi cho tôi Roger Stone', 'Get Me Roger Stone', 2017, '<p>Trỗi dậy, sụp đổ rồi tái sinh, chính trị gia sừng sỏ Roger Stone thực sự là linh hồn của đội ngũ ủng hộ Donald Trump trong suốt nhiều thập kỷ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/goi-cho-toi-roger-stone-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/goi-cho-toi-roger-stone-poster.jpg', '2024-02-11 17:11:58', 8, '', 141, 0),
(751, 'Vi Hữu Ám Hương Lai - Tẩy Duyên Hoa', 'The Scent of Time', 2023, '<p>Vi Hữu Ám Hương Lai - Tẩy Duyên Hoa - The Scent of Time 2023 là một bộ phim Việt Sub Thuyết Minh kể về câu chuyện của Hoa Thiển, con gái của Tể tướng đương triều. Với ngoại hình xinh đẹp và tài năng trong việc cầm kỳ thi họa, Hoa Thiển thu hút lòng người. Tuy nhiên, bên trong cô lại có một tâm địa hống hách, ngang tàng và khó chịu, khiến mọi người xung quanh không có thiện cảm đối với cô.</p><p>&nbsp;</p><p>Hoa Thiển đã từ lâu yêu Trọng Dạ Lan, vị vương gia trúc mã, nhưng không dám thổ lộ tình cảm của mình. Trọng Dạ Lan nhầm Hoa Thiển là Mục Dao và đã yêu và cưới cô làm vợ. Tuy nhiên, khi Mục Dao xuất hiện, thái độ của Trọng Dạ Lan đã thay đổi. Hoa Thiển nhận ra rằng dù cô có tâm cơ và ác độc đến mức nào, cô cũng không thể chiếm được trái tim của Trọng Dạ Lan nữa. Vì vậy, cô quyết định thay đổi tính cách của mình để tìm kiếm hạnh phúc trọn vẹn.</p><p>&nbsp;</p><p>Cuộc sống của Hoa Thiển bước sang một trang mới khi cô tiến cung và gặp Trọng Khê Ngọ, huynh đệ ruột của Trọng Dạ Lan. Với tính cách ngoan ngoãn, biết nghe lời và hành xử đúng mực, Hoa Thiển đã lấy lòng Thái hậu và Trọng Khê Ngọ. Trọng Khê Ngọ cũng có tình cảm với Mục Dao và muốn chia rẽ đôi uyên ương. Từ một đồng minh, Trọng Khê Ngọ dần dần yêu Hoa Thiển một cách sâu đậm mà không hề hay biết. Anh luôn cho rằng mọi việc anh làm đều vì muốn tốt cho Hoa Thiển và muốn đưa cô lên ngôi vị cao nhất trong hậu cung. Nhưng thực tế là anh khiến cô phải hy sinh cả gia tộc của mình.</p><p>&nbsp;</p><p>Bên cạnh Hoa Thiển còn có Hoa Nhung Châu, người cô chỉ xem là tiểu đệ. Tuy nhiên, không ngờ rằng Hoa Nhung Châu lại yêu thương cô và sẵn sàng làm chỗ dựa, hy sinh cả tính mạng để cứu cô. Anh là một người đàn ông thâm tình, không có tiền bạc, quyền lực hay địa vị, nhưng anh có thể cho cô ngồi ở vị trí duy nhất trong trái tim, điều mà Trọng Khê Ngọ không thể làm được.</p><p>&nbsp;</p><p>Giữa hai sự lựa chọn, một Trọng Khê Ngọ sẵn sàng làm mọi thứ vì muốn tốt cho Hoa Thiển và một Hoa Nhung Châu có thể hy sinh cả tính mạng cho cô, Hoa Thiển sẽ chọn ai? Hãy cùng đón xem bộ phim để biết kết quả cuối cùng!</p>', 1, 'https://img.ophim11.cc/uploads/movies/vi-huu-am-huong-lai-tay-duyen-hoa-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vi-huu-am-huong-lai-tay-duyen-hoa-poster.jpg', '2024-02-11 17:12:01', 8, '', 45, 4),
(752, 'Cô gái Kretek', 'Cigarette Girl', 2023, 'Hành trình yêu thương và tự khám phá của một nghệ nhân tài ba mở ra khi cô thách thức truyền thống trong ngành thuốc lá đinh hương ở Indonesia những năm 1960.', 1, 'https://img.ophim11.cc/uploads/movies/co-gai-kretek-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-gai-kretek-poster.jpg', '2024-02-11 17:12:13', 8, 'https://www.youtube.com/watch?v=ejRQzHh8gLI', 0, 0),
(753, 'Onimusha', 'Onimusha', 2023, 'Nắm trong tay vũ khí hắc ám diệt hồn, liệu người kiếm sĩ huyền thoại và hội huynh đệ samurai có thể đánh bại cuộc nổi dậy của thây ma khát máu?', 1, 'https://img.ophim11.cc/uploads/movies/onimusha-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/onimusha-poster.jpg', '2024-02-11 17:12:40', 8, 'https://www.youtube.com/watch?v=-1wsUxg68Ek', 0, 0),
(754, 'Con nhà giàu', 'Hana Yori Dango', 1996, 'Tsukushi thuộc tầng lớp trung lưu và chẳng mấy ấn tượng với 4 cậu trai giàu có, nổi tiếng thống trị học viện danh tiếng mà cô theo học, ngay cả khi một trong số họ phải lòng cô.', 1, 'https://img.ophim11.cc/uploads/movies/con-nha-giau-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/con-nha-giau-poster.jpg', '2024-02-11 17:13:02', 8, '', 24, 0),
(755, 'Bộ ba nữ tặc', 'Wingwomen', 2023, '<p>Chán ngán cuộc sống trốn chạy, tay trộm chuyên nghiệp nọ quyết định rửa tay gác kiếm... sau khi thực hiện phi vụ cuối dễ dàng với đồng phạm và một tài xế đào tẩu mới đầy hung hãn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/voleuses-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/voleuses-poster.jpg', '2024-02-11 17:13:23', 8, 'https://www.youtube.com/watch?v=Au9Uz4_H6zA', 114, 0),
(756, 'Đấu Trường Say Xỉn', 'The Hungover Games', 2014, '<p>Khi bữa tiệc của tiến sĩ Doug kết thúc tại 1 nhà nghỉ tồi tàn ngoại ô Las Vegas, những anh chàng say xỉn , Bradley, Ed, và Zach thức dậy trong 1 căn phòng lạ trong 1 thế giới không giống như nơi họ đang sống, mà lại vắng mặt anh chàng Doug. Sau khi gặp các nhân vật trong Đấu Trường Chết Đói, các chàng ngự lâm của chúng ta mới nhận ra là họ đang trên con tầu đến với Đấu Tường Say Xỉn. Một trận đấu sinh tồn, các chàng trai của chúng ta lần lượt phải đối mặt với các nhân vật nguy hiểm của các Quận khác nhau. Will Bradley, Ed, và Zach liệu có tìm được Doug và đưa anh ta đến đám cưới được không ?</p>', 0, 'https://img.ophim11.cc/uploads/movies/dau-truong-say-xin-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dau-truong-say-xin-poster.jpg', '2024-02-11 17:13:37', 8, '', 87, 0),
(757, 'Thủy thủ mặt trăng (Phần 3)', 'Sailor Moon Crystal (Season 3)', 2014, 'Nữ sinh cấp hai Tsukino Usagi và các bạn phát hiện ra họ có khả năng biến hình thành Thủy thủ mặt trăng, mang sứ mệnh bảo vệ thế giới khỏi bóng tối.', 1, 'https://img.ophim11.cc/uploads/movies/thuy-thu-mat-trang-phan-1-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thuy-thu-mat-trang-phan-1-poster.jpg', '2024-02-11 17:13:44', 8, '', 24, 0),
(758, 'Vụ Ly Hôn Thế Kỷ', 'Matrimonial Chaos', 2018, '<p>Dựa trên nguyên tác \"Saikou no Rikon\" phát sóng trên đài Fuji TV năm 2013, Matrimonial Chaos là bộ phim lãng mạn – hài hước xoay quanh suy nghĩ của đàn ông và phụ nữ trong độ tuổi 30 ở thời hiện đại, khi mà ly hôn không còn là việc gì quá lạ lẫm và xa vời trong xã hội. Bộ phim là sự kết hợp giữa hai cái tên đình đám Cha Tae Hyun và Bae Doo Na, hứa hẹn sẽ là tác phẩm hài hước \"chất hơn nước cất\" dịp cuối năm nay...</p>', 1, 'https://img.ophim11.cc/uploads/movies/vu-ly-hon-the-ky-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vu-ly-hon-the-ky-poster.jpg', '2024-02-11 17:14:07', 8, '', 30, 0),
(759, 'PAW Patrol: Phim Siêu Đẳng', 'PAW Patrol: The Mighty Movie', 2023, '<p>Một mảnh thiên thạch kỳ diệu đã rơi xuống Thành Phố Phiêu Lưu, mang đến siêu năng lực cho những chú cún PAW Patrol và biến chúng thành Những Chú Cún Quyền Năng.</p><p>&nbsp;</p>', 0, 'https://img.ophim11.cc/uploads/movies/paw-patrol-phim-sieu-dang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/paw-patrol-phim-sieu-dang-poster.jpg', '2024-02-11 17:14:14', 8, 'https://www.youtube.com/watch?v=UDgjJ9XzgHk', 92, 0),
(760, 'Khóa Trong', 'Locked In', 2023, '<p>Cố gắng giải mã bí mật về những chấn thương của một bệnh nhân hôn mê, nữ y tá tốt bụng phát hiện ra sự ganh đua gay gắt, ngoại tình, phản bội và án mạng liên quan đến họ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/khoa-trong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/khoa-trong-poster.jpg', '2024-02-11 17:14:36', 8, 'https://www.youtube.com/watch?v=y6a3yXfMEJg', 96, 0),
(761, 'Kỳ Tích Tình Yêu', 'The Infinite Love', 2023, '<p>Xoay quanh câu chuyện tình éo le giữa hai chàng trai và một cô gái. Davika và Pawee vốn là một cặp nhưng do một tai nạn, cô tưởng anh đã chết. Davika cuối cùng cũng tiếp tục với Chatchawin, người luôn ở bên cạnh và giúp chữa lành trái tim tan vỡ của cô. Sáu năm sau, Pawee trở lại. Giữa một tình yêu cũ in sâu, và một tình yêu mới với những ước mơ về một tương lai tươi sáng... liệu cô ấy sẽ chọn ai?</p>', 1, 'https://img.ophim11.cc/uploads/movies/ky-tich-tinh-yeu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ky-tich-tinh-yeu-poster.jpg', '2024-02-11 17:14:57', 8, '', 55, 0),
(762, 'Dong Yi', 'Dong Yi', 2010, '<p>Lấy bối cảnh dưới thời trị vì của Vua Sukjong thuộc triều đại Joseon, câu chuyện tập trung vào Dong Yi, một cung nữ lấy nước được Hoàng hậu Inhyeon tin tưởng và sau đó được nhà vua sủng ái khi ông cảm động trước những lời cầu nguyện của cô cho sức khỏe của Hoàng hậu trong thời gian trị vì. những tranh chấp tại tòa án do Jang Hee Bin gây ra. Dong Yi trở thành vợ lẽ với cấp bậc sook-bin và sinh ra một người con trai sau này trở thành vị vua thứ 21 của Joseon, Yeongjo.</p>', 1, 'https://img.ophim11.cc/uploads/movies/dong-yi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dong-yi-poster.jpg', '2024-02-11 17:15:06', 8, 'https://www.youtube.com/watch?v=pgjHPVbLTpQ', 65, 3),
(763, 'Sử Thi', 'Destan/Epic', 2022, '<p>Câu chuyện xảy ra vào thế kỷ thứ 8 trước khi người Thổ Nhĩ Kỳ chuyển sang đạo Hồi. Câu chuyện bắt đầu với Alpagu Khan (Selim Bayraktar), người có lính bộ binh đã thiệt mạng vì một cái bẫy của Trung Quốc. Sau sự phản bội này, anh trai của anh ta là Balamir (Gök Yabghu) tìm thấy một ghi chú của một người lính Trung Quốc cho thấy rằng vợ của Alpagu là Tılsım Hatun đã phản bội anh ta. Cô và cha cô đã thành lập một liên minh với Trung Quốc để tiêu diệt Gok Khaganate. Khi biết được điều này, Alpagu Khan đã giết Tılsım Hatun, từ đó khiến đứa con trai tàn tật của mình, Batuga (Edip Tepeli) mồ côi. Bộ phim mô tả một câu chuyện tình sử thi của Akkiz (Ebru Şahin), người cũng mồ côi cha mẹ sau khi Alpagu Khan giết cha mình sau sự phản bội của người Trung Quốc, và Batuga và hành trình của họ để giành lấy công lý và trả thù cho Gök Khan.&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/su-thi-cua-akkiz-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/su-thi-cua-akkiz-poster.jpg', '2024-02-11 17:15:16', 8, 'https://www.youtube.com/watch?v=vek778GSwWc', 230, 0),
(764, 'VIP - Tình yêu giấu kín', 'V.I.P', 2023, '<p>Rin là một người phụ nữ dường như có tất cả: Cô là thành viên chủ chốt của nhóm quản lý khách hàng VIP tại một cửa hàng bách hóa lớn của Thái Lan. Nhóm phục vụ khách hàng siêu giàu của cửa hàng, cung cấp các phiên mua sắm riêng tư và các dịch vụ độc quyền. Ngoài thành đạt, cô còn xinh đẹp và có người chồng bảnh bao, thành đạt không kém Pakawat, trưởng nhóm cùng đội ngũ quản lý. Nhưng cuộc đời cô sụp đổ vào một đêm khuya, cô nghe thấy Pakawat đang tranh cãi nảy lửa với ai đó qua điện thoại. Ngay sau đó, cô nhận được một tin nhắn nặc danh có nội dung “Chồng của bạn đang ngoại tình với một người trong nhóm của bạn”. Đột nhiên, Rin nảy sinh nghi ngờ, háo hức tìm hiểu xem ai đã gửi tin nhắn. Cô bắt đầu nghi ngờ Pakawat có thể đang lừa dối cô sau lưng với một người mà cô nghĩ mình có thể tin tưởng. Pakawat có phải là chuột tình không? Và nếu vậy, anh ta đã lừa dối cô với ai?</p>', 1, 'https://img.ophim11.cc/uploads/movies/vip-tinh-yeu-giau-kin-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vip-tinh-yeu-giau-kin-poster.jpg', '2024-02-11 17:15:27', 8, '', 70, 0),
(765, 'Yêu Nhầm Sát Thủ', 'Killers', 2010, '<p>Sốc vì bị người yêu đá, Jennifer dọa bố mẹ sẽ uống thuốc tự tử. Không nỡ nhìn thấy con gái đau khổ, cha của Jennifer, ông Kornfeldt, một nhân viên mật vụ ở Washington đã cho vợ và con gái đi cùng mình trong một chuyến công tác đến Pháp. Tại một bờ biển tuyệt đẹp ở Pháp, Jennifer đã tình cờ gặp Spencer - một anh chàng cực kỳ hấp dẫn và ga lăng. Ngay phút đầu tiên gặp Spencer, Jennifer đã nhận ra Spencer chính là người đàn ông hoàn hảo mà cô hằng mong ước. Vì vậy, bằng mọi cách Jennifer quyết tâm hạ gục “mục tiêu” điển trai này. Thế nhưng, điều mà Jennifer không ngờ tới là Spencer - “người đàn ông vạn người mê” của cô lại là một điệp viên, một tay sát thủ ngầm của chính phủ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/yeu-nham-sat-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/yeu-nham-sat-thu-poster.jpg', '2024-02-11 17:26:14', 8, '', 0, 0),
(766, 'Vỡ Mộng Chốn Thiên Đường', 'Couples Retreat', 2009, '<p>Sau gần tám năm vui vẻ bên nhau, Jason và Cynthia bất ngờ gây sững sốt cho bạn bè khi tuyên bố sắp sửa ly dị. Và để cứu vãn cuộc hôn nhân này, hai người quyết định làm một chuyến du lịch xa hoa cuối cùng đến Eden Resort, một hòn đảo thiên đường nhiệt đới tại Nam Thái Bình Dương, nơi nổi tiếng với những liệu pháp mạnh mẽ chuyên giải quyết các vấn đề lứa đôi. Để có tiền trang trải chi phí cho chuyến du lịch này, cả hai cùng rủ nhóm bạn thân của mình tham gia với suy nghĩ “đôi bên cùng có lợi”: Trong khi hai người hòa giải, nhóm bạn của họ sẽ vui chơi trên bãi biển cát trắng trải đầy nắng vàng, thư giãn trong các phòng spa, chơi lưới sóng và tận hưởng. Tuy nhiên, mọi việc không chỉ đơn giản như vậy...</p>', 0, 'https://img.ophim11.cc/uploads/movies/vo-mong-chon-thien-duong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vo-mong-chon-thien-duong-poster.jpg', '2024-02-11 17:26:18', 8, '', 0, 0),
(767, 'Truy Lùng Sát Thủ', 'One in the Chamber', 2012, '<p>Hai sát thủ chuyên nghiệp làm việc cho cả hai bên trong một cuộc chiến băng đảng Nga và trở thành mục tiêu của một kẻ thù không rõ lai lịch nhằm tiêu diệt chứng cứ phạm tội...</p>', 0, 'https://img.ophim11.cc/uploads/movies/truy-lung-sat-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/truy-lung-sat-thu-poster.jpg', '2024-02-11 17:26:20', 8, '', 0, 0),
(769, 'Trang Số 8', 'Page Eight', 2011, '<p>Johnny Worricker là một nhân viên lâu năm của MI5. Ông chủ và cũng là người bạn tốt nhất của ông, Benedict Baron bất ngờ qua đời, bỏ lại đằng sau một tập hồ sơ không thể giải thích được, đe dọa sự ổn định của tổ chức. Trong khi đó, cơ hội ập đến khi Jonhny gặp người hàng xóm của mình và nhà hoạt động chính trị Nancy Pierpan. Jonhny buộc phải rời bỏ công việc của mình cùng với thân phận hiện tại để tìm ra sự thật...</p>', 0, 'https://img.ophim11.cc/uploads/movies/trang-so-8-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/trang-so-8-poster.jpg', '2024-02-11 17:26:26', 8, '', 0, 0),
(770, 'Ứng Dụng Anh Hùng', 'Private Hero', 2018, '<p>Trong một thế giới đầy tội ác, có một thị trấn nhỏ miễn nhiễm với tất cả loại tội phạm. Wu Zhengyi tập luyện kung fu hàng ngày để trở thành ngôi sao bảo vệ thị trấn. Wu cuối cùng khám phá ra thị trấn đang bị kiểm soát bởi một tên tội phạm. Wu sẽ làm gì để loại bỏ tên này?</p>', 0, 'https://img.ophim11.cc/uploads/movies/ung-dung-anh-hung-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ung-dung-anh-hung-poster.jpg', '2024-02-11 17:26:29', 8, '', 0, 2),
(771, 'Trận Chiến Vô Chủ', 'Under Cover', 2019, '<p>Vào cuối triều đại nhà Thanh, phiến quân nổi dậy và thực hiện nhiều tội ác, liên tiếp lẻn vào cung điện và thực hiện các vụ ám sát. Nhưng tất cả đều thất bại. Vì lý do này, Dong Ha Xuyên sẵn sàng vào cung điện và độc lập ám sát Xianfeng. Nhưng khi thành công đã đến, cuộc xung đột dân sự của phiến quân đã sụp đổ. Trận chiến Dong Ha Xuyên và những người khác đã không thành công.</p>', 0, 'https://img.ophim11.cc/uploads/movies/tran-chien-vo-chu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tran-chien-vo-chu-poster.jpg', '2024-02-11 17:26:31', 8, '', 0, 4),
(772, 'Biển sâu dậy sóng', 'In the Heart of the Sea', 2015, '<p>Trong chuyện có thật đã tạo cảm hứng cho Moby Dick này, đoàn thủy thủ săn cá voi ở New England đã chống chọi trong tuyệt vọng khi bị một con cá voi khổng lồ húc lật tàu.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bien-sau-day-song-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bien-sau-day-song-poster.jpg', '2024-02-11 17:26:33', 8, '', 21, 0),
(773, 'Lạc Vào Hư Vô', 'Enter the Void', 2010, '<p>Oscar và Linda là 2 anh em ruột sống ở Tokyo, Oscar làm trung gian bán ma túy, còn Linda múa thoát y ở một night club. Trong một lần bị cảnh sát mai phục và truy bắt, Oscar bị bắn chết. Và sau đó cậu như tan vào hư vô, biến thành một hồn ma, nhưng vẫn vật vờ ở Tokyo theo dõi em gái mình cùng những chuyện xảy ra sau cái chết của mình...</p>', 0, 'https://img.ophim11.cc/uploads/movies/lac-vao-hu-vo-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/lac-vao-hu-vo-poster.jpg', '2024-02-11 17:26:35', 8, '', 0, 0),
(774, 'Khó Thở (2012)', 'Breathless', 2012, '<p>Buồn chán chồng của mình, Lorna và cô bạn quyết định tự chữa \"bệnh\" cho mình bằng rượu Tennessee whiskey. Nhưng quyết định đó lại dẫn họ đến một vấn đề rắc rối hơn. Khi cảnh sát trưởng Cooley hỏi một số câu hỏi rắc rối khiến mọi việc phát triển thành một câu chuyện trả thù và sống sót theo đúng kiểu Texas: táo bạo và tàn nhẫn...</p>', 0, 'https://img.ophim11.cc/uploads/movies/kho-tho-2012-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/kho-tho-2012-poster.jpg', '2024-02-11 17:26:39', 8, '', 0, 0),
(775, 'Hương Mộc Lan', 'Magnolia', 2000, '<p>Bộ phim cảm động kể về giây phút cuối đời của 2 người đàn ông và số phận của những người có liên quan : Một người cha đang hấp hối. Một cô vợ trẻ. Một người con trai nổi tiếng bị mất tích. Một viên sĩ quan cảnh sát đang yêu. Một người từng là thiên tài.. Tất cả những cảm xúc kìm nén, những tiếc nuối cả cuộc đời được gói gọn trong một ngày. Một ngày u ám khi con người ta phải đếm những khoảnh khắc cuối đời bằng từng phút, từng giây trên giường bệnh...</p>', 0, 'https://img.ophim11.cc/uploads/movies/huong-moc-lan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/huong-moc-lan-poster.jpg', '2024-02-11 17:26:43', 8, '', 0, 0),
(776, 'Hoắc Nguyên Giáp', 'Huo Yuanjia', 2019, '<p>Phim mô tả câu chuyện về Huo YuanJia, võ sĩ Trung Quốc dựa vào tinh thần võ thuật của mình để bảo vệ phẩm giá của người Trung Quốc. Tại thời điểm cuối triều đại nhà Thanh, Trung Quốc phải đối mặt với những khó khăn và thách thức từ trong và ngoài nước.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoac-nguyen-giap-2019-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoac-nguyen-giap-2019-poster.jpg', '2024-02-11 17:26:47', 8, '', 0, 3),
(777, 'Hiện Tượng Siêu Nhiên 2', 'Paranormal Activity 2', 2010, '<p>Câu chuyện bắt đầu khi một gia đình ba người đón chào sự ra đời của bé Hunter. Cha, mẹ và cô chị gái đang tuổi thiếu niên đều vô cùng hào hứng. Cả chú chó Abby nữa. Sau một sự kiện, gia đình quyết định dựng hệ thống camera an ninh bao quát toàn bộ khu nhà. Một thành viên trong gia đình còn yêu thích việc quay phim đến mức luôn kè kè bên mình chiếc máy quay cầm tay.Bóng đêm trùm xuống và người mẹ bắt đầu nghe thấy nhiều tiếng động lạ, cũng như chứng kiến xoong chảo tự rơi khỏi giá bếp hay những cánh cửa tự đóng sập sau lưng mình. Rồi cô con gái cũng bắt đầu nghe được các âm thanh và vô tình bắt được trong camera của mình cảnh thứ gì đấy đang chuyển động. Chú chó nổi giận hằng đêm, nhưng không ai có phản ứng gì. Người cha quyết định đích thân chứng tỏ cho các thành viên còn lại trong gia đình rằng nhất định phải có một cách giải thích hợp lý cho mọi chuyện. Gần như ông đã thành công. Cuối cùng, cả gia đình quyết định ngồi xem lại những thước phim được camera an ninh ghi lại. Và họ bắt đầu nhận ra có điều gì đó không bình thường ở những cánh cửa tự đóng sầm lại, hay ai đó bị kéo lê quanh ngôi nhà. Họ nhận thức được rằng những thực thể kia dường như hành động ngày càng hung bạo hơn khi đêm xuống. Chỉ cho đến cuối cùng họ mới biết được rằng những thực thể giận giữ đang muốn gì và ai hay cái gì đang thực hiện hành động hằn thù...</p>', 0, 'https://img.ophim11.cc/uploads/movies/hien-tuong-sieu-nhien-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hien-tuong-sieu-nhien-2-poster.jpg', '2024-02-11 17:26:49', 8, '', 0, 0),
(778, 'Đại Sư Thanh Nông', 'Cyan Wizard', 2019, '<p>Phim xoay quanh nhân vật Li Daoshi, một pháp sư trừ tà được sư phụ cử xuống núi để hoàn thành nhiệm vụ đã được giao phó. Khi đi ngang qua ngôi làng chài, anh tình cờ gặp người đàn ông giả điên giả khùng và phát hiện ra bí mật của ngôi làng lâu nay. Hiện tại, có một con quái vật biển hung ác, đã giết chết bất cứ ai đi qua con sông để đánh bắt cá. Sau trận chiến đầu tiên với quái vật, Li Daoshi biết được thân thế thật của con thủy quái và tìm cách hóa giải thù hận và minh oan cho nó. Bằng trái tim nhân hậu và lòng trắc ẩn, anh cố thuyết phục mọi người nhưng không ai chấp nhận, liệu Li Daoshi có thể giúp thủy quái trở về cuộc sống bình thường.</p>', 0, 'https://img.ophim11.cc/uploads/movies/dai-su-thanh-nong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dai-su-thanh-nong-poster.jpg', '2024-02-11 17:26:52', 8, '', 0, 0),
(779, 'Cuộc Chiến Sinh Tồn', 'Dead Season', 2012, '<p>Một loại virus chết người được lây lan khắp nơi trong Thành Phố, dần tấn công vào tất cả mọi người ở bất cứ đâu biến họ thành những Zombie tấn công những người còn sống sót. Những người sống sót phải tìm cách lẫn trốn và chống trả lại bọn zombie đang khát máu để sinh tồn...</p>', 0, 'https://img.ophim11.cc/uploads/movies/cuoc-chien-sinh-ton-2012-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuoc-chien-sinh-ton-2012-poster.jpg', '2024-02-11 17:26:55', 8, '', 0, 0),
(780, 'Quyền Lực Tuyệt Đối', 'J. Edgar', 2011, '<p>Bộ phim kể về quá trình tiến tới quyền lực của Giám đốc FBI - J. Edgar Hoover (1895-1972), trong đó tập trung vào quá trình ông gây dựng Cuc Điều tra Liên Bang (FBI) - cơ quan ông điều hành cho đến khi qua đời vào năm 1972.</p>', 0, 'https://img.ophim11.cc/uploads/movies/quyen-luc-tuyet-doi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quyen-luc-tuyet-doi-poster.jpg', '2024-02-11 17:27:00', 8, '', 0, 3),
(781, 'Quê Hương Trên Đồng Cỏ', 'Home on the Range', 2004, '<p>Ở vùng ngoại ô, có một nông trại trong mơ của gia súc, nơi mà heo, bò, gà sống rất vui vẻ chan hòa và không bao giờ bị “làm thịt”. Nhưng rồi bà chủ nhân hậu bị phá sản, nông trại bị tịch thu để bán đấu giá. Nghe đâu những người đang lăm le mua lại nông trại sẽ sẵn sàng “làm thịt” hết gia súc. Trước hiểm họa bị giết thịt, bầy gia súc quyết định tìm cách cứu vãn nông trại. Chúng cử ra ba cô bò cái Grace, Maggie và Caloway đỏng đảnh nhưng dũng cảm và mưu trí đến gặp cảnh sát trưởng để thương lượng. Thử thách của chúng là bắt được một tên cướp và đem số tiền thưởng về để cứu nông trại. Liệu ba cô bò cái có hoàn thành được nhiệm vụ...</p>', 0, 'https://img.ophim11.cc/uploads/movies/que-huong-tren-dong-co-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/que-huong-tren-dong-co-poster.jpg', '2024-02-11 17:27:03', 8, '', 0, 0),
(782, 'Quan Vân Trường', 'The Lost Bladesman', 2011, '<p>Quan Vân Trường là câu chuyện kể về những ngày tháng “thân tại doanh Tào lòng ở Hán” của Quan Vũ, về cuộc hành trình hộ tống Qi Lan (Tôn Lệ) – vợ của Lưu Bị (Phương Trung Tín) ra khỏi vòng kiềm tỏa của Tào Tháo (Khương Văn), giữ trọn đạo làm tôi và đạo làm tiểu đệ. Trong cuộc hành trình ấy, Quan Vũ đã phải vượt qua biết bao hiểm nguy, cạm bẫy. Khi thì là những lời ngon ngọt dụ dỗ, vàng bạc châu báu... Mà Tào Tháo dùng để mua chuộc Quan Vũ, khi thì là những cuộc giao đấu quyết liệt để phá vòng vây quân Ngụy... Nhưng thử thách càng nhiều thì tấm lòng trung thành dũng cảm của Quan Vân Trường lại càng sáng ngời và đáng quý.</p>', 0, 'https://img.ophim11.cc/uploads/movies/quan-van-truong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quan-van-truong-poster.jpg', '2024-02-11 17:27:05', 8, '', 0, 2),
(783, 'Phù Dâu', 'Bridesmaids', 2011, '<p>Bridesmaids là câu chuyện về Annie – một cô nàng thất bại trong cả công việc lẫn cuộc sống. Một ngày kia, người bạn thân nhất của cô – Lilian, thông báo mình sắp sửa kết hôn. Dù bản thân còn “kẹt” trong “thảm cảnh” nhưng Annie vẫn hết lòng giúp Lilian chuẩn bị lễ cưới với vai trò là một phù dâu. Nào ngờ, vị trí danh dự này lại đem đến cho Annie khá nhiều rắc rối, kéo cô vào cuộc chiến gay go giữa các phù dâu. Nhưng cũng từ đây, Annie nhận được nhiều bài học đắt giá về tình bạn, tình yêu và cuộc sống...</p>', 0, 'https://img.ophim11.cc/uploads/movies/phu-dau-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/phu-dau-poster.jpg', '2024-02-11 17:27:08', 8, '', 0, 0),
(784, 'Mạng Đổi Mạng 2', 'John Wick: Chapter 2', 2017, '<p>Phim Mạng Đổi Mạng 2 - John Wick: Chapter 2 2017: Sau cuộc thư hùng ở phần 1, gã cựu sát thủ John Wick sẽ trở lại trong phần 2 với một sứ mệnh mới và một kẻ thù mới. Mọi thứ sẽ gay cấn và nguy hiểm hơn rất nhiều. May mắn, bên người John Wick sẽ xuất hiện một chú chó đáng yêu khác để an ủi tâm hồn cô đơn của gã.</p>', 0, 'https://img.ophim11.cc/uploads/movies/mang-doi-mang-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/mang-doi-mang-2-poster.jpg', '2024-02-11 17:27:10', 8, '', 0, 0),
(785, 'Hậu Duệ', 'The Descendants', 2012, '<p>Bộ phim tâm lí hài dựa trên cuốn tiểu thuyết của Kaui Hart Hemmings. Matt King là người đại diện cho vùng đất của gia đình ông tại Hawaii, đang cố gắng kết nối lại với 2 cô con gái của mình sau tai nạn chèo thuyền nghiêm trọng khiến Elizabeth - vợ ông rơi vào trạng thái hôn mê. Trước áp lực của các phe phái về việc bán đất, Matt King đưa 2 cô con gái theo trên 1 chuyến đi từ Oahu tới Kauai để đối mặt với 1 nhà môi giới bất động sản trẻ tuổi - người có mối quan hệ với Elizabeth trước khi cô gặp tai nạn bất hạnh, và muộn màng biết được 1 bí mật về vợ mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hau-due-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hau-due-poster.jpg', '2024-02-11 17:27:14', 8, '', 0, 0),
(786, 'Đường Sơn Đại Huynh', 'The Big Boss', 1971, '<p>Phim của hãng Gia Hoà do đạo diễn nổi tiếng La Duy ( Lo Wei) thực hiện tại Thái Lan vs kinh phí ít ỏi là 400 ngàn $ Hong Kong, trong đó thù lao của Lý Tiểu Long là 15 ngàn USD. Trong phim này anh thủ vai Trương Triều Anh ( Trịnh Triều An), một chàng trai Hồng Kông giỏi võ sang Thái Lan tìm việc làm. Anh được vào làm tại một xưởng sản xuất nước đá. Tại đây anh và các công nhân đã phát hiện ra ông chủ hãng nước đá núp bóng để buôn lậu và vận chuyển ma tuý... Chi tiết thú vị của bộ phim là trước khi lên đường lập nghiệp, mẹ của Trương Triều Anh đã đưa cho anh một mặt dây chuyền cẩm thạch kèm với lời dặn là bất cứ giá nào cũng không được đánh nhau. Công nhân hãng nước đá vì phản đối ông chủ đã bị bọn côn đồ đánh đập dã man. Cho đến khi bọn côn đồ trong lúc ẩu đả với các công nhân đã làm đứt sợi dây chuyền mà mẹ đã tặng cho anh. Đến lúc ấy Trương Triều Anh mới hợp lực cùng với các công nhân nện cho bọn côn đồ một trận ra trò. Như vậy nửa đầu của bộ phim người xem không hề thấy những cảnh Lý Tiểu Long thi triển võ thuật, và nửa sau bộ phim thì mọi người đã phải kinh ngạc trước những động tác liên hoàn mạnh mẽ dứt khoát của anh. Đây là một dụng ý của nhà sản xuất khi xây dựng 1 kịch bản để tạo những bất ngờ thú vị cho khán giả khi trình làng một thần tượng võ thuật mới. Đặc biệt lần đầu tiên khán giả được chứng kiến những cú liên hoàn cước trứ danh mà trước này chỉ nghe nói đến trên sách báo.</p>', 0, 'https://img.ophim11.cc/uploads/movies/duong-son-dai-huynh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/duong-son-dai-huynh-poster.jpg', '2024-02-11 17:27:17', 8, '', 0, 1),
(787, 'Đội Đặc Nhiệm', 'S.W.A.T.: Firefight', 2011, '<p>S.W.A.T là tên đội đặc nhiệm cảnh sát Los Angeles. Câu chuyện xoay quanh đội của Hondo. Vì một lỗi lầm trong lúc giải thoát con tin mà Jim Street và đồng nghiệp của anh bị tách ra. Anh chàng kia bị đuổi việc còn Jim thì bị giáng chức xuống làm người giữ đồ. Nhờ sự bảo lãnh của Hondo mà Jim trở lại làm cảnh sát đặc nhiệm và được gửi đi huấn luyện. Trong đội còn có Sanchez - cô gái xinh đẹp nhưng bản lãnh không thua đàn ông và TJ - kẻ luôn cạnh tranh với Jim. Họ đã có những ngày tháng bên nhau thật vui vẻ, đoàn kết...</p>', 0, 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/doi-dac-nhiem-poster.jpg', '2024-02-11 17:27:19', 8, '', 0, 0),
(788, 'Đại Học Ma', 'Midnight University', 2016, '<p>Đã bao giờ bạn thắc mắc rằng, liệu thế giới bên kia có còn điều gì ngoài muôn vạn hồn ma cùng những câu chuyện truyền miệng rùng rợn? Bạn có từng đặt giả thuyết hoang đường rằng ở đó cũng tồn tại một… lớp học? Nếu có thì sẽ như thế nào? Sẽ có bài kiểm tra chứ? Sẽ phải học những gì? Phim Midnight University xoay quanh nhân vật nữ chính là cô sinh viên tên Star - hotgirl của một trường đại học - cùng sáu người bạn cùng trường khác. Vì nhiều lý do, nhóm bạn buộc phải tham gia lớp học đêm nằm ở phòng Zero (vốn được sinh viên toàn trường xem là “lãnh địa” của những “đồng học” nhưng đã chết trước khi kịp tốt nghiệp), tạm gọi là một “lớp học ma ám” vô cùng đáng sợ. Cũng vì thế, bảy sinh viên “bất đắc dĩ” phải tham gia vào lớp học ở thế giới bên kia, mỗi tối vào lúc nửa đêm.</p>', 0, 'https://img.ophim11.cc/uploads/movies/dai-hoc-ma-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dai-hoc-ma-poster.jpg', '2024-02-11 17:27:22', 8, '', 0, 0),
(789, 'Người phụ nữ bị ghét nhất nước Mỹ', 'The Most Hated Woman in America', 2017, '<p>Bộ phim kể về cuộc đời đầy tranh cãi của nhà hoạt động theo chủ nghĩa vô thần Madalyn Murray O\'Hair, từ những vụ kiện quan trọng cho đến ngày bà bị bắt cóc.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-phu-nu-bi-ghet-nhat-nuoc-my-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-phu-nu-bi-ghet-nhat-nuoc-my-poster.jpg', '2024-02-11 17:29:29', 8, '', 132, 0),
(790, 'Sinh nhật', 'Birthday', 2019, '<p>Cặp cha mẹ vẫn đang buồn đau giờ càng chật vật trước ký ức về đứa con trai đã khuất, họ khó lòng quyết định có nên tổ chức sinh nhật cho cậu hay không.</p>', 0, 'https://img.ophim11.cc/uploads/movies/sinh-nhat-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sinh-nhat-poster.jpg', '2024-02-11 17:29:32', 8, '', 159, 0),
(791, 'Thiên long bát bộ - Thiên sơn đồng lão', 'The Dragon Chronicles - The Maidens of Heavenly Mountain', 1994, '<p>Khi vị võ sư được yêu mến trở bệnh, hai tỷ muội hay cãi vã phải bảo vệ quyền uy của vị võ sư trước một kẻ thù tàn ác và cả gia tộc mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/thien-long-bat-bo-thien-son-dong-lao-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thien-long-bat-bo-thien-son-dong-lao-poster.jpg', '2024-02-11 17:29:34', 8, '', 136, 0),
(792, 'Tôi thấy thật lạc lõng trong thế giới này', 'I Don\';t Feel at Home in This World Anymore', 2017, '<p>Cô trợ lý y tá rụt rè đã thấy cuộc sống thú vị hơn khi cùng người hàng xóm độc thân truy tìm băng cướp đã đột nhập vào nhà của cô.</p>', 0, 'https://img.ophim11.cc/uploads/movies/toi-thay-that-lac-long-trong-the-gioi-nay-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/toi-thay-that-lac-long-trong-the-gioi-nay-poster.jpg', '2024-02-11 17:29:36', 8, '', 136, 0),
(793, 'Vòng eo 56', 'Queen of the Bikini', 2016, '<p>Người mẫu Ngọc Trinh thủ vai chính mình trong phim tiểu sử dựa trên chuyện có thật về quá trình cô vươn tới sự nổi tiếng – và đôi khi là gây tranh cãi – ở tầm quốc tế.</p>', 0, 'https://img.ophim11.cc/uploads/movies/vong-eo-56-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vong-eo-56-poster.jpg', '2024-02-11 17:29:38', 8, '', 138, 0),
(794, 'Xin chào bé cưng', 'Hello Babies', 2014, '<p>Những đối thủ sống cùng làng cả đời chẳng chịu \"kém miếng\", và giờ thì ai cũng chạy đua để quyết trở thành người đầu tiên có cháu trai.</p>', 0, 'https://img.ophim11.cc/uploads/movies/xin-chao-be-cung-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/xin-chao-be-cung-poster.jpg', '2024-02-11 17:29:41', 8, '', 133, 1),
(795, 'Báo thù trong ngục', 'Doing Hard Time', 2004, '<p>Sau khi những kẻ sát hại con anh được nhận bản án quá nhẹ, người đàn ông quyết tâm trả thù đã cố tình để mình bị tống giam để thực thi thứ công lý mà anh muốn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bao-thu-trong-nguc-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bao-thu-trong-nguc-poster.jpg', '2024-02-11 17:29:42', 8, '', 141, 0),
(796, 'Chàng trai năm ấy', 'Dandelion', 2014, '<p>Sau khi nhận được chẩn đoán nghiệt ngã, một ca sĩ lạc quan, nhiều hoài bão phải suy ngẫm về cuộc đời và di sản của mình khi hội bạn thân tụ họp lại để hỗ trợ anh.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chang-trai-nam-ay-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chang-trai-nam-ay-poster.jpg', '2024-02-11 17:29:45', 8, '', 154, 1),
(797, 'Nghi Phạm Thứ Tám', 'Dust To Dust', 2023, '<p>Năm 1995, một vụ cướp tiền giấy có vũ trang quy mô lớn đã xảy ra ở Quảng Đông, khi một chiếc xe chở tiền của ngân hàng bị 5 tên cướp có vũ trang cướp, gây thiệt hại lên tới 15 triệu USD và 3 người mang tiền đã thiệt mạng trong vụ việc.…</p>', 0, 'https://img.ophim11.cc/uploads/movies/nghi-pham-thu-tam-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nghi-pham-thu-tam-poster.jpg', '2024-02-11 17:29:47', 8, 'https://www.youtube.com/watch?v=uLQHtOefuCA', 100, 0),
(798, 'Loki: Thần Lừa Lọc (Phần 2)', 'Loki (Season 2)', 2023, 'Khi Steve Rogers, Tony Stark và Scott Lang quay trở về cột mốc 2012, ngay khi trận chiến ở New York kết thúc, để “mượn tạm” quyền trượng của Loki. Nhưng một tai nạn bất ngờ xảy đến, khiến Loki nhặt được khối lặp phương Tesseract và tiện thể tẩu thoát. Cuộc trốn thoát này đã dẫn đến dòng thời gian bị rối loạn. Cục TVA – tổ chức bảo vệ tính nguyên vẹn của dòng chảy thời gian, buộc phải can thiệp, đi gô cổ ông thần này về làm việc. Tại đây, Loki có hai lựa chọn, một là giúp TVA ổn định lại thời gian, không thì bị tiêu hủy. Dĩ nhiên Loki chọn lựa chọn thứ nhất. Nhưng đây là nước đi vô cùng mạo hiểm, vì ông thần này thường lọc lừa, “lươn lẹo”, chuyên đâm lén như bản tính tự nhiên của gã.', 1, 'https://img.ophim11.cc/uploads/movies/loki-than-lua-loc-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/loki-than-lua-loc-phan-2-poster.jpg', '2024-02-11 17:29:51', 8, 'https://www.youtube.com/watch?v=G4JuopziR3Q', 52, 0),
(799, 'Tình Yêu Và Tiền Bạc', 'Kara Para Ask', 2014, '<p>Ömer là cảnh sát. Sau cái chết của vợ sắp cưới, anh phải chịu đựng rất nhiều đau đớn. Thi thể của Sibel, vợ chưa cưới của Ömer, được tìm thấy trên đỉnh một vách đá, trong một chiếc ô tô cạnh một doanh nhân khá già, giàu có. Sau cú sốc về cái chết đột ngột của cô và những cáo buộc về tình yêu lừa dối mình, Ömer nhận ra rằng còn nhiều điều đằng sau vụ giết người đáng ngờ của cô.</p>', 1, 'https://img.ophim11.cc/uploads/movies/tinh-yeu-va-tien-bac-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tinh-yeu-va-tien-bac-poster.jpg', '2024-02-11 17:29:55', 8, 'https://www.youtube.com/watch?v=rf4GgSBEaCI', 130, 0),
(800, 'Cutthroat Island', 'Cutthroat Island', 1995, 'Morgan Adams and her slave, William Shaw, are on a quest to recover the three portions of a treasure map. Unfortunately, the final portion is held by her murderous uncle, Dawg. Her crew is skeptical of her leadership abilities, so she must complete her quest before they mutiny against her. This is made yet more difficult by the efforts of the British crown to end her pirate raids.', 0, 'https://img.ophim11.cc/uploads/movies/cutthroat-island-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cutthroat-island-poster.jpg', '2024-02-11 17:29:57', 8, 'https://www.youtube.com/watch?v=zFAipdyx928', 124, 0),
(801, 'A Soul Haunted by Painting', 'A Soul Haunted by Painting', 1994, 'At the beginning of the twentieth century, Yu-liang leaves a brothel in a small Chinese town, to become the second wife of Mr. Pan. While Pan is away at the revolution in Yunnan, Yu-liang learns to paint and takes art classes at the Shanghai Art Institute, until it is closed for painting nudes. Because she cannot bear him a son, Yu-liang leaves Pan to his first wife, and studies art in Paris, where she wins an award for a nude self-portrait. She returns to join Pan in Nanking in the 1930\'s, and becomes a Professor until it is discovered that she came from a brothel. She returns to Paris to live the rest of her life there, and finally gains a major exhibition of her work.', 0, 'https://img.ophim11.cc/uploads/movies/a-soul-haunted-by-painting-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/a-soul-haunted-by-painting-poster.jpg', '2024-02-11 17:30:03', 8, '', 130, 1),
(802, 'Career Opportunities', 'Career Opportunities', 1991, 'Josie, the daughter of the town\'s wealthiest businessman, faces problems at home and wishes to leave town but is disoriented. Her decision is finalized after she falls asleep in a Target dressing room. She awakens to find herself locked in the store overnight with the janitor, Jim, the town \"no hoper\" and liar.', 0, 'https://img.ophim11.cc/uploads/movies/career-opportunities-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/career-opportunities-poster.jpg', '2024-02-11 17:30:08', 8, 'https://www.youtube.com/watch?v=WW9BFI1ii40', 83, 0),
(803, 'Halfaouine: Boy of the Terraces', 'Halfaouine: Boy of the Terraces', 1990, '<p>Twelve-year-old Noura dangles uncertainly in that difficult netherworld between childhood and adulthood. His growing libido has gotten him banned from the women\'s baths, where his mother took him when he was younger, but he\'s not yet old enough to participate in grown-up discussions with the men of his Tunisian village. Noura\'s only real friend is a troublemaker named Salih -- the village political outcast.</p>', 0, 'https://img.ophim11.cc/uploads/movies/halfaouine-boy-of-the-terraces-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/halfaouine-boy-of-the-terraces-poster.jpg', '2024-02-11 17:30:14', 8, '', 139, 0),
(804, 'Thư Tình Già', 'Love Letter', 1981, '<p>Yuko is in love with an old poet who happens to be also a married man. She waits patiently for him and only him, yet she is constantly being lust by others.</p>', 0, 'https://img.ophim11.cc/uploads/movies/thu-tinh-gia-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/thu-tinh-gia-poster.jpg', '2024-02-11 17:30:19', 8, '', 123, 0),
(805, 'Cô Hầu Phòng ở Manhattan', 'Maid in Manhattan', 2002, 'Lửa tình nhen nhóm khi cô hầu phòng gặp một chính trị gia đang lên tại một khách sạn xa hoa ở New York. Duy chỉ có một vấn đề: anh tưởng cô là một vị khách.', 0, 'https://img.ophim11.cc/uploads/movies/co-hau-phong-o-manhattan-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/co-hau-phong-o-manhattan-poster.jpg', '2024-02-11 17:30:24', 8, 'https://www.youtube.com/watch?v=7r_1rDfQfrg', 105, 2),
(806, 'Oppenheimer', 'Oppenheimer', 2023, 'Câu chuyện về J. Robert Oppenheimer, người giữ vị trí quan trọng trong việc chế tạo bom nguyên tử vào Thế Chiến II.', 0, 'https://img.ophim11.cc/uploads/movies/oppenheimer-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/oppenheimer-poster.jpg', '2024-02-11 17:30:29', 8, 'https://www.youtube.com/watch?v=bK6ldnjE3Y0', 181, 0),
(807, 'Câu chuyện về người thợ săn hươu đuôi trắng', 'The Legacy of a Whitetail Deer Hunter', 2018, '<p>Một thợ săn nổi danh cố gắng gắn kết với đứa con trai 12 tuổi của mình trong một chuyến đi tới miền hoang dã, nhưng ông học được rằng tình cảm gia đình không thể ép buộc.</p>', 0, 'https://img.ophim11.cc/uploads/movies/cau-chuyen-ve-nguoi-tho-san-huou-duoi-trang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cau-chuyen-ve-nguoi-tho-san-huou-duoi-trang-poster.jpg', '2024-02-11 17:30:35', 8, '', 123, 0),
(808, 'Chelsea và đặc quyền của người da trắng', 'Hello, Privilege. It\'s Me, Chelsea', 2019, '<p>Trong phim tài liệu này, Chelsea Handler khám phá tác động của đặc quyền da trắng lên văn hóa Mỹ và cả lợi ích mà đặc quyền ấy mang lại cho cuộc sống và sự nghiệp của cô.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chelsea-va-dac-quyen-cua-nguoi-da-trang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chelsea-va-dac-quyen-cua-nguoi-da-trang-poster.jpg', '2024-02-11 17:30:37', 8, '', 14, 0),
(809, 'Chiếc biển quảng cáo tai quái', 'A Home with A View', 2019, '<p>Khi biển quảng cáo của nhà hàng xóm chặn tầm nhìn về phía thành phố, một gia đình tại Hong Kong phải dùng tới biện pháp quyết liệt và giàu trí tưởng tượng để hạ nó xuống.</p>', 0, 'https://img.ophim11.cc/uploads/movies/chiec-bien-quang-cao-tai-quai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/chiec-bien-quang-cao-tai-quai-poster.jpg', '2024-02-11 17:30:39', 8, '', 131, 0),
(810, 'Chơi vơi', 'Adrift', 2009, '<p>Giữa Hà Nội tù túng và xa cách, cô dâu mới quay cuồng trong những khát khao thể xác. Còn cô bạn thân thiết với ham muốn mãnh liệt thì chỉ muốn phá hoại hôn nhân của cô.</p>', 0, 'https://img.ophim11.cc/uploads/movies/choi-voi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/choi-voi-poster.jpg', '2024-02-11 17:30:41', 8, '', 145, 2),
(811, 'Đây là gia đình tôi', 'All In My Family', 2019, '<p>Sau khi lập gia đình riêng ở Mỹ, một nhà làm phim đồng tính nam ghi lại quá trình chấp nhận của gia đình Trung Hoa truyền thống và tràn đầy tình yêu thương của anh.</p>', 0, 'https://img.ophim11.cc/uploads/movies/day-la-gia-dinh-toi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/day-la-gia-dinh-toi-poster.jpg', '2024-02-11 17:30:43', 8, '', 40, 0),
(812, 'Gã thợ cáp', 'The Cable Guy', 1996, '<p>Khi Steven chuyển đến chỗ ở mới, một gã thợ lắp đặt cáp hăng hái quá đà giúp anh \"kết nối\" – và không buông tha, thậm chí sau khi Steven cố kết thúc \"tình bạn\" của họ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ga-tho-cap-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ga-tho-cap-poster.jpg', '2024-02-11 17:30:44', 8, '', 135, 0),
(813, 'Hoàng Phi Hồng 2: Nam nhi đương tự cường', 'Once Upon a Time in China II', 1992, '<p>Trong khi ở Quảng Châu để tham dự một hội nghị y khoa, Hoàng Phi Hồng đối đầu với Bạch Liên Giáo khét tiếng và giúp đỡ các nhà cách mạng chính trị.</p>', 0, 'https://img.ophim11.cc/uploads/movies/hoang-phi-hong-2-nam-nhi-duong-tu-cuong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/hoang-phi-hong-2-nam-nhi-duong-tu-cuong-poster.jpg', '2024-02-11 17:47:16', 8, '', 152, 0),
(814, 'Kế hoạch Phi Ưng', 'Armour of God 2: Operation Condor', 1991, '<p>Một mật vụ bắt đầu tiến hành nhiệm vụ lớn nhất từ trước đến nay của mình: tìm số vàng mà Đức Quốc xã đã chôn tại sa mạc Sahara trong Thế chiến II.</p>', 0, 'https://img.ophim11.cc/uploads/movies/ke-hoach-phi-ung-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ke-hoach-phi-ung-poster.jpg', '2024-02-11 17:47:17', 8, '', 146, 1),
(815, 'Nam thần xe ôm', 'Bikeman', 2018, '<p>Giả làm nhân viên ngân hàng với gia đình, một tài xế xe ôm nhanh nhẹn phải vật lộn để duy trì màn kịch đó khi tình cờ gặp lại người anh thầm thích hồi nhỏ.</p>', 0, 'https://img.ophim11.cc/uploads/movies/nam-than-xe-om-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nam-than-xe-om-poster.jpg', '2024-02-11 17:47:19', 8, '', 142, 0),
(816, 'Đại chiến Titan: Phần 2', 'Attack on Titan: Part 2', 2015, '<p>Khi Eren biến đổi đang bị giam giữ, bí mật được hé lộ và kế hoạch được lập ra. Eren, Mikasa và Armin chiến đấu cùng Quân đoàn Trinh sát vì toàn thể loài người.</p>', 0, 'https://img.ophim11.cc/uploads/movies/dai-chien-titan-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/dai-chien-titan-phan-2-poster.jpg', '2024-02-11 17:47:21', 8, '', 119, 0),
(817, 'Ra ngoài', 'Get Out', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/ra-ngoai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ra-ngoai-poster.jpg', '2024-02-11 17:47:24', 8, '', 1150, 2),
(818, 'Robot Maid', 'Robot Maid', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/robot-maid-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/robot-maid-poster.jpg', '2024-02-11 17:47:26', 8, '', 11933, 2),
(819, 'Sát thủ', 'the Assassin', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/sat-thu-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sat-thu-poster.jpg', '2024-02-11 17:47:27', 8, '', 11547, 2),
(820, 'Sau khi bình minh', 'After Daybreak', 2016, '', 0, 'https://img.ophim11.cc/uploads/movies/sau-khi-binh-minh-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sau-khi-binh-minh-poster.jpg', '2024-02-11 17:47:29', 8, '', 1559, 0),
(821, 'Yêu một nghệ sĩ', 'Fall in love with An Artist', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/yeu-mot-nghe-si-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/yeu-mot-nghe-si-poster.jpg', '2024-02-11 17:47:31', 8, '', 12045, 2),
(822, '12 con vịt vàng', '12 Golden Ducks', 2015, '<p>Sau khi thất tình và sự nghiệp lao dốc, gã trai bao thu hút Trương Cận Lai trở lại Hồng Kông để lấy lại phong độ của mình.</p>', 0, 'https://img.ophim11.cc/uploads/movies/12-con-vit-vang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/12-con-vit-vang-poster.jpg', '2024-02-11 17:47:33', 8, '', 123, 0),
(823, '27 76', '27 76', 2016, '<p>Khi chồng cô bị buộc tội tham gia đảo chính quân sự, một phụ nữ đang mang thai giúp chồng chứng minh anh vô tội. Lấy cảm hứng từ những sự kiện có thật.</p>', 0, 'https://img.ophim11.cc/uploads/movies/27-76-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/27-76-poster.jpg', '2024-02-11 17:47:34', 8, '', 158, 0),
(824, 'Băng cướp ngân hàng', 'American Heist', 2014, '<p>Cuộc đời một cựu tội phạm vừa đi vào quỹ đạo ổn định, thì người anh trai ra tù và lôi kéo anh vào thế giới ngầm để làm phi vụ cướp cuối cùng.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bang-cuop-ngan-hang-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bang-cuop-ngan-hang-poster.jpg', '2024-02-11 17:47:37', 8, '', 134, 0),
(825, 'Bộ ba rắc rối', 'Triple Trouble', 2015, '<p>Sau khi cùng tỉnh dậy trên một hòn đảo, ba phụ nữ bắt đầu chắp nối những sự việc xảy ra đêm hôm trước – với sự tham gia của một người lạ đẹp trai.</p>', 0, 'https://img.ophim11.cc/uploads/movies/bo-ba-rac-roi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bo-ba-rac-roi-poster.jpg', '2024-02-11 17:47:40', 8, '', 132, 3),
(826, 'Cảnh sát tương lai', 'Future Cops', 1993, '<p>Bộ ba đặc cảnh du hành đến năm 1993 sau khi một trùm tội phạm phái tay sai trở về quá khứ để tẩy não vị thẩm phán đã kết án hắn.</p>', 0, 'https://img.ophim11.cc/uploads/movies/canh-sat-tuong-lai-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/canh-sat-tuong-lai-poster.jpg', '2024-02-11 17:47:42', 8, '', 134, 1),
(827, 'Người sống sót', 'Survivor', 2016, '', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-song-sot-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-song-sot-poster.jpg', '2024-02-11 17:47:43', 8, '', 12611, 2),
(828, 'Người thuê nhà khác', 'the Other Tenant', 2019, '', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-thue-nha-khac-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-thue-nha-khac-poster.jpg', '2024-02-11 17:47:46', 8, '', 134, 6);
