(829, 'Người yêu neo đậu', 'Sweetheart anchor fight', 2017, '', 0, 'https://img.ophim11.cc/uploads/movies/nguoi-yeu-neo-dau-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nguoi-yeu-neo-dau-poster.jpg', '2024-02-11 17:47:47', 8, '', 1451, 0),
