(835, 'Quán trà Herbal (Tiếng Quảng Đông)', 'Herbal Tea ( Cantonese )', 2004, '<p>Bản tính của Lâm Vỹ Châu rất vô tư phóng khoáng, ông bố già của cô đã qua đời lúc cô mới 12 tuổi, đã giao cô cho một quán trà nguội để cô quản lý, từ đó Vỹ Châu đã làm việc chăm chỉ và tô điểm cho quán trà càng thêm có sức sống. Với tính cách vô tư cô đã không để ý anh chàng một sách Triệu Thế Xuân đã có tình cảm mến mộ vớiTô Lương người bạn hợp tác cùng cô . Một ngày nọ , cô đã cho Chân Chí Đan thuê phòng với giá thuê rất rẻ , Chân là người đóng thế võ thuật, mơ ước có ngày trở thành diễn viên chính,có một người bạn diễn viên là Linda và một người thầy không chuyên nghiệp. Sau khi Chân Chí Đan bị LinDa phụ tình,sự quan tâm và nhiệt tình của Lâm Vỹ Châu khiến cho hai người xích lại gần nhau hơn.\\n</p>', 0, 'https://img.ophim11.cc/uploads/movies/quan-tra-herbal-tieng-quang-dong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quan-tra-herbal-tieng-quang-dong-poster.jpg', '2024-02-11 17:48:01', 8, '', 13321, 0),
(836, 'Yêu bạn cắn bạn', 'Love you bite you', 2016, '', 0, 'https://img.ophim11.cc/uploads/movies/yeu-ban-can-ban-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/yeu-ban-can-ban-poster.jpg', '2024-02-11 17:48:04', 8, '', 122, 0),
(837, 'Yêu Không Giới Hạn', ' Hudutsuz Sevda                                                                                                                                                                                                                                  ', 2023, '<p>Khi còn nhỏ, Halil İbrahim mất cha vì mối thù huyết thống và bị đày đến Istanbul. Hai mươi năm sau, anh trở về quê hương ở vùng Karadeniz với tư cách là một chàng trai trẻ đẹp trai và mạnh mẽ. Anh dự định kết hôn với cô gái anh yêu, Yasemin và bắt đầu một cuộc sống mới. Tuy nhiên, các sự kiện không cho phép điều này. Halil İbrahim dấn thân vào hành trình trả thù và cuộc đời anh sẽ thay đổi hoàn toàn khi chạm trán Zeynep đến từ gia đình Leto.</p>', 1, 'https://img.ophim11.cc/uploads/movies/yeu-khong-gioi-han-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/yeu-khong-gioi-han-poster.jpg', '2024-02-12 02:38:52', 8, '', 130, 0),
(838, 'Bị đuổi khỏi tổ đội anh hùng, tôi nhắm đến một cuộc sống nhàn nhã ở vùng biên cương Phần 2', '真の仲間じゃないと勇者のパーティーを追い出されたので、辺境でスローライフすることにしました 第2期', 2024, '<p>Người hùng Reid từng bị trục xuất khỏi đội dũng cảm và bị coi là không phải là \"đối tác thực sự\". Giờ đây, anh điều hành một cửa hàng thuốc thảo dược ở một nơi xa xôi cùng với tình yêu trọn đời của mình là Công chúa Litte và người chị gái dũng cảm và thân thiết trước đây Luti, sống một cuộc sống yên bình và thoải mái. \"Tôi rất hạnh phúc. Tôi có thể tận hưởng khung cảnh tuyệt đẹp cùng Red.\" \"Tôi rất vui khi có thể dành thời gian với anh trai mình một lần nữa.\" Để có được viên ngọc quý nhất, họ bắt đầu du hành trong khi tận hưởng cảnh đẹp, vừa thưởng thức đồ ăn ngon...</p>', 1, 'https://img.ophim11.cc/uploads/movies/bi-duoi-khoi-to-doi-anh-hung-toi-nham-den-mot-cuoc-song-nhan-nha-o-vung-bien-cuong-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/bi-duoi-khoi-to-doi-anh-hung-toi-nham-den-mot-cuoc-song-nhan-nha-o-vung-bien-cuong-phan-2-poster.jpg', '2024-02-12 02:39:26', 8, '', 24, 0),
(839, 'Cuộc Sống Thường Ngày Của Tiên Vương (Phần 4)', 'The Daily Life of the Immortal King Season 4', 2023, 'Chuyện nói về một anh chàng với tuổi thơ bắt đầu năm sáu tuổi, anh giết vua quỷ Swallow Sky Clam. Là một phù thủy tu luyện toàn năng, Tiên vương phải che giấu sức mạnh của mình và sống giữa một nhóm sinh viên tu luyện bình thường.', 1, 'https://img.ophim11.cc/uploads/movies/cuoc-song-thuong-ngay-cua-tien-vuong-phan-4-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/cuoc-song-thuong-ngay-cua-tien-vuong-phan-4-poster.jpg', '2024-02-12 02:39:28', 8, '', 18, 27),
(840, 'Quái Dị', 'Monstrous', 2022, '<p>Jung Ki Hoon từng là một nhà khảo cổ học phát hiện ra những hiện tượng siêu nhiên kỳ lạ. Cuộc sống của anh ấy đã bị thay đổi bởi một sự kiện bất ngờ. Anh là nhà xuất bản của tạp chí Chuyện lạ hàng tháng và điều hành kênh YouTube Chuyện lạ hàng tháng. Anh đến quận Jinyang vì ly hôn với Lee Soo-Jin và nghiên cứu về một bức tượng Phật bị quỷ ám.<br>Là một nhà khảo cổ học, Lee Soo Jin rất giỏi giải mã các chữ cái và ký hiệu. Cô ấy đã làm rất tốt công việc của mình. Cô đến huyện Jinyang sau khi đứa con duy nhất của cô qua đời. Cô đang tìm kiếm câu trả lời cho những hiện tượng không giải thích được. Có một hiện tượng kỳ lạ xảy ra với người dân quận Jinyang.<br><strong>Monstrous</strong> là một bộ phim kinh dị siêu nhiên sắp được phát sóng vào tháng 4 năm 2022. Đạo diễn Yeon Sang Ho của Train to Busan, Peninsula, và Hellbound đã tham gia vào dự án này.<br>Diễn viên Koo Kyo Hwan trong vai giáo sư khảo cổ học Ki Hoon và Shin Hyun Bin đóng vai vợ cũ của các ngôi sao nổi tiếng. Kim Ji Young, Kwak Dong Yeon, Nam Da Reum và Park Ho San đã tham gia vào bộ phim&nbsp;này.<br>Trong tập <strong>phim monstrous</strong>, một bức tượng Phật cổ được phát hiện trong một ngôi làng nhỏ và là điềm báo những điều xui xẻo sắp xảy đến. Ki Hoon phải chiến đấu với những linh hồn xấu xa để cứu ngôi làng.</p>', 1, 'https://img.ophim11.cc/uploads/movies/quai-di-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/quai-di-poster.jpg', '2024-02-12 06:55:22', 8, 'https://www.youtube.com/watch?v=V1vUf7ifA8Q', 30, 3),
(841, 'Bá Chủ Bầu Trời', 'Masters of the Air', 2024, 'Trong Thế chiến II, các phi công mạo hiểm mạng sống gia nhập Nhóm Ném Bom 100, tình anh em được hun đúc bởi lòng dũng cảm, sự mất mát và chiến thắng.', 1, 'https://img.ophim11.cc/uploads/movies/ba-chu-bau-troi-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/ba-chu-bau-troi-poster.jpg', '2024-02-13 04:24:33', 8, 'https://www.youtube.com/watch?v=lA-1JCRguZ0', 45, 6),
(842, 'Sejak: Mê Hoặc Quân Vương', 'Captivating the King', 2024, '<p>Giữa cuộc tranh giành quyền lực chính trị và hoàng gia, vị vua nọ vướng vào một nữ nhân cuốn hút. Nàng khao khát trả thù, nhưng rốt cuộc lại vô tình phải lòng ngài.</p><p>&nbsp;</p>', 1, 'https://img.ophim11.cc/uploads/movies/sejak-me-hoac-quan-vuong-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/sejak-me-hoac-quan-vuong-poster.jpg', '2024-02-13 04:24:50', 8, 'https://www.youtube.com/watch?v=_1t7mqiqtkk', 45, 0),
(843, 'Trò Chơi Sống Còn', 'Fatal Rule', 2023, 'Để không bị bắt làm nô lệ,Kiều Kinh Đình, người vô tình bước vào trò chơi vực thẳm, đã thành lập liên minh với Thư Ngải một game thủ cũ mang trong mình lòng hận thù, và Bạch Nhĩ, một thiếu niên với quá khứ bí ẩn. Họ cùng nhau đối mặt với sự ác độc của Hàn Bân, kẻ thống trị tàn ác, và tổ chức của anh ta. Sau những cuộc chiến khốc liệt, khi họ tự tin rằng chiến thắng đã đến gần, họ phát hiện ra mình bị rơi vào bẫy của Hàn Bân, lâm vào tình cảnh tuyệt vọng. Điều đáng sợ hơn là, với thất bại này, sự tin tưởng duy nhất giữa ba người cũng tan vỡ hoàn toàn. Trong thời khắc nguy cấp, sự xuất hiện của một cao thủ siêu phàm, Châu Nhất Đao, thay đổi cả cục diện lực lượng tại làng mới và mang đến cho Kiều Kinh Đình và những người khác một tia hy vọng trốn thoát.', 1, 'https://img.ophim11.cc/uploads/movies/tro-choi-song-con-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/tro-choi-song-con-poster.jpg', '2024-02-13 04:25:04', 8, '', 25, 0),
(844, 'Nghịch Thiên Tà Thần', 'Against the Gods', 2023, 'Trên đại lục Thương Vân, Đại Thổ Y Tông đã bị sát hại tàn nhẫn vì giữ một trong bảy viên Thần Dược Thiên Không. Việc này đã khiến cho cả thiên hạ đều thèm muốn viên Thần Dược này, dẫn đến cái chết đau đớn của ông. Người trò truyện của ông, Vân Triệt, đã mang viên Thần Dược này để báo thù cho thầy, và trong quá trình này đã gieo ra biết bao sóng gió và chết chóc. Cuối cùng, anh đã bị các cao thủ võ lâm đẩy đến bước đường cùng tại Thiên Huyền Dã. Dẫu vậy, Vân Triệt đã không chịu khuất phục, anh nuốt viên Thần Dược đó và nhảy xuống vực tự tử. Tuy nhiên, ý thức của anh không biết bởi một lực lượng bí ẩn đã hướng dẫn, anh đã tự mình vượt thời gian và tỉnh dậy trong thế giới Thiên Huyền Lục Lâm, trên cơ thể của một thiếu niên tên là Tiêu Triệt', 1, 'https://img.ophim11.cc/uploads/movies/nghich-thien-ta-than-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/nghich-thien-ta-than-poster.jpg', '2024-02-13 04:25:05', 8, '', 23, 0),
(845, 'Phản Bội', 'Aldatmak', 2022, '<p>Ông là một thẩm phán tòa án gia đình nổi tiếng và được kính trọng. Cô là một người phụ nữ trung thực và nguyên tắc, người đã cứu nhiều cuộc hôn nhân khỏi sự tan vỡ, đảm bảo rằng nhiều đứa trẻ nhận được tình cảm và tình yêu thương mà chúng xứng đáng có được, đồng thời luôn đứng về phía công lý.</p>', 1, 'https://img.ophim.live/uploads/movies/phan-boi-tnk-thumb.jpg', 'https://img.ophim.live/uploads/movies/phan-boi-tnk-poster.jpg', '2024-02-13 04:25:07', 8, '', 145, 0),
(846, 'Cô Dâu Istanbul', 'Istanbullu Gelin', 2017, '<p>Faruk là chủ một công ty xe buýt và là lãnh đạo của một gia đình quyền lực ở Bursa, một đô thị ở Thổ Nhĩ Kỳ. Faruk gặp một cô gái chơi violin và yêu cô ấy. Nhưng người mẹ thống trị của Faruk không hài lòng với mối quan hệ của con trai mình.</p>', 1, 'https://img.ophim.live/uploads/movies/co-dau-instabul-thumb.jpg', 'https://img.ophim.live/uploads/movies/co-dau-instabul-poster.jpg', '2024-02-13 04:25:08', 8, '', 120, 5),
(847, 'Vigilante', 'Vigilante', 2023, '<p>Đơn vị Đội Điều tra Thủ đô theo dõi một tổ chức tên là Vigilante, chuyên xét xử những kẻ độc ác trốn tránh pháp luật đã trở thành một hiện tượng xã hội.</p>', 1, 'https://img.ophim11.cc/uploads/movies/vigilante-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/vigilante-poster.jpg', '2024-02-14 00:26:42', 8, 'https://www.youtube.com/watch?v=wXecjX4dIGM', 60, 3),
(848, 'SPY x FAMILY', 'SPY x FAMILY', 2023, 'Nhằm ngăn những kẻ cực đoan châm ngòi cho cuộc chiến với quốc gia láng giềng Ostania, Twilight, điệp viên hàng đầu của Westalis phải điều tra chính trị gia người Ostanian là Donovan Desmond bằng cách xâm nhập vào trường học của con trai ông ta - học viện Eden danh giá. Dưới vỏ bọc Loid Forger, một bác sĩ, Twilight đã nhận nuôi cô bé mồ côi Anya và kết hôn giả với Yor Briar rồi cho Anya nhập học tại học viện Eden mà không hề hay biết hai người này cũng có thân phận bí mật: Yor là sát thủ được mệnh danh \"Công chúa Thorn\" còn Anya là siêu năng lực gia có khả năng đọc suy nghĩ. Tuy khởi đầu là một gia đình giả mà cả ba đều lợi dụng lẫn nhau, nhưng theo thời gian, họ dần nhận ra tầm quan trọng của hai người kia trong trái tim mình.', 1, 'https://img.ophim11.cc/uploads/movies/spy-x-family-phan-2-thumb.jpg', 'https://img.ophim11.cc/uploads/movies/spy-x-family-phan-2-poster.jpg', '2024-02-14 04:33:32', 8, 'https://www.youtube.com/watch?v=6sosTNRw_uQ', 24, 1),
(849, 'Cảm Ơn Em Đã Sưởi Ấm Anh', 'Angels Fall Sometimes', 2024, '<p>Lin Tuo and An Zhi Que met at a job fair during the summer internship of their junior year. They fell in love at first sight, and after deepening their understanding of each other, they determined their relationship. As graduation season approaches, the two join hands as they went through university to working life together and plan for a better future. Although the road of life was not going smoothly, but with their mutual encouragement, it gradually got on the right track.</p>', 1, 'https://img.ophim12.cc/uploads/movies/cam-on-em-da-suoi-am-anh-thumb.jpg', 'https://img.ophim12.cc/uploads/movies/cam-on-em-da-suoi-am-anh-poster.jpg', '2024-03-18 13:35:34', 8, '', 45, 0),
(850, 'Phi Trì Nhân Sinh', 'Pegasus', 2024, '<p>Bộ phim kể về Trương Trì, người bị thương nặng sau khi văng khỏi đường đua và bất ngờ xuyên không vào cơ thể của Lâm Trăn Đông 21 tuổi. Anh đã tìm mọi cách để ngăn cản anh của tuổi 24 tuổi đi vào vết xe đổ một lần nữa và giúp Lâm Trăn Đông trở thành tay đua chuyên nghiệp.<br>&nbsp;</p>', 1, 'https://img.ophim12.cc/uploads/movies/phi-tri-nhan-sinh-2024-thumb.jpg', 'https://img.ophim12.cc/uploads/movies/phi-tri-nhan-sinh-2024-poster.jpg', '2024-03-18 13:35:36', 8, '', 45, 0),
(851, 'Kung Fu Panda 4', 'Kung Fu Panda 4', 2024, '<p>Po đang chuẩn bị trở thành thủ lĩnh tinh thần của Thung lũng Hòa bình của mình, nhưng cũng cần một người thay thế anh ấy làm Chiến binh Rồng. Vì vậy, anh ta sẽ huấn luyện một học viên kung fu mới tại chỗ và sẽ chạm trán với một nhân vật phản diện tên là Tắc kè hoa, kẻ gợi lên những nhân vật phản diện trong quá khứ.</p>', 0, 'https://img.ophim12.cc/uploads/movies/kung-fu-panda-4-thumb.jpg', 'https://img.ophim12.cc/uploads/movies/kung-fu-panda-4-poster.jpg', '2024-03-18 13:35:37', 8, 'https://www.youtube.com/watch?v=_inKs4eeHiI', 85, 1),
(852, 'Nữ Hoàng Nước Mắt', 'Queen of Tears', 2024, '<p>Nữ hoàng cửa hàng bách hóa và hoàng tử siêu thị xoay xở với khủng hoảng hôn nhân, rồi tình yêu bắt đầu nảy nở trở lại theo cách kỳ diệu.</p><p>&nbsp;</p>', 1, 'https://img.ophim15.cc/uploads/movies/nu-hoang-nuoc-mat-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/nu-hoang-nuoc-mat-poster.jpg', '2024-03-18 13:37:00', 8, 'https://www.youtube.com/watch?v=Gg2D8zrzlOA', 45, 8),
(853, 'Tài Phiệt và Cảnh Sát', 'Flex X Cop', 2024, '<p>Bộ phim xoay quanh anh chàng Jin Yi Soo, một người được coi là tầng lớp thìa vàng của xã hội Hàn Quốc hiện nay. Cuộc sống của anh vốn đang bình yên nhưng bỗng dưng vướng vào một vụ án, từ đó đã thay đổi con người anh ta và đưa đẩy sang một lối rẽ khác. Yi Soo đã tham gia một đội điều tra tợi sở cảnh sát và chuyên săn bắt cướp. anh ta sử dụng các mối quan hệ và sự giàu có để làm lợi thế cho mình và tuân theo sự chỉ huy của một vị thám tử tận tâm tên là Lee Kang Hyun.</p>', 1, 'https://img.ophim13.cc/uploads/movies/tai-phiet-va-canh-sat-thumb.jpg', 'https://img.ophim13.cc/uploads/movies/tai-phiet-va-canh-sat-poster.jpg', '2024-03-18 13:37:10', 8, '', 45, 21),
(855, 'Godzilla x Kong: Đế Chế Mới', 'Godzilla x Kong: The New Empire', 2024, 'Following their explosive showdown, Godzilla and Kong must reunite against a colossal undiscovered threat hidden within our world, challenging their very existence – and our own.', 0, 'https://img.ophim15.cc/uploads/movies/godzilla-x-kong-de-che-moi-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/godzilla-x-kong-de-che-moi-poster.jpg', '2024-03-23 06:12:53', 8, 'https://www.youtube.com/watch?v=lV1OOlGwExM', 0, 25),
(856, 'Gọi em bằng tên anh', 'Call Me by Your Name', 2017, '<p>Call Me By Your Name được chuyển thể từ tiểu thuyết cùng tên của nhà văn André Aciman, lấy bối cảnh những năm 80. Nội dung tập trung vào mối quan hệ đầy cảm hứng giữa cậu bé 17 tuổi Elio (Timothée Chalamet) và chàng sinh viên 24 tuổi Oliver (Armie Hammer).Oliver là sinh viên khảo cổ học người Mỹ đến ở trong biệt thự nhà Elio và theo học giáo sư là bố của cậu bé. Hai chàng trai trẻ đã bị cuốn vào một mối tình lãng mạn giữa khung hình tuyệt đẹp của miền quê nước Ý trong một mùa hè rực rỡ năm 1983.</p>', 0, 'https://img.ophim14.cc/uploads/movies/goi-em-bang-ten-anh-thumb.jpg', 'https://img.ophim14.cc/uploads/movies/goi-em-bang-ten-anh-poster.jpg', '2024-03-30 06:19:16', 8, 'https://www.youtube.com/watch?v=bXIHgcJbr0U', 132, 5),
(858, 'Ký Sinh Thú: Phần 2', 'Parasyte: Part 2', 2015, '<p>Nhân loại đang bị tấn công bởi những ký sinh trùng ngoài hành tinh ăn thịt người bắt chước con người. Một trái phiếu ký sinh trùng với chủ nhà học sinh trung học trẻ của mình, và anh ta thuyết phục ký sinh trùng để giúp anh ta ngăn chặn những người khác.</p>', 0, 'https://img.ophim14.cc/uploads/movies/ky-sinh-thu-phan-2-thumb.jpg', 'https://img.ophim14.cc/uploads/movies/ky-sinh-thu-phan-2-poster.jpg', '2024-04-07 02:14:00', 8, '', 0, 2),
(859, 'Hình Cảnh', 'Gun Metal Grey', 2010, 'Từ một cảnh sát chính trực, Thạch Đông Thăng (do Huỳnh Nhật Hoa đóng) bất ngờ liên quan đến vụ mưu sát, phải ngồi tù oan suốt 15 năm trời. Dù đã được minh oan nhưng sau khi ra tù, Thăng gần như mất tất cả, gia đình, danh tiếng và địa vị. Sự mất mát to lớn này thôi thúc anh trở lại ngành để tìm ra căn nguyên vụ án năm xưa. Thăng hợp tác ăn ý cùng đồng nghiệp Mễ An Định (do Miêu Kiều Vỹ đóng), phá nhiều vụ án lớn.', 1, 'https://img.ophim15.cc/uploads/movies/hinh-canh-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/hinh-canh-poster.jpg', '2024-04-18 13:17:14', 8, '', 45, 7),
(860, 'Gặp Lại Tiêu Dao', 'Sword and Fairy 1', 2024, '<p>Tiểu nhị Lý Tiêu Dao có ước mơ trở thành đại hiệp tình cờ gặp được Triệu Linh Nhi, hậu duệ của Nữ Oa. Họ kết bạn và cùng nhau đi tìm Thủy Linh Châu có thể chấm dứt nạn hạn hán khắp thiên hạ. Trên đường đi, họ lần lượt kết giao với nhiều người bạn cùng chí hướng như oan gia Lâm Nguyệt Như, thư sinh nho nhã Lưu Tấn Nguyên... Cả nhóm cùng nhau vượt qua khó khăn, nguy hiểm để tìm kiếm linh châu, đập tan âm mưu đáng sợ là hủy diệt cả thế giới của Bái Nguyệt giáo chủ.</p><p>&nbsp;</p>', 1, 'https://img.ophim15.cc/uploads/movies/gap-lai-tieu-dao-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/gap-lai-tieu-dao-poster.jpg', '2024-04-18 13:17:20', 8, '', 45, 0),
(861, 'Tích Hoa Chỉ', 'Blossoms in Adversity', 2024, '<p>Hoa phủ cao quý hiển hách bất ngờ bị tịch biên và lưu đày, chỉ còn lại phụ nữ cùng trẻ em bơ vơ. Đại tiểu thư Hoa Chỉ không còn giả vờ ngốc nghếch giấu dốt nữa, cô dẫn dắt phụ nữ trong nhà trình diễn \"màn lột xác của phụ nữ quyền quý\", thoát khỏi cảnh đói rét và nguy hiểm trong muôn vàn chông gai. Cô còn biến ty sứ Thất Túc là Cố Yến Tích dũng mãnh vô song thành \"Yến tiên sinh\", người thương mà ai nấy đều yêu mến. Trong suốt hành trình có cãi vã, có mặn nồng, từ một tiểu thư khuê các gặp nạn, Hoa Chỉ cũng trưởng thành và trở thành người chủ gia đình, hướng tới một cuộc sống mới rực rỡ.</p><p>&nbsp;</p>', 1, 'https://img.ophim15.cc/uploads/movies/tich-hoa-chi-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/tich-hoa-chi-poster.jpg', '2024-04-18 13:17:24', 8, '', 45, 1),
(862, 'Tình Yêu Hai Chiến Tuyến', 'My Military Valentine', 2024, '<p>Tình Yêu Hai Chiến Tuyến - My Military Valentine, kể về câu chuyện về sự lãng mạn và thống nhất giữa hai miền Triều Tiên giữa một ngôi sao thế giới Hàn Quốc đã nhập ngũ và một nữ quân nhân Triều Tiên. Lloyd là một ngôi sao thế giới có lượng fan nữ trên toàn cầu. Mặc dù anh ấy là một ngôi sao đẳng cấp thế giới, người đã càn quét tất cả các kỷ lục nghệ sĩ thế kỷ 21 của Hàn Quốc, nhưng anh ấy vẫn nhập ngũ sau khi bị cuốn vào một dạng âm mưu nào đó và trải qua một loạt các sự kiện. Thiếu úy Baek Young Ok dẫn đầu quân đoàn thứ tám của Triều Tiên trong lực lượng đặc biệt. Trái ngược với vẻ ngoài xinh đẹp, Baek Young Ok lại có nét quyến rũ hoài nghi và tính cách hoàn hảo.</p><p>&nbsp;</p>', 1, 'https://img.ophim15.cc/uploads/movies/tinh-yeu-hai-chien-tuyen-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/tinh-yeu-hai-chien-tuyen-poster.jpg', '2024-04-18 13:17:27', 8, '', 46, 0),
(863, 'Hồng Nhung', 'Kızıl Goncalar', 2023, '<p><br>\"Kızıl Goncalar\" kể câu chuyện cảm động về Meryem, kết hôn từ năm 14 tuổi trong một tôn giáo Hồi giáo, và hiện đang dũng cảm chiến đấu để ngăn con gái của mình, Zeynep, khỏi phải chịu cảnh giống như cô dâu của cháu trai của thủ lĩnh. Dẫn dắt bởi chị dâu của mình, một cựu thành viên của tôn giáo, họ nhận ra rằng họ phải trốn chạy để cứu Zeynep khỏi cánh tay mạnh mẽ của tôn giáo. Sợ hãi giấu kín kế hoạch của mình khỏi chồng tàn ác, Meryem phải trước tiên kiếm tiền bằng cách làm người chăm sóc trong nhà của bác sĩ tâm thần học không tôn giáo Levent, người đồng ý giúp đỡ cô. Mặc dù họ có niềm tin tôn giáo và tiến bộ trái ngược nhau, Meryem và Levent được hấp dẫn bởi cảm xúc, nhưng cuộc hỗn loạn trong cuộc sống của họ trở nên nghiêm trọng hơn khi danh tính của con gái anh được tiết lộ.</p>', 1, 'https://img.ophim.live/uploads/movies/hong-nhung-thumb.jpg', 'https://img.ophim.live/uploads/movies/hong-nhung-poster.jpg', '2024-04-18 13:17:30', 8, 'https://www.youtube.com/watch?v=kWq-S6LO_m8', 120, 7),
(864, 'Hoa Máu', 'Kan Cicekleri', 2022, '<p>Câu chuyện kể về Dilan, một bên là khát vọng và hy vọng, và một bên là Baran, người phải kết hôn để ngăn chặn mối thù và mặt khác cứu anh trai mình khỏi vòng xoáy này. Tuy nhiên, cuộc hôn nhân này là một nhà tù đối với hai người họ, và chú của anh, người ghen tị với sự giàu có của anh, muốn nối lại tình địch. Mối quan hệ mâu thuẫn này sẽ gây ra những cơn gió mạnh thổi giữa hai trái tim; cuộc hôn nhân này sẽ trở thành một cuộc hôn nhân thực sự?</p>', 1, 'https://img.ophim.live/uploads/movies/hoa-mau-thumb.jpg', 'https://img.ophim.live/uploads/movies/hoa-mau-poster.jpg', '2024-04-18 13:17:42', 8, '', 60, 9),
(865, 'Mouse Kẻ Săn Người', 'Mouse', 2021, '<p>Phim kể về cảnh sát tuần tra đầy chính trực Jung Ba Reum (do Lee Seung Gi thủ vai) và cảnh sát hình sự Go Moo Chi (do Lee Hee Joon thủ vai) mất cha mẹ vì tên cuồng sát, sống để báo thù, sau khi gặp được \\\"Kẻ săn mồi\\\" ác độc nhất thuộc 1% những bệnh nhân mắc bệnh tâm thần, vận mệnh của họ đã hoàn toàn thay đổi.</p>', 1, 'https://img.ophim15.cc/uploads/movies/mouse-ke-san-nguoi-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/mouse-ke-san-nguoi-poster.jpg', '2024-04-22 07:25:25', 8, 'https://www.youtube.com/watch?v=8CN_199YVKA', 12421, 22),
(866, 'Cậu Út Nhà Tài Phiệt', 'Reborn Rich', 2022, '<p>Được chuyển thể từ tiểu thuyết The Youngest Son of a Conglomerate, xoay quanh nhân vật Yoon Hyun Woo (Song Joong Ki), một thư ký của Tập đoàn Sunyang. Hyun Woo là một nhân viên trung thành, nhưng lại nhận kết cục thảm khốc bởi chính gia đình mà anh \"cúc cung tận tuỵ\". Sau khi chết thảm, Yoon Hyun Woo sống lại một lần nữa dưới thân xác Jin Do Joon, con trai út của gia đình Sunyang Group. Mang hình hài của Jin Do Joon, Yoon Hyun Woo làm việc tiếp quản công ty cũng như bắt đầu màn trả thù của mình.</p>', 1, 'https://img.ophim15.cc/uploads/movies/cau-ut-nha-tai-phiet-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/cau-ut-nha-tai-phiet-poster.jpg', '2024-04-29 04:20:20', 8, 'https://www.youtube.com/watch?v=lq3pyNdP67k', 60, 32),
(867, 'Trộm Được Tướng Quân Nửa Ngày Nhàn', 'The Substitute Princess\'s Love', 2024, '<p>Chiến Thần Văn Dạ hy sinh trên chiến trường ngay trước ngày kết hôn, cả nước đều thương tiếc. Cô dâu ban đầu muốn gả đi là con gái chính thức của gia đình Thẩm tể tướng, bà Thẩm không muốn con gái mình trở thành góa phụ nhưng lại sợ việc hủy hôn sẽ nhận lấy chỉ trích từ dư luận. Vì vậy, bà tìm Thẩm Khả Hỷ, là con gái ngoài giá thú đang sống bên ngoài của Thẩm gia, ép cô kết hôn thay cho con gái bà. Tuy nhiên, tin tức ngoài chiến trường đã bị nhầm lẫn, Văn Dạ dẫn quân trở lại triều đình, Thẩm Khả Hỷ được gả cho Văn Dạ và chính thức trở thành công chúa, cô và hoàng tử trở thành cặp đôi vô cùng hạnh phúc, trong suốt quá trình đó, hai người thực sự đã nảy sinh tình cảm với nhau. Sau những thách thức mà họ đã đối mặt, cuối cùng, họ đã hiểu rõ giá trị thực sự của tình yêu và sự chăm sóc. Họ quyết định ở bên nhau, không theo đuổi sự giàu có và thịnh vượng, chỉ mong muốn tận hưởng những khoảnh khắc bình yên và đáng trân quý mà họ có thể trao cho nhau.</p><ol><li>&nbsp;</li></ol>', 1, 'https://img.ophim15.cc/uploads/movies/trom-duoc-tuong-quan-nua-ngay-nhan-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/trom-duoc-tuong-quan-nua-ngay-nhan-poster.jpg', '2024-05-01 14:18:27', 8, '', 30, 0),
(868, 'Cáp Nhĩ Tân 1944', 'In the Name of the Brother', 2024, '<p>Cáp Nhĩ Tân 1944 là một bộ phim thời đại trinh thám gián điệp do đạo diễn Trương Lê (Ở Bên Nhau) chỉ đạo, với sự tham gia diễn xuất của Tần Hạo (Góc Bí Mật) và Dương Mịch (Tiểu Thời Đại) tham gia đóng chính. Năm 1944, Cáp Nhĩ Tân dưới sự cai trị phi pháp của Nhật Bản, Tống Trác Văn, một đảng viên đóng giả làm cảnh sát tuần tra đường sắt, đã bị trưởng phòng Đặc vụ Quan Tuyết nhầm là ân nhân cứu mạng của mình - thực ra là Tống Trác Vũ, anh sinh đôi thất lạc nhiều năm của Trác Văn. Trác Văn được giao nhiệm vụ cao nhất là điều tra vụ việc quân đội Kanto của Trưởng phòng Asano Daigo đến Cáp Nhĩ Tân, và lợi dụng Quan Tuyết để tiếp cận phòng Đặc vụ. Nhưng đột nhiên Tống Trác Vũ lại xuất hiện, đẩy Trác Văn vào tình thế khó lường. Quan Tuyết máu lạnh đa nghi, tàn nhẫn và độc ác, còn Trác Vũ lại hành động bốc đồng, thường xuyên vô tình phá hỏng kế hoạch của Trác Văn.</p>', 1, 'https://img.ophim15.cc/uploads/movies/cap-nhi-tan-1944-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/cap-nhi-tan-1944-poster.jpg', '2024-05-01 14:18:40', 8, '', 44, 0),
(869, 'Vi Ám Chi Hoả ', 'Tender Light', 2024, 'The dim light and shadow wake up the dark night, everything is silent, and there is no place to hide the heartbeat. In the lights of the town, Nanya and Zhou Luo encountered a touch of warmth.', 1, 'https://img.ophim15.cc/uploads/movies/vi-am-chi-hoa-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/vi-am-chi-hoa-poster.jpg', '2024-05-01 14:18:42', 8, '', 49, 0),
(870, 'Sắc Xuân Gửi Người Tình', 'Will Love In Spring', 2024, '<p>Chen Maidong, once a rebellious youth, chooses to become a mortician after experiencing a life-changing event. Zhuang Jie, who becomes disabled due to a car accident, strives for a better life and becomes a successful professional in a big city. This drama portrays the journey of them who, despite their contrasting personalities and circumstances, learn to understand and accept one another. Their love heals their hearts, allowing them to embrace and appreciate their \"imperfect\" selves.</p>', 1, 'https://img.ophim15.cc/uploads/movies/sac-xuan-gui-nguoi-tinh-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/sac-xuan-gui-nguoi-tinh-poster.jpg', '2024-05-01 14:18:46', 8, '', 45, 0),
(871, 'Sắc Xuân Gửi Người Tình', 'Will Love In Spring', 2024, '<p>Chen Maidong, once a rebellious youth, chooses to become a mortician after experiencing a life-changing event. Zhuang Jie, who becomes disabled due to a car accident, strives for a better life and becomes a successful professional in a big city. This drama portrays the journey of them who, despite their contrasting personalities and circumstances, learn to understand and accept one another. Their love heals their hearts, allowing them to embrace and appreciate their \\\"imperfect\\\" selves.</p>', 1, 'https://img.ophim15.cc/uploads/movies/sac-xuan-gui-nguoi-tinh-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/sac-xuan-gui-nguoi-tinh-poster.jpg', '2024-05-01 14:18:48', 8, '', 45, 0),
(872, 'Thời Đại Thiếu Niên Của Tôi', 'Our Memories', 2024, '<p>Tọa lạc tại \"phố vũ trụ\" của một thị trấn nhỏ ven biển, \"Vua trẻ em\" Vương Hoàn Vũ, \"Nữ thần vũ đạo\" Vệ Tinh, \"Cửa hàng thế hệ thứ hai\" Hàn Soái, \"Thiếu nữ ma ngựa\" Quách Đình và \"Nhà văn học\" Sử Văn Khả từ nhỏ là thanh mai trúc mã, cùng nhau lớn lên. Đối mặt với năm cuối cấp tốt nghiệp phổ thông, bất luận học sinh kém như Vương Hoàn Vũ, Hàn Soái và Quách Đình, hay học bá như Vệ Tinh và Sử Văn Khả đều phải đối mặt với vấn đề khó tương lai đi đâu về đâu. Phiền não của sự trưởng thành đi cùng với sự mờ mịt của thanh xuân, cũng lặng lẽ gõ cửa trái tim bọn trẻ. Thanh xuân là một trận nhốn nháo hoảng loạn, nhưng chỉ cần có những người bạn quan tâm ở bên, bạn chẳng có gì phải sợ hãi. Một năm nay, nhóm thanh thiếu niên với những tính cách khác nhau và có sức hấp dẫn lẫn nhau, với khí chất riêng, đã trải qua những niềm vui, nỗi buồn do tình cảm gia đình, tình bạn và tình yêu hồ đồ mang lại. Giữa lúc do dự và bối rối, họ cẩn thận làm rõ hướng đi của mình, bảo vệ sơ tâm của mình và tiếp tục chạy về phía kia trong lòng mình.</p>', 1, 'https://img.ophim15.cc/uploads/movies/thoi-dai-thieu-nien-cua-toi-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/thoi-dai-thieu-nien-cua-toi-poster.jpg', '2024-05-01 14:18:52', 8, '', 35, 1),
(873, 'Tiệm Chụp Ảnh Ma Quái', 'The Midnight Studio', 2024, '<p>Những câu chuyện ly kỳ xoay quanh một studio chỉ làm việc với người đã khuất được điều hành bởi nhiếp ảnh gia Seo Ki Joo và các cộng sự đặc biệt của anh ấy.</p><p>&nbsp;</p>', 1, 'https://img.ophim15.cc/uploads/movies/tiem-chup-anh-ma-quai-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/tiem-chup-anh-ma-quai-poster.jpg', '2024-05-01 14:18:56', 8, 'https://www.youtube.com/watch?v=lJscyqq5xMI', 60, 1),
(874, 'Thất Bại Thê Thảm', 'Fiasco', 2024, '<p>Khi thảm họa ập xuống phim trường của một người lần đầu làm đạo diễn, đoàn làm phim ghi lại mọi chuyện khi những tai nạn, hành vi tống tiền và phá hoại xảy ra sau đó ở hậu trường.</p><p>&nbsp;</p>', 1, 'https://img.ophim15.cc/uploads/movies/that-bai-the-tham-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/that-bai-the-tham-poster.jpg', '2024-05-01 14:19:04', 8, '', 32, 0),
(875, 'Lúc đó tôi đã chuyển sinh thành Slime: Tóm tắt mùa 2 trong một tiếng', '転生したらスライムだった件 第2期', 2024, 'Người anh hùng Limuru và những quái vật ngưỡng mộ anh ấy đang xây dựng lý tưởng tưởng chừng đơn giản về&quot; một đất nước nơi con người và quái vật có thể chung sống với nhau. &quot;\nTuy nhiên, rõ ràng vẫn tồn tại một sự &quot;thù địch với quái vật&quot; trong thế giới này.\nCòn Rimuru thì sao?', 1, 'https://img.ophim15.cc/uploads/movies/luc-do-toi-da-chuyen-sinh-thanh-slime-tom-tat-mua-2-trong-mot-tieng-thumb.jpg', 'https://img.ophim15.cc/uploads/movies/luc-do-toi-da-chuyen-sinh-thanh-slime-tom-tat-mua-2-trong-mot-tieng-poster.jpg', '2024-05-01 14:19:11', 8, '', 44, 1),
(876, 'Thanh Gươm Diệt Quỷ: Đại Trụ Đặc Huấn (Huấn Luyện Trụ Cột)', 'Demon Slayer: Hashira Training Arc, Kimetsu no Yaiba: Hashira Geiko-hen', 2024, 'Demon Slayer: Kimetsu no Yaiba là một bộ truyện tranh Nhật Bản được viết và minh họa bởi Koyoharu Gotouge. Phim kể về cậu thiếu niên Tanjiro Kamado, người cố gắng trở thành một kẻ giết quỷ sau khi gia đình cậu bị tàn sát và em gái cậu, Nezuko, bị biến thành quỷ.', 1, 'https://img.ophim.live/uploads/movies/thanh-guom-diet-quy-dai-truc-dac-huan-thumb.jpg', 'https://img.ophim.live/uploads/movies/thanh-guom-diet-quy-dai-truc-dac-huan-poster.jpg', '2024-05-14 01:14:04', 8, 'https://www.youtube.com/watch?v=Sl2k7bfBeCw', 24, 3),
(877, 'Nhất Thời Im Lặng', 'Moment of Silence', 2024, '<p>Bà nội trợ khiếm thính Mai Ling Jing có một người chồng hoàn hảo Wang Shi Ming và một người bạn thân ân cần Su Xi. Tuy nhiên, cuộc sống tưởng chừng như hạnh phúc của cô lại tan vỡ khi cô bất ngờ lấy lại được thính giác; Hóa ra chồng cô đã ngoại tình với bạn thân của cô và đang lên kế hoạch cho một âm mưu khủng khiếp hơn. Để tìm ra sự thật, Mai đã chịu đựng sự tủi nhục và giả điếc, dấn thân vào hành trình trả thù chồng và người bạn thân của mình.</p>', 1, 'https://img.ophim.live/uploads/movies/nhat-thoi-im-lang-thumb.jpg', 'https://img.ophim.live/uploads/movies/nhat-thoi-im-lang-poster.jpg', '2024-05-19 04:02:26', 8, '', 15, 0),
(878, 'Tiên Kiếm', 'A Happy Life ', 2013, '<p>A wealthy fox family (in human appearances)have nine daughters. The father of daughters is a known king in their world. One day the father decides to get her youngest daughter married through an arranged marriage. The youngest daughter love going to the muggle (human world) and enjoys everything-food, clothing, games, shopping. Therefore to avoide the marriage she does a make marriage contract with a muggle without letting him knowing her real identity, which leads to many intereting and craziness into their life.</p>', 1, 'https://img.ophim.live/uploads/movies/tien-kiem-thumb.jpg', 'https://img.ophim.live/uploads/movies/tien-kiem-poster.jpg', '2024-05-19 04:09:58', 8, '', 45, 1),
(879, 'Hạt Ngọc Trai', 'Inci Taneleri', 2024, '<p>Liệu Azem Yücedağ, người được ra tù sau nhiều năm, có tìm lại được những gì mình đã đánh mất? Liệu Azem, người đang theo đuổi hy vọng với quá khứ đau khổ, bí mật lớn lao mà anh mang trong mình và gánh nặng cuộc sống trên lưng, có thể thu thập lại những viên ngọc trai rải rác từ chiếc vòng cổ của mình không?</p>', 1, 'https://img.ophim.live/uploads/movies/hat-ngoc-trai-thumb.jpg', 'https://img.ophim.live/uploads/movies/hat-ngoc-trai-poster.jpg', '2024-05-19 04:17:50', 8, '', 130, 1),
(880, 'Đệ nhất ái nữ', 'First Daughter', 2004, '<p>Con gái Tổng thống Hoa Kỳ nhất quyết muốn đi học đại học như một đứa trẻ bình thường. Nhưng khi bạn có bố là lãnh đạo của thế giới tự do, \"bình thường\" chỉ là tương đối.</p>', 0, 'https://img.ophim.live/uploads/movies/e-nhat-ai-nu-thumb.jpg', '', '2024-05-19 07:16:45', 8, '', 146, 0),
(881, 'Vụ án Outreau: Cơn ác mộng nước Pháp', 'The Outreau Case: A French Nightmare', 2024, '<p>Loạt phim tài liệu này nhìn lại vụ án Outreau, một trong những bê bối lớn nhất lịch sử nước Pháp. Vụ việc thương tâm này liên quan đến bạo hành trẻ em và thảm họa tư pháp.</p>', 1, 'https://img.ophim.live/uploads/movies/vu-an-outreau-con-ac-mong-nuoc-phap-thumb.jpg', 'https://img.ophim.live/uploads/movies/vu-an-outreau-con-ac-mong-nuoc-phap-poster.jpg', '2024-05-19 07:24:33', 8, '', 44, 1),
(882, 'Giáng Long Thần Chưởng Tô Khất Nhi 2', 'Master So Dragon Subduing Palms 2', 2020, '<p>Phim Giáng Long Thần Chưởng Tô Khất Nhi 2 - Master So Dragon Subduing Palms 2 kể về hai quan tòa của huyện Lâm Giang hẻo lánh bị giết bởi một viên thắt cổ tự tử. Su Qi’er và Tie Qiaosan, Đội bảo vệ của Cung điện, đến huyện Lâm Giang để điều tra vụ việc. Vì không thể nhận được bất kỳ sự giúp đỡ nào, họ che giấu danh tính của mình và tham gia vào băng nhóm ăn xin để điều tra. Không muốn khuất phục trước nghịch cảnh và với niềm tin vào công lý, họ tiếp tục chiến đấu bằng trí thông minh và lòng dũng cảm chống lại những kẻ chủ mưu của vụ án.</p>', 0, 'https://img.ophim.live/uploads/movies/giang-long-than-chuong-to-khat-nhi-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/giang-long-than-chuong-to-khat-nhi-2-poster.jpg', '2024-05-19 07:26:37', 8, '', 113, 0),
(883, 'Tông Sư Công Phu Hoắc Nguyên Giáp', 'Fearless Kungfu King', 2020, '<p>Tông Sư Công Phu Hoắc Nguyên Giáp - Fearless Kungfu King kể về thanh niên trẻ tuổi Hoắc Nguyên Giáp một lòng chỉ muốn \"Lấy võ phục người\", bỏ nhà đi đến Thiên Tân. Tại đây Hoắc Nguyên Giáp tình cờ gặp được Nông Kình Tôn đang gặp nguy hiểm và giải vây cho hắn. Nông Kình Tôn thấy Hoắc Nguyên Giáp có võ nghệ siêu quần, khuyên hắn mở võ quán để cường quốc cường dân. Để có thể lập thân ở đất Thiên Tân với số võ quán nhiều như nấm, Hoắc Nguyên Giáp đã khiêu chiến thành công liên tiếp 7 võ quán, cuối cùng trong trận đấu với U Lan - đệ tử của Đại Đao Vương Ngũ danh tiếng, ông đã bị thế lực gian ác bao vây tấn công.</p>', 0, 'https://img.ophim.live/uploads/movies/tong-su-cong-phu-hoac-nguyen-giap-thumb.jpg', 'https://img.ophim.live/uploads/movies/tong-su-cong-phu-hoac-nguyen-giap-poster.jpg', '2024-05-19 07:26:41', 8, '', 89, 0),
(884, 'Lắng Nghe Hạnh Phúc', 'Someone Like You', 2015, '<p>Phim Lắng Nghe Hạnh Phúc - Someone like you xoay quanh người đàn ông tên là Phương Triển Thừa ông bị mất tất cả mọi thứ trong một vụ tai nạn xe hơi thảm khóc, và ông cũng mất vị hôn thê của mình do ông bị mất thị lực, nhiều nổi đau cứ đến với ông nên ông không còn tâm trí để ghép giác mạc có thể hồi phục lại thị lực. Nhưng bất ngờ đến với ông là có một người phục nữ trông giống hệt vợ của mình, được thuê để trở thành y tá ngày ngày chăm sóc ông. Câu chuyện phim Lắng Nghe Hạnh Phúc bất đầu từ đây ông Phương Triển Thừa có đến với người phục nữ mới không…</p>', 1, 'https://img.ophim.live/uploads/movies/lang-nghe-hanh-phuc-thumb.jpg', 'https://img.ophim.live/uploads/movies/lang-nghe-hanh-phuc-poster.jpg', '2024-05-19 07:26:43', 8, '', 43, 0),
(885, 'Eileen', 'Eileen', 2023, 'Mùa đông buốt giá ở Massachusetts năm 1964, nhà tù nơi cô thư ký trẻ Eileen làm việc vừa tiếp nhận một cố vấn mới - Rebecca Saint John. Tình bạn chớm nở giữa họ rẽ sang hướng khác khi Rebecca tiết lộ một bí mật đen tối — đẩy Eileen vào con đường hung hiểm.', 0, 'https://img.ophim.live/uploads/movies/eileen-thumb.jpg', 'https://img.ophim.live/uploads/movies/eileen-poster.jpg', '2024-05-19 07:28:27', 8, 'https://www.youtube.com/watch?v=otDHCJcdN34', 98, 0),
(886, 'Miranda\'s Victim', 'Miranda\'s Victim', 2023, 'The true story of Trish Weir who in 1963 was kidnapped and brutally raped by Ernesto Miranda. Committed to putting her assailant in prison, Trish’s life is destroyed by America’s legal system as she triggers a law that transforms the nation.', 0, 'https://img.ophim.live/uploads/movies/mirandas-victim-thumb.jpg', 'https://img.ophim.live/uploads/movies/mirandas-victim-poster.jpg', '2024-05-19 07:28:46', 8, 'https://www.youtube.com/watch?v=TkmAg81KNP8', 127, 0),
(887, 'Monster 2023', 'Monster ', 2023, '<p>Mugino Saori (Ando Sakura) là một bà mẹ đơn thân hiện đang nuôi cậu con trai học lớp 5 tên là Mugino Minato (Kurokawa Souya). Tuy nhiên, cậu bé đã sớm bắt đầu có những hành vi kỳ lạ như tự cắt tóc và khi đi học về nhà lại chỉ còn mang 1 chiếc giày. Một đêm nọ, Minato không về nhà và sau khi gọi điện khắp nơi, Saori tìm thấy cậu bé trong một đường hầm xe lửa bỏ hoang. Từ đây, Saori bắt đầu nghi ngờ giáo viên của con trai mình tên là Hori (Nagayama Eita) đang có những hành vi bạn hành con mình và đến trường đòi lời giải thích. Tuy nhiên, Saori phải sớm thất vọng trước thái độ của thầy Hori và những người khác, đỉnh điểm hơn khi thầy Hori có nhắc tới việc một cậu bé tên là Yori (Hiigari Hinata) mới là nạn nhân của Minato.</p>', 0, 'https://img.ophim.live/uploads/movies/monster-2023-thumb.jpg', 'https://img.ophim.live/uploads/movies/monster-2023-poster.jpg', '2024-05-19 07:29:05', 8, '', 25, 0),
(888, 'The Comeback Trail', 'The Comeback Trail', 2020, 'Two movie producers who owe money to the mob set up their aging movie star for an insurance scam to try and save themselves. But they wind up getting more than they ever imagined.', 0, 'https://img.ophim.live/uploads/movies/the-comeback-trail-thumb.jpg', 'https://img.ophim.live/uploads/movies/the-comeback-trail-poster.jpg', '2024-05-19 07:29:14', 8, 'https://www.youtube.com/watch?v=H9aJATnSseo', 105, 0),
(889, 'Chính Quyền', 'The Regime', 2024, '<p>Câu chuyện về một năm bên trong bức tường cung điện của chế độ châu Âu hiện đại khi nó bắt đầu sáng tỏ.</p>', 1, 'https://img.ophim.live/uploads/movies/chinh-quyen-thumb.jpg', 'https://img.ophim.live/uploads/movies/chinh-quyen-poster.jpg', '2024-05-19 07:29:28', 8, 'https://www.youtube.com/watch?v=82bST-tsEdY', 50, 0),
(890, 'Argylle: Siêu Điệp Viên', 'Argylle', 2024, 'Khi nội dung bộ sách điệp viên của mình bám theo quá sát hoạt động của một tổ chức ngầm nguy hiểm, tiểu thuyết gia hướng nội Elly Conway và con mèo của mình bị cuốn vào thế giới tình báo ngoài đời thực, nơi không thứ gì, và không ai, giống như vẻ bề ngoài.', 0, 'https://img.ophim.live/uploads/movies/argylle-sieu-diep-vien-thumb.jpg', 'https://img.ophim.live/uploads/movies/argylle-sieu-diep-vien-poster.jpg', '2024-05-19 07:29:29', 8, 'https://www.youtube.com/watch?v=Sy6eNs3EW3E', 139, 1),
(891, 'Chánh Thanh Tra 1958', 'Chief Detective 1958', 2024, '<p>Trong thời đại bạo lực và tham nhũng, Park Yeong-han, một thám tử khiêm tốn, hợp tác với Sang-sun, Kyung-hwan và Ho-jeong để bảo vệ công lý.</p>', 1, 'https://img.ophim.live/uploads/movies/chanh-thanh-tra-1958-thumb.jpg', 'https://img.ophim.live/uploads/movies/chanh-thanh-tra-1958-poster.jpg', '2024-05-19 07:30:58', 8, '', 70, 0),
(892, 'Tôi Sống Ở Nơi Khác', 'What If', 2024, 'Bộ phim kể về câu chuyện của Hạ Quả, một cô gái bình thường. Khi phải đối mặt với vô vàn sự lựa chọn khác nhau trong cuộc sống, cô đã xướng lên khúc dạo đầu dẫn đến hai cuộc đời hoàn toàn trái ngược. Liệu cô ấy sẽ chọn cuộc sống ngập tràn náo nhiệt ở thành phố nhỏ hay sẽ dấn thân vào cuộc sống bôn ba ở đô thị sầm uất phồn hoa? Con đường nào mới có thể dẫn cô đến với một cuộc sống \"phi thường hơn một chút\"?', 1, 'https://img.ophim.live/uploads/movies/toi-song-o-noi-khac-thumb.jpg', 'https://img.ophim.live/uploads/movies/toi-song-o-noi-khac-poster.jpg', '2024-05-19 07:33:33', 8, '', 40, 1),
(893, 'Doctor Who', 'Doctor Who', 2024, '<p>Với khả năng du hành vượt thời gian và không gian, Chúa tể thời gian - Doctor thứ 15 bắt đầu hành trình mới đầy thử thách và đối đầu với nhiều kẻ thù nguy hiểm cùng người bạn đồng hành của mình là Ruby Sunday.</p>', 1, 'https://img.ophim.live/uploads/movies/doctor-who-thumb.jpg', 'https://img.ophim.live/uploads/movies/doctor-who-poster.jpg', '2024-05-19 08:29:00', 8, 'https://www.youtube.com/watch?v=QoyV65HoRFA', 55, 0),
(894, 'Ẩm Thực Lẩu Trung Hoa', 'The Hot Life', 2019, '<p>Bắt đầu cuộc hành trình xuyên Trung Quốc để khám phá món lẩu đặc sản vùng miền của đất nước và cách món ăn ấm áp này gắn kết mọi người lại với nhau</p>', 1, 'https://img.ophim.live/uploads/movies/am-thuc-lau-trung-hoa-thumb.jpg', 'https://img.ophim.live/uploads/movies/am-thuc-lau-trung-hoa-poster.jpg', '2024-05-19 08:29:01', 8, '', 25, 0),
(895, 'Lập Lời Cầu Nguyện', 'Schoßgebete', 2014, 'A comedy centered on a sexually adventurous young woman who is trying to be the perfect wife, mother, and lover.', 0, 'https://img.ophim.live/uploads/movies/lap-loi-cau-nguyen-thumb.jpg', 'https://img.ophim.live/uploads/movies/lap-loi-cau-nguyen-poster.jpg', '2024-05-19 08:29:01', 8, 'https://www.youtube.com/watch?v=JC1geNwvCYI', 89, 0),
(896, 'A Time to Kill', 'A Time to Kill', 1996, '<p>Lấy bối cảnh một thị trấn nhỏ của nước Mỹ nhưng chứa đựng những xung đột ngấm ngầm của nạn phân biệt chủng tộc. Một ngày nọ, cô bé da màu 10 tuổi đang trên đường từ tiệm tạp hóa về nhà thì bị hai thanh niên da trắng lêu lổng bắt hiếp, tra tấn và cuối cùng ném cô bé xuống vực để phi tang. May mắn thay, cô bé đã sống sót, nhận diện được khuôn mặt kẻ thủ ác, hai tên ác nhân nhanh chóng bị bắt để chờ ngày xét xử…<br>Người cha có cô con gái bị hại biết chắc rằng những kẻ thủ ác kia cùng lắm chỉ ngồi tù 10 năm. Không thỏa lòng với phán quyết đó, ông đã vác súng bắn chết hai tên tội phạm và làm bị thương một phó cảnh sát trưởng ngay tại tòa án. Thời lượng còn lại của bộ phim chính là sự giằng xé của luật sư cũng có con gái nhỏ, bào chữa cho người cha đang quẫn trí nọ. Đó là thảm cảnh xảy ra khi công lý không thể thỏa mãn người dân vô tội.</p>', 0, 'https://img.ophim.live/uploads/movies/a-time-to-kill-thumb.jpg', 'https://img.ophim.live/uploads/movies/a-time-to-kill-poster.jpg', '2024-05-19 08:29:07', 8, '', 22, 0),
(897, 'Thợ Săn (1975)', 'Dersu Uzala', 1975, '<p>A military explorer meets and befriends a Goldi man in Russia’s unmapped forests. A deep and abiding bond evolves between the two men, one civilized in the usual sense, the other at home in the glacial Siberian woods.</p>', 0, 'https://img.ophim.live/uploads/movies/tho-san-1975-thumb.jpg', 'https://img.ophim.live/uploads/movies/tho-san-1975-poster.jpg', '2024-05-19 08:29:09', 8, '', 222, 0),
(898, 'Dersu Uzala', 'Dersu Uzala', 1975, '<p>A military explorer meets and befriends a Goldi man in Russia’s unmapped forests. A deep and abiding bond evolves between the two men, one civilized in the usual sense, the other at home in the glacial Siberian woods.</p>', 0, 'https://img.ophim.live/uploads/movies/dersu-uzala-thumb.jpg', 'https://img.ophim.live/uploads/movies/dersu-uzala-poster.jpg', '2024-05-19 08:29:10', 8, '', 222, 0),
(899, 'Drowning by Numbers', 'Drowning by Numbers', 1988, 'Three generations of women who seek to murder their husbands share a solidarity for one another which brings about three copy-cat drownings.', 0, 'https://img.ophim.live/uploads/movies/drowning-by-numbers-thumb.jpg', 'https://img.ophim.live/uploads/movies/drowning-by-numbers-poster.jpg', '2024-05-19 08:29:10', 8, 'https://www.youtube.com/watch?v=5tBxhzpFO1M', 119, 0),
(900, 'Niềm Tin Lung Lay', 'First Reformed', 2018, 'A pastor of a small church in upstate New York starts to spiral out of control after a soul-shaking encounter with an unstable environmental activist and his pregnant wife.', 0, 'https://img.ophim.live/uploads/movies/niem-tin-lung-lay-thumb.jpg', 'https://img.ophim.live/uploads/movies/niem-tin-lung-lay-poster.jpg', '2024-05-19 08:29:15', 8, 'https://www.youtube.com/watch?v=hCF5Y8dQpR4', 113, 0),
(901, 'Người \"Bạn\" Trong Tưởng Tượng', 'Imaginary', 2024, 'Toy Story phiên bản kinh dị sắp làm khán giả ngất luôn tại rạp! Chú gấu nhồi bông trông thì bình thường dễ thương nhưng lại sai khiến cô bạn nhỏ chơi một trò chơi đen tối với những thử thách kỳ lạ!', 0, 'https://img.ophim.live/uploads/movies/nguoi-ban-trong-tuong-tuong-thumb.jpg', 'https://img.ophim.live/uploads/movies/nguoi-ban-trong-tuong-tuong-poster.jpg', '2024-05-19 08:29:21', 8, 'https://www.youtube.com/watch?v=W--2y6mUhbI', 104, 2),
(902, 'Thiếu Niên Babylon', 'Young Babylon', 2024, 'Knowing nothing more than the working-class life he is born into, headstrong Lu Xiaolu reluctantly starts down the path he is expected to follow. At age nineteen in 1990s China, he feels pressure to follow suit with those around him and takes a job at the town’s saccharin factory. Slowly, he adjusts to the bureaucratic factory routine, making the best of the situation by bonding with coworkers, flirting with girls, and refusing to give in completely to the expectations of those around him.\n\nAs Lu Xiaolu finds his way, a startling portrait of an economically expanding China comes into view; the propaganda of a common goal gives way to a bottom-line system that he sees as indifferent to individual happiness. But thanks to the relationships he develops, Lu Xiaolu decides to fight for the life he wants.', 1, 'https://img.ophim.live/uploads/movies/thieu-nien-babylon-thumb.jpg', 'https://img.ophim.live/uploads/movies/thieu-nien-babylon-poster.jpg', '2024-05-19 08:29:28', 8, '', 39, 1),
(903, 'Đại Tiểu Thư Vượt Qua Chông Gai', 'Lady Revenger Returns From the Fire', 2024, '<p>La Ái Liên, con gái phú thương thiên phú hơn người, vốn được thừa kế gia nghiệp, sống cuộc sống ổn định, nhưng lại bị ép vào bước đường cùng vì một tai bay vạ gió. Sau khi thoát chết, cô không gục ngã, mà vực dậy được nhờ phẩm chất bền bỉ của mình, chèo chống gia nghiệp, hướng về tương lai nhờ niềm tin vững chắc.</p><p>&nbsp;</p>', 1, 'https://img.ophim.live/uploads/movies/dai-tieu-thu-vuot-qua-chong-gai-thumb.jpg', 'https://img.ophim.live/uploads/movies/dai-tieu-thu-vuot-qua-chong-gai-poster.jpg', '2024-05-19 08:29:29', 8, '', 45, 0),
(904, 'Khánh Dư Niên (Bản đặc biệt)', 'Joy of Life (Special Season)', 2024, 'Khánh Dư Niên được chuyển thể từ tiểu thuyết cùng tên của tác giả Miêu Nị. Lấy bối cảnh những năm cuối nhà Đông Tấn, tướng quốc công Lưu Dụ soán vị Thành Vũ Đế. Giữa trận huyết chiến, chỉ có đứa bé do hoàng phi Diệp Khinh Minh sinh ra may mắn thoát nạn. Thượng thư Phạm Kiến đem đứa nhỏ về nuôi dưỡng, đặt tên là Phạm Nhàn. Phạm Nhàn năm 18 tuổi, bắt đầu bị cuốn vào cuộc tranh giành mưu quyền trong cung. Đồng thời cũng trở thành vị quan tài ba giải quyết nhiều vụ án nan giải. Phạm Nhàn một lòng trung thành với Vũ Đế, sau lại biết y chính là kẻ hại chết cha mẹ mình. Chân tướng sáng tỏ, Phạm Nhàn vì cha mẹ quyết tâm báo thù, cũng vì thương xót sinh linh trăm họ, chống lại chính sách tàn bạo của Vũ Đế. Cuối cùng thành công khiến Vũ Đế thoái vị, ngôi vị truyền cho Tam hoàng tử. Triều đình trong ngoài khôi phục, dân an thái bình, Phạm Nhàn đem theo người thương yêu ẩn cư bên bờ biển.', 1, 'https://img.ophim.live/uploads/movies/khanh-du-nien-phan-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/khanh-du-nien-phan-2-poster.jpg', '2024-05-19 08:29:30', 8, '', 45, 0),
(905, 'Mở Ra Một Thế Giới Tuyệt Vời (Phần 3)', 'KONOSUBA - God\'s blessing on this wonderful world! Season 3', 2024, 'Satou Kazuma, một hikikomori đam mê trò chơi, Nhưng cuộc sống ngắn ngủi của anh kết thúc vì tai nạn giao thông lãng xẹt ... Nhưng khi anh ta tỉnh dậy, một cô gái xinh đẹp, người tự gọi mình là một nữ thần đã ở phía trước đôi mắt anh ấy và đưa anh ấy đến một thế giới khác, Khi sang thế giới mới, cậu gặp ngày càng nhiều mấy cô nàng không điên thì cũng tâm thần, riết rồi cậu muốn quay trở về thế giới cũ càng nhanh càng tốt...', 1, 'https://img.ophim.live/uploads/movies/mo-ra-mot-the-gioi-tuyet-voi-phan-3-thumb.jpg', 'https://img.ophim.live/uploads/movies/mo-ra-mot-the-gioi-tuyet-voi-phan-3-poster.jpg', '2024-05-19 08:29:32', 8, 'https://www.youtube.com/watch?v=pejn2NQk7PI', 24, 1),
(906, 'Sóng Gió Chỉ Cấm Thành', 'Happy Flying Dragon', 1998, '<p><i>Quang Tự năm thứ 24. Mận Thuấn thất bại. Vua Quang Tự bị giam lỏng (vua bù nhìn). Dân chúng lầm than. Nữ phi tặc – Liễu Thanh Thanh chạm trán Mạnh Tiểu Sơn dần dần trở thành hoan hĩ oan gia. Môt hôm, trong dịp tình cờ, 2 người này trà trộn trong cung đình mục đích vốn là muốn ăn cắp. Không ngờ bị dính líu trong các vụ đoạt quyền, gây ra không biết bao nhiêu chuyện dở khóc dở cười…</i><br><br><i>Sau khi gây án đại họa, tên thái giám mao dạnh Mạnh Tiểu Sơn và Liểu Thanh Thanh bèn dẫn luôn em gái Tiểu Gian và tên khâm phạm bộ quốc thống lãnh trốn ra cung đình. Trong lúc bối rối, Sơn đành mạo danh là Hoàng Thượng và Thanh Thanh mạo danh là Đa La Cách Cách lừa bịp Viên Thế Khải. Nào ngờ chẳng được như ý muốn</i><br><i>còn bị cao thủ các phái truy sát.</i></p>', 1, 'https://img.ophim.live/uploads/movies/song-gio-chi-cam-thanh-thumb.jpg', 'https://img.ophim.live/uploads/movies/song-gio-chi-cam-thanh-poster.jpg', '2024-05-19 08:29:35', 8, '', 45, 0);
INSERT INTO `phim` (`id_phim`, `ten_phim`, `ten_tienganh`, `nam_san_xuat`, `mo_ta`, `loai_phim`, `hinh_anh`, `anh_bia`, `created_at`, `diem_danh_gia`, `link_trailer`, `thoi_luong`, `luot_xem`) VALUES
(907, 'Miêu Thúy Hoa', 'Lady FLower Fist', 1997, '<p><i>Phương Đức, một nhà buôn giàu có nổi tiếng, trong một lần tình cờ lỡ đụng chạm và gây ra sự hiểu lầm với Miêu Thúy Hoa. Miêu Thúy Hoa là con gái duy nhất của võ sư Miêu Hiển, Miêu Thúy Hoa có võ công cao cường lại có lòng nghĩa hiệp và chút ương ngạnh. Một lần vì bênh vực lẽ phải, Miêu Thúy Hoa đã giao đấu với con trai của viên quan Tổng Đốc địa phương, tên công tử bột này bị tai nạn qua đời, khiến cho quan Tổng Đốc rắp tâm trả thù Miêu Thúy Hoa. Phương Đức tình cờ biết được nên ra tay cứu Miêu Thúy Hoa bằng cách nhận là ý trung nhân. Vì Phương Đức quen biết với nhiều người trong Hoàng Thất nên quan Tổng Đốc không làm gì được, nhưng Thái Hậu lại sủng ái Phương Đức mới thí hôn Miêu Thúy Hoa cho Phương Đức. Sự việc rắc rối từ đây!! Miêu Thúy Hoa về làm vợ Tư bất đắc dĩ !! Tại đây có cô em gái của người vợ cả quá cố tính tình trẻ con, hay ganh tị và đem lòng yêu thương anh rễ Phương Đức nên luôn ganh ghét Miêu Thúy Hoa. Cô vợ 2, tối ngày tìm cách chọc phá Miêu Thúy Hoa, luôn tỏ ra hiểu biết thực chất ko biết gì, và nhất là chỉ giỏi sai vặt. Cô vợ 3, tính khí khái, do là con nhà võ nên rất hợp với Miêu Thúy Hoa, nhưng luôn “bỏ quên bộ óc trong phòng” (theo lời bà vợ 2 ) và rất nghe lời bà vợ 2 !! Vì thế trong nhà Phương Đức luôn có chuyện xảy ra… Nhiều tình tiết cười đau bụng bắt nguồn từ đây !!</i></p>', 1, 'https://img.ophim.live/uploads/movies/mieu-thuy-hoa-thumb.jpg', 'https://img.ophim.live/uploads/movies/mieu-thuy-hoa-poster.jpg', '2024-05-19 08:29:37', 8, '', 45, 0),
(908, 'Hiệp Khách Mặt Nạ Đen', 'Hiệp Khách Mặt Nạ Đen', 2001, '<p><i>Hiệp Khách Mặt Nạ Đen (phim Singapore) lấy cảm hứng từ một câu chuyện ngắn của Trung Quốc. Câu chuyện kể về một tên trộm chuyên cướp giàu giúp nghèo trong triều đại Nam Tống. Hiệp khách mặt nạ đen ngày thường là một bổ đầu chuyên chống lại những sự bất công. Cả Lý Nam Tinh và Âu Dương Chấn Hoa đều trở thành đối thủ khi cả hai đều rơi vào tình yêu với bà chủ tửu lầu do Phạm Văn Phương thủ vai. Dân chúng của Điền thành đang vô cùng cảm kích hiệp đạo \"Nghĩa lai giả\" nhưng không ngờ anh ta lại chính là bổ đầu của nha môn. Tống đầu 1 kê được triệu tới đây làm sứ giả.</i></p>', 1, 'https://img.ophim.live/uploads/movies/hiep-khach-mat-na-den-thumb.jpg', 'https://img.ophim.live/uploads/movies/hiep-khach-mat-na-den-poster.jpg', '2024-05-19 08:29:39', 8, '', 45, 1),
(910, '12.12: The Day', '12.12: The Day', 2023, 'After the assassination of President Park, martial law has been declared. A coup d’état bursts out by Defense Security Commander Chun Doo-gwang and a private band of officers following him. Capital Defense Commander Lee Tae-shin, an obstinate soldier who believes the military should not take political actions, fights against Chun Doo-gwang to stop him. The conflict between the two grows while military leaders are holding their decision and Defense Minister is gone. In the midst of chaos, the spring of Seoul that everyone longed for heads to unexpected direction.', 0, 'https://img.ophim.live/uploads/movies/1212-the-day-thumb.jpg', 'https://img.ophim.live/uploads/movies/1212-the-day-poster.jpg', '2024-05-19 08:59:20', 8, 'https://www.youtube.com/watch?v=mmQKt07PaHs', 142, 1),
(911, 'Công Chúa Điện Hạ Thật Kỳ Lạ', 'The Strange Princess	', 2024, 'Sơn Đại vương Mã Đại Hữu bắt cóc công chúa Giang Thiên Nhi, bị sét đánh trúng và kỳ diệu hoán đổi cơ thể, thậm chí còn cảm nhận được nhau, trở thành chung số phận. Giang Thiên Nhi muốn hoán đổi lại cơ thể để tổ chức hôn lễ với thiếu tướng quân yêu quý Lục Thiên Hành, còn Mã Đại Hữu cũng muốn báo thù cho cha mình. Hai người buộc phải thỏa hiệp với hiện thực, hợp tác cùng nhau vượt qua các cửa ải khó khăn. Ứng Vương âm mưu tạo phản, cho người lẻn vào sơn trại của Mã Đại Hữu, chiếm lấy sơn trại làm nơi bí đóng quân bí mật. Giang Thiên Nhi giúp Mã Đại Hữu tra rõ chân tướng về mối thù cha năm xưa, còn Lục Thiên Hành cũng phải tìm bằng chứng về việc Ứng Vương mưu phản cho hoàng đế, cả ba người mỗi người một mục đích đều đến ở tại phủ Ứng Vương. Ứng Vương mưu phản trước kế hoạch, lật đổ triều đình, Giang Thiên Nhi lập tức trở thành người không nhà để về. Lục Thiên Hành cũng bị cha mình ép phải cưới con gái của Ứng Vương là Giang Khả Lam để thể hiện lòng trung thành.', 1, 'https://img.ophim.live/uploads/movies/cong-chua-dien-ha-that-ky-la-thumb.jpg', 'https://img.ophim.live/uploads/movies/cong-chua-dien-ha-that-ky-la-poster.jpg', '2024-05-19 08:59:30', 8, '', 11, 0),
(912, 'Cô Ấy Hoàn Hảo', 'Perfect Her', 2024, 'Trong buổi kỷ niệm mười năm kết hôn của nữ chính Bạch Lê và chồng là Diệp Vân Khải, cô gặp gỡ nam chính Tô Du, đàn em của mình từ đại học. Khi đó, Tô Du đã là bạn trai của Ninh Mạt Thần. Bạch Lê bị Ninh Mạt Thần bày mưu phát hiện sự thật về chồng ngoại tình, trong khi Ninh Mạt Thần lại là đối tượng của mối quan hệ ngoại tình đó. Sau một vụ tai nạn, linh hồn của nữ chính và tiểu tam hoán đổi, sau đó linh hồn của nữ chính cùng với tiểu tam tỉnh lại, mở đường cho con đường trả thù. Vợ cả Bạch Nguyệt và linh hồn của tiểu tam ác độc hoán đổi, đội lên mặt nạ phát hiện lội ngược dòng để xoay chuyển tình thế.', 1, 'https://img.ophim.live/uploads/movies/co-ay-hoan-hao-thumb.jpg', 'https://img.ophim.live/uploads/movies/co-ay-hoan-hao-poster.jpg', '2024-05-19 08:59:32', 8, '', 45, 0),
(913, 'Em Là Ánh Sáng Của Anh', 'My Star', 2023, 'Cố Lâm Tinh, đại thiếu gia nhà họ Cố trước giờ ngang ngược, kiêu căng vô tình gặp gỡ Trần Tư Nam, một trợ giảng đại học kiên cường, lương thiện. Cố Lâm Tinh lâm vào hoàn cảnh sa sút, buộc phải ký thỏa thuận thuê chung nhà, hai người từ đó bắt đầu cuộc sống chung ngọt ngào. Tuy nhiên mâu thuẫn gia đình đã nảy sinh. Trước những tin đồn bịa đặt và cám dỗ của đồng tiền, Cố Lâm Tinh và Trần Tư Nam sẽ lựa chọn như thế nào?', 1, 'https://img.ophim.live/uploads/movies/em-la-anh-sang-cua-anh-thumb.jpg', 'https://img.ophim.live/uploads/movies/em-la-anh-sang-cua-anh-poster.jpg', '2024-05-19 08:59:36', 8, '', 11, 0),
(914, 'THE NEW GATE', 'THE NEW GATE', 2024, 'THE NEW GATE―an online game transformed into a life-and-death struggle for its players. Thanks to the valiant efforts of Shin, the most powerful of them all, an end to the game and freedom for everyone seemed within reach. But just moments after Shin defeats the game\'s final boss, he finds himself bathed in an unknown light and transported some 500 years into the future of the in-game world. Thrown from a simple game gone wrong into a strange new land, one young swordsman of unrivalled strength is about to embark on a legendary journey!', 1, 'https://img.ophim.live/uploads/movies/the-new-gate-thumb.jpg', 'https://img.ophim.live/uploads/movies/the-new-gate-poster.jpg', '2024-05-19 08:59:36', 8, 'https://www.youtube.com/watch?v=zr2yisUUnc8', 24, 0),
(915, 'Thế Tử Biến Mất Rồi!', 'Missing Crown Prince', 2024, '<p>Một bộ phim hài lãng mạn lấy bối cảnh ở Joseon kể về một hoàng tử bị một người phụ nữ sẽ trở thành công chúa quản lý.</p>', 1, 'https://img.ophim.live/uploads/movies/the-tu-bien-mat-roi-thumb.jpg', 'https://img.ophim.live/uploads/movies/the-tu-bien-mat-roi-poster.jpg', '2024-05-19 08:59:38', 8, '', 60, 1),
(916, 'Cầm Tù', 'Esaret', 2022, '<p>Orhun là một doanh nhân thành đạt, lớn lên trong một gia đình giàu có nhưng không có tình yêu thương cùng với chị gái song sinh Nihan, em gái Nurşah và người mẹ xa cách lạnh lùng Afife của họ. Nihan rời đi để làm công việc tình nguyện với tư cách là một bác sĩ ở Eritrea, nhưng gần đây cô ấy không thể liên lạc được và gia đình cô ấy đang lo lắng cho cô ấy. Trong khi tìm kiếm em gái của mình, anh tình cờ gặp Hira, một cô gái nghèo đang sống cuộc đời của một tù nhân dưới bàn tay của những kẻ buôn người. Khi họ phát hiện ra rằng Nihan đã bị đầu độc và giết chết bởi một băng đảng địa phương, Orhun suy sụp. Khi phát hiện ra rằng Hira thực sự là người đã đầu độc em gái mình, Orhun ấp ủ một kế hoạch trả thù độc ác: anh ta sẽ đưa Hira về nhà với mình và khiến mọi thứ trở nên tồi tệ hơn với cô ấy. Trong khi đó, Afife, mẹ của họ, đã ngăn cản cha của Orhun kể từ khi anh ta thời thơ ấu bí mật. Orhun quyết định kết hôn với Hira để trả thù. Afife ghét những người có địa vị thấp hơn và cô ấy bị ám ảnh bởi “dòng máu thuần khiết”. Liệu cuộc hôn nhân này có giam cầm Afife, hay cặp đôi sẽ tìm thấy sự chuộc lỗi sau khi trả hết nợ?</p>', 1, 'https://img.ophim.live/uploads/movies/cam-tu-thumb.jpg', 'https://img.ophim.live/uploads/movies/cam-tu-poster.jpg', '2024-05-19 09:00:35', 8, 'https://www.youtube.com/watch?v=1e9F4Prqnus', 60, 0),
(917, 'Xin Hãy Yêu Anh Như Vậy', 'Men In love', 2024, '<p>Xin hãy yêu anh như vậy\" là một bộ phim truyền hình tình cảm đô thị do đạo diễn Trương Bác Dục (đạo diễn của \"Khúc biến tấu ánh trăng\") chỉ đạo, có sự tham gia của Hồ Nhất Thiên (diễn viên chính trong \"Gửi thời thanh xuân ngây thơ tươi đẹp\"), Lương Khiết (người đóng chính trong \"Một ngày biến thành em\") đóng vai chính. Câu chuyện xoay quanh Diệp Hàm (do Hồ Nhất Thiên đóng), một biên tập viên chính trị có tính kỷ luật, chăm chỉ, tình cờ giúp đỡ Lý Tiêu Tiêu (do Lương Khiết đóng), một giáo viên thể dục vụng về, đáng yêu hết lần này đến lần khác. Tuy nhiên, vì những trải nghiệm trong quá khứ, Diệp Hàm khó lòng mở cửa trái tim một lần nữa. Từ Giai Thành (Đại Húc đóng) một nhà xuất bản nhiệt huyết và thẳng thắn , tình cờ gặp lại Đồng Y Văn (Tôn Gia Linh đóng), người mẫu nổi tiếng ngày xưa. Họ cố gắng cân bằng giữa tình yêu và sự nghiệp. Mối quan hệ giữa bốn người trở nên phức tạp và thách thức do Tiêu Tiêu thầm yêu Giai Thành. Trong những thăng trầm và khó khăn, Diệp Hàm bảo vệ tình cảm thầm kín và sự yếu đuối của Tiêu Tiêu, trong khi Tiêu Tiêu hoàn toàn chữa lành những vết thương tình cảm của Diệp Hàm. Cuối cùng, Giai Thành và Y Vân vượt qua thử thách để đạt được hạnh phúc viên mãn. Những người bạn khác cũng đang trải qua những thử thách của cuộc sống. Hứa Ngạn, một luật sư chín chắn và chuyên nghiệp, tài năng xuất sắc nhưng luôn e ngại đối mặt với mối quan hệ với Từ Gia Lâm (do Ngô Thiên Doanh đóng) một người trẻ trung và năng động. Trong khi đó, Lộ Chính (Lý Điện Tôn đóng) chủ một quán cà phê lãng mạn, đã kết hôn nhiều năm với vợ là Quách Thanh Vân ( do Trương Dao đóng), trong cuộc hôn nhân tưởng chừng hoàn hảo, nhưng lại ẩn chứa những nỗi đau không ai biết. Sau khi trải qua nhiều thử thách, chia ly và đoàn tụ trong sự nghiệp cũng như các mối quan hệ, cuối cùng họ cũng có được hạnh phúc cho riêng mình và ngày càng gắn bó với nhau hơn.</p>', 1, 'https://img.ophim.live/uploads/movies/xin-hay-yeu-anh-nhu-vay-thumb.jpg', 'https://img.ophim.live/uploads/movies/xin-hay-yeu-anh-nhu-vay-poster.jpg', '2024-05-19 09:01:16', 8, '', 45, 0),
(918, 'Tương Tư Cổ', 'Lovesickness', 2024, 'Cô gái bình thường Mạc An An bất ngờ xuyên không về nghìn năm trước, gặp và hiểu biết lẫn nhau về Sở quốc công Tiêu Sở, quyền khuynh triều dã, Tiêu Sở. Để thay đổi số phận bị kẻ xấu hại của Tiêu Sở, Mạc An An xuyên qua ba lần, cùng Tiêu Sở trải qua một tình yêu đầy đau khổ kéo dài hàng nghìn năm.', 1, 'https://img.ophim.live/uploads/movies/tuong-tu-co-thumb.jpg', 'https://img.ophim.live/uploads/movies/tuong-tu-co-poster.jpg', '2024-05-19 09:01:19', 8, '', 10, 0),
(919, 'Lúc Đó Tôi Đã Chuyển Sinh Thành Slime (Phần 3)', 'That Time I Got Reincarnated as a Slime Season 3', 2024, 'Chuyển thể từ light novel cùng tên của tác giả Fuse. Anh chàng Satoru Mikami, 37 tuổi, FA nhiều năm với sống cuộc sống chán chường và không mấy vui vẻ gì. Ngày kia vận số đen đủi bám lấy anh chàng, bị cướp tấn công, giết ngay tại chỗ, tưởng chừng tháng ngày chán ngắt ấy đã kết thúc. Nhưng không! Ấy lại chính là sự khởi đầu của một cuộc sống mới, Mikami tỉnh dậy, thấy mình đang ở trong một thế giới kì lạ.\n\nVà điều quái dị là anh ta không còn hình dạng người nữa mà đã trở thành quái vật slime dẻo quẹo và không có mắt. Khi dần quen với hình dáng mới này, anh chàng bắt đầu khám phá thế giới cùng với những quái vật khác. Và thế là, cuộc đời làm Slime ở một thế giới mới bắt đầu.', 1, 'https://img.ophim.live/uploads/movies/luc-do-toi-da-chuyen-sinh-thanh-slime-phan-3-thumb.jpg', 'https://img.ophim.live/uploads/movies/luc-do-toi-da-chuyen-sinh-thanh-slime-phan-3-poster.jpg', '2024-05-19 09:01:26', 8, 'https://www.youtube.com/watch?v=uOzwqb74K34', 24, 0),
(920, 'Kẻ Ngoại Lai Ở Học Viện Ma Vương (Phần 2)', 'The Misfit of Demon King Academy Ⅱ: Raja Iblis Terkuat dalam Sejarah Bereinkarnasi dan Bersekolah dengan Keturunannya', 2023, '<p>The Misfit of Demon King Academy II Để chấm dứt cuộc xung đột bất tận giữa con người và ác quỷ, Quỷ vương Anos Voldigoad sẵn sàng hy sinh mạng sống của mình, với hy vọng được tái sinh trong một tương lai hòa bình. Để chuẩn bị cho sự trở lại của vị vua của họ, quỷ tộc đã thành lập Học viện Quỷ vương, một tổ chức ưu tú có nhiệm vụ xác định danh tính của Anos khi anh ta tỉnh lại. Anh ta tái sinh hai thiên niên kỷ sau đó, nhưng thật ngạc nhiên, anh ta sớm biết rằng mức độ ma thuật trên thế giới đã suy giảm nghiêm trọng trong thời gian anh ta vắng mặt ...</p>', 1, 'https://img.ophim.live/uploads/movies/the-misfit-of-demon-king-academy-ii-thumb.jpg', 'https://img.ophim.live/uploads/movies/the-misfit-of-demon-king-academy-ii-poster.jpg', '2024-05-19 09:01:29', 8, '', 24, 0),
(921, 'The 8 Show', 'The 8 Show', 2024, 'Eight individuals trapped in a mysterious 8-story building participate in a tempting but dangerous game show where they earn money as time passes.', 1, 'https://img.ophim.live/uploads/movies/the-8-show-thumb.jpg', 'https://img.ophim.live/uploads/movies/the-8-show-poster.jpg', '2024-05-19 09:01:29', 8, 'https://www.youtube.com/watch?v=ZPWGfNU20vQ', 50, 0),
(922, ' Võ Hiệp Đế Nữ Hoa', 'Princess Cheung Ping', 1981, '<p><i>Lấy bối cảnh thời nhà Minh lúc mà Tào Quá Thuần lộng quyền ức hiếp kẻ yếu bốc lộc nhân dân, vua Sùng Trinh có cô con gái là công chúa Trường Bình thông minh xinh đẹp thường xuyên hiến kế cho vua cha trừng trị kẻ gian. Phim Võ Hiệp Đế Nữ Hoa còn có hai cánh tay đắc lực của công chúa Trường Bình là Châu Thế Hiển và cao thủ võ lâm Viên Nhược Phi. Tuy nhiên hai người này cũng góp phần tạo nên mối tình tay ba khi điều đem lòng yêu Trường Bình. Công chúa Chiêu Nhân thì lại đem lòng yêu say đắm Nhược Phi, tướng quân Viên Sùng Hoán thì yêu công chúa Chiêu Nhân tạo nên một vòng tròn tình yêu đầy trắc trở và éo le. Xem PhimVõ Hiệp Đế Nữ Hoa để tiếp tục thấy được cuộc đời đầy sóng gió của công chúa Trường Bình khi triều đình của cha cô bị thất bại, Sùng Trinh tự vẫn còn chị em cô lưu lạc nhân gian. Trước đó cô và Thế Hiển thành thân để Thế Hiển đi sang nước người cứu vãn tình thế. Sau khi trở về anh đi tìm Trường Bình khắp nơi. Xem phim Võ Hiệp Đế Nữ Hoa với kết thúc buồn khi vì tình thế mà Trường Bình và cả Thế Hiển điều uống thuốc độc tử vẫn dù trước đó hai người đã trải qua nhiều sóng gió.</i></p>', 1, 'https://img.ophim.live/uploads/movies/vo-hiep-de-nu-hoa-thumb.jpg', 'https://img.ophim.live/uploads/movies/vo-hiep-de-nu-hoa-poster.jpg', '2024-05-19 09:01:47', 8, '', 45, 0),
(923, 'Tân Tiểu Ngũ Nghĩa', 'Tân Tiểu Ngũ Nghĩa', 1987, '<p><i>Vua Tương Dương âm mưu làm loạn, và Bai Yutang, một trong năm con chuột, muốn giành danh hiệu liên minh, nhưng đã anh dũng hy sinh. Bai Yunsheng, con trai của Yutang, quyết tâm giành lại cơ thể của cha mình, trong khi nữ hoàng ba chuột Xu Liang, Han Tianjin và Lu Zhen muốn lập công trong liên minh, họ hợp tác với con trai Bắc Chivalrous Ai Hu, và cuối cùng cũng thành công đạt được mục đích, cũng bắt được Tương Dương vương, đoạt được ngôi vị hoàng đế, chính là \"Tiểu Ngũ Chính\". Để cạnh tranh thứ hạng, Xiao Wuyi quyết định làm một việc lớn và tách ra. Sau đó, năm người bị chia cắt, Yun Sheng và Ai Hu thậm chí còn bị đóng khung vì âm mưu nổi loạn. Từ Thiên Long muốn tìm cách chiếm đoạt ngai vàng, thậm chí còn hạ độc chị gái Xueer, Xiao Wuyi thề sẽ giải cứu hai người.</i></p>', 1, 'https://img.ophim.live/uploads/movies/tan-tieu-ngu-nghia-thumb.jpg', 'https://img.ophim.live/uploads/movies/tan-tieu-ngu-nghia-poster.jpg', '2024-05-19 09:01:51', 8, '', 45, 0),
(924, 'Alex Rider (Phần 2)', 'Alex Rider (Season 2)', 2021, '<p>Sau cái chết của người chú và sứ mệnh chết chóc nhằm hạ bệ Point Blanc, Alex Rider mong muốn bỏ lại quá khứ phía sau và làm lại cuộc đời. Tuy nhiên, khi một cuộc tấn công kinh hoàng vào gia đình một người bạn kéo anh trở lại thế giới gián điệp, Alex phải làm sáng tỏ một âm mưu chính trị nham hiểm gây hậu quả toàn cầu.</p>', 1, 'https://img.ophim.live/uploads/movies/alex-rider-phan-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/alex-rider-phan-2-poster.jpg', '2024-05-19 09:01:57', 8, 'https://www.youtube.com/watch?v=wFYq8eqpQw4', 45, 0),
(925, 'Alex Rider (Phần 1)', 'Alex Rider (Season 1)', 2020, '<p>Alex Rider là một học sinh trung học bình thường tại London. Nhưng sau vụ tai nạn bất ngờ của người chú, cậu bé phát hiện ra nhiều bí mật mà người chú đã che giấu suốt bao năm và bất đắc dĩ trở thành đặc vụ cho MI6. Từ đó, Alex bắt đầu chuyến phiêu lưu ly kỳ, gay cấn và điều tra được nhiều âm mưu chống phá thế giới của các tổ chức ngầm.</p>', 1, 'https://img.ophim.live/uploads/movies/alex-rider-phan-1-thumb.jpg', 'https://img.ophim.live/uploads/movies/alex-rider-phan-1-poster.jpg', '2024-05-19 09:02:04', 8, 'https://www.youtube.com/watch?v=wFYq8eqpQw4', 45, 0),
(926, 'Tracker', 'Tracker', 2024, '<p>Colter Shaw du hành dọc đất nước trong chiếc RV cũ kỹ của mình, giúp cảnh sát và các công dân tìm người thân mất tích và xử lý tội phạm, cho đến khi vụ án mới nhất của anh thay đổi tất cả.</p>', 1, 'https://img.ophim.live/uploads/movies/tracker-thumb.jpg', 'https://img.ophim.live/uploads/movies/tracker-poster.jpg', '2024-05-19 09:02:06', 8, 'https://www.youtube.com/watch?v=Hw6RlFyPbNM', 45, 1),
(927, 'Bridgerton (Phần 3)', 'Bridgerton (Season 3)', 2024, 'Khi những người mới ra mắt khao khát trở thành nhân vật nổi bật nhất vũ hội, một cô gái nhút nhát sống hai thân phận tìm thấy ánh sáng giữa những bí mật và bất ngờ.', 1, 'https://img.ophim.live/uploads/movies/bridgerton-phan-3-thumb.jpg', 'https://img.ophim.live/uploads/movies/bridgerton-phan-3-poster.jpg', '2024-05-19 09:02:15', 8, 'https://www.youtube.com/watch?v=gpv7ayf_tyE', 50, 0),
(928, 'Giám Tâm', '鉴心', 2024, '<p>Bộ phim truyền hình ngắn về tình yêu hồi hộp \"Jianxin\" của Trung Hoa Dân Quốc lấy bối cảnh ở thành phố Vân Giang trong Chiến tranh chống Nhật. Phim kể về Yan Yumo, một cô gái bề ngoài xuất thân từ một gia đình thư pháp và hội họa nhưng thực chất là một nhân viên tình báo của ĐCSTQ. Sau khi thâm nhập vào Quốc Dân Đảng, cô gặp Cố Tân Thành, một cậu bé bán thuốc. Cả hai đã trải qua thử thách sinh tử và đối phó với nhiều thế lực khác nhau. Họ sử dụng các kỹ thuật như giả mạo thư pháp và hội họa để nhận dạng và giả mạo, cuối cùng đã tìm ra được thông tin tình báo chiến lược quan trọng và phá tan kế hoạch chiến đấu của quân đội Nhật Bản. Từ đầu đến cuối, ông luôn kiên định với niềm tin cách mạng của mình, luôn nghĩ đến gia đình và đất nước, đồng thời hoàn thành quá trình trưởng thành và chuyển hóa của mình.</p>', 1, 'https://img.ophim.live/uploads/movies/giam-tam-thumb.jpg', 'https://img.ophim.live/uploads/movies/giam-tam-poster.jpg', '2024-05-19 09:02:34', 8, '', 15, 0),
(929, 'Phát Thanh Viên Thành Thật', 'Frankly Speaking', 2024, '<p>Một phát thanh viên được kính trọng đột nhiên mất khả năng tự kiểm duyệt khi phát sóng, thu hút sự chú ý của một biên kịch truyền hình và mời anh tham gia chương trình tạp kỹ của cô ấy.</p>', 1, 'https://img.ophim.live/uploads/movies/phat-thanh-vien-thanh-that-thumb.jpg', 'https://img.ophim.live/uploads/movies/phat-thanh-vien-thanh-that-poster.jpg', '2024-05-19 09:02:38', 8, 'https://www.youtube.com/watch?v=TSqRd-tV2Rw', 80, 0),
(930, 'Cô kỳ lân Thelma', 'Thelma the Unicorn', 2024, 'Cô ngựa lùn biết hát ao ước trở thành ngôi sao bỗng lập tức nổi tiếng khi biến thành kỳ lân lấp lánh. Nhưng trở thành nhân vật nổi tiếng quả là một chặng đường đầy thử thách.', 0, 'https://img.ophim.live/uploads/movies/co-ky-lan-thelma-thumb.jpg', 'https://img.ophim.live/uploads/movies/co-ky-lan-thelma-poster.jpg', '2024-05-19 09:02:48', 8.2, 'https://www.youtube.com/watch?v=BOEMUudvYAw', 93, 1),
(931, 'Máu của Zeus (Phần 2)', 'Blood of Zeus (Season 2)', 2024, 'Để thoát khỏi Địa ngục mãi mãi, Hades lên kế hoạch giành vương miện của Zeus cho mình và đoàn tụ với Persephone yêu dấu với tư cách là kẻ cai trị Olympus.', 1, 'https://img.ophim.live/uploads/movies/mau-cua-zeus-phan-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/mau-cua-zeus-phan-2-poster.jpg', '2024-05-19 09:03:09', 8, 'https://www.youtube.com/watch?v=9JAQh544RHE', 31, 0),
(932, 'Mỹ vị hầm ngục', 'Delicious in Dungeon', 2024, 'Hầm ngục, rồng… và món quái vật hầm thơm ngon!? Các nhà thám hiểm đột nhập vào vương quốc trúng lời nguyền bị chôn vùi để cứu bạn mình và gây náo loạn trên đường đi.', 1, 'https://img.ophim.live/uploads/movies/my-vi-ham-nguc-thumb.jpg', 'https://img.ophim.live/uploads/movies/my-vi-ham-nguc-poster.jpg', '2024-05-19 09:03:25', 8, 'https://www.youtube.com/watch?v=n5JEoD7keVo', 26, 0),
(933, 'URUSEI YATSURA Mùa 2', 'うる星やつら　後半', 2024, 'URUSEI YATSURA Mùa 2', 1, 'https://img.ophim.live/uploads/movies/urusei-yatsura-mua-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/urusei-yatsura-mua-2-poster.jpg', '2024-05-19 09:03:36', 8, '', 23, 0),
(934, 'WIND BREAKER', 'Wind Breaker', 2024, 'Haruka Sakura wants nothing to do with weaklings—he\'s only interested in the strongest of the strong. He\'s just started at Furin High School, a school of degenerates known only for their brawling strength—strength they use to protect their town from anyone who wishes it ill. But Haruka\'s not interested in being a hero or being part of any sort of team—he just wants to fight his way to the top!', 1, 'https://img.ophim.live/uploads/movies/wind-breaker-thumb.jpg', 'https://img.ophim.live/uploads/movies/wind-breaker-poster.jpg', '2024-05-19 09:03:36', 8, 'https://www.youtube.com/watch?v=dTMmCSHOSEQ', 24, 1),
(935, 'Dương Môn Nữ Tướng 2001', 'Legendary Fighter: Yang\'s Heroine', 2001, '<p>Phim kể về một gia tộc họ Dương ở thời Tống (Trung Quốc), không chỉ các bậc nam nhi trong dòng họ là những vị anh hùng bất khuất mà các nữ nhi từ lão bà bà Xa Thái Quân (72 tuổi) đến Dương Bát muội, Mộc Quế Anh, 18 tuổi, cũng là những bậc nữ lưu đánh thắng giặc Liêu. Các nữ tướng này, mỗi khi đất nước lâm nguy đều xung phong dẹp giặc. Đan xen giữa những màn võ thuật được vận dụng kỹ xảo điện ảnh đẹp mắt, là những cảnh đấu trí thông minh phán đoán thế trận. Trong phim còn có các nhân vật đầy cá tính như: Mộc Quế Anh (Ninh Tịnh đóng), Công chúa Ngân Kính (Nhạc Linh), Dương Tứ Lang (Quách Tấn An)... và đặc biệt là sự trở lại phim trường của \"nữ hoàng phim võ hiệp\" Trịnh Phối Phối...</p>', 1, 'https://img.ophim.live/uploads/movies/legendary-fighter-thumb.jpg', 'https://img.ophim.live/uploads/movies/legendary-fighter-poster.jpg', '2024-05-19 09:03:45', 8, '', 45, 0),
