(939, 'Dora và thành phố vàng mất tích', 'Dora and the Lost City of Gold', 2019, '<p>Khi bố mẹ cô mất tích trong cuộc tìm kiếm một thành phố cổ xưa đầy vàng, nhà thám hiểm tuổi teen sôi nổi và bạn bè tiến vào rừng sâu để cứu họ.</p>', 0, 'https://img.ophim.live/uploads/movies/dora-va-thanh-pho-vang-mat-tich-thumb.jpg', 'https://img.ophim.live/uploads/movies/dora-va-thanh-pho-vang-mat-tich-poster.jpg', '2024-05-19 14:00:28', 8, '', 144, 0),
