(949, 'Di sản của Bourne', 'The Bourne Legacy', 2012, '<p>Sau thất bại với Jason Bourne, CIA nhận thấy họ phải đối phó với một mối đe dọa tương tự khi một nhóm các đặc vụ bị ly gián khác xuất hiện.</p>', 0, 'https://img.ophim.live/uploads/movies/di-san-cua-bourne-thumb.jpg', 'https://img.ophim.live/uploads/movies/di-san-cua-bourne-poster.jpg', '2024-05-19 14:00:35', 8, '', 215, 0),
