(951, 'Mục Trung Vô Nhân 2: Dùng Mắt Trả Mắt ', 'Eye for an Eye 2', 2024, '<p>Bộ phim rạp này là phần tiếp theo của bộ phim trực tuyến năm 2022 mang tên \"Mục Trung Vô Nhân\" kể về Thành Hạt Tử ( Tạ Miêu thủ vai), một người mù có võ nghệ cao cường. Thành Hạt Tử tình cờ cứu sống Trương Tiểu Ngư ( Dương n Hữu thủ vai) có gia đình bị sát hại . Dưới sự thuyết phục của Tiểu Ngư, Thành Hạt Tử không thể từ chối cậu nên đã đồng ý giữ cậu lại và dạy cho cậu võ thuật. Tiểu Ngư cũng đang chờ đợi thời cơ để bắt đầu hành trình trả thù.</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/muc-trung-vo-nhan-2-dung-mat-tra-mat-thumb.jpg', 'https://img.ophim.live/uploads/movies/muc-trung-vo-nhan-2-dung-mat-tra-mat-poster.jpg', '2024-05-19 14:00:39', 8, 'https://www.youtube.com/watch?v=TQUsUHULMMw', 90, 1),
(952, 'Khu Vực Tuần Tra', ' Side Beat', 1999, '<p><i>Châu Thế Phân và Diệp Gia Tín đều là cảnh sát, nhưng mối quan hệ của hai người luôn xung đột dấn đến hai người như hai kẻ đối địch,cả hai không nhìn mặt nhau. Về sau, Phân biết rõ quá khứ của cô người yêu - Giang Bích Tình, Phân không những không ngần ngại, ngược lại anh còn động viên khích lệ Tình cố gắng vượt qua những khó khăn trong cuộc sống. Nhưng những năm tháng làm việc với nhau,Phân và Tín dần dần hiểu nhau hơn, họ giúp đỡ lẫn nhau trong công việc. Nhưng không lâu sau đó một nữ phóng viên tên xuất hiện làm cho mối quan hệ giữa hai người lại một lần nữa lâm vào bế tắc...</i></p>', 1, 'https://img.ophim.live/uploads/movies/khu-vuc-tuan-tra-thumb.jpg', 'https://img.ophim.live/uploads/movies/khu-vuc-tuan-tra-poster.jpg', '2024-05-19 14:00:39', 8, '', 45, 0),
(953, 'Thám Tử Lừng Danh Conan', 'Detective Conan', 2005, '<p>Mở đầu câu truyện, cậu học sinh trung học 17 tuổi (trong truyện tranh là 16) <strong>Shinichi Kudo</strong> (Jimmy Kudo) bị biến thành cậu bé <strong>Conan</strong> Edogawa. <strong>Shinichi</strong> trong phần đầu của Thám tử lừng danh Conan được miêu tả là một thám tử học đường. Trong một lần đi chơi công viên \"Miền Nhiệt đới\" với cô bạn từ thuở nhỏ (cũng là bạn gái) Ran Mori (Rachel Moore), cậu bị dính vào vụ án một hành khách trên Chuyến tàu tốc hành trong công viên, Kishida (Kenneth), bị giết trong một vụ án cắt đầu rùng rợn. Cậu đã làm sáng tỏ vụ án và trên đường về nhà, chứng kiến một vụ làm ăn mờ ám của những người đàn ông mặc toàn đồ đen. Kudo bị phát hiện, bị đánh ngất sau đó những người đàn ông áo đen đã cho cậu uống một thứ thuốc độc chưa qua thử nghiệm là Apotoxin-4869 (APTX4869) với mục đích thủ tiêu cậu. Tuy nhiên chất độc đã không giết chết Kudo. Khi tỉnh lại, cậu bàng hoàng nhận thấy thân thể mình đã bị teo nhỏ trong hình dạng của một cậu học sinh tiểu học.</p>', 1, 'https://img.ophim.live/uploads/movies/tham-tu-lung-danh-conan-thumb.jpg', 'https://img.ophim.live/uploads/movies/tham-tu-lung-danh-conan-poster.jpg', '2024-05-22 12:10:28', 8, '', 25, 12),
(954, 'Thiên Hành Kiện', 'Heroes', 2024, '<p>Bộ phim kể về những năm cuối thời Thanh, một nhóm người với thân phận khác biệt vì một cơ duyên mà bị cuốn vào hành trình tìm kiếm báu vật kì lạ, và họ dần kiên định với lý tưởng cứu nước của mình trong làn sóng lịch sử rộng lớn cuộn trào.</p><p>&nbsp;</p>', 1, 'https://img.ophim.live/uploads/movies/thien-hanh-kien-thumb.jpg', 'https://img.ophim.live/uploads/movies/thien-hanh-kien-poster.jpg', '2024-05-22 12:14:58', 8, '', 45, 0),
(955, 'Nam Ngọc Khanh Tâm', 'Practice Daughter', 2024, '<p>Thiên kim cao quý của thừa tướng, Mai Ngọc Phiến và thần trộm Tiểu Đậu Tử là hai cô gái mang hai tính cách và thân phận khác xa nhau, đã tạo nên bao câu chuyện dở khóc dở cười trong quá trình trao đổi cuộc đời cho nhau. Hãy xem thiên kim thừa tướng Mai Ngọc Phiến sẽ làm thế nào để tán đổ thái tử Nam Cung Diệu của nước Tịch Tây bằng sức hút trái ngược của \"thần trộm bá đạo\". Và liệu thái tử Nam Cung Diệu lạnh lùng lại còn mắc chứng rối loạn ám ảnh cưỡng chế có thể phá vỡ lời tiên đoán của quốc sư Bạch Diệp rằng nước Tịch Tây sẽ bị hủy diệt bởi tình yêu của thái tử, cuối cùng không phụ nước nhà chẳng phụ nàng hay không?</p><p>&nbsp;</p>', 1, 'https://img.ophim.live/uploads/movies/nam-ngoc-khanh-tam-thumb.jpg', 'https://img.ophim.live/uploads/movies/nam-ngoc-khanh-tam-poster.jpg', '2024-05-22 12:14:59', 8, '', 38, 0),
(956, 'Bí Kíp Yêu Đương Của Phương Tiểu Thư', 'Miss Fang\'s Love Secrets	', 2023, 'Phương Tịch Mộ, lập trình viên của game yêu đương \"Quan Hệ Bí Mật\", vô tình bị mắc kẹt trong trò chơi và trở thành NPC có thể đăng xuất bất cứ lúc nào khi đang tăng ca. Để giữ được mạng quèn, phải chinh phục nam chính Bách Hạo Thiên của game, hoàn thành nhiệm vụ tình yêu tuyến chính trước. Phương Tịch Mộ với lý thuyết yêu đương thượng thừa nhưng lại ế từ trong trứng, còn đối thủ lại là tổng tài bá đạo với danh xưng \"Lý tưởng hoàn hảo của mọi cô gái\", ai sẽ cao tay hơn đây? Chế độ Khó đã bắt đầu, chỉ còn một quy tắc sinh tồn - chỉ có \"đánh cắp trái tim\" mới có giữ được mạng, đến lúc thể hiện kỹ năng thật sự rồi...', 1, 'https://img.ophim.live/uploads/movies/bi-kip-yeu-duong-cua-phuong-tieu-thu-thumb.jpg', 'https://img.ophim.live/uploads/movies/bi-kip-yeu-duong-cua-phuong-tieu-thu-poster.jpg', '2024-05-22 12:15:01', 8, '', 10, 0),
(957, 'Khi Em Chạy Về Mọi Thời Không', 'Present Is Present', 2024, '<p>Tuy rằng Nguyên Hạ lớn lên trong hoàn cảnh khó khăn, nhưng trái tim cô vẫn luôn giữ được sự ấm áp. Cô và Ngụy Tử Kỳ luôn hướng về nhau, bù đắp cho nhau. Vượt qua không gian thời gian, giữa vô vàn vũ trụ song song, họ không ngừng cứu lấy đối phương và dành tình cảm sâu đậm cho nhau.</p><p>&nbsp;</p>', 1, 'https://img.ophim.live/uploads/movies/khi-em-chay-ve-moi-thoi-khong-thumb.jpg', 'https://img.ophim.live/uploads/movies/khi-em-chay-ve-moi-thoi-khong-poster.jpg', '2024-05-22 12:15:01', 8, '', 30, 0),
(958, 'Phá Kén (Phần 2)', 'Insect Detective (Season 2)', 2024, 'Bộ phim kể về câu chuyện một nghiên cứu sinh ngành Độc học Côn trùng Đàm Cảnh Thiên vô tình bị cuốn vào một vụ án ly kỳ. Trong quá trình giúp cảnh sát phá án anh đã nảy sinh tình cảm với bác sĩ pháp y Kim Linh, đồng thời khám phá ra bí ẩn về thân thế của mình, vạch trần kẻ đứng sau đã ẩn náu nhiều năm.', 1, 'https://img.ophim.live/uploads/movies/pha-ken-phan-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/pha-ken-phan-2-poster.jpg', '2024-05-22 12:15:02', 8, '', 45, 0),
(959, 'Thách Mà Dám Yêu', 'Dare to Love Me', 2024, 'Sau khi rời quê nhà vùng nông thôn được gây dựng dựa trên luật pháp Joseon, nam nhân nọ gặp một nữ nhân có cá tính mạnh thử thách những ranh giới xã hội cứng nhắc của chàng.', 1, 'https://img.ophim.live/uploads/movies/thach-ma-dam-yeu-thumb.jpg', 'https://img.ophim.live/uploads/movies/thach-ma-dam-yeu-poster.jpg', '2024-05-22 12:15:06', 8, 'https://www.youtube.com/watch?v=TiHyGJrHXvc', 65, 0),
(960, 'Vụ án Asunta', 'The Asunta Case', 2024, 'Sau khi hai vị phụ huynh báo cáo cô con gái 12 tuổi của họ là Asunta mất tích, cuộc điều tra nhanh chóng chĩa mũi dùi về phía họ.', 1, 'https://img.ophim.live/uploads/movies/vu-an-asunta-thumb.jpg', 'https://img.ophim.live/uploads/movies/vu-an-asunta-poster.jpg', '2024-05-22 12:15:09', 8, 'https://www.youtube.com/watch?v=-w4Ilcm5oEg', 55, 1),
(961, 'Tứ Vương 2', '4 Kings 2', 2023, '<p>Sau khi một kẻ buôn ma túy bí mật bày mưu chống lại họ, hai băng nhóm học sinh vướng vào mối thù cay đắng dẫn đến chuỗi hậu quả bạo lực.</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/tu-vuong-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/tu-vuong-2-poster.jpg', '2024-05-22 12:15:14', 8, '', 133, 0),
(962, 'Ashes', 'Ashes', 2024, '<p>Từ ảo mộng say đắm đến cuộc tình nguy hiểm, người phụ nữ giàu có đã kết hôn nọ thấy cuộc đời mình đổ nát chẳng thể cứu vãn sau khi nhặt được một cuốn tiểu thuyết chưa xuất bản.</p>', 0, 'https://img.ophim.live/uploads/movies/ashes-thumb.jpg', 'https://img.ophim.live/uploads/movies/ashes-poster.jpg', '2024-05-22 12:15:20', 8, '', 100, 0),
(963, 'Trinil: Kembalikan Tubuhku', 'Trinil', 2024, 'Đang tìm kiếm thân xác mất tích, một cái đầu ám cặp vợ chồng nọ khi họ vừa trở về nhà sau tuần trăng mật.', 0, 'https://img.ophim.live/uploads/movies/trinil-kembalikan-tubuhku-thumb.jpg', 'https://img.ophim.live/uploads/movies/trinil-kembalikan-tubuhku-poster.jpg', '2024-05-22 12:15:21', 8, 'https://www.youtube.com/watch?v=11dKyZzqQKY', 105, 0),
(964, 'Triệu Phú Ẩm Thực Khu Ổ Chuột (Phần 1)', 'Slumfood Millionaire (Season 1)', 2020, 'From Mumbai to Bangkok, this docuseries visits impoverished areas in Asia and features unheralded chefs who make amazing dishes with limited resources.', 1, 'https://img.ophim.live/uploads/movies/trieu-phu-am-thuc-khu-o-chuot-phan-1-thumb.jpg', 'https://img.ophim.live/uploads/movies/trieu-phu-am-thuc-khu-o-chuot-phan-1-poster.jpg', '2024-05-22 12:15:28', 8, '', 30, 0),
(965, 'Triệu Phú Ẩm Thực Khu Ổ Chuột (Phần 2)', 'Slumfood Millionaire (Season 2)', 2023, 'A new batch of talented cooks showcases boundless culinary creativity and delicious dishes from regions such as Cebu, An Giang and West Bengal.', 1, 'https://img.ophim.live/uploads/movies/trieu-phu-am-thuc-khu-o-chuot-phan-2-thumb.jpg', 'https://img.ophim.live/uploads/movies/trieu-phu-am-thuc-khu-o-chuot-phan-2-poster.jpg', '2024-05-22 12:15:28', 8, '', 30, 0),
(966, 'Trận Chung Kết: Vụ Tấn Công Wembley', 'The Final: Attack on Wembley', 2024, '<p>Khi nước Anh cuối cùng cũng có cơ hội giành chiến thắng trong một giải vô địch lớn, 6.000 người hâm mộ bóng đá không có vé tràn vào Sân vận động Wembley và gây hỗn loạn.</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/tran-chung-ket-vu-tan-cong-wembley-thumb.jpg', 'https://img.ophim.live/uploads/movies/tran-chung-ket-vu-tan-cong-wembley-poster.jpg', '2024-05-22 12:15:29', 8, 'https://www.youtube.com/watch?v=sYH7gRgJ2Bc', 82, 0),
(967, 'Người Bảo Vệ Loài Bướm Chúa', 'The Guardian of the Monarchs', 2024, '<p>Rừng Michoacán là nơi sinh sống của hàng triệu con bướm chúa. Nhà hoạt động Homero Gómez lên tiếng mạnh mẽ về việc bảo tồn nơi này, nhưng rồi ông bỗng mất tích.</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/nguoi-bao-ve-loai-buom-chua-thumb.jpg', 'https://img.ophim.live/uploads/movies/nguoi-bao-ve-loai-buom-chua-poster.jpg', '2024-05-22 12:17:00', 8, 'https://www.youtube.com/watch?v=1nQuDpNHKMU', 92, 0),
(968, 'Mơ Ước Tiếp Viên', 'View from the Top', 2003, '<p>Ước mơ trở thành tiếp viên hàng không của cô nàng ở thị trấn nhỏ gặp chút sóng gió khi cô gặp một đồng nghiệp xéo xắt, một phi công sôi nổi và một người hướng dẫn điên rồ.</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/mo-uoc-tiep-vien-thumb.jpg', 'https://img.ophim.live/uploads/movies/mo-uoc-tiep-vien-poster.jpg', '2024-05-22 12:17:00', 8, 'https://www.youtube.com/watch?v=elF04ebuXHI', 87, 0),
(969, 'Mẹ Ơi, Con Yêu Mẹ', 'Ma, I Love You', 2023, '<p>Buồn bực vì con gái định đi du học, người mẹ đơn thân bảo bọc quá mức bèn nỗ lực hết sức để giữ cho gia đình nhỏ của họ ở bên nhau.</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/me-oi-con-yeu-me-thumb.jpg', 'https://img.ophim.live/uploads/movies/me-oi-con-yeu-me-poster.jpg', '2024-05-22 12:17:06', 8, 'https://www.youtube.com/watch?v=_CFgv39X7Xw', 100, 0),
(970, 'Kỳ Trăng Mật Sóng Gió', 'Honeymoonish', 2024, '<p>Trong tuần trăng mật, cặp vợ chồng mới cưới nọ nhận ra rằng họ khác nhau ở hầu hết mọi mặt. Nhưng liệu những sự đối lập đó có thể trở thành điểm thu hút?</p>', 0, 'https://img.ophim.live/uploads/movies/ky-trang-mat-song-gio-thumb.jpg', 'https://img.ophim.live/uploads/movies/ky-trang-mat-song-gio-poster.jpg', '2024-05-22 12:17:09', 8, 'https://www.youtube.com/watch?v=MG_0jgZL08g', 100, 0),
(971, 'Hội Chứng Tuổi Thanh Xuân: Em Gái Xuất Hành', 'Rascal Does Not Dream of a Sister Venturing Out', 2023, 'Sau khi bị đe dọa tính mạng và những hành vi bắt nạt khác trên mạng, Kaede Azusagawa đã có một phá vỡ phân ly dẫn đến mất trí nhớ hoàn toàn. Trong hai năm tiếp theo, cô sống như một con người hoàn toàn mới, một người khép kín trốn tránh thế giới. May mắn thay, nhờ có sự đồng hành của anh trai và những người bạn mới, cô ấy đã có thể hồi phục — mặc dù cái giá phải trả để có thể hồi phục là những kỷ niệm trong hai năm quý giá đó. Bây giờ Kaede không chỉ phải cố gắng để tiến về phía trước với một lỗ hổng trong ký ức mà cô ấy còn phải đối phó với nỗi sợ hãi mà những người gần gũi nhất với mình bây giờ sẽ cảm thấy xa cách với con người hiện tại của cô ấy vì quá thân thuộc với bóng hình của cô gái trong hai năm qua.', 0, 'https://img.ophim.live/uploads/movies/hoi-chung-tuoi-thanh-xuan-em-gai-xuat-hanh-thumb.jpg', 'https://img.ophim.live/uploads/movies/hoi-chung-tuoi-thanh-xuan-em-gai-xuat-hanh-poster.jpg', '2024-05-22 12:17:14', 8, 'https://www.youtube.com/watch?v=LZ09Alg3GcM', 74, 0),
(972, 'Tai Nạn', 'Crash', 2024, '<p>Bộ phim kể về Cha Yeon-ho, một người theo chủ nghĩa cá nhân hợp lý từ KAIST và Min So-hee, một chuyên gia điều tra giao thông với khả năng phán đoán lạnh lùng và sự nhạy cảm ấm áp tại Cơ quan Điều tra Tội phạm Giao thông (TCI).</p>', 1, 'https://img.ophim.live/uploads/movies/tai-nan-thumb.jpg', 'https://img.ophim.live/uploads/movies/tai-nan-poster.jpg', '2024-05-22 12:17:19', 8, 'https://www.youtube.com/watch?v=wf6TBxwe884', 45, 0),
(973, 'Hội Mẹ Độc Thân', 'The Single Moms Club', 2014, '<p>Quy tụ sau khi con họ gặp rắc rối ở trường, năm người mẹ đơn thân nhận thấy họ có nhiều điểm chung hơn họ tưởng.</p><p>&nbsp;</p>', 0, 'https://img.ophim.live/uploads/movies/the-single-moms-club-thumb.jpg', 'https://img.ophim.live/uploads/movies/the-single-moms-club-poster.jpg', '2024-05-22 12:17:23', 8, 'https://www.youtube.com/watch?v=WQNOvfixtpo', 111, 0),
(974, 'Heeramandi', 'Heeramandi: The Diamond Bazaar', 2024, 'Quý cô Mallika mưu mô quản lý một kỹ viện ưu tú, nhưng rồi đối thủ mới đe dọa quyền kiểm soát của cô khi bạo loạn bùng phát ở Ấn Độ nơi Anh cai trị.', 1, 'https://img.ophim.live/uploads/movies/heeramandi-thumb.jpg', 'https://img.ophim.live/uploads/movies/heeramandi-poster.jpg', '2024-05-22 12:17:27', 8, 'https://www.youtube.com/watch?v=WvzZYynDkwA', 47, 0),
(975, 'Giáo Phái Tận Thế Của Antares de la Luz', 'The Doomsday Cult of Antares de la Luz', 2024, 'Gần 10 năm sau khi bị truy tố tội ác ghê tởm, các cựu thành viên của một giáo phái ở Chile chia sẻ trải nghiệm đầy ám ảnh của họ.', 0, 'https://img.ophim.live/uploads/movies/giao-phai-tan-the-cua-antares-de-la-luz-thumb.jpg', 'https://img.ophim.live/uploads/movies/giao-phai-tan-the-cua-antares-de-la-luz-poster.jpg', '2024-05-22 12:17:33', 8, 'https://www.youtube.com/watch?v=RTuBmIuTojs', 100, 0),
(976, 'Downton Abbey 2: Thời Đại Mới', 'Downton Abbey: A New Era', 2022, 'The Crawley family goes on a grand journey to the south of France to uncover the mystery of the dowager countess\'s newly inherited villa. Meanwhile, a Hollywood director seeks to film his latest production at Downton.', 0, 'https://img.ophim.live/uploads/movies/downton-abbey-2-thoi-dai-moi-thumb.jpg', 'https://img.ophim.live/uploads/movies/downton-abbey-2-thoi-dai-moi-poster.jpg', '2024-05-22 12:17:36', 8, 'https://www.youtube.com/watch?v=GLKTPdIrjuU', 125, 0),
(977, 'Dị Thường', 'Unnatural', 2018, 'Một bác sĩ pháp y nghiêm túc và một nhóm chuyên gia đảm nhận những vụ án phức tạp thông qua công việc của họ tại Phòng nghiên cứu Điều tra Cái chết Dị thường.', 1, 'https://img.ophim.live/uploads/movies/di-thuong-thumb.jpg', 'https://img.ophim.live/uploads/movies/di-thuong-poster.jpg', '2024-05-22 12:17:41', 8, '', 45, 0),
(978, 'Dhevaprom - Kwanruetai', 'Dhevaprom- Kwanruetai', 2024, '<p>Khi bác sĩ nhà Jutathep và người phụ nữ tốt bụng nhà Dhevaprom phải lòng nhau, họ phải vượt qua mối ác cảm kéo dài nhiều thế hệ giữa hai gia đình để được bên nhau.</p><p>&nbsp;</p>', 1, 'https://img.ophim.live/uploads/movies/dhevaprom-kwanruetai-thumb.jpg', 'https://img.ophim.live/uploads/movies/dhevaprom-kwanruetai-poster.jpg', '2024-05-22 12:17:48', 8, '', 70, 0),
(979, 'Cảm ơn, mời người tiếp theo!', 'Thank You, Next', 2024, 'Sau cuộc chia tay đau lòng, nữ luật sư trẻ nọ lao vào thế giới hẹn hò thời hiện đại đầy phức tạp, với sự ủng hộ hết mực của hội bạn thân.', 1, 'https://img.ophim.live/uploads/movies/cam-on-moi-nguoi-tiep-theo-thumb.jpg', 'https://img.ophim.live/uploads/movies/cam-on-moi-nguoi-tiep-theo-poster.jpg', '2024-05-22 12:17:53', 8, 'https://www.youtube.com/watch?v=LVVOndXLwD8', 37, 0),
(980, 'César Román: Đầu bếp sát nhân', 'Cooking Up Murder: Uncovering the Story of César Román', 2024, 'Loạt phim tài liệu này phân tích một vụ án giết người liên quan đến gã đầu bếp người Tây Ban Nha gây dựng sự nghiệp được chú ý thông qua hàng loạt bí mật và danh tính giả.', 1, 'https://img.ophim.live/uploads/movies/cesar-roman-dau-bep-sat-nhan-thumb.jpg', 'https://img.ophim.live/uploads/movies/cesar-roman-dau-bep-sat-nhan-poster.jpg', '2024-05-22 12:17:56', 8, '', 50, 0),
(981, 'Bưu thiếp', 'Postcards', 2024, 'Tới Ấn Độ để khám sức khỏe, hành trình của bà mẹ đơn thân người Nigeria nọ chạm đến cuộc sống của tất cả những người mà cô gặp.', 1, 'https://img.ophim.live/uploads/movies/buu-thiep-thumb.jpg', 'https://img.ophim.live/uploads/movies/buu-thiep-poster.jpg', '2024-05-22 12:17:57', 8, '', 27, 0),
(982, 'Bữa Tiệc Trong Hang Thỏ', 'Down the Rabbit Hole', 2024, 'Raised in opulence and culture, 10 year old Tochtli\'s lavish life contrasts with the darkness that seeps in from his father\'s criminal activities.', 0, 'https://img.ophim.live/uploads/movies/fiesta-en-la-madriguera-thumb.jpg', 'https://img.ophim.live/uploads/movies/fiesta-en-la-madriguera-poster.jpg', '2024-05-22 12:17:59', 8, 'https://www.youtube.com/watch?v=ClqC-VYnW6w', 103, 0),
(983, 'Bheem quả cảm: Giờ vui chơi', 'Mighty Bheem\'s Playtime', 2024, 'Bé Bheem ham vui có sức mạnh đáng kinh ngạc sẽ đi học. Hãy cùng tham gia các cuộc phiêu lưu trong lớp học khi bé kết bạn mới và bày vô số trò nghịch ngợm!', 1, 'https://img.ophim.live/uploads/movies/bheem-qua-cam-gio-vui-choi-thumb.jpg', 'https://img.ophim.live/uploads/movies/bheem-qua-cam-gio-vui-choi-poster.jpg', '2024-05-22 12:18:05', 8, '', 6, 0),
(984, 'Ấu Trùng Tinh Nghịch Ở Sao Hỏa', 'Larva in Mars', 2024, 'Landing on Mars after a silly mishap, goofy larva friends Red and Yellow encounter curious Martians — and a sinister secret.', 1, 'https://img.ophim.live/uploads/movies/au-trung-tinh-nghich-o-sao-hoa-thumb.jpg', 'https://img.ophim.live/uploads/movies/au-trung-tinh-nghich-o-sao-hoa-poster.jpg', '2024-05-22 12:18:06', 8, '', 16, 1),
(985, 'Anh Em Wahab', 'Brothers in Arms', 2024, '<p>Thanh tra, nhà báo và bạn bè kể lại câu chuyện hấp dẫn về hành trình trở nên tai tiếng của hai anh em ở thập niên 70, khiến họ lọt vào danh sách Bị truy nã gắt gao nhất Singapore.</p>', 1, 'https://img.ophim.live/uploads/movies/anh-em-wahab-thumb.jpg', 'https://img.ophim.live/uploads/movies/anh-em-wahab-poster.jpg', '2024-05-22 12:18:06', 8, '', 60, 0),
(986, 'Ashley Madison: Tình dục, lừa dối và bê bối', 'Ashley Madison: Sex, Lies & Scandal', 2024, 'Khi trang web hẹn hò dành cho những người muốn ngoại tình bị tấn công, dữ liệu riêng tư của hàng triệu người dùng bị lộ, hủy hoại nhiều cuộc hôn nhân và nhiều cuộc đời.', 1, 'https://img.ophim.live/uploads/movies/ashley-madison-tinh-duc-lua-doi-va-be-boi-thumb.jpg', 'https://img.ophim.live/uploads/movies/ashley-madison-tinh-duc-lua-doi-va-be-boi-poster.jpg', '2024-05-22 12:18:06', 8, 'https://www.youtube.com/watch?v=sPEC4yfvoCw', 49, 0),
(987, 'Anone', 'anone', 2018, 'Mớ tiền bí ẩn dẫn một cô gái trẻ trở lại thị trấn cổ nơi cô từng sống. Tại đó, cô có cuộc gặp định mệnh với Anone, một người phụ nữ lớn tuổi.', 1, 'https://img.ophim.live/uploads/movies/anone-thumb.jpg', 'https://img.ophim.live/uploads/movies/anone-poster.jpg', '2024-05-22 12:18:07', 8, '', 54, 0),
(988, 'Amar Singh Chamkila', 'Amar Singh Chamkila', 2024, 'A humble singer’s brash lyrics ignite fame and fury across Punjab as he grapples with soaring success and brutal criticism before his untimely death.', 0, 'https://img.ophim.live/uploads/movies/amar-singh-chamkila-thumb.jpg', 'https://img.ophim.live/uploads/movies/amar-singh-chamkila-poster.jpg', '2024-05-22 12:18:10', 8, 'https://www.youtube.com/watch?v=uGXB1PFg7E0', 146, 0),
(989, 'Thứ Bậc', 'Hierarchy', 2024, '<p>0,01% số học sinh đứng đầu nắm quyền kiểm soát luật pháp và trật tự ở trường cấp ba Jusin, nhưng một học sinh chuyển trường bí mật lại gây nhiễu loạn thế giới bất khả xâm phạm ấy.</p><p>&nbsp;</p>', 1, 'https://img.ophim.live/uploads/movies/thu-bac-thumb.jpg', 'https://img.ophim.live/uploads/movies/thu-bac-poster.jpg', '2024-05-22 12:18:16', 8, '', 0, 0);
